var book = {
	"name": "၂ ကွ့ၭနဲၪ့ဆၧ",
	"numChapters": 36,
	"chapters": {
		"1": {
			"1": "<sup>1</sup> တၭစဒၫဝံၭအဖိၪခွၫ စစီလမၧၫ့ ဂုးထၪ့ခၧၫ့ထၪ့လၧ အဘၩ့အမုးအဖၧၩ့နီၪ, ဒဲယဟိဝၩ, အဝ့ၫဒၪအယွၩ အီၪလၧအၥိၭတၭ, မၩဒိၪထၪ့ထီၫထၪ့အဝ့ၫ အၪအၪ",
			"2": "<sup>2</sup> လ့ၬလီၫ.- ထီးနီၪလဖၧၫ့ စစီလမၧၫ့ချဲၩ့ထၪ့လၧအံၫစ ရ့လၭထီးအလူၬ, ဒဲၦအထီၫ့ၥံၪ အခိၪလဖၪ, ဒဲၦအ ယၩၥံၪအခိၪလဖၪ, ဒဲၦစ့ၩရၫ့ခွးလဖၪ, ဒဲလၧကယဲၦ ဒိၪၥံၪလၧအံၫစရ့လၭထီးအလူၬအကျၩ, လၧအမွဲဖါ",
			"3": "<sup>3</sup> လဖၪအခိၪၥံၪလီၫ.- တၭစစီလမၧၫ့, ဒဲဆၧအီၪကီၪ့ ထီးအလူၬလၧအၥိၭ, လ့ၩထၪ့လၧဆၧထၪ့ထီၫအလး လၧဂံဘအၧၫ့အဖၧၩ့နီၪ, အဂဲးဘဲၫယီၩယဟိဝၩယွၩ အဆၧအီၪကီၪ့အတဲၩဆံၫ့ဎံၪ လၧယဟိဝၩအခ့ၫအ ၡၩစမိစ့ၭ မၩထၪ့ဝ့ၫ လၧၡါမုနၧၫ့ဖၫ, အီၪဝ့ၫထီးနီၪ",
			"4": "<sup>4</sup> လီၫ.- အ့ၪမွဲယွၩအတလၫနီၪ စဒၫဝံၭဂဲၫဆိၬထၪ့ခွံၬ ယူၭလၧကၧၫယၭယံအရံၫ့ထီၩ့လၧ အလးလၧစဒၫဝံၭ တဲၩ့ဝဲၩဝ့ၫလၧအဂး အဂဲးဘဲၫယီၩ အဝ့ၫဒၪမၩထၪ့",
			"5": "<sup>5</sup> ယူၭတဲၩလၧအဂးလၧယရုစလံၫ့အဖၧၩ့နီၪလီၫ.- တၭ ဆၧလုအလးထီးဝီၩလၧ စဟၧၫအဖိၪခွၫစယုရဲၫအဖိၪ ခွၫ,စဘ့ၫဇလံလၭမၩထၪ့ဝ့ၫနီၪ, အီၪဝ့ၫထီးနီၪလၧယ ဟိဝၩအတဲၩဆံၫ့ဎံၪအမ့ၬယၫတၭ, စစီလမၧၫ့ဒဲဆၧ",
			"6": "<sup>6</sup> အီၪကီၪ့နီၪအၪ့ဎၬဆၧလၧအနီၪလီၫ.- တၭစစီလမၧၫ့ လ့ၩထီၩ့ဝ့ၫလၧဆၧလုအလး ထီးဝီၩအအီၪလၧယဟိ ဝၩအမ့ၬယၫလၧဆၧအီၪကီၪ့ အတဲၩဆံၫ့ဎံၪအအီၪနီၪ, ဒဲလုထၪ့ဆၧလုမ့ၪ လထီၫ့လၧအလီၩ့လီၫ.",
			"7": "<sup>7</sup> လၧမုလနၩဎးနီၪ ယွၩမၩဖျီၪထၪ့အၥၭ လၧစစီလ မၧၫ့တၭ,စံၭအဝ့ၫ, ဆၧလၧယမိဖ့ၪလၫ့နၧၩလမံၩ့နီၪ,",
			"8": "<sup>8</sup> အၪ့ကံၩ့ဆံၭ.- စစီလမၧၫ့စံၭဆၧၫ့ယွၩ, နဝ့ၫဒၪနဒုၭနဲၪ ဆၧယၫ့ၥၭဖၭဒိၪ လၧယဖါစဒၫဝံၭ, ဒဲဒုၭကဲၪထၪ့",
			"9": "<sup>9</sup> ယၧၩလၧစဎွၩလၧအဝ့ၫဒၪအလးလီၫ.- ဘိၩ့နဲၪ့ယီၩ, ယဟိဝၩယွၩဧ့, နဆၧချဲၩ့ဝဲၩလၧယဖါစဒၫဝံၭနီၪ, မွဲအ ဂုးထၪ့ဝ့ၫဆံၭ. အဂဲးဘဲၫယီၩ နအီၪက့ၪထၪ့ယူၭယၧၩ လၧၦခမျၧးလၧအအၪဝ့ၫ ဘဲၫဂၪ့ခိၪမုၬအၥိၭနီၪအဖၫ့",
			"10": "<sup>10</sup> ခိၪလီၫ.- ဘိၩ့နဲၪ့ယီၩ ဖ့ၪလၫ့လါယၧၩ လၧဆၧကိၪ့ၥ့ၪ ကိၪ့ဘၪဒဲဆၧၥ့ၪယၫ, ဘဲၫၥိၭယမိလ့ၩထၪ့ ဒဲဂဲၫနုၬ လၧၦခမျၧးယီၩအမ့ၬယၫဆံၭ. အဂဲးဘဲၫယီၩၦခမျၧး ဖၭဒိၪယီၩမွဲပလၫစ့ၩရၫ့မိၥ့ၪလဂၩလဲၪ.",
			"11": "<sup>11</sup> တၭယွၩစံၭစစီလမၧၫ့, မွဲဆၧလမံၩ့ယီၩ အီၪလၧန ၥၭခံဖၧၩ့အကၠီၩ့နီၪ, နလအၪ့ကံၩ့ဘၪ စူၪလးခၪ့ခိၪ, ဆၧအဎၧၩ့အဎီ, ဆၧလၩဆၧဖၩ့မွဲဂ့ၩ, နဒုၪနဒၩၥံၪအ ၥၭမၧၫ့မွဲဂ့ၩ, ဒဲနအၪ့ကံၩ့လၧနၥၭမိမၧၫ့ယံၬနီၪဆ့အ့ၬး အ့ၪမွဲနအၪ့ကံၩ့ဆၧကိၪ့ၥ့ၪကိၪ့ဘၪ ဒဲဆၧၥ့ၪယၫလၧ နနၫ့ဆါအဂး, ဘဲၫၥိၭနမိစ့ၩရၫ့ယၡၩခမျၧးၥံၪ, လၧယ",
			"12": "<sup>12</sup> အီၪက့ၪထၪ့နၧၩ ကဲၪစဎွၩလၧအဖၫ့ခိၪတၭ,- နမိန့ဘၪ ဆၧကိၪ့ၥ့ၪကိၪ့ဘၪ ဒဲဆၧၥ့ၪယၫ, ဒဲယမိဖ့ၪလၫ့နၧၩ လၧစူၪလးခၪ့ခိၪ, ဒဲဆၧအဎၧၩ့အဎီ,ဒဲဆၧလၩဆၧဖၩ့, ဘဲၫစဎွၩၥံၪလၧအအီၪထၪ့ဆိၫနဲၪ့နၧၩနီၪ လန့ဘၪဝ့ၫ နးဂၩအၥိၭ, ဒဲၦလၧအအီၪထၪ့ဝ့ၫလၧနလးခဲၫ့လဖၪမိ န့ဘၪဘဲၫနီၪၥိၭနးဂၩဆ့အ့ၬ.",
			"13": "<sup>13</sup> ထီးနီၪလဖၧၫ့စစီလမၧၫ့ ဂဲၫထဲၩ့လၩ့လၧလးထၪ့ထီၫ နီၪလၧဂံဘအၧၫ့အဖၧၩ့ ထီၩ့လၧယရုစလံၫ့. လၧဆၧ အီၪကီၪ့အတဲၩဆံၫ့ဎံၪအအီၪတၭ, ကဲၪထၪ့စဎွၩလၧ အံၫစရ့လၭအဖၫ့ခိၪလီၫ.",
			"14": "<sup>14</sup> တၭစစီလမၧၫ့ အီၪက့ၪကီၪ့လဲၪ့ၥုၭလဖၪ, ဒဲၦလၧ အထူၬကၥ့ၪလဖၪ, အလဲၪ့ၥုၭလဖၪ အီၪဝ့ၫလထီၫ့လံ ယၩ,ဒဲၦလၧအထူၬကၥ့ၪလဖၪ အီၪဝ့ၫလလၬနံၫထီၫ့, လၧအအီၪက့ၪဝ့ၫလၧဒိၩ့ၥံၪ ဘၪဆဲၫ့လၧလဲၪ့ၥုၭအဖၧၩ့ နီၪ,ဒဲလၧစဎွၩအၥိၭလၧ ယရုစလံၫ့အဖၧၩ့ဆ့လီၫ.",
			"15": "<sup>15</sup> စဎွၩဒုၭအီၪထၪ့ကျိၪၥံၪစ့ၩၥံၪ, ထီၫ့ၥံၪလွ့ၫၥံၪလၧ ယရုစလံၫ့အဖၧၩ့နီၪ, ဘဲၫလိးလဖၪအၥိၭ, ဒဲၥံၪ့ၡိၫအ့ ရ့ၭအၪအၪလ့ၬ ဘဲၫၥံၪ့ကူၪလဖၪ လၧခိၪလီၩ့ ဆူၭဖၧၩ့",
			"16": "<sup>16</sup> အၥိၭနီၪလီၫ.- တၭၦၡၩဂဲၫဆိၬကၥ့ၪလဖၪလၧအံဇံၭ ဒဲလၧကိအၫလၧစစီလမၧၫ့အဂးလီၫ. စဎွၩအၡၩဖနံၬ",
			"17": "<sup>17</sup> ဖိၪဒိၭန့ဝ့ၫလၧကိအၫနီၪ လၧအဎွ့ၩလီၫ.- ၦလ့ၩဆၧ, ဂဲၫထဲၩ့ဆိၬလၧအံဇံၭအလဲၪ့ၥုၭလဖျိၪ့ လၧစ့ၩၡက့လၭ ဎူၫယၩအဂး, ဒဲကၥ့ၪလဒုၩ လၧလယၩယဲဆံၫအဂး လီၫ. အဝ့ၫၥံၪလ့ၩထၪ့တၭ, ဂဲၫထဲၩ့န့ကၥ့ၪလဖၪလၧ ၦဟံၥၭဖိၪအစဎွၩထီးအလူၬလဖၪအဂး, ဒဲလၧစံရအၫ အစဎွၩလဖၪအဂး, ဘဲၫအဆၧအီၪဝ့ၫအၥိၭနီၪလီၫ."
		},
		"2": {
			"1": "<sup>1</sup> တၭစစီလမၧၫ့ အီၪက့ၪလၩ့အၥၭ လၧအမိမၩထၪ့ ဂံၪ့လဖျိၪ့လၧယဟိဝၩအမံၩ့အဂး, ဒဲဂံၪ့လဖျိၪ့လၧအ",
			"2": "<sup>2</sup> ဘၩ့အမုးအဂးဆ့လီၫ.- စစီလမၧၫ့ဝံထၪ့နၬထၪ့ၦၡၩ နွ့ၫလၬ လၧအမိ အွံၪဆၧဆိၬဆၧ, ဒဲဎိၭလၬ လၧအမိ တဲၩၥံၪ့လၧခိၪလီၩ့အဖၧၩ့နီၪ, ဒဲၦၡၩၥၧၫ့ထီၫ့ဎူၫယၩ လၧအမိယိအဝ့ၫၥံၪလီၫ.",
			"3": "<sup>3</sup> စစီလမၧၫ့အၪ့မၧၫ့လၩ့ဆၧ လၧတဲအၫအစဎွၩဟုရၫ့ လဂၩနီၪ,စံၭဝ့ၫဒၪ, ဘဲၫနမၩလၧယဖါစဒၫဝံၭတၭ, ဖ့ၪ လၫ့အဝ့ၫလၧၥံၪ့ၡိၫအ့ရ့ၭဘဲၫအမိမၩဂံၪ့ လၧအမိအီၪ ဝ့ၫလၧအဖၧၩ့အၥိၭနီၪ, မၩယၧၩဘဲၫနီၪအၥိၭဆ့ဆံၭ.",
			"4": "<sup>4</sup> ယိခွါ,ယမၩထၪ့ဂံၪ့ လၧယဟိဝၩယယွၩအမံၩ့အဂး, ဘဲၫၥိၭဆၧမိအီၪက့ၪဆံၫ့ဎံၪဝ့ၫ လၧအဂးဒၪဝ့ၫအဂး, ဒဲလၧဆၧဆူၭခဲၩဆၧနၧၫ့မၧၫ့ လၧအဝ့ၫဒၪ အမ့ၬယၫ အဂး,ဒဲလၧဆၧမ့ၬယၫ အကိၪလထံၪဎးအဂး, ဒဲဆၧ လုမ့ၪလဖၪလၧမုဂီၩ ဒဲလၧမုဂၪလၩ့အဂး, လၧမးၥံၫ အနံၩလဖၪ, ဒဲလၧလၩၥံၪလဖၪ, ဒဲလၧယဟိဝၩပယွၩ အဆၧအီၪကီၪ့မၩဘိၪ့ၥံၪ အဆၧၫ့အထီဆ့လီၫ. အနီၪ မွဲလၧအံၫစရ့လၭအဂး အဆိၩဆိၩအကၠၪကၠၪလီၫ.",
			"5": "<sup>5</sup> တၭဂံၪ့လၧယမိမၩထၪ့နီၪ မွဲဖၭဒိၪ, အဂဲးဘဲၫယီၩပ",
			"6": "<sup>6</sup> ယွၩဒိၪဝ့ၫလၧယွၩထီးအလူၬလဖၪ အဖၫ့ခိၪလီၫ. တၭ မွဲပလၫမၩထၪ့ဂံၪ့ လၧအဝ့ၫဒၪအဂး မိၥ့ၪလဂၩလဲၪး အဂဲးဘဲၫယီၩမူၭခိၪ, ဒဲမူၭခိၪထီၫထုၬလဖၪနီၪ ထီလၧ အဂးအ့ၬ. အခိးမွဲယဝ့ၫဒၪ, လၧယမိမၩထၪ့ဂံၪ့ လၧ အဝ့ၫဒၪအဂး, ယမွဲၦလဂၩလဲၪး အ့ၪလမွဲဘၪန့ၫဆၧ လမံၩ့ယီၩဘဲၫၥိၭဆၧမိဆူၭခဲၩ ဆၧလုထၪ့ဆၧလၧအ",
			"7": "<sup>7</sup> မ့ၬယၫလီၫ.- မၩအၥၭဘဲၫနီၪတၭ အၪ့မၧၫ့လၩ့န့ယဂး ၦလဂၩလၧအကိၪ့မၩဆၧၥ့ၪ လၧထီၫ့မွဲဂ့ၩ, လၧစ့ၩမွဲ ဂ့ၩ,ဒဲလၧထီးဝီၩ, ဒဲလၧထၭ,ဒဲလၧဆၧဝီၩလုၭး ဒဲဆၧ ဝီၩ,ဒဲဆၧလၫ, ဒဲလၧအစူၪၥ့ၪဘဲၫၥိၭ အမိစိၭဖျၩဆၧ ၥ့ၪလၧၦကိၪ့ဆၧၥ့ၪအကျၩ, လၧအအီၪလၧယစူၪဖၧၩ့ လၧယုဒၫအဖၧၩ့, ဒဲလၧယရုစလံၫ့အဖၧၩ့, လၧယဖါ",
			"8": "<sup>8</sup> စဒၫဝံၭတဲၩ့ဝဲၩဝ့ၫလဖၪလီၫ.- ဖ့ၪယုဆ့ယၧၩ, လၧၥံၪ့ ၡိၫအ့ရ့ၭ, ၥံၪ့ၡိၫ,ဒဲၥံၪ့အလၫမူၭလဖၪ, လၧအအီၪလၧ လ့ၭဘနၧၫ့အဖၧၩ့း အဂဲးဘဲၫယီၩ ယၥ့ၪယၫလၧနခ့ၫန ၡၩလဖၪအစူၪၥ့ၪလၧ အမိခူၬၥံၪ့လဖၪလၧ လ့ၭဘနၧၫ့",
			"9": "<sup>9</sup> အဖၧၩ့နီၪ,- တၭ,ယိခွါ, ယခ့ၫယၡၩၥံၪမိအီၪလၧနခ့ၫ နၡၩလဖၪအၥိၭ, ဘဲၫၥိၭအမိတဲၩ့ဝဲၩၥံၪ့ၥံၪ အၪအၪ လ့ၬလၧယဂး, အဂဲးဘဲၫယီၩ ဂံၪ့လၧယမိမၩကဲၪထၪ့",
			"10": "<sup>10</sup> လဖျိၪ့နီၪလၩ့လၭဝ့ၫဖၭဒိၪလီၫ.- တၭယိခွါ, ယမိဖ့ၪ လၫ့နခ့ၫနၡၩၥံၪ, ၦလၧအတဲၩၥံၪ့လဖၪ, ဘုၪကၠိၩ့အကီၫ နံၫလၬ, ဒဲဘုၪမုယီၩအကီၫနံၫလၬ, ဒဲစဘံၭထံၫအဘၭ ၥၫနံၫလၬ, ဒဲၥိၪအဘၭၥၫနံၫလၬလီၫ.",
			"11": "<sup>11</sup> တဲအၫအစဎွၩဟုရၫ့နီၪ စံၭဆၧၫ့ဆၧလၧဆၧကွ့ၭအ ၥၭအဖၧၩ့တၭ, ဖ့ၪယုဝ့ၫလၧစစီလမၧၫ့နီၪ, စံၭဝ့ၫဒၪ, လၧယဟိဝၩ အဲၪအၡၩခမျၧးအကၠီၩ့တၭ, အဝ့ၫအီၪ",
			"12": "<sup>12</sup> က့ၪနၧၩလၧစဎွၩလၧအဝ့ၫၥံၪအဖၫ့ခိၪလီၫ.- လၧနီၪ အမ့ၬယၫစဟုရၫ့စံၭဝ့ၫ, ယဟိဝၩအံၫစရ့လၭအယွၩ, လၧမၩကဲၪထၪ့ဂၪ့ခိၪဒဲမူၭခိၪ, လၧအဖ့ၪလၫ့စဎွၩ ဒၫဝံၭအဖိၪခွၫ အီၪလၧဆၧကိၪ့ၥ့ၪ, အီၪလၧဆၧထီး လၩ့အၥၭဒဲၥုၪ့ဆၭၥၭဆၭ, ဘဲၫၥိၭအမိမၩထၪ့ယဟိ ဝၩအဂံၪ့လဖျိၪ့, ဒဲဂံၪ့လဖျိၪ့လၧအဘၩ့အမုးအဂးဆ့,",
			"13": "<sup>13</sup> မွဲဆၧစံၭထၪ့အၪ့အူၭဝ့ၫဆံၭ.- တၭဘိၩ့နဲၪ့ယီၩယအၪ့ မၧၫ့လၩ့ယူၭၦလဂၩ ကိၪ့ဆၧၥ့ၪအီၪလၧအၥုၪ့ဆၭၥၭ",
			"14": "<sup>14</sup> ဆၭစဟုရၫ့အၪဘံၫ,- လၧအမွဲၦမုၪလၧဒၫ့အဖိၪမုၪလ ဖၪအကျၩအဖိၪခွၫတၭ, အဝ့ၫဒၪအဖါဘၪဆဲၫ့လၧတဲ အၫ,အစူၪၥ့ၪလၧအမၩဆၧလၧထီၫ့, ဒဲလၧစ့ၩ,လၧထီး ဝီၩ,လၧထၭ,လၧလိး, ဒဲလၧၥံၪ့,လၧဆၧဝီၩလုၭ, လၧ ဆၧလၫ, ဒဲလၧဆၧဘွၩဖျ့ၫလံၬကံၭ, ဒဲလၧဆၧဝီၩၥံၪ အဖၧၩ့လီၫ. ဒဲစိၭဖျၩဆၧလၧဆၧလမံၩ့လါလါၥ့ၪဆ့, ဒဲကိၪ့ဒၪန့ ဆၧကိၪ့လမံၩ့လါလါ လၧဆၧအၪ့မၧၫ့ဝ့ၫ နီၪ,အီၪလၧၦကိၪ့ဆၧၥ့ၪအကျၩ, ဒဲလၧကဆါစဒၫဝံၭ",
			"15": "<sup>15</sup> နဖါအၡၩကိၪ့ဆၧၥ့ၪအၥိၭနီၪလီၫ.- မၩအၥၭဘဲၫနီၪ တၭဘုၪကၠိၩ့နီၪ, ဒဲဘုၪမုယီၩ, ဒဲၥိၪ,စဘံၭထံၫၥံၪ,လၧ ယကဆါလီၩဘၪဝ့ၫနီၪ, မွဲအဖ့ၪယုဝ့ၫလၧအခ့ၫအၡၩ",
			"16": "<sup>16</sup> အအီၪဆံၭ.- တၭပဝ့ၫဒၪပမိတဲၩန့ၥံၪ့ လၧလ့ၭဘနၧၫ့ အဖၧၩ့ဎွ့ၩၥိၭနမၩဆၧနီၪအလးအီၪဝ့ၫလီၫ. တၭပမိ ဆိၬလၩ့လၧထီၫ့ဖၧၩ့လၧ မၫဆမံၭလခီၫလၧနအီၪထီၩ့ လၧယီၭပၫတၭ, နဝ့ၫဒၪနဘၪမၩန့ထီးနီၪ ဆိၬထၪ့လၧ ယရုစလံၫ့လီၫ.",
			"17": "<sup>17</sup> တၭစစီလမၧၫ့ဝံထၪ့နၬထၪ့ ကယဲၦလခီၫဘၩ့မုးဖိၪ လဖၪ,လၧအအီၪဝ့ၫလၧခးအံၫစရ့လၭ အဖၧၩ့ထီးအ လူၬနီၪ,လၧဆၧဝံထၪ့နၬထၪ့ လၧအဖါစဒၫဝံၭဝံထၪ့နၬ ထၪ့ဝ့ၫ အလးခဲၫ့တၭး ၦၡၩၥံၪအီၪဝ့ၫ လကုၬယဲလၬ",
			"18": "<sup>18</sup> ၥၧၫ့ထီၫ့ဎူၫယၩလီၫ.- အဝ့ၫဒၪအီၪက့ၪၦနွ့ၫလၬလၧ အဘၪအွံၪဆၧဆိၬဆၧ, ဒဲဎိၭလၬ လၧအဘၪတဲၩၥံၪ့ ၥံၪလၧခိၪလီၩ့ဖၧၩ့, ဒဲအခိၪလဖၪၥၧၫ့ထီၫ့ဎူၫယၩ, လၧ အမိယိဝ့ၫဒဲ ဒုၭနဲၪၦခမျၧးၥံၪအဆၧမၩလီၫ."
		},
		"3": {
			"1": "<sup>1</sup> ထီးနီၪလဖၧၫ့ စစီလမၧၫ့မၩထၪ့ၥၫ့ယဟိဝၩအဂံၪ့ လၧယရုစလံၫ့အဖၧၩ့ လၧခိၪလီၩ့မိၫရဲအၫ, လၧယဟိ ဝၩနဲၪဖျီၪထၪ့အၥၭ လၧအဖါစဒၫဝံၭအလးနီၪ, မွဲအ လးလၧစဒၫဝံၭတဲၩ့ဝဲၩလၧ ၦယ့ဘုၫဖိၪစအီနၫ့အခရဲး",
			"2": "<sup>2</sup> ဖၧၩ့နီၪလီၫ.- လၧအကဲၪထၪ့စဎွၩလံနံၪ့လနံၪ့, လၩနံၫ ဘံၪ့လဘံၪ့, ဒဲလၩထၪ့နံၫနံၩလနံၩနီၪမၩထၪ့ၥၫ့ဝ့ၫလီၫ.",
			"3": "<sup>3</sup> အယီၩမွဲဆၧလၧစစီလမၧၫ့ ဘၪဆၧၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့ ဝ့ၫလၧအမိမၩထၪ့ယွၩအဂံၪ့ အဂဲးအကၠီၪ့လီၫ. အဖၭ ထီၫဘဲၫနိၪထိၪလၧအခၪ့ထံၭအၥိၭ အဖျါဎူၫဆံၫ ဒဲအ",
			"4": "<sup>4</sup> ဒၪ့ဎၩ့အဖျါနံၫဆံၫလီၫ.- တၭဂံၪ့အထိၬချိၫ့လၧအမ့ၬ ယၫနီၪ,အဖၭထီၫဘဲၫဂံၪ့အဒၪ့ဎၩ့အၥိၭ, မွဲအဖျါနံၫ ဆံၫဒဲအထၪ့ထီၫနီၪအဖျါလယၩနံၫဆံၫတၭ, လၧအ",
			"5": "<sup>5</sup> ဖၧၩ့နီၪဖၩ့ဝ့ၫလၧထီၫ့ဆံၫ့လီၫ.- ဂံၪ့ဖၭဒိၪလၧအဖၧၩ့ လခီၫနီၪမၩဝ့ၫဂံၪ့ခိၪအဒၩလၧၥံၫ့ၡိၫ, လၧအဖၩ့ဝ့ၫလၧ ထီၫ့ဆံၫ့တၭ, အီၪက့ၪၥံၪ့စီၩ့မလီၫ့လၧအလီၩ့, ဒဲၥွ့ၫ",
			"6": "<sup>6</sup> ဖျံၩဆ့လီၫ.- တၭကယၧၩ့ထၪ့ဂံၪ့နီၪလၧလိးအဂ့ၩလ ဖၪလၧဆၧဎံၫဆၧလၩအဂးလီၫ. တၭထီၫ့နီၪ မွဲပဝ့ၫ",
			"7": "<sup>7</sup> အံၫ့အထီၫ့လီၫ.- တၭအဝ့ၫဖၩ့ဆ့ဂံၪ့, ဖိၪဆိၬဂၩ့ဖၩ ၥံၪ,ထုၪ့ၥံၪ, ဒဲအဒီၪ့လဖၪ, ဒဲအတရၫ့လဖၪနီၪလၧ ထီၫ့,ဒဲဖျၩကံၪခ့ၫရူၬလဖၪ လၧအဒီၪ့ၥံၪအလီၩ့လီၫ.",
			"8": "<sup>8</sup> တၭမၩဂံၪ့အဆံၫ့ဎံၪထုၬနီၪ, အဖၭထီၫဘဲၫဂံၪ့အ ဒၪ့ဎၩ့အဖျါနံၫဆံၫ, ဒဲအဒၪ့ဎၩ့နီၪ အဖျါနံၫဆံၫတၭ,",
			"9": "<sup>9</sup> ဖၩ့ဝ့ၫလၧထီၫ့ဆံၫ့အကံကၫဎူၫယၩလီၫ.- ထၭစူၩလ ဖၪအလယၧးနီၪ မွဲထီၫ့အၡက့လၭ ယဲဆံၫလီၫ. ဒူၭ လၧထၭလဆၫ့လဖၪနီၪ ဖၩ့ထၬဝ့ၫလၧထီၫ့လီၫ.",
			"10": "<sup>10</sup> တၭလၧဂံၪ့ဆံၫ့ဎံၪထုၬအဖၧၩ့နီၪ, မၩခ့ၫရူၬၥံၪနံၫ ဒုၩလၧအဒ့ၭကံၪဝ့ၫအဂၩ့တၭ, ဖၩ့ထၬအဝ့ၫၥံၪလၧ",
			"11": "<sup>11</sup> ထီၫ့လီၫ.- တၭခ့ၫရူၬလဖၪအဒံၭၥံၪ အဖၭထီၫမွဲအဖျါ နံၫဆံၫတၭး ဒံၭလဘံၪ့ယဲဖျါထီၩ့လၧဂံၪ့အဒီၪ့, ဒဲအ ဒံၭဂူၫဂၩလဘံၪ့ယဲဖျါ ထီၩ့လၧခ့ၫရူၬလဒုၩဒၪ အဒံၭ",
			"12": "<sup>12</sup> တၭး- ခ့ၫရူၬဂူၫဂၩလဒုၩအဒံၭ လဘံၪ့ယဲဖျါထီၩ့လၧ ဂံၪ့အဒီၪ့, ဒဲအဒံၭဂူၫဂၩလဘံၪ့ယဲဖျါ ဘုၭစိၩလၧခ့ၫရူၬ",
			"13": "<sup>13</sup> ဂူၫဂၩအဒံၭလဘံၪ့နီၪလီၫ.- တၭခ့ၫရူၬလဖၪအဒံၭ ယၩ့ထၪ့အၥၭနီၪအဖျါနံၫဆံၫ, ဆၧၫ့ထုၪ့ဝ့ၫလၧအခၪ့",
			"14": "<sup>14</sup> လဖၪတၭ, အမ့ၬအီၪလၧအဖၧၩ့လခီၫလီၫ.- အဝ့ၫမၩ ကလကၫလၧဆၧလၫ, ဒဲဆၧလုၭဖုၬ, ဒဲဆၧဝီၩ, ဒဲဆၧ ဘွၩဖျ့ၫလံၬကံၭတၭ, မၩခ့ၫရူၬလဖၪလၧအလီၩ့လီၫ.",
			"15": "<sup>15</sup> တၭလၧဂံၪ့အမ့ၬယၫနီၪ မၩဝ့ၫထုၪ့ဖၭဒိၪနံၫထုၪ့လၧ အထၪ့ထီၫအနါၥၧၫ့ဆံၫယဲဖျါ, ဒဲအခိၪစီၪ့လၧအဖၫ့",
			"16": "<sup>16</sup> ခိၪဆုၬဆုၬနီၪမွဲယဲဖျါလီၫ.- မၩၥွ့ၫဖျံၩ, ဘဲၫလၧချဲၩ့ ဆၧအလးအဖၧၩ့ၥိၭ, အီၪက့ၪဝ့ၫလၧထုၪ့လဖၪအခိၪ တၭ,မၩၥလဲၩၥၪၥံၪအဖျိၪ့လယၩတၭ, အီၪက့ၪဝ့ၫလၧ",
			"17": "<sup>17</sup> ၥွ့ၫဖျံၩအလီၩ့နီၪလီၫ.- အဝ့ၫဒၪဘိၭဆၧၫ့ထုၪ့အထုၪ့ ဖၭဒိၪလဖၪနီၪ, အလထုၪ့လၧစူၪထွ့ၪလခီၫ, ဒဲအလထုၪ့ လၧစူၪစ့ၪလခီၫတၭ, လၧအစူၪထွ့ၪလခီၫ လထုၪ့နီၪ ကိၭဝ့ၫအမံၩ့ယၫခံၫ့, ဒဲလၧစူၪစ့ၪလခီၫ လထုၪ့အမံၩ့ ဘိအၭနီၪလီၫ."
		},
		"4": {
			"1": "<sup>1</sup> လၧနီၪအမ့ၬယၫ အဝ့ၫဒၪတဲၩ့ဝဲၩဆၧလုအလးထီး ဝီၩ,အဖၭထီၫလခီၫနီၪ မွဲအဖျါနံၫဆံၫ, ဒဲအဒၪ့ဎၩ့အ ဖျါနံၫဆံၫ, ဒဲအထၪ့ထီၫလခီၫအဖျါလဆံၫလီၫ.",
			"2": "<sup>2</sup> အဝ့ၫဒၪၥိၫ့ကမၫဆ့တၭ, အခိၪဖဲၩ့လၧအနဲၩ့ထံၭလ ခီၫထီၩ့လၧအနဲၩ့ထံၭလခီၫဒၪနီၪ, မွဲအဖျါလဆံၫတၭး မွဲဆၧအဝၩ့ဒၩ့နီၪ, ဒဲအထၪ့ထီၫလခီၫအီၪယဲဖျါး ဒဲဖျံၩ",
			"3": "<sup>3</sup> ဖၭထီၫအဖျါၥၧၫ့ဆံၫဝၬဖီၩ့ဝ့ၫဝၬဝၬနီၪလီၫ.- လၧအ ဖၫ့လၬနီၪ အီၪဝ့ၫလၧဆၧအခံးအဂၩ့ လၩ့ဂၬချီဖၫၥံၪ ဝၬဖီၩ့ဝ့ၫတၭ, လၧလဖျါအဖၧၩ့ဆံၫဒုၩဆံၫဒုၩ, အီၪဖီၩ့ ကမၫထၧၫ့ဖျိၪ့ယၫဝၬဝၬလီၫ. ချီဖၫအဂၩ့လဖၪနီၪဘၪ ၥိၫ့အၥၭနံၫဂဲး လၧကမၫဘၪၥိၫ့အၥၭနီၪ လဖၧၫ့ဎး",
			"4": "<sup>4</sup> လီၫ.- ကမၫနီၪအီၪဝ့ၫလၧချီဖၫလဆံၫနံၫဒုၩအဖၫ့ခိၪ တၭ,ၥၧၫ့ဒုၩဒိၭအမ့ၬလၧမုဖၩလခီၫ, ဒဲၥၧၫ့ဒုၩဒိၭအ မ့ၬလၧမုနုၬး ဒဲၥၧၫ့ဒုၩဒိၭအမ့ၬလၧမုခံၫ့, ဒဲၥၧၫ့ဒုၩဒိၭ အမ့ၬလၧမုထၪ့လခီၫနီၪလီၫ. ဆၧအီၪက့ၪကမၫနီၪ လၧအဝ့ၫၥံၪအလီၩ့တၭ, အခဲၫ့လဖၪ အီၪဝ့ၫလၧအ",
			"5": "<sup>5</sup> ဖၧၩ့လခီၫလီၫ.- တၭအတၪ့နီၪမွဲလစိၭ, အခိၪဖဲၩ့မၩ အၥၭဘဲၫလိၫ့အခိၪဖဲၩ့ၥိၭတၭ, အီၪဝ့ၫလၧဖီၫယၫအ ဖူၩၥံၪဖီၫၥံၪတၭ, ထီဝ့ၫဘၭၥၫၥၧၫ့ထီၫ့လီၫ. အဝ့ၫမၩ",
			"6": "<sup>6</sup> ကဲၪထၪ့အံၪ့ဒိၫ့ဆံၫဖျိၪ့တၭ,- အီၪက့ၪယဲဖျိၪ့လၧစူၪ ထွ့ၪလခီၫ, ဒဲယဲဖျိၪ့လၧစူၪစ့ၪလခီၫ, လၧၥူၫဝၭဆၧအ ဖၧၩ့အဂးလီၫ. ဆၧလၧအဝ့ၫၥံၪလုထၪ့လၧဆၧလုမ့ၪ အဂးနီၪ ၥူၫဝၭခွံၬဝ့ၫလၧအဝ့ၫၥံၪအဖၧၩ့နီၪ, အ့ၪမွဲက မၫနီၪ,မွဲလၧၦလုဆၧလဖၪ မိၥူၫဝၭခွံၬအၥၭ လၧအ ဖၧၩ့အဂးလီၫ.",
			"7": "<sup>7</sup> အဝ့ၫဒၪမၩကဲၪထၪ့မ့ၪဒိၩ့ အလးထီၫ့ဆံၫဖျိၪ့ဘဲၫအ ခံးအဂၩ့အၥိၭတၭ, အီၪက့ၪဝ့ၫလၧနီးဖၧၩ့, ယဲဖျိၪ့လၧ စူၪထွ့ၪလခီၫ, ဒဲယဲဖျိၪ့လၧစူၪစ့ၪလခီၫလီၫ.",
			"8": "<sup>8</sup> အဝ့ၫဒၪမၩကဲၪထၪ့ဆ့စပွဲဆံၫဘံၪ့တၭ, အီၪက့ၪဝ့ၫ လၧနီးဖၧၩ့ ယဲဘံၪ့လၧစူၪထွ့ၪလခီၫ, ဒဲယဲဘံၪ့လၧစူၪ စ့ၪလခီၫလီၫ. ဒဲအဝ့ၫဒၪမၩကဲၪထၪ့ထွ့ၫထီၫ့အဖျိၪ့လ ယၩလီၫ.",
			"9": "<sup>9</sup> လၧနီၪအမ့ၬယၫ မၩၦလုဆၧၥံၪအဝၩ့, ဒဲအဝၩ့ဖၭ ဒိၪ,ဒဲတရၫ့လဖၪလၧဝၩ့အဂးနီၪ, ဒဲဖၩ့အတရၫ့လဖၪ",
			"10": "<sup>10</sup> လၧထီးဝီၩလီၫ.- တၭအီၪက့ၪကမၫလဖျိၪ့နီၪလၧမုထၪ့ စူၪထွ့ၪလခီၫ, ဎၩ့လၧမုခံၫ့လခီၫနီၪလီၫ.",
			"11": "<sup>11</sup> တၭစဟုရၫ့မၩကဲၪထၪ့ဖၧၩ့ၥံၪ, ဒဲဆွးၥံၪ, ဒဲထွ့ၫၥံၪ လီၫ. တၭစဟုရၫ့မၩဂီၩ့ဆၧမၩ လၧအမိမၩလၧစဎွၩ",
			"12": "<sup>12</sup> စီလမၧၫ့အဂး, လၧယွၩအဂံၪ့လဖျိၪ့နီၪအဂးတၭ,- မွဲ ဘဲၫယီၩ, ထုၪ့ဖၭဒိၪနံၫထုၪ့, ဒဲဆၧအဖျိၪ့ဒိၪ့လဖၪ ဒဲခိၪ စီၪ့လၧအအီၪလၧထုၪ့ဖၭဒိၪနံၫထုၪ့အဖၫ့ခိၪနီၪ, ဒဲဆၧ ချၩ့နံၫချၩ့ လၧအမိမၩဘံၭခိၪစီၪ့ အဆၧဖျိၪ့ဒိၪ့နံၫဖျိၪ့",
			"13": "<sup>13</sup> လၧအအီၪဝ့ၫလၧထုၪ့ဖၭဒိၪၥံၪအဖၫ့ခိၪလီၫ.- ဒဲလၧ ဆၧချၩ့နံၫချၩ့နီၪအလီၩ့ ၥလဲၩၥၪလဖၪလံယၩတၭ,လၧ ဆၧချၩ့နံၫချၩ့နီၪ အလီၩ့ဆုၬဆုၬ ၥလဲၩၥၪၥံၪအီၪဝ့ၫ နံၫဂဲးနံၫဂဲးဘဲၫၥိၭ အမိမၩဘံၭခိၪစီၪ့အဆၧချိၪ့ဒိၪ့နံၫ",
			"14": "<sup>14</sup> ဖျိၪ့လၧအအီၪဝ့ၫလၧ ထုၪ့ဖၭဒိၪၥံၪအဖၫ့ခိၪလီၫ.- တၭ မၩဆၧအခၪ့လဖၪ, ဒဲအံၪ့ဒိၫ့လၧခၪ့လဖၪ အဖၫ့ခိၪ, ကမၫလဖျိၪ့ဒဲချီဖၫလဆံၫနံၫဒုၩ လၧအဖၫ့လၬလီၫ.",
			"15": "<sup>15</sup> ဖၧၩ့ၥံၪဒဲဆွးၥံၪ, ဒဲနိၪပုၭဆၧယၪၥံၪ, ဒဲကယဲဆၧလမံၩ့",
			"16": "<sup>16</sup> လါလါဘၪဆဲၫ့လၧအဝ့ၫၥံၪထီးအလူၬနီၪ, စဟုရၫ့အ ဖါမၩဝ့ၫလၧထီးဘၩ့ယုၩ့ယဲ လၧစစီလမၧၫ့အဂး,လၧ",
			"17": "<sup>17</sup> ယဟိဝၩအဂံၪ့လဖျိၪ့နီၪအဂးလီၫ.- တၭစဎွၩၥိၫ့အဝ့ၫ ၥံၪလၧယီၫဒၫ့အဆၧပျၩ့ဖၧၩ့, လၧဂၪ့ခိၪအဖံၬကျၩအီၪ လၧစၧကီၭဒဲဇံရဒၭဟၫ အဘိၩ့ဆၧၩ့နီၪလီၫ.",
			"18": "<sup>18</sup> စစီလမၧၫ့ မၩကဲၪထၪ့ဖၧၩ့ၥံၪထွ့ၫၥံၪ အၪအၪလ့ၬ ဘဲၫနီၪၥိၭ, အဂဲးဘဲၫယီၩ ထီးဝီၩအလယၧးနီၪဆၧဒၪ",
			"19": "<sup>19</sup> န့ဘၪၥ့ၪအ့ၬ.- တၭစစီလမၧၫ့မၩကဲၪထၪ့ဖၧၩ့ၥံၪထွ့ၫ ၥံၪထီးအလူၬ, လၧအအီၪလၧယွၩအဂံၪ့အဂး, ဒဲဆၧ လုအလးထီၫ့ဆ့, ဒဲစပွဲလဖၪ, လၧဆၧအီၪက့ၪဆၧမ့ၬ",
			"20": "<sup>20</sup> ယၫအကိၪနီၪလၧအဖၫ့ခိၪ,- ဒဲမ့ၪဒိၩ့အလးဒဲအမ့ၪဒိၩ့ ၥံၪလၧထီၫ့ဆံၫ့, ဘဲၫၥိၭအမိခဲၩထၪ့ဘဲၫလၧချဲၩ့ဆၧအ",
			"21": "<sup>21</sup> လးအမ့ၬယၫအၥိၭနီၪလီၫ.- ဒဲဖူၩၥံၪဖီၫၥံၪ, ဒဲမ့ၪဒိၩ့ ၥံၪ,ဒဲနိၪထံၬၥံၪ မၩဝ့ၫလၧထီၫ့, မွဲထီၫ့ဂ့ၩထုၬနီၪဆ့",
			"22": "<sup>22</sup> လီၫ.- ဒဲနိၪထံၬမ့ၪၥံၪ, ဒဲထွ့ၫၥံၪ, ဒဲနိၪထိၩ့ၥံၪ, ဒဲဆၧနၧၫ့ မၧၫ့အဖၧၩ့မ့ၪၥံၪ, လၧထီၫ့ဆံၫ့လီၫ. ဒဲပၭတၫၥံၪလၧ လးဆံၫ့ဎံၪထုၬ အတရၫ့ၥံၪအဂး, ဒဲနီးအတရၫ့ၥံၪအ ဂးမွဲထီၫ့လီၫ."
		},
		"5": {
			"1": "<sup>1</sup> ဘဲၫနီၪၥိၭကယဲဆၧမၩလၧ စစီလမၧၫ့မၩဝ့ၫလၧယ ဟိဝၩအဂံၪ့အဂးနီၪ ဂီၩ့ဝ့ၫဒၪထီးအလူၬလီၫ. စစီလ မၧၫ့ဂဲၫဆိၬန့ကယဲဆၧလဖၪ လၧအဖါစဒၫဝံၭအီၪက့ၪ လၧဆၧဆံၫ့ဎံၪအဂးနီၪ, ဒဲကျိၪၥံၪစ့ၩၥံၪ, ထီၫ့ၥံၪလွ့ၫ ၥံၪ,ဒဲဆၧဖိၪဆၧလံၩထီးအလူၬလဖၪတၭ, အီၪက့ၪဝ့ၫ လၧအဂံၪ့အဎၧၩ့အဎီအကျၩလီၫ.",
			"2": "<sup>2</sup> ထီးနီၪလဖၧၫ့စစီလမၧၫ့ ကိၭကီၪ့အံၫစရ့လၭအၥုၪ့ က့ၭၥၭၡါလဖၪ, ဒဲအဒီၪ့ၥံၪအခိၪလဖၪ ထီးအလူၬ, လၧအမွဲအံၫစရ့လၭဖိၪအဖါလဖၪအခိၪၥံၪ, လၧယရု စလံၫ့အဖၧၩ့နီၪ, ဘဲၫၥိၭအမိဂဲၫဆိၬ ယဟိဝၩအဆၧ အုၩ့လၩ့အတလၫ လၧစဒၫဝံၭအဒိၩ့ဖၧၩ့နီၪ, လၧအမွဲ ဇံအိၫ့လီၫ.",
			"3": "<sup>3</sup> အခိးမွဲအံၫစရ့လၭ အၡၩထီးအလူၬလဖၪအီၪကီၪ့ လၧစဎွၩအအီၪ လၧဆၧဘိၪ့ဖၧၩ့ လၧလၩနွ့ၫဘံၪ့လ",
			"4": "<sup>4</sup> ဘံၪ့လီၫ.- တၭအံၫစရ့လၭအၥုၪ့က့ၭၥၭၡါလဖၪထီး အလူၬဂဲၫထီၩ့နီၪး ဒဲၦလံဝဲၫဖိၪလဖၪ မၩန့တလၫနီၪ",
			"5": "<sup>5</sup> လီၫ.- အဝ့ၫဂဲၫထၪ့ဆိၬထၪ့တလၫနီၪး ဒဲဆၧအီၪကီၪ့ အတဲၩဆံၫ့ဎံၪ, ဒဲဖၧၩ့ၥံၪထွ့ၫၥံၪဆံၫ့ဎံၪ ထီးအလူၬၥံၪ လၧအအီၪဝ့ၫလၧတဲၩဆံၫ့ဎံၪအဖၧၩ့နီၪ, ဆၧနီၪလဖၪ",
			"6": "<sup>6</sup> ၦလုဆၧၥံၪဒဲၦလံဝဲၫဖိၪၥံၪ ဂဲၫဆိၬထၪ့ဝ့ၫဒၪလီၫ.- တၭ စဎွၩစီလမၧၫ့, ဒဲအံၫစရ့လၭ အဆၧအီၪကီၪ့ထီးအလူၬ လၧအအီၪကီၪ့လၧအအီၪ လၧတလၫနီၪအမ့ၬယၫ,လု ထၪ့ၥိၪၥံၪဘ့ၪၥံၪဒဲချီဖၫၥံၪ, လၧအအၪဝ့ၫအၪအၪလ့ၬ",
			"7": "<sup>7</sup> ထီးဆၧဝံထၪ့နၬထၪ့ၥ့ၪဝါအ့ၬ.- ၦလုဆၧလဖၪဂဲၫဆိၬ ယဟိဝၩအဆၧအုၩ့လၩ့အတလၫ ထီၩ့လၧအလးဒၪ ဝ့ၫအဖၧၩ့, လၧဂံၪ့အချဲၩ့ဆၧအလး, လၧလးဆံၫ့ဎံၪ ထုၬအဖၧၩ့လၧခ့ၫရူၬလဖၪ အဒံၭၥံၪအဖၫ့လၬနီၪလီၫ.",
			"8": "<sup>8</sup> အဂဲးဘဲၫယီၩ ခ့ၫရူၬလဖၪ ယၩ့ထၪ့အဒံၭၥံၪလၧတ လၫအလးအဖၫ့ခိၪတၭး ခ့ၫရူၬလဖၪချႃၬဘံၭတလၫ",
			"9": "<sup>9</sup> နီၪဒဲအနိၪယိၭဘီၩ့လဖၪ လၧအဖၫ့ခိၪလီၫ.- တၭအဝ့ၫ ၥံၪထုၭထၪ့နိၪယိၭဘီၩ့လဖၪနီၪ, အခံၫထိၭၥံၪဖျီၪထၪ့ လၧတလၫအီၪလၧချဲၩ့ဆၧအလး အမ့ၬယၫး အ့ၪမွဲလၧ ခီၫ့နီၪဖျီၪထၪ့ဝ့ၫအ့ၬ. အီၪထီးနီၪထီးမုဆၫလနံၩယီၩ",
			"10": "<sup>10</sup> လီၫ.- လၧတလၫဖၧၩ့နီၪဆၧအီၪန့ၫလိးပၪနံၫဘံၪ့လၧ စမိစ့ၭအီၪက့ၪလၩ့ဝ့ၫလၧ ဟိရ့ၭအဂၩ့ထံၭ, အလးလၧ ယဟိဝၩအုၩ့လၩ့လိၬအၥၭ လၧအံၫစရ့လၭဖိၪလဖၪ နီၪ,လၧအဝ့ၫၥံၪဂဲၫစဲၪ့ထၪ့ခွံၬ လၧအံဇံၭအဖၧၩ့တၭ, ဆၧဂူၫဂၩအီၪနးမံၩ့အ့ၬ.",
			"11": "<sup>11</sup> တၭဆၧမၩအၥၭ လၧၦလုဆၧလဖၪ ဂဲၫစဲၪ့ထၪ့ခွံၬ လၧလးဆံၫ့ဎံၪအဖၧၩ့နီၪ, (အဂဲးဘဲၫယီၩ ကယဲၦလု ဆၧလဖၪလၧအအီၪဝ့ၫထီးအလူၬ ဘၪဆၧမၩဆံၫ့ဎံၪ",
			"12": "<sup>12</sup> ဝ့ၫတၭ, အီၪခိၭလိၬအၥၭလဒီၪ့လဒီၪ့နီၪမွဲအ့ၬ.- ၦလံ ဝဲၫလဖၪဆ့လၧအမၩထၭခိၪနီၪ, ကယဲၦဘၪဆဲၫ့လၧစ အၫစၭ,လၧစဟံမၫ့, လၧစယ့ၭဒုၫၥၫ့, အီၪလၧအဝ့ၫၥံၪ အဖိၪခွၫၥံၪ,ဒဲအထၧၫ့ဖုဝဲလဖၪ, ကီၩ့ထၪ့ၥိၭထၪ့အ ၥၭလၧဆၧဘွၩဖျ့ၫလံၬကံၭ, အီၪလၧစံၩ့စံၩ့ၥံၪ, နါဒံၩ့ ၥံၪ,ၥၫ့ထီးၥံၪ, ဆၧၫ့ထုၪ့လၧဆၧလုအလးမုထၪ့လခီၫ, ဒဲၦလုဆၧလဖၪလယၩနံၫဆံၫ အီၪလၧအဝ့ၫၥံၪအၥိၭ",
			"13": "<sup>13</sup> အူၪထၪ့ခွ့ၩလဖၪတၭ,) ဆၧမၩအၥၭထီးၦအူၪခွ့ၩ ၥံၪ,ဒဲၦမၩထၭခိၪၥံၪ ဘဲၫၦလဂၩဎးအၥိၭတၭ, မၩၥီၫ လမံၩ့ဎး လၧအစံၭထၪ့အၪ့အူၭယဟိဝၩ, ဒဲထီးအဝ့ၫ ၥံၪမၩၥီၫထၪ့အလူ, ဒဲခွ့ၩလဖၪ, ဒဲစံၩ့စံၩ့ၥံၪ,ဒဲဆၧလၧ အမၩၥီၫမုၬလဖၪနီၪ, ဒဲအၪ့အူၭထၪ့ယဟိဝၩ, အဂဲး ဘဲၫယီၩအဝ့ၫဒၪမွဲဆၧဂ့ၩး အဂဲးဘဲၫယီၩ အခိးအတၩ နီၪအီၪဝ့ၫအဆိၩဆိၩအကၠၪကၠၪတၭး ထီးနီၪလဖၧၫ့ ဂံၪ့လဖျိၪ့နီၪ ဎွ့ၩဝ့ၫလၧဆၧအုၪ့, ယဟိဝၩ အဂံၪ့ဒၪ",
			"14": "<sup>14</sup> လ့ၬ,- အခိးမွဲၦလုဆၧလဖၪ, လၧဆၧအုၪ့အကၠီၩ့နီၪ, ဆၧၫ့ထုၪ့မၩအဆၧမၩလဖၪၥ့ၪဝါအ့ၬ, အဂဲးဘဲၫယီၩ ယဟိဝၩအလၩအဖၩ့ မၩဎွ့ၩထၪ့ယွၩအဂံၪ့လဖျိၪ့နီၪ လီၫ."
		},
		"6": {
			"1": "<sup>1</sup> ထီးနီၪလဖၧၫ့စစီလမၧၫ့စံၭဝ့ၫ, ယဟိဝၩစံၭလၧအ",
			"2": "<sup>2</sup> မိအီၪဝ့ၫလၧဆၧခံၭတၪ့အကျၩလီၫ.- အ့ၪမွဲယဝ့ၫဒၪ ယမၩထၪ့ဂံၪ့လဖျိၪ့ လၧနအီၪဝ့ၫအဂး, ဒဲလၧနမိအီၪ",
			"3": "<sup>3</sup> ဂုးခၧၫ့ဝ့ၫအဆိၩဆိၩအကၠၪကၠၪအဂးလီၫ.- စဎွၩကၠၪ ထဲၩ့အမ့ၬနီၪ, ဆိၪဂ့ၩအံၫစရ့လၭ အဆၧအီၪကီၪ့ထီး အလူၬဆၧၫ့ထုၪ့ဝ့ၫဒၪလီၫ.",
			"4": "<sup>4</sup> တၭအဝ့ၫဒၪစံၭဝ့ၫ, ယဟိဝၩအံၫစရ့လၭအယွၩ, လၧအမၩလၧၫ့ထၪ့ဎွ့ၩထၪ့ ဆၧလၧအနိၭချဲၩ့ဝ့ၫလၧ ယဖါစဒၫဝံၭလဂၩနီၪ လၧအစူၪဒၪဝ့ၫ, မွဲအဘၪဆၧစံၭ",
			"5": "<sup>5</sup> ထၪ့အၪ့အူၭဝ့ၫဆံၭ.- အဝ့ၫဒၪစံၭ, ခီၫလၧမုနံၩလၧ ယဒုၭစဲၪ့ထၪ့ခွံၬယၡၩခမျၧးၥံၪ လၧအံဇံၭခီးဘိၩ့နဲၪ့ ယီၩ,ယရွံန့ဒိၩ့လၧအံၫစရ့လၭ အဒီၪ့လဖၪအကျၩ, လၧဆၧမိမၩထၪ့ဂံၪ့လၧအဖၧၩ့ ဘဲၫၥိၭယမံၩ့မိအီၪထီး နီၪ,နးစီၪ့အ့ၬ, တၭယရွံန့ၦၡၩလၧ အမိပၧၩ့ယၡၩခ",
			"6": "<sup>6</sup> မျၧးအံၫစရ့လၭနီၪနးဂၩဆ့အ့ၬး- အ့ၪမွဲယရွံန့ယူၭယ ရုစလံၫ့, ဘဲၫၥိၭယမံၩ့မိအီၪထီးနီၪ, ဒဲယရွံန့ယူၭစဒၫ ဝံၭလဂၩဘဲၫၥိၭအမိအီၪလၧ ယၡၩခမျၧးအံၫစရ့လၭ",
			"7": "<sup>7</sup> အဖၫ့ခိၪလီၫ.- တၭဆၧအီၪဝ့ၫလၧယဖါစဒၫဝံၭအၥၭ ခံဖၧၩ့လၧအမိမၩထၪ့ဂံၪ့လဖျိၪ့ လၧယဟိဝၩအံၫစရ့",
			"8": "<sup>8</sup> လၭအယွၩအမံၩ့အဂးလီၫ.- အ့ၪမွဲယဟိဝၩစံၭယဖါ စဒၫဝံၭနီၪ, ဆၧလၧအအီၪလၧနၥၭခံဖၧၩ့လၧနမိမၩထၪ့ ဂံၪ့လဖျိၪ့လၧယမံၩ့အဂးတၭ, မွဲဆၧအဂ့ၩလၧအအီၪ",
			"9": "<sup>9</sup> လၧနၥၭခံဖၧၩ့း- မွဲလါနၫ့ဘဲၫနီၪတၭ နဝ့ၫဒၪနမၩထၪ့ ဘၪဂံၪ့လဖျိၪ့နီၪအ့ၬ. အ့ၪမွဲနဖိၪခွၫလၧ အမိဂဲၫထၪ့လၧ နယးဒံၩ့အဖၧၩ့လဂၩနီၪ, အဝ့ၫဒၪမိမၩထၪ့ဂံၪ့လဖျိၪ့",
			"10": "<sup>10</sup> နီၪလၧယမံၩ့အဂးလီၫ.- မၩအၥၭဘဲၫနီၪတၭ ယဟိ ဝၩမၩလၧၫ့ထၪ့ဎွ့ၩထၪ့ယူၭ ဆၧလၧအချဲၩ့ဝဲၩဝ့ၫနီၪး အဂဲးဘဲၫယီၩ ယဝ့ၫဒၪယဂဲထုၪ့ထၪ့လၧယဖါစဒၫဝံၭ အလးတၭ, ဆၧအီၪက့ၪထၪ့ယၧၩ လၧအံၫစရ့လၭအ လးဆီၩ့ဆီအလီၩ့, ဘဲၫယဟိဝၩချဲၩ့ဝဲၩဝ့ၫအၥိၭ, ဒဲမၩ ထၪ့ယူၭဂံၪ့လဖျိၪ့ လၧယဟိဝၩအံၫစရ့လၭအယွၩအ",
			"11": "<sup>11</sup> မံၩ့အဂးလီၫ.- တၭလၧအဖၧၩ့နီၪယအီၪက့ၪယူၭတ လၫ,လၧယဟိဝၩ အဆၧအုၩ့လၩ့, လၧအအုၩ့လၩ့ လိၬအၥၭလၧအံၫစရ့လၭဖိၪလဖၪ, အီၪဝ့ၫလၧအဖၧၩ့ နီၪလီၫ.",
			"12": "<sup>12</sup> အဝ့ၫဒၪဆၧၫ့ထုၪ့လၧယဟိဝၩ အဆၧလုလးအနဲၩ့ ထံၭ,လၧအံၫစရ့လၭအဆၧအီၪကီၪ့ ထီးအလူၬအမ့ၬ",
			"13": "<sup>13</sup> ယၫတၭ, ယူၬထၪ့အစူၪၥံၪလီၫ.- အဂဲးဘဲၫယီၩစစီလ မၧၫ့မၩယူၭဆၧထၪ့ထီၫလမံၩ့လၧထီးဝီၩ, အဖၭထီၫ ယဲဖျါ,အဒၪ့ဎၩ့ယဲဖျါ, ဒဲအထၪ့ထီၫၥၧၫ့ဖျါတၭ, အီၪ က့ၪယူၭဝ့ၫလၧဝၩ့အၥၭကျၩနီၪ, အဝ့ၫဒၪ ဆၧၫ့ထုၪ့ လၧဆၧလမံၩ့နီၪအလီၩ့, ဒဲထွံၩလၩ့အခၪ့လုးခိၪလၧ အံၫစရ့လၭအဆၧအီၪကီၪ့ ထီးအလူၬအမ့ၬယၫတၭ, ယူၬထၪ့အစူၪၥံၪလၧမူၭခိၪ, တၭစံၭဝ့ၫး",
			"14": "<sup>14</sup> ယဟိဝၩအံၫစရ့လၭအယွၩဧ့, လၧမူၭခိၪမွဲဂ့ၩ,လၧ ဂၪ့ခိၪချိၫ့မွဲဂ့ၩ, ယွၩဘဲၫနၧၩအၥိၭယီၩ အီၪနးဂၩအ့ၬး နဝ့ၫဒၪနထီးန့ဆၧအုၩ့လၩ့, ဒဲနဲၪဖျီၪထၪ့ဆၧယၫ့ၥၭ လၧနခ့ၫနၡၩလဖၪ, လၧအလ့ၩဆၧလၧနမ့ၬယၫလၧအ",
			"15": "<sup>15</sup> ဝ့ၫၥံၪအၥၭထၧၫ့ဖျိၪ့ယၫလီၫ.- ဆၧလၧနချဲၩ့ဝဲၩယူၭ လၧနခ့ၫနၡၩယဖါစဒၫဝံၭနီၪ, နဝ့ၫဒၪနထီးန့ယူၭတၭ, နချဲၩ့ဆၧလၧနနိၭနီၪ, နမၩလၧၫ့ထၪ့ဎွ့ၩထၪ့လၧနစူၪ",
			"16": "<sup>16</sup> ယူၭ,ဘဲၫဆၧအီၪလၧမုဆၫလနံၩယီၩအၥိၭလီၫ.- မၩ အၥၭဘဲၫနီၪတၭ, ဘိၩ့နဲၪ့ယီၩ, ယဟိဝၩအံၫစရ့လၭ အယွၩဧ့, ဆၧလၧနအုၩ့လၩ့ဝဲၩယူၭ လၧနခ့ၫနၡၩယ ဖါစဒၫဝံၭနီၪ ထီးန့နဝ့ၫလၧဆၧလဖၪနီၪဆံၭ. လၧနစံၭ ဝ့ၫ,ၦလၧအဘၪဆဲၫ့လၧနၧၩ လၧအမိဆၧၫ့နၩ့လၧအံၫ စရ့လၭအလးဆီၩ့ဆီအလီၩ့နီၪ, မိလၩ့မါဘၪလၧယ မ့ၬယၫအ့ၬး မွဲလါနၫ့ဘိၩန့ၫယီၩလမံၩ့, မွဲနဖိၪနလံၩ လဖၪထီးလၩ့အၥၭဘဲၫၥိၭအမိလ့ၩဆၧလၧ ယဆၧၥီၪ့ ဆၧၥၫ့အဖၧၩ့, ဘဲၫနလ့ၩဆၧလၧယမ့ၬယၫအၥိၭနီၪ",
			"17": "<sup>17</sup> ဆံၭ.- တၭဘိၩ့နဲၪ့ယီၩ, ယဟိဝၩ, အံၫစရ့လၭအယွၩ ဧ့,နလူလၧနချဲၩ့ယူၭ လၧနခ့ၫနၡၩစဒၫဝံၭနီၪ, မွဲအအီၪ ဂုးဂုးခၧၫ့ခၧၫ့ဆံၭ.",
			"18": "<sup>18</sup> တၭယွၩနီၪ, မွဲအမိအီၪလၧဂၪ့ခိၪချိၫ့ယီၩလၧၦၡၩ အကျၩတၡါဆ့ဧၪ. ယိခွါ, မူၭခိၪ, ဒဲမူၭခိၪထၪ့ထီၫ ထုၬၥံၪ,ထီလၧနဂးအ့ၬး တၭဂံၪ့လၧယမၩထၪ့လဖျိၪ့",
			"19": "<sup>19</sup> ယီၩ,ဆံၭနဲၪ့ဒံၭအနီၪ, ဆံၭအၪလဲၪၬ- အခိးမွဲ,ယဟိဝၩ ယယွၩဧ့, ထိးဆၧၫ့နခ့ၫနၡၩအဆၧအၪ့ကံၩ့ယီၩ ဒဲအ ဆၧဘၩဆိၪဖၪဆံၭ. ဒိၭနနါလၧနခ့ၫနၡၩ အဆၧကိၭ ၡၭထၪ့ဒဲအၪ့ကံၩ့ဘၩဆိၪဖၪ ဆၧလၧနမ့ၬယၫဆံၭ.",
			"20": "<sup>20</sup> ဘဲၫၥိၭနမ့ၬၥၪၥံၪမိအီၪဝဲထၪ့အၥၭ လၧဂံၪ့လဖျိၪ့ယီၩ အဖၫ့ခိၪလၧ မုဆၫဆၫမုနၩနၩ, အလးလၧနစံၭဝဲၩလၧ နမိအီၪက့ၪနမံၩ့ထီးနီၪတၭး ခိၭနၪနခ့ၫနၡၩလၧအအၪ့ ကံၩ့ဆၧဒဲဘၩဆိၪဖၪစိၩ ဆၧအလးလစီၪ့ယီၩဆံၭ.",
			"21": "<sup>21</sup> အခိးမွဲခိၭနၪနခ့ၫနၡၩ အဆၧအၪ့ကံၩ့အၪ့ယၫဝ့ၫလဖၪ, ဒဲလၧနခ့ၫနၡၩခမျၧး, အံၫစရ့လၭ, လၧအဝ့ၫၥံၪမိအၪ့ ကံၩ့စိၩဂံၪ့လဖျိၪ့ယီၩဆံၭ. လၧနအီၪအလးလၧမူၭခိၪ နီၪ,နါဂၧၫ့နဝ့ၫတၭ, ထီးနအ့ၪနါဂၧၫ့နီၪ, မၩဖီၩ့မၩဖျ့ၭ ဆံၭ.",
			"22": "<sup>22</sup> ၦလဂၩအ့ၪမၪဘၪ ၦလၧအနဲၩ့ထံၭတၭ, အ့ၪဆိၪ လၩ့အၥၭလၧဆၧဒုၭဆိၪလၩ့ဝ့ၫတၭ, အဆၧဆိၪလၩ့ အၥၭနီၪအ့ၪဂဲၫထၪ့လၧ နဆၧလုလးအမ့ၬယၫလၧဂံၪ့",
			"23": "<sup>23</sup> လဖျိၪ့ယီၩအဖၧၩ့တၭ,- ထီးနီၪလဖၧၫ့လၧမူၭခိၪနီၪနါ ဂၧၫ့နဝ့ၫတၭ, မၩနဝ့ၫတၭ, စ့ၩရၫ့နခ့ၫနၡၩလဖၪ,လၧ နစ့ၩရၫ့စၪၦအၧၩ့နီၪ လၧနဖ့ၪလၫ့ထဲၩ့အဖၧၩ့ၥၭဒၪဝ့ၫ လၧအနၫ့ဆါအခိၪဎွံၪ အဖၫ့ခိၪဆံၭး ဒဲလၧနအီၪက့ၪ တီၩအီၪက့ၪလီၩ့ ၦတီၩၦလီၩ့ လၧနဖ့ၪလၫ့ဝ့ၫ ဘဲၫအ ဆၧတီၩဆၧလီၩ့အၥိၭနီၪဆံၭ.",
			"24": "<sup>24</sup> နၡၩခမျၧးအံၫစရ့လၭ အ့ၪဘၪဆၧကျီၪ့ဝ့ၫ လၧအ ဒုၪအဒၩအမ့ၬယၫနီၪ, လၧအမၪဘၪနၧၩအကၠီၩ့တၭး အ့ၪကၠၪထဲၩ့အၥၭဒဲအုၩ့လၩ့နမံၩ့, ဒဲအၪ့ကံၩ့အၪ့ယၫ ဆၧ,ဘၩဆိၪဖၪ လၧနမ့ၬယၫတီၩ လၧဂံၪ့လဖျိၪ့ယီၩ",
			"25": "<sup>25</sup> တၭ,- ထီးနီၪလဖၧၫ့လၧမူၭခိၪနီၪ, နါဂၧၫ့နဝ့ၫ, ဒဲမၩ ဖီၩ့မၩဖျ့ၭနခ့ၫနၡၩ အံၫစရ့လၭအဆၧဒဲၩဘၭ ဒဲဂဲၫ ထဲၩ့န့ဒီၭအဝ့ၫၥံၪ ထီၩ့လၧထံၫၥံၪခးၥံၪလၧနဖ့ၪလၫ့အ ဝ့ၫၥံၪ,ဒဲအဖါလဖၪနီၪဆံၭ.",
			"26": "<sup>26</sup> ထီးမူၭခိၪအ့ၪဘၪဆၧကၭဘံၭထၬအၥၭနီၪ, ဆၧလ ဆၧၩ့လၩ့ဘၪ လၧအဝ့ၫၥံၪမၪဘၪနၧၩအကၠီၩ့နီၪး အ ဝ့ၫၥံၪအ့ၪအၪ့ကံၩ့အၪ့ယၫဆၧတီၩ လၧအလးယီၩ တၭ,အုၩ့လၩ့နမံၩ့ဒဲကၠၪခွံၬအၥၭ လၧအဆၧဒဲၩဘၭ",
			"27": "<sup>27</sup> လၧနဒုၭဘၪၡၪ့ဘၪနၭနီၪး- ထီးနီၪလဖၧၫ့လၧမူၭခိၪ နီၪနါဂၧၫ့နဝ့ၫ, ဒဲမၩဖီၩ့မၩဖျ့ၭနခ့ၫနၡၩၥံၪ အဆၧဒဲၩ ဘၭ,ဒဲနၡၩခမျၧးအံၫစရ့လၭလဖၪဆ့း ထီးနအ့ၪၥီၪ့ ထဲၩ့ၥၫ့ထဲၩ့အဝ့ၫၥံၪ လၧဖၧၩ့ၥၭအဂ့ၩ, လၧအဝ့ၫၥံၪ ကြၨၭဖိၬဝ့ၫလဘီၩ့တၭး ထံၫၥံၪခးၥံၪ လၧနဖ့ၪလၫ့န ၡၩခမျၧးလဖၪလၧအန့ၥၫဆၧအလးနီၪ, ဒုၭဆၧၩ့လၩ့ လၧအဖၧၩ့နီၪဆံၭ.",
			"28": "<sup>28</sup> ဆၧၥၭဝံလၩ့ဒိၩအ့ၪအီၪထၪ့လၧခးဖၧၩ့, ဆၧၥံၫချဲၫ့ အ့ၪအီၪထၪ့ဘုၪၥံၪဂူၫၥံၪအ့ၪဘၪ ဆၧဂၭဂီၩ့နီၪ, နၫလ့ မွဲဂ့ၩ,ထွ့ၥံၪ, ၥံၭၥံၪမွဲဂ့ၩအ့ၪအီၪတၭး လၧအဝ့ၫၥံၪအ ထံၫအခးအဒိၩ့လဖၪအဖၧၩ့နီၪ, အဒုၪအဒၩလဖၪ အ့ၪဝၩ့ထၬ အဝ့ၫၥံၪတၭး ထီးဒၪဖၧၩ့လးဆၫ လမံၩ့",
			"29": "<sup>29</sup> လါလါ,ထီးဒၪဆၧစူၭဆၧဆၫလမံၩ့လါလါနီၪး- ထီး ဒၪဆၧအၪ့ကံၩ့ဘၩဆိၪဖၪ လမံၩ့လါလါ လၧၦလဂၩ ဂၩအ့ၪအၪ့ကံၩ့ဝ့ၫမွဲဂ့ၩ, နၡၩခမျၧးအံၫစရ့လၭထီး အလူၬ အၪ့ကံၩ့ဝ့ၫမွဲဂ့ၩ, ထီးကယဲၦၡၩလဂၩဘၪလ ဂၩဆုၬဆုၬအ့ၪၥ့ၪယၫအနၫ့ဆါ အဖၧၫ့လးဆၫ, ဒဲအ ဆၧၥုၪ့အုၭၥၭအုၭတၭး အ့ၪယူၬထၪ့စိၩအစူၪလၧဂံၪ့",
			"30": "<sup>30</sup> လဖျိၪ့ယီၩး- ထီးနီၪလဖၧၫ့လၧမူၭခိၪအဖၧၩ့နအီၪဝ့ၫ အလးနီၪခိၭနၪနဝ့ၫ,ဒဲမၩဖီၩ့မၩဖျ့ၭ, ဒဲကယဲၦၡၩလဂၩ ဘၪလဂၩဆုၬဆုၬလၧနၥ့ၪယၫအၥၭခံဖၧၩ့နီၪ, (အဂဲး ဘဲၫယီၩၦၡၩဖိၪၥံၪအၥၭခံဖၧၩ့နီၪ ၦၥ့ၪယၫမွဲန့ၫနၧၩ) ဖ့ၪလၫ့အဝ့ၫၥံၪ ဘဲၫအဖၧၩ့ၥၭထီးအလူၬအီၪဝ့ၫအၥိၭ",
			"31": "<sup>31</sup> နီၪဆံၭ.- ဘဲၫၥိၭအဝ့ၫၥံၪမိၥၭမဲၪနၧၩ, ဒဲလ့ၩဆၧလၧ နဖၧၩ့ၥၭလဖၪ လဆိၩဒၪအဝ့ၫၥံၪအၥၭမၧၫ့ လၧထံၫ ၥံၪခးၥံၪအဖၧၩ့, လၧနဖ့ၪလၫ့ယူၭပဖါလဖၪနီၪဆံၭ.",
			"32": "<sup>32</sup> လၧနီၪအမ့ၬယၫ လၧၦလခီၫဘၩ့မုးဖိၪအဂဲး,ၦလ ဘၪဆဲၫ့ဘၪလၧနၡၩခမျၧး အံၫစရ့လၭနီၪ, အ့ၪမွဲလၧန မံၩ့ဖၭဒိၪအကၠီၩ့တၭ, အ့ၪဂဲၫလၧထံၫယဲၩ့ခးယဲၩ့လၧ နစူၪဆီၪ့ ဒဲလၧနယူၬထၪ့နစူၪအကၠီၩ့တၭ, အဝ့ၫၥံၪ အ့ၪဂဲၫအၪ့ကံၩ့ဘၩဆိၪဖၪ လၧဂံၪ့ယီၩအဖၧၩ့တၭ,",
			"33": "<sup>33</sup> ထီးနီၪလဖၧၫ့ လၧမူၭခိၪအဖၧၩ့, နအီၪဝ့ၫအလးနီၪ, ခိၭနၪနဝ့ၫ, ဒဲမၩဘဲၫၦလခီၫဘၩ့မုးဖိၪ အၪ့ကံၩ့နၧၩအ ၥိၭထီးအလူၬနီၪဆံၭး ဘဲၫၥိၭၦခမျၧးလၧဂၪ့ခိၪချိၫ့ ထီးအလူၬလဖၪ မိၥ့ၪယၫနမံၩ့, ဒဲၥၭမဲၪနၧၩ, ဘဲၫနၡၩ ခမျၧးအံၫစရ့လၭအၥိၭ, ဒဲမိၥ့ၪယၫလၧနဂံၪ့လၧယမၩ ထၪ့လဖျိၪ့ယီၩ, ဘၪဆၧကိၭဝ့ၫလၧနမံၩ့ဆံၭ.",
			"34": "<sup>34</sup> တၭနၡၩခမျၧးၥံၪအ့ၪလ့ၩထၪ့ ဒုၭၥုၭထၫ့ဒုၪဒၩအ ဝ့ၫၥံၪအဒုၪအဒၩလဖၪ လၧဖၧၩ့ၥၭလၧနအၪ့မၧၫ့ဝ့ၫ နီၪ,အဝ့ၫၥံၪအ့ၪအၪ့ကံၩ့ဘၩဆိၪဖၪ ဆၧလၧနၧၩတီၩ လၧဒိၩ့လၧနရွံန့လဖျိၪ့ယီၩ, ဒဲဂံၪ့လၧယမၩထၪ့လၧန မံၩ့အဂးလဖျိၪ့ယီၩး ထီးနီၪလဖၧၫ့လၧမူၭခိၪအဖၧၩ့",
			"35": "<sup>35</sup> နီၪ,- ခိၭနၪနဝ့ၫအဝ့ၫၥံၪ အဆၧအၪ့ကံၩ့ဝ့ၫအဆၧဘၩ ဆိၪဖၪလဖၪတၭး စ့ၩရၫ့ဆၧအတီၩအလီၩ့ လၧအဝ့ၫ ၥံၪအဂးဆံၭ.",
			"36": "<sup>36</sup> အဝ့ၫၥံၪအ့ၪမၪဘၪနၧၩတၭ, (အဂဲးဘဲၫယီၩ ၦၡၩ လၧအလမၪဘၪဆၧနီၪအီၪနးဂၩအ့ၬ.) နအ့ၪၥၭထၪ့ အဝ့ၫၥံၪတၭ, ဖ့ၪလၫ့ခွံၬဝ့ၫ လၧအဒုၪအဒၩအစူၪဖၧၩ့ နီၪ,အဒုၪအဒၩၥံၪ အ့ၪဆိၬခွံၬ အၪ့မၧၫ့ဎီးဝ့ၫ လၧထံၫ",
			"37": "<sup>37</sup> ယဲၩ့ခးယဲၩ့မွဲဂ့ၩ, လၧအဘူၭမွဲဂ့ၩး- မွဲလါနၫ့ဘဲၫနီၪ တၭ,အဝ့ၫၥံၪအ့ၪဆီၫ့မီၪ့လၩ့အၥၭ လၧထံၫၥံၪခးၥံၪ လၧၦၡၩဆိၬ အၪ့မၧၫ့ဎီးဝ့ၫ လၧအဖၧၩ့နီၪ, အ့ၪကၠၪ ကဒၩထဲၩ့အၥၭ လၧထံၫၥံၪခးၥံၪ လၧအဘၪ ဆၧအၪ့ မၧၫ့ဎီးဝ့ၫအဖၧၩ့တၭ, စံၭဝ့ၫ, ပမၪဘၪယူၭ, ပဂၭဖျိၭ",
			"38": "<sup>38</sup> ဖၧၩ့ၥၭယူၭ, ပမၩယူၭဆၧအၧၩ့ဆၧၥၫ့ယူၭး- တၭအ ဝ့ၫၥံၪအ့ၪကၠၪကဒၩထဲၩ့အၥၭ လၧနအီၪလၧအၥၭထၧၫ့ ဖျိၪ့ယၫ, ဒဲလၧအၥၭၡီၩ့ထီးအလူၬ, လၧခးလၧအဝ့ၫ ၥံၪဘၪဆၧအၪ့မၧၫ့ဎီးဝ့ၫလၧအဖၧၩ့, အလးလၧၦၡၩ ဆိၬအၪ့မၧၫ့ဎီးဝ့ၫနီၪ, အ့ၪအၪ့ကံၩ့ဘၩဆိၪဖၪစိၩအ ဝ့ၫၥံၪအထံၫအခး, လၧနဖ့ၪလၫ့အဖါၥံၪ, ဒဲဒိၩ့လၧနရွံ န့ဝ့ၫလဖျိၪ့နီၪ, ဒဲလၧဂံၪ့လၧယမၩထၪ့လၧနမံၩ့အဂးလ",
			"39": "<sup>39</sup> ဖျိၪ့ယီၩတၭး ထီးနီၪလဖၧၫ့လၧမူၭခိၪအဖၧၩ့,- နအီၪ ဝ့ၫအလးနီၪ, ခိၭနၪအဝ့ၫၥံၪအဆၧအၪ့ကံၩ့ ဒဲအဆၧ ဘၩဆိၪဖၪလဖၪ, ဒဲစ့ၩရၫ့အဝ့ၫၥံၪ လၧဆၧတီၩဆၧ လီၩ့,ဒဲမၩဖီၩ့မၩဖျ့ၭ နခ့ၫနၡၩလဖၪလၧအမၪဘၪနၧၩ နီၪဆံၭ.",
			"40": "<sup>40</sup> ဘိၩ့နဲၪ့ယီၩ ယယွၩဧ့, မွဲနမ့ၬၥၪၥံၪအီၪဝဲထၪ့အၥၭ, ဒဲဒိၭနနါၥံၪလၧဆၧဘၩဆိၪဖၪ လၧအလးယီၩဆံၭ.",
			"41": "<sup>41</sup> မၩအၥၭဘဲၫနီၪတၭ, ဘိၩ့နဲၪ့ယီၩယဟိဝၩယွၩဧ့, ဂဲထုၪ့လၧနအီၪပွံၭအလးဖၧၩ့, နဝ့ၫဒၪဒဲနစီၩ့နမၩ့အတ လၫနီၪဆံၭ. ယဟိဝၩယွၩဧ့, မွဲနၡၩလုဆၧလဖၪကီၩ့ ထၪ့ၥိၭထၪ့ဆၧထိးထဲၩ့တၩ့ထဲၩ့တၭ, မွဲနၡၩဆံၫ့ဎံၪ လဖၪၥုၪ့ထိၬၥၭထိၬ လၧနဆၧဂ့ၩ ဆၧဘွၩအဖၧၩ့နီၪ",
			"42": "<sup>42</sup> ဆံၭ.- ယဟိဝၩယွၩဧ့, ထီးကၠၪခွံၬနမ့ၬလၧနၡၩဘၪ ဆၧဂုၪဝ့ၫလဂ့ၩ. နၪ့ထၪ့ထဲၩ့ဆၧယၫ့ၥၭ လဖၪဘၪဆဲၫ့ လၧနခ့ၫနၡၩစဒၫဝံၭနီၪဆံၭ."
		},
		"7": {
			"1": "<sup>1</sup> ထီးစစီလမၧၫ့ဘၩဆိၪဖၪဆၧဂီၩ့နီၪ, မ့ၪဂဲၫလၩ့လၧ မူၭခိၪတၭ, အၪ့ခွံၬဆၧလုမ့ၪ, ဒဲဆၧလုလဖၪတၭ, ယ",
			"2": "<sup>2</sup> ဟိဝၩအလၩအဖၩ့မၩဎွ့ၩထၪ့ဂံၪ့လဖျိၪ့နီၪလီၫ.- ၦလု ဆၧလဖၪနုၬလၧယဟိဝၩအဂံၪ့ဖၧၩ့ဖိးအ့ၬ. အဂဲးဘဲၫ ယီၩယဟိဝၩအလၩအဖၩ့ မၩဎွ့ၩထၪ့ယူၭယဟိဝၩ",
			"3": "<sup>3</sup> အဂံၪ့ဖၧၩ့ယူၭ.- ထီးအံၫစရ့လၭဖိၪၥံၪထီးအလူၬနီၪ ဒၪဘၪမ့ၪဂဲၫလၩ့, ဒဲယဟိဝၩအလၩအဖၩ့ လၧဂံၪ့နီၪ အဖၫ့ခိၪတၭး အဝ့ၫၥံၪၡီၫ့လၩ့အၥၭ ထီးအမ့ၬလဖၪ ထီၩ့လၩ့လၧဂၪ့ခိၪ, လၧဆၧဒၩလၩ့ဝ့ၫ လၧလိးတၭ, ဘိၪ့ထၪ့ဘၩထၪ့ဆၧ, ဒဲစံၭထၪ့အၪ့အူၭယဟိဝၩနီၪ, အဂဲးဘဲၫယီၩမွဲဆၧအဂ့ၩး အဂဲးဘဲၫယီၩအခိးအတၩ အီၪဝ့ၫအဆိၩဆိၩအကၠၪကၠၪလီၫ.",
			"4": "<sup>4</sup> ထီးနီၪလဖၧၫ့စဎွၩဒဲ ၦခမျၧးၥံၪထီးအလူၬလဖၪလု",
			"5": "<sup>5</sup> ထၪ့ဆၧလၧယဟိဝၩအမ့ၬယၫလီၫ.- စဎွၩစီလမၧၫ့လု ထၪ့ဆၧလၧချီဖၫၥံၪနံၫလၬနံၫထီၫ့, ဒဲၥိၪၥံၪဘ့ၪၥံၪလ ကုၬနံၫလၬတၭး စဎွၩဒဲၦခမျၧးထီးအလူၬ မၩဘိၪ့ဖလါ",
			"6": "<sup>6</sup> ယွၩအဂံၪ့နီၪလီၫ.- တၭၦလုဆၧလဖၪ မၩအဝ့ၫၥံၪအ ဆၧဖံၭဆၧမၩလီၫ. ၦလံဝဲၫဖိၪလဖၪမၩဆ့, အီၪလၧ ယဟိဝၩအဆၧၥံၫကျံၩအဎၧၩ့အဎီလဖၪနီၪ, လၧစဎွၩ ဒၫဝံၭမၩဝဲၩဝ့ၫဘဲၫၥိၭ အမိစံၭထၪ့အၪ့အူၭယဟိဝၩ, အဂဲးဘဲၫယီၩ အခိးအတၩနီၪ အီၪဝ့ၫအဆိၩဆိၩအ ကၠၪကၠၪလီၫ. ထီးစဒၫဝံၭ စံၭထၪ့အၪ့အူၭဆၧလၧအ ဝ့ၫၥံၪအဆၧမၩအကၠီၩ့တၭ, ၦလုဆၧလဖၪအူၪထၪ့ခွ့ၩ ၥံၪလၧအဝ့ၫၥံၪအမ့ၬယၫတၭ, အံၫစရ့လၭထီးအလူၬ",
			"7": "<sup>7</sup> ဆၧၫ့ထုၪ့ဝ့ၫလီၫ.- လၧနီၪအမ့ၬယၫ ဝၩ့လၧအအီၪလၧ ယဟိဝၩအဂံၪ့အမ့ၬယၫနီၪ, စစီလမၧၫ့မၩဆံၫ့ဎံၪအ ၥၭကျၩ, အဂဲးဘဲၫယီၩ အလးထီးနီၪအဝ့ၫလုထၪ့ဆၧ လုမ့ၪ, ဒဲဆၧလုမၩဘၪလိၬအိၭလိၬအၥိၭဆ့, အဂဲးဘဲၫ ယီၩဆၧလုလးထီးဝီၩ လၧစစီလမၧၫ့မၩကဲၪထၪ့ဝ့ၫနီၪ လၧဆၧလုမ့ၪ ဒဲဆၧမၩဘိၪ့ကိၪမုၬ, ဒဲဆၧအၥိၪနီၪအ ဂးထီဝ့ၫအ့ၬ.",
			"8": "<sup>8</sup> အဆၧၫ့အထီနီၪ စစီလမၧၫ့မၩဆၧဘိၪ့နွ့ၫနံၩအထး ဖၧၩ့,ဒဲအံၫစရ့လၭထီးအလူၬဆ့အီၪလၧအၥိၭ, မွဲဆၧ အီၪကီၪ့ဖၭဒိၪလၧဆၧဂဲၫနုၬ လၧဟၫမၫ ထီၩ့လၧအံ",
			"9": "<sup>9</sup> ဇံၭအထံၫမိၡါနီၪလီၫ.- လၧမုဎိၭနံၩလနံၩနီၪ အဝ့ၫၥံၪ မၩဆၧအီၪကီၪ့ဆံၫ့ဎံၪး အဂဲးဘဲၫယီၩမၩဆၧလုလး အဆၧမၩဘိၪ့ဖလါဆၧနွ့ၫနံၩအထးဖၧၩ့, ဒဲမၩဆၧ",
			"10": "<sup>10</sup> ဘိၪ့နီၪနွ့ၫနံၩလီၫ.- တၭလၧလၩနွ့ၫဘံၪ့လဘံၪ့လၩ ထၪ့နံၫဆံၫၥၧၫ့နံၫလနံၩနီၪ, အဝ့ၫဒၪကွဲၪဖျါခွံၬၦခမျၧး ၥံၪလၧအဝ့ၫၥံၪအတဲၩလဖၪ, အီၪလၧအၥုၪ့ထိၬၥၭ ထိၬ,ၥုၪ့ဎွံၫၥၭယီၫ, အဂဲးဘဲၫယီၩယဟိဝၩနဲၪဖျီၪထၪ့ ယူၭအဆၧဂ့ၩဆၧဘွၩ လၧစဒၫဝံၭ, ဒဲလၧစစီလမၧၫ့, ဒဲလၧအၡၩခမျၧးအံၫစရ့လၭလီၫ.",
			"11": "<sup>11</sup> စစီလမၧၫ့မၩဂီၩ့ယဟိဝၩအဂံၪ့ယူၭ, ဒဲစဎွၩအဂံၪ့ဆ့ ဘဲၫနီၪအၥိၭ, တၭကယဲဆၧလမံၩ့လါလါ လၧအနုၬ လၧစစီလမၧၫ့အၥၭလၧအမိမၩလၧ ယဟိဝၩအဂံၪ့အ ဂးမွဲဂ့ၩ, လၧအဂံၪ့ဒၪဝ့ၫအဂးမွဲဂ့ၩ, မၩဝ့ၫထီးအလူၬ လၧအဆၧဘီၪထၪ့ယီၫထၪ့လီၫ.",
			"12": "<sup>12</sup> ယဟိဝၩနဲၪဖျီၪထၪ့အၥၭ လၧစစီလမၧၫ့လၧမုနၩ လခီၫတၭ, စံၭဝ့ၫဒၪ, ယနါဂၧၫ့ယူၭနဆၧဘၩဆိၪဖၪ တၭ,ယရွံန့ယူၭအလးယီၩ လၧဆၧလုအဂံၪ့လၧယနၫ့",
			"13": "<sup>13</sup> ဆါဒၪယဝ့ၫအဂးလီၫ.- ယအ့ၪကၭဘံၭထၬမူၭခိၪဘဲၫ ၥိၭဆၧလဆၧၩ့လၩ့ဘၪတၭ, ယအ့ၪမၪလူၬထွ့ၥံၪလၧ အမိအၪ့ခွံၬထံၫၥံၪခးၥံၪမွဲဂ့ၩ, ယအ့ၪအၪ့မၧၫ့ဆၧၥံၫ",
			"14": "<sup>14</sup> ချဲၫ့လၧယၡၩခမျၧးၥံၪအကျၩမွဲဂ့ၩး- ယခ့ၫယၡၩလၧ အဘၪဆၧကိၭဝ့ၫလၧယမံၩ့နီၪ အ့ၪဆၪ့လၩ့အၥၭ,ဒဲ အၪ့ကံၩ့ဘၩဆိၪဖၪဆၧ, ဒဲအၪ့ဎူၫအၪ့ဎၬယမ့ၬ, ဒဲကၠၪ ခွံၬအၥၭလၧအဖၧၩ့ၥၭအၧၩ့လဖၪနီၪ, ထီးနီၪလဖၧၫ့ လၧမူၭခိၪနီၪ ယမိခိၭနၪ, ဒဲမၩဖီၩ့မၩဖျ့ၭအဝ့ၫၥံၪအ ဆၧဒဲၩဘၭတၭ, အထံၫအခးနီၪ ယမိမၩဘျၪထဲၩ့ဆ့",
			"15": "<sup>15</sup> လီၫ.- ဘိၩ့နဲၪ့ယီၩယမ့ၬၥၪၥံၪ မိအီၪဝဲထၪ့အၥၭ,ဒဲယ မိဒိၭယနါလၧဆၧဘၩဆိၪဖၪ လၧအလးဖၧၩ့ယီၩလီၫ.",
			"16": "<sup>16</sup> အဂဲးဘဲၫယီၩယရွံန့ယူၭ ဒဲအီၪက့ၪဆံၫ့ဎံၪယူၭဂံၪ့လ ဖျိၪ့ယီၩ, ဘဲၫၥိၭယမံၩ့ မိအီၪဝ့ၫထီးယီၩ အဆိၩဆိၩ အကၠၪကၠၪတၭး ယမ့ၬၥၪၥံၪ ဒဲယၥုၪ့ယၥၭမိအီၪထီး ယီၩလထံၪဎးလဘီၩ့ဎးလီၫ.",
			"17": "<sup>17</sup> တၭလၧနနၫ့ဆါဒၪနဝ့ၫအဂဲး, နအ့ၪလ့ၩဆၧလၧယ မ့ၬယၫ, ဘဲၫနဖါစဒၫဝံၭလ့ၩဝ့ၫအၥိၭ, ဒဲမၩကယဲဆၧ လၧယမၪလူၬနၧၩလဖၪထီးအလူၬ, ဒဲထီးန့ဖံၭထၬယ",
			"18": "<sup>18</sup> ၥနိၫလဖၪ, ဒဲယဆၧစ့ၩရၫ့လဖၪနီၪ,- ထီးနီၪလဖၧၫ့ယ မိအီၪက့ၪနဘၩ့နမုးအလးဆီၩ့ဆီ ဂုးဂုးခၧၫ့ခၧၫ့, ဘဲၫ ယအုၩ့လၩ့ဆၧလၧနဖါစဒၫဝံၭအၥိၭ, ယစံၭယဝ့ၫ,ၦ ဘၪဆဲၫ့လၧနၧၩ လၧအမိပၧၩ့ဆၧလၧ အံၫစရ့လၭအ ကျၩနီၪ, လူၬဝ့ၫဒၪအ့ၬ.",
			"19": "<sup>19</sup> အ့ၪမွဲနၥံၪအ့ၪကၠၪခွံၬနၥံၪအၥၭတၭ, အ့ၪခွံၬၡိၭယ ၥနိၫလဖၪ, ဒဲယဆၧမၪလူၬလဖၪ, လၧယအီၪက့ၪလၩ့ ယူၭလၧနၥံၪအမ့ၬယၫတၭ, အ့ၪလ့ၩမၩယွၩဂူၫဂၩၥံၪ အဆၧဖံၭဆၧမၩ, ဒဲဘိၪ့ထၪ့ဘၩထၪ့အဝ့ၫၥံၪတၭး",
			"20": "<sup>20</sup> ထီးနီၪလဖၧၫ့ ယမိထ့ၭထၪ့ခွံၬအဝ့ၫၥံၪ လၧယခးဖၧၩ့ လၧယဖ့ၪလၫ့ယူၭအဝ့ၫၥံၪနီၪ, ဒဲဂံၪ့လဖျိၪ့ယီၩ,လၧယ အီၪက့ၪဆံၫ့ဎံၪယူၭ လၧယမံၩ့အဂး ယမိခွံၬၡိၭလၧ ယမ့ၬယၫ, ဒဲမၩကဲၪထၪ့ဝ့ၫလၧဆၧချဲၩ့အဒီၩ့, ဒဲဆၧချဲၩ့",
			"21": "<sup>21</sup> လိလၧၦဆၨၩၥံၪထီးအလူၬအကျၩလီၫ.- တၭဂံၪ့လ ဖျိၪ့ယီၩလၧအအီၪထီၫထီၫလ့ၬ, မိကဲၪလၧဆၧထီၫမံၫ ထီၫမၪလမံၩ့ လၧကယဲၦလၧအလဲးလီၩ့ လၧဖၧၩ့ၥၭ လဂၩဘၪလဂၩဆုၬဆုၬအမ့ၬယၫ ထီးအမိစံၭဝ့ၫ,ယ ဟိဝၩမၩဆၧဘဲၫယီၩလၧခးဖၧၩ့ယီၩ, ဒဲလၧဂံၪ့လဖျိၪ့",
			"22": "<sup>22</sup> ယီၩမွဲဘၪလဲၪ.- တၭဆၧမိစံၭဆၧၫ့ဝ့ၫဘဲၫယီၩ, အဝ့ၫ ၥံၪခွံၬၡိၭခွံၬယဟိဝၩအဝ့ၫၥံၪအဖါလဖၪအယွၩ, လၧ အဂဲၫဆိၬထၪ့ခွံၬအဝ့ၫၥံၪလၧ ခးအံဇံၭအဖၧၩ့နီၪ,ဒဲဖီၪ့ ထၬယွၩဂူၫဂၩလဖၪတၭ, ဘိၪ့ထၪ့ဘၩထၪ့အဝ့ၫၥံၪ,ဒဲ မၩအဆၧဖံၭဆၧမၩဆ့လီၫ. အခိးမွဲဆၧမၩအၥၭဘဲၫ နီၪတၭ,အဝ့ၫဒၪဒုၭဂဲၫဆၧအၧၩ့ထီးအလူၬယီၩ လၧ အဝ့ၫၥံၪအလီၩ့လီၫ."
		},
		"8": {
			"1": "<sup>1</sup> ထီးအနံၪ့နံၫဆံၫလဖၪထုၬဝ့ၫတၭ, အဆၧၫ့အထီလၧ စစီလမၧၫ့မၩထၪ့ယဟိဝၩအဂံၪ့, ဒဲအဂံၪ့ဒၪဝ့ၫနီၪး",
			"2": "<sup>2</sup> ဆၧမၩအၥၭလၧဒိၩ့လဖၪ, လၧစဟုရၫ့ဖ့ၪထဲၩ့ယူၭ လၧစစီလမၧၫ့အစူၪဖၧၩ့နီၪ, စစီလမၧၫ့မၩဂ့ၩထၪ့ထဲၩ့ အဝ့ၫၥံၪတၭ, ဒုၭအီၪအံၫစရ့လၭဖိၪၥံၪ လၧဒိၩ့လဖၪ နီၪအဖၧၩ့လီၫ.",
			"3": "<sup>3</sup> တၭစစီလမၧၫ့လ့ၩထၫ့ဒၩ ဟၫမၭဇိဘၫ ဒဲမၩနၧၩ့",
			"4": "<sup>4</sup> မၩစၪဝ့ၫဒၪလီၫ.- အဝ့ၫမၩထၪ့တဒၫမီၫ လၧမံၩ့လၬ ကျၩ,ဒဲဒိၩ့ၥံၪထီးအလူၬ လၧဆၧအီၪက့ၪကီၪ့ဆၧဖိၪ ဆၧလံၩလၧအဖၧၩ့ လၧအမၩထၪ့ဝ့ၫလၧဟၫမၭအ",
			"5": "<sup>5</sup> ဖၧၩ့နီၪလီၫ.- မၩဆ့ဘ့ၭၥဟိရၫ့လၧထၭ, ဒဲဘ့ၭၥဟိရၫ့ လၧလၬလၧအမွဲဒိၩ့ၥံၪအီၪလၧခိၪဒၧၩ့လဖၪ, အီၪလၧ",
			"6": "<sup>6</sup> တရၫ့ၥံၪ,ဒဲနိၪဘီၩ့ၥံၪ,- ဒဲဘၫအလၭ,ဒဲဒိၩ့ၥံၪထီးအ လူၬလၧဆၧအီၪက့ၪကီၪ့ဆၧဖိၪဆၧလံၩ လၧအဖၧၩ့ လၧအအီၪလၧစစီလမၧၫ့အစူၪဖၧၩ့, ဒဲအလဲၪ့ၥုၭၥံၪအ ဒိၩ့လဖၪထီးအလူၬ, ဒဲၦထူၬကၥ့ၪလဖၪအဒိၩ့ၥံၪဒဲက ယဲဆၧလၧစစီလမၧၫ့မိမၩထၪ့ဘၪအၥၭ လၧယရုစလံၫ့ အဖၧၩ့ထီးအလူၬနီၪ, ဒဲလၧလ့ၭဘနၧၫ့အဖၧၩ့, ဒဲကယဲ ဆၧထီးအလူၬ လၧထံၫၥံၪခးၥံၪအဖၧၩ့ လၧအပၧၩ့ဝ့ၫ လစီၪ့လါလါဎံၩ့ဎံၩ့လ့ၬလီၫ.",
			"7": "<sup>7</sup> ကယဲၦလၧအအီၪလၩ့ထးလၧ ၦဟံၥၭဖိၪ,ၦအၫ မၧၫ့ဖိၪ,ဒဲၦပံရ့ၭဖိၪ,ၦဟံဝဲၫဖိၪ, ဒဲၦယ့ဘုၫဖိၪ,လၧအလ",
			"8": "<sup>8</sup> ဘၪဆဲၫ့ဘၪ လၧအံၫစရ့လၭနီၪး- အဝ့ၫၥံၪအဖိၪအ လံၩ,လၧအအီၪလၩ့ထးလၧခးဖၧၩ့နီၪ, လၧၦအံၫစရ့ လၭဖိၪလမၩဂၭဂီၩ့ဘၪတၭ, အဝ့ၫၥံၪနီၪ စစီလမၧၫ့ အၪ့မၧၫ့အဖ့ၪလၫ့ခီၫ့ထီၩ့လၩ့ ခီးမုဆၫလနံၩယီၩ",
			"9": "<sup>9</sup> လီၫ.- အ့ၪမွဲၦအံၫစရ့လၭဖိၪၥံၪ စစီလမၧၫ့အၪ့မၧၫ့အ မၩဎီးအဆၧမၩနးဂၩအ့ၬး အ့ၪမွဲအဝ့ၫၥံၪ ကဲၪၦၥုၭ ဖိၪလဖၪ,ဒဲၦၥုၭခိၪၥံၪအၦဒိၪလဖၪ, ဒဲလဲၪ့ၥုၭၥံၪအခိၪ လဖၪ,ဒဲၦထူၬကၥ့ၪအခိၪလဖၪလီၫ.",
			"10": "<sup>10</sup> တၭၦလဖၪယီၩမွဲစစီလမၧၫ့ အၦဒိၪဖၭဒိၪလဖၪ,နံၫ ယၩယဲဆံၫ, လၧအအီၪလၧၦခမျၧးၥံၪအဖၫ့ခိၪလီၫ.",
			"11": "<sup>11</sup> တၭစစီလမၧၫ့ဂဲၫထၪ့ဆိၬခွံၬ ဖၫရိၫအဖိၪမုၪလၧစဒၫ ဝံၭအဒိၩ့ဖၧၩ့ထီၩ့လၧဂံၪ့လဖျိၪ့ လၧအမၩထၪ့လၧၦမုၪ နီၪအဂးလီၫ. အဂဲးဘဲၫယီၩအဝ့ၫစံၭဝ့ၫဒၪ, ယမၫအီၪ လၧအံၫစရ့လၭ အစဎွၩဒၫဝံၭအဂံၪ့ဖၧၩ့အ့ၬး အဂဲး ဘဲၫယီၩယဟိဝၩအတလၫ ဂဲၫထဲၩ့အီၪထီးနီၪတၭ,မွဲ ဆၧအလးဆံၫ့ဎံၪလီၫ.",
			"12": "<sup>12</sup> ထီးနီၪလဖၧၫ့စစီလမၧၫ့လုထၪ့ ဆၧလုမ့ၪလဖၪလၧ ယဟိဝၩအဂး, လၧယဟိဝၩ အဆၧလုလးအလီၩ့,",
			"13": "<sup>13</sup> လၧအမၩထၪ့ဝ့ၫလၧထိၬချိၫ့အမ့ၬယၫး- လနံၩအဂး, လနံၩအဂးလုထၪ့ဝ့ၫဘဲၫစမိစ့ၭ မၪလူၬဝ့ၫအၥိၭ,လၧ မးၥံၫအနံၩလဖၪ, ဒဲလၧလၩၥံၫအခၫ, ဒဲလၧဆၧမၩဘိၪ့ ဆံၫ့ဎံၪလဖၪ လနံၪ့အထးဖၧၩ့ၥၧၫ့ဘျၩ့, ဆၧဘိၪ့ကိၪလ အီၪဘၪလၧမံၪ ဒဲဆၧဘိၪ့နွ့ၫလဖၪ, ဒဲဆၧဘိၪ့တဲၩၥံၪ",
			"14": "<sup>14</sup> နီၪလီၫ.- ဘဲၫအဖါစဒၫဝံၭစ့ၩရၫ့ဝ့ၫအၥိၭ, အဝ့ၫဒၪအီၪ က့ၪၦလုဆၧလဖၪလဒီၪ့လဒီၪ့ ဘဲၫအဝ့ၫၥံၪ အဆၧမၩ အီၪဝ့ၫအၥိၭ, ဒဲၦလံဝဲၫဖိၪလဖၪအဆၧယိဝ့ၫ, ဘဲၫၥိၭ အမိစံၭထၪ့အၪ့အူၭဆၧ, ဒဲမၩဆၧအခ့ၫအၡၩအဆၧ မၩလၧၦလုဆၧလဖၪအမ့ၬယၫ, ဘဲၫအဆၧမၩလၧလ နံၩအဂးလနံၩအဂးအီၪဝ့ၫအၥိၭနီၪလီၫ. ဒဲၦပၧၩ့တရၫ့ လဖၪဘဲၫအဒီၪ့အီၪဝ့ၫအၥိၭ လၧကယဲတရၫ့ထံၭကိၭစီၪ့ ဒ့ၭလီၫ. အဂဲးဘဲၫယီၩ ယွၩအၡၩစဒၫဝံၭလဂၩနီၪမၪ",
			"15": "<sup>15</sup> လူၬဝ့ၫဘဲၫနီၪၥိၭလီၫ.- တၭစဎွၩအဆၧမၪလူၬ,လၧအ မၪလူၬၦလုဆၧလဖၪ ဒဲၦလံဝဲၫဖိၪလဖၪလၧကယဲဆၧ လမံၩ့လါလါအဂး, ဒဲလၧဆၧအီၪက့ၪကီၪ့ဆၧဖိၪဆၧ",
			"16": "<sup>16</sup> လံၩအဂးနီၪအဝ့ၫၥံၪစဲၪ့ဒၪဝ့ၫအ့ၬ.- တၭကယဲဆၧမၩ လၧစစီလမၧၫ့မၩဝ့ၫနီၪ, ဆၧတဲၩ့ဝဲၩဝ့ၫလၧမုနံၩ လၧ ဆၧအီၪက့ၪလၩ့ယဟိဝၩအဂံၪ့ အခၪ့ထံၭနီၪထီၩ့လၩ့ လၧဆၧမၩထၪ့ဂံၪ့ဂီၩ့ဝ့ၫဒၪလီၫ. တၭယဟိဝၩအဂံၪ့ နီၪဘၪဆၧမၩထီးအဂီၩ့ဂ့ၩဘၪစဲၪလီၫ.",
			"17": "<sup>17</sup> ထီးနီၪလဖၧၫ့ စစီလမၧၫ့ လ့ၩထီၩ့လၧအံဇအၧၫ့ ဂံဘၧၫ,ဒဲလၧအံလီၭ လၧမၫဆမံၭနဲၩ့ လၧခးအံဒၧၫ့အ",
			"18": "<sup>18</sup> ဖၧၩ့လီၫ.- တၭစဟုရၫ့အၪ့မၧၫ့လၩ့ ကဘၩ့ၥံၪလၧအ ခ့ၫအၡၩလဖၪအစူၪဖၧၩ့, ဒဲၦၡၩၥံၪလၧအၥ့ၪယၫမၫ ဆမံၭအဂဲးအကၠီၪ့တၭ, အဝ့ၫၥံၪလ့ၩလၧစစီလမၧၫ့အ ခ့ၫအၡၬ အၥိၭလၧအိဖၧၫနီၪတၭ, မၩန့ထီၫ့အကံကၫ လံယၩယဲဆံၫ လၧအလးထီးနီၪတၭ, ဂဲၫထဲၩ့ဆိၬဝ့ၫ လၧစဎွၩစီလမၧၫ့အအီၪလီၫ."
		},
		"9": {
			"1": "<sup>1</sup> ထီးၡံဘၫအနးဎွၩမုၪနါဂၧၫ့ စစီလမၧၫ့အလၩအဖၩ့ အဂဲးအကၠီၪ့တၭ, ဂဲၫဝ့ၫလၧယရုစလံၫ့ဘဲၫၥိၭအမိမၩ ခွါအဝ့ၫလၧဆၧချဲၩ့ကၪလဖၪ, အီၪလၧၦၡၩအဒီၪ့ဖၭ ဒိၪ,ဒဲကလအူၭၥံၪလၧအဆိၬဆၧနၧၫ့မၧၫ့လဖၪ, ဒဲထီၫ့ အၪအၪလ့ၬ, ဒဲလိးဂ့ၩလဖၪလီၫ. ထီးအဂဲၫထီၩ့လၧ စစီလမၧၫ့အအီၪနီၪ, ချဲၩ့ဒုၪ့အဝ့ၫလၧကယဲဆၧလၧအ",
			"2": "<sup>2</sup> အီၪလၧအၥၭခံဖၧၩ့လီၫ.- စစီလမၧၫ့လီၩဘၪဝ့ၫကယဲ အအၪ့စၪ့ဆၧလမံၩ့လါလါ ထီးအလူၬတၭး ဆၧလၧ အလလီၩဘၪၦမုၪနီၪ ဆၧအီၪဘံၭဝ့ၫလၧစစီလမၧၫ့နး မံၩ့အ့ၬ.",
			"3": "<sup>3</sup> ထီးၡံဘၫ အနးဎွၩမုၪနီၪဒၪဘၪစစီလမၧၫ့ အဆၧ ကိၪ့ၥ့ၪ, ဒဲဂံၪ့လၧအမၩထၪ့ဝ့ၫ, ဒဲဆၧအၪ့လၧအစပွဲ",
			"4": "<sup>4</sup> ခိၪနီၪ,- ဒဲအခ့ၫအၡၩၥံၪဆၧၫ့နၩ့ဝ့ၫ, ဒဲၦၡၩၥံၪမၩအ ဆၧမၩ,ဒဲအဝ့ၫၥံၪအကီၩ့အၥိၭနီၪ, ဒဲၦလၧအဆိၬလိၫ့ လဖၪဆ့, ဒဲအဝ့ၫၥံၪအကီၩ့အၥိၭနီၪး ဒဲဎၫ့ၥံၪလၧအ လ့ၩထၪ့လၧယဟိဝၩအဂံၪ့ဖၧၩ့တၭ, အၥၭအီၪလၧၩ့",
			"5": "<sup>5</sup> လၧအဖၧၩ့အ့ၬ.- တၭစံၭစဎွၩနီၪ, ဆၧပရၧၫ့လၧနဆၧ မၩ,ဒဲနဆၧကိၪ့ၥ့ၪအဂဲး လၧယနါဂၧၫ့လၧယခးဒၪယ ဝ့ၫအဖၧၩ့နီၪ, မွဲယူၭတီၩယူၭး မွဲလါနၫ့ဘိၩလၧယလ ချႃၭထီၩ့ဒံၭဘၪ, ဒဲလဒၪဒံၭဘၪလၧယမ့ၬၥၪဒၪယဝ့ၫ",
			"6": "<sup>6</sup> တၭ,ယနဲၩဆၧချဲၩ့လဖၪနီၪၥ့ၪအ့ၬ. တၭ,ယိခွါ,နဆၧ ကိၪ့ၥ့ၪအဆၧဖၭဒိၪအဖိၭဖၫ့နီၪ ဆၧလီၩဘၪယၧၩ အ့ၬးအဂဲးဘဲၫယီၩ နဆၧလၩဆၧဖၩ့ အၪနဲၪ့ဒိၪနဲၪ့ဒံၭ",
			"7": "<sup>7</sup> လၧယနါဂၧၫ့ဘၪလီၫ.- နၡၩလဖၪမုၬဝ့ၫ, နခ့ၫနၡၩလ ဖၪယီၩလၧအဆၧၫ့ထုၪ့လၧ နမ့ၬယၫလထံၪဎးဘီၩ့ဎး",
			"8": "<sup>8</sup> တၭ,နါဂၧၫ့နဆၧကိၪ့နီၪမုၬဝ့ၫဒၪဆ့လီၫ.- ယဟိဝၩန ယွၩလၧအမုၬအၥၭ လၧနဖၧၩ့အီၪက့ၪထၪ့နၧၩလၧအ လးဆီၩ့ဆီအလီၩ့နီၪ ဘဲၫနမိကဲၪစဎွၩလၧယဟိဝၩန ယွၩအဂးတၭ, ဘၪဆၧစံၭထၪ့အၪ့အူၭဝ့ၫလီၫ. အဂဲး ဘဲၫယီၩလၧနယွၩအဲၪယူၭ အံၫစရ့လၭအကၠီၩ့တၭ, ဘဲၫၥိၭအမိမၩဂုးထၪ့ခၧၫ့ထၪ့အဝ့ၫၥံၪ အဆိၩဆိၩအ ကၠၪကၠၪနီၪ, မွဲအဒုၭကဲၪထၪ့နၧၩလၧစဎွၩလၧအဝ့ၫၥံၪ အဖၫ့ခိၪ,ဘဲၫၥိၭ နမိစ့ၩရၫ့ဆၧဒဲမၩဆၧတီၩဆၧလီၩ့",
			"9": "<sup>9</sup> လီၫ.- ၦမုၪနီၪဖ့ၪလၫ့စဎွၩလၧထီၫ့အကံကၫလယၩနံၫ ဆံၫ, ဒဲဆၧနၧၫ့မၧၫ့လဖၪအၪအၪလ့ၬ, ဒဲလိးဂ့ၩလဖၪ တၭး ဆၧနၧၫ့မၧၫ့ၥံၪ ဘဲၫၡံဘၫအနးဎွၩမုၪ ဖ့ၪလၫ့စစီ လမၧၫ့အၥိၭအီၪဝ့ၫနးစီၪ့အ့ၬ.",
			"10": "<sup>10</sup> စဟုရၫ့အခ့ၫအၡၩ, ဒဲစစီလမၧၫ့အခ့ၫအၡၩလဖၪ, လၧအဂဲၫထဲၩ့ဆိၬထီၫ့လၧအိဖၧၫနီၪ, ဂဲၫထဲၩ့ဆိၬဆ့ၥံၪ့",
			"11": "<sup>11</sup> အလၫမၧၭလဖၪ ဒဲလိးဂ့ၩၥံၪဆ့လီၫ.- တၭလၧၥံၪ့အ လၫမၧၭလဖၪနီၪ, စဎွၩမၩဎၫ့ၥံၪ လၧယဟိဝၩအဂံၪ့ အဂး,ဒဲစဎွၩအနီးအဂးဆ့, ဒဲနါဒံၩ့,ၥၫ့ထီးလဖၪလၧ ၦၥံၫကျံၩဆၧအဂးလီၫ. တၭလၧခးယုဒၫ အဖၧၩ့နီၪ ဆၧဒၪဘၪဆၧဘဲၫနီၪၥိၭနးဆိၭအ့ၬ.",
			"12": "<sup>12</sup> စဎွၩစီလမၧၫ့ဖ့ၪလၫ့ၡံဘၫ အနးဎွၩမုၪလၧဆၧလၧ အဂဲၫန့ဝ့ၫ လၧစဎွၩအအီၪနီၪအဖၫ့ခိၪ, ကယဲဆၧလၧ အဘၪအၥၭထီးဒၪအအၪ့ကံၩ့ ဆၧလမံၩ့လါလါလီၫ. ၦမုၪကၠၪအၥၭတၭ, ထဲၩ့ထဲၩ့ဝ့ၫလၧအခးဒၪဝ့ၫ,အဝ့ၫ ဒၪဒဲအခ့ၫအၡၩလဖၪလီၫ.",
			"13": "<sup>13</sup> တၭထီၫ့လၧအဂဲၫထီၩ့လၧစစီလမၧၫ့ အအီၪလၧလ နံၪ့အထးဖၧၩ့အလယၧးမွဲကံကၫ ဎူၫယၩဎူၫဆံၫဎူၫကံ",
			"14": "<sup>14</sup> ကၫလီၫ.- လၧနီၪအမ့ၬယၫၦအၪ့ဎၬဆၧလဖၪဒဲၦဖနံၬ ဖိၪလဖၪဂဲၫဆိၬဝ့ၫဒၪဆ့လီၫ. တၭအရ့ဘၠၫ အစဎွၩ ထီးအလူၬလဖၪ, ဒဲထံၫၥံၪခးၥံၪ အၦဒိၪလဖၪဂဲၫဆိၬ ထီၫ့ၥံၪလွ့ၫၥံၪ, ကျိၪၥံၪစ့ၩၥံၪလၧစစီလမၧၫ့အအီၪလီၫ.",
			"15": "<sup>15</sup> တၭစဎွၩစီလမၧၫ့မၩကဲၪထၪ့ ထၩ့ဖံၭလဖၪနံၫယၩ လၧထီၫ့ခိလီၪ့နီၪ, ထီၫ့ၡက့လၭဎူၫယၩလၧထၩ့ဖံၭလ",
			"16": "<sup>16</sup> ဘံၪ့လီၫ.- ဒဲထၩ့ဖံၭဖိၪၥၧၫ့ယၩလၧထီၫ့ခိလီၪ့, ထီၫ့ၡ က့လၭၥၧၫ့ယၩ အီၪလၧထၩ့ဖံၭလဘံၪ့လီၫ. တၭစ ဎွၩအီၪက့ၪအဝ့ၫၥံၪ လၧလ့ၭဘနၧၫ့အမံၩ့လၬကျၩအ ဂံၪ့ဖၧၩ့နီၪလီၫ.",
			"17": "<sup>17</sup> လၧနီၪအမ့ၬယၫ စဎွၩမၩလးဆီၩ့ဆီ ဖၭဒိၪလၧက",
			"18": "<sup>18</sup> ဆၫ့မဲၪတၭ, ဖၩ့ဝ့ၫလၧထီၫ့ဆံၫ့လီၫ.- လးဆီၩ့ဆီနီၪ အီၪလၧဎၫ့ဎူၫၥွၫ ဒဲခၪ့ယဲးလးထီၫ့လၧဆၧမၩထၬဝ့ၫ လၧလးဆီၩ့ဆီနီၪ, ဒဲစူၪဘီၩ့ၥံၪအီၪလၧဆၧၫ့နၩ့အလး လါခီၫလါခီၫ ဒဲဆၬလၥၧၫ့နံၫဒုၩဆၧၫ့ထုၪ့ဝ့ၫ လၧစူၪ",
			"19": "<sup>19</sup> ဘီၩ့အနဲၩ့ထံၭတၭ,- ဒဲဆၬလၥၧၫ့လဆံၫနံၫဒုၩဆၧၫ့ ထုၪ့လၧဎၫ့ဎူၫၥွၫၥံၪအလီၩ့ လၧအလခီၫအလီၩ့,ဒဲလၧ အလခီၫဒၪအလီၩ့နီၪဆ့လီၫ. တၭဆၧလၩ့ဂၬဘဲၫနီၪ",
			"20": "<sup>20</sup> လၧဘၩ့ၥံၪမုးၥံၪအဖၧၩ့အီၪနးစီၪ့အ့ၬ.- စစီလမၧၫ့အ လိၫ့ၥံၪလၧအအီၩဆၧလၧအဖၧၩ့နီၪ မွဲထီၫ့ထီးအလူၬ တၭ,ဒဲလ့ၭဘနၧၫ့မံၩ့လၬကျၩအဂံၪ့ဖၧၩ့နီၪ, ဖၧၩ့ၥံၪ ထွ့ၫၥံၪနီၪထီးအလူၬ မွဲထီၫ့ဆံၫ့လီၫ. လၧစ့ၩနီၪမၩဝ့ၫ နးဖျိၪ့အ့ၬ. လၧစစီလမၧၫ့အမုနံၩလဖၪနီၪ, ၦအီၪက့ၪ",
			"21": "<sup>21</sup> စ့ၩဘဲၫဆၧလူဒိၪဎွ့ၩဒိၪအၥိၭနးမံၩ့အ့ၬ.- အဂဲးဘဲၫ ယီၩစဎွၩအကဘၩ့ၥံၪလ့ၩလၧ တၫၡံၭလၧစဟုရၫ့အ ခ့ၫအၡၩအၥိၭတၭး လၧၥၧၫ့နံၪ့အထးဖၧၩ့နီၪကဘၩ့ ၥံၪဂဲၫထဲၩ့လၧတၫၡံၭလကၠၪတၭ, ဂဲၫထဲၩ့ဆိၬထီၫ့ဒဲ စ့ၩ,ကဆၫ့မဲၪ,ဒဲကယုၩဖၫၥံၪ, ဒဲထိၪၡၬၥံၪနီၪလီၫ.",
			"22": "<sup>22</sup> တၭစဎွၩစီလမၧၫ့ဒိၪနဲၪ့ဒံၭ ကယဲဂၪ့ခိၪအစဎွၩၥံၪ ထီးအလူၬလၧအဆၧလူဒိၪဎွ့ၩဒိၪ, ဒဲလၧဆၧကိၪ့ၥ့ၪ",
			"23": "<sup>23</sup> ကိၪ့ဘၪအဖၧၩ့နီၪလီၫ.- တၭကယဲဂၪ့ခိၪအစဎွၩထီး အလူၬလဖၪအၪ့ဎၬ စစီလမၧၫ့အမ့ၬး ဘဲၫၥိၭအမိနါ ဂၧၫ့အဆၧကိၪ့ၥ့ၪ, လၧယွၩအီၪက့ၪဝ့ၫ လၧအၥၭခံ",
			"24": "<sup>24</sup> ဖၧၩ့လီၫ.- အဝ့ၫၥံၪဂဲၫဆိၬအဆၧဖ့ၪလၫ့လဂၩဘၪလ ဂၩဆုၬဆုၬ,လၧထွ့ၫစ့ၩၥံၪ, ထွ့ၫထီၫ့ၥံၪ,ဒဲဆၧကီၩ့ဆၧ ၥိၭ,ဒဲကၥ့ၪအပိၭအလၫ့ဒဲဆၧနၧၫ့မၧၫ့ၥံၪ, ကၥ့ၪၥံၪ,ဒဲ ကၥ့ၪလၫၥံၪ, လနံၪ့ဘၪလနံၪ့လနံၪ့ဘၪလနံၪ့လီၫ.",
			"25": "<sup>25</sup> တၭစစီလမၧၫ့အီၪလၧတၩ့ခူၬ အဒူၭၥံၪလံထီၫ့လၧ အလဲၪ့ၥုၭကၥ့ၪအဂး, ဒဲၦနၫ့ကၥ့ၪလဖၪလလၬနံၫထီၫ့, လၧအအီၪက့ၪဝ့ၫလၧလဲၪ့ၥံၪအဒိၩ့ဖၧၩ့ ဒဲလၧစဎွၩအ အီၪလၧယရုစလံၫ့အဖၧၩ့လီၫ.",
			"26": "<sup>26</sup> တၭအဝ့ၫဒၪပၧၩ့ဆၧလၧ စဎွၩထီးအလူၬၥံၪအဖၫ့ ခိၪ,လၧထံၫမိၡါနီၪ ထီၩ့လၧဖလံၡၫဖိၪအခး, ဒဲထီၩ့",
			"27": "<sup>27</sup> လၧအံဇံၭအနဲၩ့ထံၭနီၪဆ့လီၫ.- တၭစဎွၩနီၪဒုၭကဲၪ ထၪ့စ့ၩလၧယရုစလံၫ့အဖၧၩ့ ဘဲၫလိးၥံၪအၥိၭ, ဒဲၥံၪ့ ၡိၫအ့ရ့ၭလဖၪဘဲၫၥံၪ့ကူၪၥံၪ လၧအအီၪဝ့ၫလၧဆၧပျၩ့",
			"28": "<sup>28</sup> ဖၧၩ့လဖၪအၪအၪလ့ၬအၥိၭနီၪလီၫ.- တၭၦလ့ၩလၧ အံဇံၭဂဲၫထဲၩ့ဆိၬကၥ့ၪလဖၪ လၧစစီလမၧၫ့အအီၪ,ဒဲ လၧထံၫၥံၪခးၥံၪထီးအလူၬဆ့လီၫ.",
			"29": "<sup>29</sup> တၭစစီလမၧၫ့အဆၧမၩ ဂူၫဂၩၥံၪ, လၧအခၪ့ထံၭ ထီးအထုၬနီၪ, အီၪကွ့ၭအၥၭ လၧမီၪစနၫၥၫ့ အလံၬ ဖၧၩ့,ဒဲၦၡဲလိၫဖိၪစအဟဲယၫအမီၪ အဆၧချဲၩ့လဖၪအ ဖၧၩ့,ဒဲလၧမီၪစအံဒိၫအဆၧဒၪ လၧယၫလခီၫအဖၧၩ့ ထၫ့ဒၩစနံဘၭအဖိၪခွၫစယ့ၫရဘိအၫ့ လဂၩနီၪ,မွဲအ့ၬ",
			"30": "<sup>30</sup> ဧၪ.- တၭစစီလမၧၫ့ပၧၩ့ဆၧလၧ အံၫစရ့လၭထီးအ လူၬအဖၫ့ခိၪလၧယရုစလံၫ့အဖၧၩ့ အနံၪ့လံဆံၫလီၫ.",
			"31": "<sup>31</sup> တၭစစီလမၧၫ့မံၫလၧအဖါလဖၪအၥိၭနီၪ, ဒဲၦၡၩခုၪ့ လၩ့ဘၧၩ့ဝ့ၫလၧအဖါ စဒၫဝံၭအဒိၩ့ဖၧၩ့တၭး အဖိၪ ခွၫစရံၫဟဘိအၫ့ပၧၩ့ဆၧလၧ အလးနီၪလီၫ."
		},
		"10": {
			"1": "<sup>1</sup> စရံၫဟဘိအၫ့လ့ၩထီၩ့လၧၡံခံၫ့, အဂဲးဘဲၫယီၩ အံၫစရ့လၭထီးအလူၬနီၪ အီၪကီၪ့လၧၡံခံၫ့ဘဲၫၥိၭအ မိဒုၭကဲၪထၪ့အဝ့ၫလဂၩလၧစဎွၩလီၫ.",
			"2": "<sup>2</sup> တၭစနံဘၭအဖိၪခွၫစယ့ၫရဘိအၫ့နီၪ, လၧအအီၪ လၧအံဇံၭအဖၧၩ့, လၧအစဲၪ့ဖျိၭခွံၬလၧစဎွၩစီလမၧၫ့ အမ့ၬယၫနီၪး ဆၧမၩအၥၭ ထီးအနါဂၧၫ့ဝ့ၫတၭ,စ ယ့ၫရဘိအၫ့နီၪ ဂဲၫထဲၩ့ကဒၩထဲၩ့လၧ အံဇံၭလီၫ.",
			"3": "<sup>3</sup> တၭၦလဖၪအၪ့မၧၫ့ၦလ့ၩကိၭန့အဝ့ၫဒၪလီၫ. စယ့ၫရ ဘိအၫ့ဒဲအံၫစရ့လၭထီးအလူၬ ဂဲၫချဲၩ့ဒုၪ့စရံၫဟဘိ",
			"4": "<sup>4</sup> အၫ့တၭ,စံၭဝ့ၫဒၪ,- နဖါမၩပနိၪယိၭဘီၩ့ကၪမၬတၭ, ဘိၩ့နဲၪ့ယီၩနဖါအဆၧမၩကၪနီၪ, ဒဲအနိၪယိၭဘီၩ့ဎၧၫ့ ဆ့လၧအဝ့ၫဒၪ အီၪက့ၪလၧပလီၩ့ မၩဎွံၫထၪ့နဝ့ၫနး",
			"5": "<sup>5</sup> ဆံၭဘီၪၬ တၭပမိမၩနဆၧလီၫ.- အဝ့ၫဒၪစံၭအဝ့ၫၥံၪ, ၥၧၫ့နံၩဖီၩ့ခွံၬတၭ, ဂဲၫထဲၩ့ဒီၭလၧယအီၪဆံၭ. တၭၦ ၡၩၥံၪနီၪထဲၩ့ထဲၩ့ဝ့ၫဒၪလီၫ.",
			"6": "<sup>6</sup> စဎွၩရံၫဟဘိအၫ့ကိၪ့လိၬအၥၭလၧၦၥၭၡါလဖၪ, လၧအဆၧၫ့ထုၪ့လၧအဖါ စစီလမၧၫ့အမ့ၬယၫလၧအ မၧၫ့ဒံၭအဘိၩ့ဘၭတၭ, စံၭဝ့ၫဒၪ, ဘဲၫၥိၭယမိစံၭဆၧၫ့ၦ ၡၩၥံၪနီၪ, မွဲနၥံၪမိဒုၭကိၪ့ယၧၩလၧဆၧနီၪလမံၩ့လဲၪ.",
			"7": "<sup>7</sup> အဝ့ၫၥံၪချဲၩ့ဆၧၫ့ဝ့ၫတၭ, စံၭဝ့ၫဒၪ, နအ့ၪမၩၦၡၩလၧ ဆၧအခိးအတၩနီၪ, ဒဲမၩဆၧလၧအဘၪ အဝ့ၫၥံၪအ ၥၭတၭ,ချဲၩ့ဒုၪ့အဝ့ၫၥံၪ လၧဆၧအဂ့ၩတၭ, အဝ့ၫၥံၪ မိကဲၪနခ့ၫနၡၩလဖၪ အဆိၩဆိၩအကၠၪကၠၪလီၫ.",
			"8": "<sup>8</sup> မွဲလါနၫ့ဘိၩ အဝ့ၫဒၪခွံၬၡိၭခွံၬဆၧလၧ ၦၥၭၡါလ ဖၪဒုၭကိၪ့ဝ့ၫတၭ, ကိၪ့လိၬအၥၭ လၧၦၥၭဘၪ့လဖၪ လၧအဒိၪထၪ့ဎုၬလၧအဝ့ၫဒၪ, လၧအဆၧၫ့ထုၪ့ဝ့ၫလၧ",
			"9": "<sup>9</sup> အမ့ၬယၫလီၫ.- တၭစံၭအဝ့ၫၥံၪ, ဘဲၫၥိၭယမိစံၭဆၧၫ့ ၦၡၩၥံၪနီၪ, လၧအချဲၩ့ဒုၪ့ယၧၩတၭ, စံၭဝ့ၫဒၪ,နိၪယိၭ ဘီၩ့လၧနဖါအီၪက့ၪလၧပလီၩ့နီၪ, မၩဎွံၫထၪ့နဝ့ၫနး ဆံၭဘီၪၬ မွဲနၥံၪမိဒုၭကိၪ့ယၧၩ လၧဆၧနီၪလမံၩ့လဲၪ.",
			"10": "<sup>10</sup> ၦၥၭဘၪ့လဖၪ လၧအဒိၪထၪ့ဎုၬလၧ အဝ့ၫဒၪအၥိၭချဲၩ့ ဆၧၫ့ဝ့ၫတၭ, စံၭဝ့ၫဒၪ, ၦလၧအချဲၩ့ဒုၪ့နၧၩလဖၪနီၪ, လၧအစံၭဝ့ၫ, နဖါမၩဎၧၫ့ပနိၪယိၭဘီၩ့, အ့ၪမွဲနဝ့ၫဒၪ ယီၩမၩဎွံၫထၪ့လၧပဂးလဆံၭဘီၪ. နဘၪစံၭဆၧၫ့အ ဝ့ၫၥံၪဘဲၫယီၩ, ယစူၪနိၩ့ဆံၭလဘီၩ့မိတၪ့နဲၪ့ဒံၭယဖါ",
			"11": "<sup>11</sup> အယးဒံၩ့နီၪလီၫ.- အဂဲးဘဲၫယီၩ ယဖါမၩဎၧၫ့နၥံၪ အနိၪယိၭဘီၩ့တၭ, ယမိမၩဎၧၫ့ထၪ့ဒံၭနၥံၪအနိၪယိၭ ဘီၩ့ဒံၭတၭး ယဖါအၪ့ၥီၪ့နၥံၪ လၧနိၪဖျ့ၪလဖၪ,အ့ၪမွဲ ယဝ့ၫဒၪယီၩ ယမိမၩလၧဆၧကဲၪ့မ့ၥံၪလီၫ.",
			"12": "<sup>12</sup> တၭထီးအဘၪၥၧၫ့နံၩလနံၩနီၪ စယ့ၫရဘိအၫ့ဒဲၦ ၡၩထီးအလူၬလဖၪဂဲၫထီၩ့လၧစရံၫဟဘိအၫ့အအီၪ, ဘဲၫစဎွၩမၪလူၬဝ့ၫအၥိၭ, လၧအစံၭဝ့ၫ, လၧၥၧၫ့နံၩလ",
			"13": "<sup>13</sup> နံၩနီၪဂဲၫထဲၩ့ဒီၭလၧယအီၪယီၩဆံၭ.- တၭစဎွၩစံၭ ဆၧၫ့အဝ့ၫၥံၪ လၧဆၧချဲၩ့ကၪမၬတၭး စဎွၩရံၫဟဘိ",
			"14": "<sup>14</sup> အၫ့ခွံၬၡိၭခွံၬ ၦၥၭၡါလဖၪအဆၧဒုၭကိၪ့ဝ့ၫနီၪ,- ဒဲ ချဲၩ့ဆၧၫ့အဝ့ၫၥံၪဘဲၫၦၥၭဘၪ့လဖၪ ဒုၭကိၪ့ဝ့ၫအၥိၭ, စံၭဝ့ၫဒၪ,ယဖါမၩဎၧၫ့နၥံၪ အနိၪယိၭဘီၩ့နီၪ, အ့ၪမွဲ ယဝ့ၫဒၪယမိမၩဎၧၫ့နဲၪ့ဒံၭ, ယဖါအၪ့ၥီၪ့နၥံၪလၧနိၪ ဖျ့ၪလဖၪ, အ့ၪမွဲယဝ့ၫဒၪ ယမိမၩ လၧဆၧကဲၪ့မ့ၥံၪ လီၫ.",
			"15": "<sup>15</sup> တၭစဎွၩလခိၭနၪဘၪ ၦခမျၧးၥံၪ, အဂဲးဘဲၫယီၩ ဆၧနီၪလမံၩ့ ဂဲၫဝ့ၫလၧယွၩ, ဘဲၫၥိၭယဟိဝၩမိမၩ လၧၫ့ထၪ့ဎွ့ၩထၪ့အလူ, လၧအချဲၩ့ဝ့ၫ လၧၦၡဲလိၫဖိၪ စအဟဲယၫအစူၪဖၧၩ့တၭ, လီၩဘၪစနံဘၭ အဖိၪခွၫ",
			"16": "<sup>16</sup> စယ့ၫရဘိအၫ့နီၪလီၫ.- ထီးအံၫစရ့လၭထီးအလူၬဒၪ ဘၪလၧစဎွၩ လမိခိၭနၪဘၪအဝ့ၫၥံၪတၭ, ၦခမျၧးၥံၪ စံၭဆၧၫ့စဎွၩနီၪ, စံၭဝ့ၫဒၪ, ပဂးအီၪလၧစဒၫဝံၭအဖၧၩ့ ဘဲၫၥ့ၪလဲၪး ဒဲပဆၧန့ၥၫအီၪလၧစယ့ၭစံၫအဖိၪခွၫအ ဖၧၩ့နးမံၩ့အ့ၬ. အံၫစရ့လၭဧ့, လၧနၥံၪအတဲၩဒၪနၥံၪ ဝ့ၫအဖၧၩ့ဆုၬဆုၬဆံၭၬ ဘိၩ့နဲၪ့ယီၩ, စဒၫဝံၭဧ့, ယိန ဝ့ၫ,လၧနဂံၪ့ဒၪနဝ့ၫဘီၪၬ တၭအံၫစရ့လၭ ထီးအလူၬ",
			"17": "<sup>17</sup> ထဲၩ့ထဲၩ့လၧအတဲၩလီၫ.- အ့ၪမွဲၦအံၫစရ့လၭဖိၪလၧ အအီၪဝ့ၫလၧယုဒၫအဒိၩ့လဖၪနီၪ, စရံၫဟဘိအၫ့ပၧၩ့ ဆၧလၧအဝ့ၫၥံၪအဖၫ့ခိၪလီၫ.",
			"18": "<sup>18</sup> ထီးနီၪလဖၧၫ့ စဎွၩရံၫဟဘိအၫ့အၪ့မၧၫ့ စဟၫဒိ ရၫ့,လၧအပၧၩ့ဘၪအခီၫ့တၭ, ၦအံၫစရ့လၭဖိၪၥံၪခွံၬ ဝ့ၫလၧလိးထီးအၥံၫဝ့ၫဒၪလီၫ. အ့ၪမွဲစဎွၩ ရံၫဟဘိ အၫ့မၩချဲၫ့ချဲၫ့နုၬ လၧအလဲၪ့ၥုၭအဖၧၩ့တၭ, စဲၪ့ဖျိၭ",
			"19": "<sup>19</sup> ထီၩ့လၧယရုစလံၫ့အဖၧၩ့လီၫ.- တၭအံၫစရ့လၭပိၩ့ ထၪ့,ထၫ့ဒုၪဒၩစဒၫဝံၭအဂံၪ့ ထီးမုဆၫလနံၩယီၩလီၫ."
		},
		"11": {
			"1": "<sup>1</sup> ထီးစရံၫဟဘိအၫ့ဂဲၫထီၩ့လၧ ယရုစလံၫ့တၭ,ကိၭ ကီၪ့ယုဒၫဒဲဘံၪ့ယမံၫ့အၡၩဂံၪ့ဖိၪလဖၪ, လၧဆၧရွံန့ ဝ့ၫလကုၬလံလၬ, လၧအမွဲၦၥုၭဖိၪၥံၪဘဲၫၥိၭအမိဒုၭ ထၫ့ဒၩအံၫစရ့လၭ, ဒဲဂဲၫထဲၩ့န့ဒီၭ အဘၩ့အမုးလၧစ",
			"2": "<sup>2</sup> ရံၫဟဘိအၫ့အစူၪဖၧၩ့လီၫ.- အ့ၪမွဲယဟိဝၩအလူ",
			"3": "<sup>3</sup> လၩ့ဘၪယွၩအၡၩစၡံၫမအဲအၫတၭ, စံၭဝ့ၫဒၪ,- လီၩ ဘၪစစီလမၧၫ့အဖိၪခွၫစရံၫဟဘိအၫ့, ယုဒၫအစဎွၩ, ဒဲအံၫစရ့လၭထီးအလူၬ လၧအအီၪလၧယုဒၫဒဲဘံၪ့ယ",
			"4": "<sup>4</sup> မံၫ့အဖၧၩ့တၭ, စံၭအဝ့ၫၥံၪ,- ယဟိဝၩစံၭဝ့ၫဘဲၫယီၩ, ထီးလ့ၩထၪ့, ဒုၭၥုၭထၫ့ဒၩ နၥံၪအထၧၫ့ဖုဝဲလဖၪလ ဂ့ၩး ထဲၩ့ထဲၩ့လၧအဂံၪ့ဒၪဝ့ၫ လဂၩဘၪလဂၩဆုၬဆုၬ ဆံၭ. အဂဲးဘဲၫယီၩ ဆၧလမံၩ့ယီၩ ယမၩဒၪယဝ့ၫ လီၫ. အဝ့ၫၥံၪခိၭနၪယဟိဝၩအလူတၭ, လၧအမိလ့ၩ ထၫ့ဒၩစယ့ၫရဘိအၫ့နီၪ ထဲၩ့ကဒၩထဲၩ့လခီၫလီၫ.",
			"5": "<sup>5</sup> စရံၫဟဘိအၫ့အီၪ လၧယရုစလံၫ့အဖၧၩ့တၭ,မၩ ကဲၪထၪ့ဒိၩ့လဖၪ လၧပဒၩ့ဆၧအဂး လၧယုဒၫအဖၧၩ့",
			"6": "<sup>6</sup> လီၫ.- မၩထၪ့ဘ့ၭၥလံၫဟံၫ့, ဒဲအံတၫ့,ဒဲတံၫကိအၫ, ဒဲဘ့ၭၥဇၧၫ, ဒဲၡိကိၫ, ဒဲအဒၧလၫ့,",
			"7": "<sup>7</sup> ဒဲဂၫၥၭ, ဒဲမရ့ၭ",
			"9": "<sup>9</sup> ဟၫ, ဒဲဇံဖၫ,- ဒဲအဒိရံၫ့, ဒဲလၫခံၭ, ဒဲအဇံကၫ,",
			"10": "<sup>10</sup> ဒဲဇိရၫ, ဒဲအဲၫစလၫ့, ဒဲဟံဘြၧၫ့, လၧယုဒၫဒဲလၧဘံၪ့",
			"11": "<sup>11</sup> ယမံၫ့အဖၧၩ့ ဒိၩ့ပဒၩ့ဆၧအဂးလီၫ.- တၭမၩခၧၫ့ထၪ့ ထိၬၥံၪ, ဒဲအီၪက့ၪၥုၭခိၪလဖၪလၧအဖၧၩ့, ဒဲအီၪက့ၪ",
			"12": "<sup>12</sup> ပိၩ့ဆၧအၪ့ဆၧအီၩ, ဒဲၥိၪဒဲစဘံၭထံၫနီၪလီၫ.- လဒိၩ့ ဘၪလဒိၩ့နီၪ အီၪက့ၪထၩ့ဖံၭလဖၪ, ဒဲနၭၥံၪဖၩ့ၥံၪ တၭ,လၧယုဒၫဒဲဘံၪ့ယမံၫ့ၥံၪအီၪလၧအအီၪလခီၫအ ကၠီၩ့တၭ, မၩအလးလဖၪနီၪခၧၫ့လ့ၬလီၫ.",
			"13": "<sup>13</sup> ၦလုဆၧလဖၪ ဒဲၦလံဝဲၫဖိၪၥံၪလၧအအီၪ လၧအံၫ စရ့လၭထီးအလူၬအကျၩနီၪ, ဂဲၫလၧအဝ့ၫၥံၪအလး",
			"14": "<sup>14</sup> ကိၭစီၪ့ဒ့ၭထီၩ့လၧအဝ့ၫဒၪအအီၪလီၫ.- အဂဲးဘဲၫယီၩ ၦလံဝဲၫဖိၪၥံၪ စဲၪ့ဒၪအလးလဖၪ, ဒဲအဆၧန့ၥၫလဖၪ တၭ,ဂဲၫထီၩ့လၧယုဒၫဒဲယရုစလံၫ့လီၫ. အဂဲးဘဲၫယီၩ စယ့ၫရဘိအၫ့ ဒဲအဖိၪခွၫၥံၪနၫ့ထၪ့ခွံၬအဝ့ၫၥံၪ လၧၦ",
			"15": "<sup>15</sup> လုဆၧအလး လၧအလုထၪ့ယဟိဝၩနီၪလီၫ.- အဝ့ၫ အီၪက့ၪထၪ့ ၦလုဆၧလဖၪ လၧအလးထၪ့ထီၫၥံၪအ ဂး,ဒဲလၧဆၧအီၪ လၧအဆီၪ့နီၪအဂး, ဒဲလၧချီဖိၪၥံၪ",
			"16": "<sup>16</sup> လၧအမၩကဲၪထၪ့ဝ့ၫအဂးလီၫ.- လၧအဝ့ၫၥံၪအလး ခဲၫ့လၧအံၫစရ့လၭအဒီၪ့ၥံၪထီးအလူၬ, ကယဲၦလၧအ အီၪက့ၪအၥၭ လၧအမိအၪ့ဎၬ ယဟိဝၩအံၫစရ့လၭ အယွၩနီၪ, ဂဲၫထီၩ့ဆ့လၧယရုစလံၫ့, ဘဲၫၥိၭအမိလု",
			"17": "<sup>17</sup> ထၪ့ယဟိဝၩ အဝ့ၫၥံၪအဖါလဖၪအယွၩလီၫ.- တၭ အဝ့ၫၥံၪမၩခၧၫ့ထၪ့ယုဒၫအဘၩ့အမုး, ဒဲဒုၭဆီၪ့ထၪ့စ စီလမၧၫ့အဖိၪခွၫ စရံၫဟဘိအၫ့လၧၥၧၫ့နံၪ့အထးဖၧၩ့ လီၫ.အဂဲးဘဲၫယီၩ လၧၥၧၫ့နံၪ့အထးဖၧၩ့နီၪ အဝ့ၫ ၥံၪလ့ၩဆၧလၧစဒၫဝံၭ ဒဲစစီလမၧၫ့အဖၧၩ့ၥၭလီၫ.",
			"18": "<sup>18</sup> တၭစရံၫဟဘိအၫ့ န့အမၫ လၧစဒၫဝံၭအဖိၪခွၫစ ယ့ၫရမီၭအဖိၪမုၪနးမဟၫလၭ, ဒဲစယ့ၭစံၫအဖိၪခွၫ",
			"19": "<sup>19</sup> စအံၫလဲအၭအဖိၪမုၪ နးအဘဲဟလၭတၭး- အဝ့ၫဒၪ အီၪဖျဲၪန့အဖိၪလဖၪလၧအဂး, စယ့ၫအၧၭ, ဒဲစၡၫမရဲ",
			"20": "<sup>20</sup> အၫ,ဒဲစဇၫဟၫ့လီၫ.- တၭလၧအဝ့ၫဒၪအလးခဲၫ့မၩ န့စအၭဘစလၧၫ့အဖိၪမုၪ နးမၫအခၫတၭး အဝ့ၫဒၪ အီၪဖျဲၪန့စအဘဲယၫ, ဒဲစအၭတဲၫ, ဒဲစဇဲဇၫ,ဒဲစၡံလိၫ",
			"21": "<sup>21</sup> မံၭလၧအဂးလီၫ.- တၭစရံၫဟဘိအၫ့ အဲၪစအၭဘစ လၧၫ့အဖိၪမုၪနးမၫအခၫနီၪ အၪနဲၪ့ဒံၭကယဲအမၫၥံၪ ထီးအလူၬဒဲအၥံၪမၫနီၪဆ့လီၫ. (အဂဲးဘဲၫယီၩအဝ့ၫ ဒၪန့အမၫၥံၪ လဆံၫဎိၭဂၩ, ဒဲအၥံၪမၫလဖၪ ဎူၫဆံၫ တၭ,ထၪ့ဖိၪအဖိၪခွၫနံၫဆံၫဎိၭဂၩ, ဒဲအဖိၪမုၪလဖၪ",
			"22": "<sup>22</sup> ဎူၫဆံၫလီၫ.)- တၭစရံၫဟဘိအၫ့အီၪက့ၪထၪ့နးမၫအ ခၫအဖိၪခွၫစအဘဲယၫ လၧအခိၪလၧအမိပၧၩ့ဆၧ လၧအထၧၫ့ဖုဝဲၥံၪအကျၩလီၫ. အဂဲးဘဲၫယီၩ ဆီၫ့မီၪ့ လၩ့အၥၭလၧအမိဒုၭကဲၪထၪ့ အဝ့ၫလဂၩ လၧစဎွၩ",
			"23": "<sup>23</sup> လီၫ.- တၭမၩဆၧလၧဆၧကိၪ့ၥ့ၪနီၪ, ဒုၭလၩ့မုလၩ့ဖၭ အဖိၪလဖၪလၧယုဒၫ ဒဲဘံၪ့ယမံၫ့အဝၩ့လဖၪ ထီးအ လူၬ,လၧဒိၩ့ပဒၩ့ဆၧလဒိၩ့ဘၪလဒိၩ့ ဆုၬဆုၬအဖၧၩ့ တၭ,ဖ့ၪလၫ့အဝ့ၫၥံၪလၧ ဆၧအၪ့ဆၧအီၩအၪအၪလ့ၬ လီၫ. တၭအဝ့ၫဒၪဘၪအၥၭ လၧမၫၥံၪအၪဂၩလီၫ."
		},
		"12": {
			"1": "<sup>1</sup> ထီးစရံၫဟဘိအၫ့မၩဂုးထၪ့ယူၭ အဘၩ့အမုးယူၭ, ဒဲမၩဆီၪ့ထၪ့အနၫ့ဆါဒၪဝ့ၫတၭ, ဆၧမၩအၥၭလၧအ ခွံၬၡိၭခွံၬယဟိဝၩအဆၧၥီၪ့ဆၧၥၫ့ ဒဲအံၫစရ့လၭထီး အလူၬလၧအၥိၭဆ့လီၫ.",
			"2": "<sup>2</sup> ထီးစရံၫဟဘိအၫ့ကဲၪစဎွၩ ယဲနံၪ့လနံၪ့နီၪ,ဆၧမၩ အၥၭလၧအံဇံၭအစဎွၩၡံၡၭ ဂဲၫထၪ့ထၫ့ဒၩယရုစလံၫ့ နီၪ, (အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪ မၪဘၪယဟိဝၩတၭ,)",
			"3": "<sup>3</sup> အီၪလၧလဲၪ့ၥုၭလထီၫ့နံၫယၩ, ဒဲၦထူၬကၥ့ၪလဖၪဎူၫ လၬတၭး ၦခမျၧးၥံၪလၧအစဲၪ့ထၪ့ခွံၬ လၧအံဇံၭဂဲၫ ဖိၬအခဲၫ့နီၪ ဆၧဝံထၪ့နၬထၪ့ၥ့ၪဝါအ့ၬး ၦလုဘၠၫ့ဖိၪၥံၪ,",
			"4": "<sup>4</sup> ၦစူၫကံၫဖိၪၥံၪ, ဒဲၦကုၡၫဖိၪလဖၪလီၫ.- အဝ့ၫမၩန့ ဒိၩ့ပဒၩ့ဆၧလဖၪလၧအဘၪဆဲၫ့ လၧယုဒၫနီၪတၭး ဂဲၫ ထီၩ့လၧယရုစလံၫ့လီၫ.",
			"5": "<sup>5</sup> ထီးနီၪလဖၧၫ့မီၪလဂၩ စၡံၫမအဲအၫဂဲၫလၧစရံၫဟ ဘိအၫ့အအီၪ, ဒဲလၧယုဒၫအၦဒိၪလဖၪ, လၧအအီၪ ကီၪ့ၡီၩ့ဝ့ၫလၧယရုစလံၫ့နီၪ, လၧစၡံၡၭအကၠီၩ့တၭ, စံၭအဝ့ၫၥံၪ, ယဟိဝၩစံၭဝ့ၫဘဲၫယီၩ, နၥံၪစဲၪ့ဒၪယၧၩ တၭ,အခိးမွဲယအီၪက့ၪလၩ့ထးနၥံၪ လၧစၡံၡၭအစူၪ",
			"6": "<sup>6</sup> ဖၧၩ့လီၫ.- ဆၧမၩအၥၭဘဲၫနီၪတၭ အံၫစရ့လၭအၦ ဒိၪဖၭဒိၪလဖၪ, ဒဲစဎွၩလဂၩနီၪ ဆၪ့လၩ့ၡီၩ့အၥၭ တၭ,အဝ့ၫၥံၪစံၭဝ့ၫ, ယဟိဝၩမွဲအတီၩအလီၩ့လီၫ.",
			"7": "<sup>7</sup> ထီးယဟိဝၩဒၪဘၪလၧ အဝ့ၫၥံၪဆၪ့လၩ့အၥၭတၭ, ယဟိဝၩအလူလၩ့ဘၪစၡံၫမအဲအၫနီၪ, စံၭဝ့ၫဒၪ,အ ဝ့ၫၥံၪဆၪ့လၩ့ယူၭအၥၭယူၭ, အခိးမွဲယမိမၩဂၭဂီၩ့ အဝ့ၫၥံၪအ့ၬး အ့ၪမွဲယမိဖ့ၪလၫ့အဝ့ၫၥံၪ လၧဆၧဖီၩ့ ဖျ့ၭလဆံၭဆံၭတၭ, ယဆၧၥၭထၪ့မိဘၪဆၧဂါလၩ့ ခွံၬဝ့ၫလၧယရုစလံၫ့အလီၩ့ လၧစၡံၡၭအစူၪဖၧၩ့ဆ့",
			"8": "<sup>8</sup> အ့ၬ.- မွဲလါနၫ့ဘိၩ အဝ့ၫၥံၪမိကဲၪဘၪအဝ့ၫဒၪအခ့ၫ အၡၩလီၫ. မွဲဘဲၫၥိၭအဝ့ၫၥံၪမိၥ့ၪယၫ ယဆၧဖံၭဆၧ မၩ,ဒဲဆၧဖံၭဆၧမၩဘၪဆဲၫ့ လၧထံၫၥံၪခးၥံၪအဘၩ့ အမုးလဖၪနီၪလီၫ.",
			"9": "<sup>9</sup> အခိးမွဲအံဇံၭအစဎွၩ ၡံၡၭနီၪ ဂဲၫထၪ့ထၫ့ဒၩယရု စလံၫ့တၭ, မၩန့ခွံၬယဟိဝၩအဂံၪ့အဆၧအီၪက့ၪကီၪ့ အဎၧၩ့အဎီ, ဒဲစဎွၩအဂံၪ့အဆၧအီၪက့ၪကီၪ့ အဎၧၩ့ အဎီလဖၪတၭး မၩန့ဝ့ၫထီးအလူၬတၭ, ဆိၬခွံၬဆ့ထၩ့",
			"10": "<sup>10</sup> ဖံၭထီၫ့ၥံၪလၧစစီလမၧၫ့ မၩကဲၪထၪ့ဝ့ၫနီၪလီၫ.- လၧ အလးနီၪ စဎွၩရံၫဟဘိအၫ့ မၩထၩ့ဖံၭၥံၪလၧထီးဝီၩ တၭ,အီၪက့ၪလၩ့ဝ့ၫလၧ ၦခိၭဆၧဖိၪ အခိၪလဂၩအ စူၪဖၧၩ့,ၦလၧအခိၭစဎွၩအဂံၪ့ နုၬဝ့ၫအလးနီၪလီၫ.",
			"11": "<sup>11</sup> ထီးစဎွၩလ့ၩနုၬလၧ ယဟိဝၩအဂံၪ့ဖၧၩ့တၭ, ၦခိၭဆၧ ဖိၪဂဲၫမၩန့ဝ့ၫ ဒဲဂဲၫထဲၩ့ဆိၬအီၪက့ၪဒီၭဝ့ၫ လၧၦခိၭဆၧ",
			"12": "<sup>12</sup> အဒူၭဖၧၩ့နီၪလီၫ.- ထီးစဎွၩဆၪ့လၩ့အၥၭတၭ, ယဟိ ဝၩအဆၧၥၭထၪ့နီၪ ကၠၪခွံၬအၥၭလၧအဝ့ၫဒၪ, ဘဲၫၥိၭ အထီးဘၪဆၧဂၭဂီၩ့ထီးအလူၬလဂ့ၩတၭး လၧယုဒၫ အဖၧၩ့နီၪဆၧမၩအၥၭဂ့ၩဆ့လီၫ.",
			"13": "<sup>13</sup> တၭစဎွၩရံၫဟဘိအၫ့မၩဆီၪ့ထၪ့အၥၭ လၧယရုစ လံၫ့အဖၧၩ့, ဒဲပၧၩ့ဘၪဆၧလီၫ. အဂဲးဘဲၫယီၩလၧစရံၫ ဟဘိအၫ့ကဲၪၥၫ့စဎွၩနီၪ, အၥၭအီၪလံဆံၫလနံၪ့တၭ, ပၧၩ့ဘၪဆၧလၧလံဆံၫလနံၪ့ လၧယရုစလံၫ့အဖၧၩ့, ဒိၩ့လၧယဟိဝၩရွံန့ခွံၬဝ့ၫ လၧအံၫစရ့လၭအဒီၪ့ၥံၪ ထီးအလူၬ, ဘဲၫၥိၭအမိအီၪက့ၪအမံၩ့ထီးနီၪလီၫ.တၭ",
			"14": "<sup>14</sup> အမိအမံၩ့မွဲနးနၫအမၫ ၦအၫမၧၫ့ဖိၪလဂၩလီၫ.- တၭ အဝ့ၫဒၪမၩအၧၩ့ဆၧနီၪ, အဂဲးဘဲၫယီၩတဲၩ့ဝဲၩအၥၭ ဘဲၫၥိၭအမိအၪ့ဎၬယဟိဝၩအ့ၬ.",
			"15": "<sup>15</sup> တၭစရံၫဟဘိအၫ့အဆၧမၩ, လၧအခၪ့ထံၭထီးအ ထုၬနီၪအီၪကွ့ၭအၥၭ လၧမီၪစၡံမအဲအၫအလံၬဖၧၩ့,ဒဲ လၧမီၪစအံဒိၫ, လၧဆၧဘၪဆဲၫ့လၧဆၧလီၩဆိၩဝ့ၫအ ဂဲးနီၪ,မွဲအ့ၬဧၪ. တၭဆၧဒုၭၥုၭအီၪထၪ့လၧစရံၫဟ ဘိအၫ့ဒဲစယ့ၫရဘိအၫ့နီၪ လထံၪဎးလဘီၩ့ဎးလီၫ.",
			"16": "<sup>16</sup> တၭစရံၫဟဘိအၫ့ မံၫဝ့ၫလၧအဖါၥံၪအၥိၭ, ဒဲၦခုၪ့ လၩ့ဘၧၩ့ဝ့ၫလၧစဒၫဝံၭအဒိၩ့ဖၧၩ့နီၪလီၫ. တၭအဖိၪ ခွၫစအဘဲယၫ ကဲၪစဎွၩလၧအလးလီၫ."
		},
		"13": {
			"1": "<sup>1</sup> လၧစယ့ၫရဘိအၫ့ ကဲၪထၪ့စဎွၩလဆံၫဎိၭနံၪ့လနံၪ့ တၭ,စအဘဲယၫကဲၪၥၫ့စဎွၩ လၧယုဒၫအဖၧၩ့တၭ,",
			"2": "<sup>2</sup> ပၧၩ့ဘၪဆၧလၧ ယရုစလံၫ့အဖၧၩ့နီၪၥၧၫ့နံၪ့လီၫ. အ မိအမံၩ့မွဲနးမံၫခ့ယၫ, ၦဂံဘအၫဖိၪစယုၫရအ့လၭအ ဖိၪမုၪလီၫ.",
			"3": "<sup>3</sup> တၭဆၧဒုၭၥုၭအီၪထၪ့လၧစအဘဲယၫ ဒဲစယ့ၫရဘိ အၫ့လီၫ. စအဘဲယၫတဲၩ့ဝဲၩဆၧဒုၭၥုၭလၧၦၥုၭဖိၪ ခမျၧးအီၪလၧအၥၭဆီၪ့, လၧၦရွံန့ဝ့ၫၦၡၩလံကုၬလီၫ. တၭစယ့ၫရဘိအၫ့တဲၩ့ဝဲၩ ဆၧဒုၭၥုၭဆ့ထၫ့ဒၩအဝ့ၫ, လၧဆၧရွံန့ဝ့ၫၦၡၩဎိၭကုၬတၭ မွဲၦၥၭဆီၪ့ဒဲၥၭဒူၩဆ့ လီၫ.",
			"4": "<sup>4</sup> တၭစအဘဲယၫ ဆၧၫ့ထုၪ့လၧခိၪလီၩ့ ဇံၫ့မရံၫ့အ လီၩ့,လၧအအီၪ လၧခိၪလီၩ့အံဖြံၫ့အဖၧၩ့နီၪ, စံၭဝ့ၫ ဒၪ,စယ့ၫရဘိအၫ့, ဒဲအံၫစရ့လၭထီးအလူၬၥံၪဧ့, ခိၭ",
			"5": "<sup>5</sup> နၪယၧၩဘီၪၬ- ယဟိဝၩအံၫစရ့လၭအယွၩနီၪဖ့ၪလၫ့ ဘၩ့မုးလၧအံၫစရ့လၭအဖၫ့ခိၪ, လၧစဒၫဝံၭအစူၪဖၧၩ့ အဆိၩဆိၩအကၠၪကၠၪ လၧဆၧအုၩ့လၩ့ ထံၫလၪနီၪ,",
			"6": "<sup>6</sup> နၥံၪကြၨၭၥ့ၪယၫ,မွဲအ့ၬဧၪ.- မွဲလါနၫ့ဘိၩစနံဘၭအ ဖိၪခွၫစယ့ၫရဘိအၫ့, စဒၫဝံၭအဖိၪခွၫစစီလမၧၫ့အခ့ၫ",
			"7": "<sup>7</sup> အၡၩလဂၩနီၪ,ဂဲထုၪ့တၭ, ပိၩ့ထၪ့အကဆါလီၫ.-ၦ ဂၭဂီၩ့ဖိၪ လၧအမွဲၦဘၫအလၭဖိၪလဖၪ အီၪကီၪ့လၧ အအီၪတၭ, အဝ့ၫၥံၪမၩဆီၪ့ထၪ့အၥၭ ထၫ့ဒၩစစီလ မၧၫ့အဖိၪခွၫစရံၫဟဘိအၫ့လဂၩ, မွဲလၧစရံၫဟဘိအၫ့ အၥၭဘၪ့ဒဲၥၭဆါအဘိၩ့ဘၭတၭ မၩနၧၩ့မၩစၪအဝ့ၫ",
			"8": "<sup>8</sup> ၥံၪၥ့ၪအ့ၬ.- တၭဘိၩ့နဲၪ့ယီၩ နၥံၪဆီၫ့မီၪ့လၧနၥံၪမိ ထၫ့ဒၩယဟိဝၩအဘၩ့အမုး လၧအအီၪလၧစဒၫဝံၭအ ဖိၪခွၫၥံၪအစူၪဖၧၩ့တၭ, မွဲကဒၪယူၭနၥံၪမွဲၦခမျၧးဖၭ ဒိၪ,ယွၩလဖၪလၧစယ့ၫရဘိအၫ့ တဲၩ့ဝဲၩချီဖိၪထီၫ့ၥံၪ",
			"9": "<sup>9</sup> အီၪလၧနၥံၪအၥိၭဆ့.- ယဟိဝၩ အၡၩလုဆၧလဖၪ စအၫရၧၫ့အဖိၪခွၫၥံၪ, ဒဲၦလံဝဲၫဖိၪလဖၪ, နၥံၪနၫ့ထၪ့ ခွံၬမွဲအ့ၬဧၪး ဒဲနၥံၪမၩထၪ့ၦလုဆၧလဖၪ ဘဲၫထံၫၥံၪ ခးၥံၪအဆၨၩလဖၪမၩဝ့ၫအၥိၭနီၪ, မွဲအ့ၬဧၪ. အခိးမွဲ ထီးဒၪၦလဂၩဂၩ လၧအဂဲၫအီၪက့ၪဆံၫ့ဎံၪ အနၫ့ဆါ ဒၪဝ့ၫ,အီၪလၧချီဖၫဖိၪဒဲၥိၪဖၫနွ့ၫဒုၩၥံၪ, အဝ့ၫဒၪလ ဂၩဂၩကဲၪထၪ့ၦလုဆၧ လၧအလမွဲဘၪ ယွၩလဖၪအ",
			"10": "<sup>10</sup> ဂးလီၫ.- အ့ၪမွဲပဝ့ၫဒၪယီၩ, ယဟိဝၩမွဲပယွၩတၭ,ပဝ့ၫ ဒၪပစဲၪ့ဒၪအဝ့ၫနီၪဆ့အ့ၬ. ဒဲၦလုဆၧလဖၪလၧအမၩ ယဟိဝၩအဆၧမၩနီၪ, မွဲစအၫရၧၫ့အဖိၪခွၫၥံၪ, ဒဲၦလံ",
			"11": "<sup>11</sup> ဝဲၫဖိၪလဖၪမၩအဝ့ၫၥံၪအဆၧမၩဆ့တၭး- လၧလဂီၩ ဘၪလဂီၩ, ဒဲလၧလဂၪဘၪလဂၪကိၭဖၧၫ့ဒ့ၭနီၪ, အဝ့ၫ ၥံၪလုထၪ့ယဟိဝၩ လၧဆၧလုမ့ၪ ဒဲဆၧနၧၫ့မၧၫ့နီၪ, ဆၧမ့ၬယၫအကိၪဆ့လၧစပွဲဆံၫ့ဎံၪအဖၫ့ခိၪ, ဒဲမ့ၪဒိၩ့ အလးထီၫ့အီၪလၧအမ့ၪဒိၩ့လဖၪ ဘဲၫအမိခဲၩဖၩ့ထၪ့ မုဂၪလၩ့လခီၫကိၭဖၧၫ့ဒ့ၭလီၫ. အဂဲးဘဲၫယီၩပဝ့ၫဒၪ ပထီးန့ယဟိဝၩပယွၩ အဆၧမၪလူၬလဖၪတၭ,နၥံၪဝ့ၫ",
			"12": "<sup>12</sup> ဒၪနၥံၪစဲၪ့ဒၪခွံၬအဝ့ၫဒၪလီၫ.- တၭ,ယိခွါ, ယွၩအနၫ့ ဆါအီၪလၧပၥိၭ ကဲၪပၥုၭခိၪ, ဒဲအၡၩလုဆၧလဖၪ အူၪထၪ့ခွ့ၩၥံၪတၭ, ကိၭၡၭထၪ့ထၫ့ဒၩနၥံၪဆ့လီၫ. ၦ အံၫစရ့လၭဖိၪၥံၪဧ့, ထီးဒုၭၥုၭထၫ့ဒၩ ယဟိဝၩနၥံၪ အဖါလဖၪအယွၩနီၪလဂ့ၩ. အဂဲးဘဲၫယီၩ နၥံၪမိဘီၪ ထၪ့ယီၫထၪ့အ့ၬ.",
			"13": "<sup>13</sup> မွဲလါနၫ့တၭ, စယ့ၫရဘိအၫ့ဒုၭအီၪထၪ့ ၦခိၭၥူၪဆၧ ဂဲၫထၪ့လၧအဝ့ၫၥံၪအလးခဲၫ့လခီၫ, အခိးမွဲအဝ့ၫၥံၪ အီၪလၧၦယုဒၫဖိၪအမ့ၬယၫ, ဒဲၦခိၭၥူၪဆၧအီၪလၧအ",
			"14": "<sup>14</sup> ချိၫ့လခီၫနီၪလီၫ.- ထီးၦယုဒၫဖိၪၥံၪယိထဲၩ့လၧအလး ခဲၫ့တၭ,ယိခွါ, ဆၧဒုၭၥုၭအီၪလၧအမ့ၬယၫဒဲလၧအ ချိၫ့လခီၫဆ့လီၫ. တၭအဝ့ၫၥံၪကိၭထၪ့ယဟိဝၩဒဲၦလု",
			"15": "<sup>15</sup> ဆၧလဖၪအူၪထၪ့ခွ့ၩၥံၪလီၫ.- ထီးနီၪလဖၧၫ့ၦယုဒၫ ဖိၪၥံၪကိၭၡၭထၪ့တၭ, လၧၦယုဒၫဖိၪကိၭၡၭထၪ့အ ဘိၩ့ဘၭနီၪ, ဆၧမၩအၥၭလၧယွၩကျီၪ့စယ့ၫရဘိအၫ့ ဒဲအံၫစရ့လၭထီးအလူၬ လၧစအဘဲယၫ ဒဲယုဒၫအမ့ၬ",
			"16": "<sup>16</sup> ယၫလီၫ.- တၭၦအံၫစရ့လၭဖိၪလဖၪစဲၪ့ဖျိၭလၧယုဒၫ အမ့ၬယၫနီၪ, ဒဲယွၩဖ့ၪလၫ့ဝ့ၫလၧ အဝ့ၫၥံၪအစူၪဖၧၩ့",
			"17": "<sup>17</sup> လီၫ.- တၭစအဘဲယၫဒဲ အၡၩခမျၧးၥံၪမၩၥံၫအဝ့ၫၥံၪ လၧဆၧၥံၫဖၭဒိၪနီၪဆ့လီၫ. အခိးမွဲၦအံၫစရ့လၭဖိၪ လၩ့ထံၩဖါၥံၫဝ့ၫၦၡၩ ရွံန့ဖိၪလဖၪယဲကုၬလီၫ.",
			"18": "<sup>18</sup> အဆၧၫ့အထီနီၪ ၦအံၫစရ့လၭဖိၪ ဘၪဆၧမၩနၧၩ့ မၩစၪတၭ, ၦယုဒၫဖိၪနၧၩ့ဝ့ၫ, အဂဲးဘဲၫယီၩအဝ့ၫၥံၪ ဒိၭနဲၩ့အၥၭလၧယဟိဝၩ အဝ့ၫၥံၪအဖါလဖၪအယွၩ",
			"19": "<sup>19</sup> လီၫ.- စအဘဲယၫလီၩ့ဆီးစယ့ၫရဘိအၫ့တၭ, မၩန့ခွံၬ ဒိၩ့လဖၪ, လၧအစူၪဖၧၩ့, ဘ့ၫၥလၭ ဒဲအတဝၫ့လဖၪ, ယ့ၫၡါနၫ ဒဲအတဝၫ့လဖၪ, ဒဲအံဖြံၫ့ဒဲအတဝၫ့လဖၪ",
			"20": "<sup>20</sup> လီၫ.- လၧစအဘဲယၫအမုနံၩလဖၪနီၪ, စယ့ၫရဘိအၫ့ န့ထဲၩ့ဒီၭအစီၩ့အမၩ့ နးဆိၭအ့ၬ. ယွၩကျီၪ့ဝ့ၫတၭ, ၥံၫဝ့ၫဒၪလီၫ.",
			"21": "<sup>21</sup> တၭစအဘဲယၫ ဆီၪ့ထၪ့လခီၫဒိၪဒိၪလ့ၬ, ဒဲန့အမၫ ၥံၪလဆံၫလံဂၩတၭ, ထၪ့ဖိၪအဖိၪခွၫနံၫဆံၫနံၫဂၩ,ဒဲ အဖိၪမုၪၥံၪလဆံၫဎူၫဂၩလီၫ.",
			"22": "<sup>22</sup> တၭစအဘဲယၫအဆၧမၩဂူၫဂၩလဖၪ, ဒဲအဖၧၩ့ၥၭ ၥံၪ,ဒဲအဆၧချဲၩ့ၥံၪနီၪ, အီၪကွ့ၭအၥၭလၧစအံဒိၫအ လံၬလီၩဖျီၪထၪ့ဆၧအဖၧၩ့နီၪ, မွဲအ့ၬဧၪ. တၭစအဘဲ ယၫမံၫဝ့ၫ လၧအဖါၥံၪအၥိၭတၭ, ၦၡၩခုၪ့လၩ့ဘၧၩ့ ဝ့ၫလၧစဒၫဝံၭအဒိၩ့ဖၧၩ့နီၪလီၫ."
		},
		"14": {
			"1": "<sup>1</sup> တၭအဖိၪခွၫစအၫစၫ ပၧၩ့ဆၧလၧအဝ့ၫဒၪအလး လီၫ. လၧအဝ့ၫဒၪအမုနံၩလဖၪနီၪ, ထံၫၥံၪခးၥံၪအီၪ ရှုၪအီၪမုၬဆံၫနံၪ့လီၫ.",
			"2": "<sup>2</sup> တၭစအၫစၫမၩဆၧလၧအဂ့ၩအဘၪ လၧယဟိဝၩ",
			"3": "<sup>3</sup> အဝ့ၫဒၪအယွၩအမ့ၬၥၪၥံၪအဖၧၩ့လီၫ.- အဂဲးဘဲၫယီၩ အဝ့ၫဒၪမၩန့ခွံၬၦလခီၫဘၩ့မုးဖိၪ အဆၧလုလးလဖၪ, ဒဲလးထၪ့ထီၫလဖၪ, ဒဲမၩခါလၩ့ခွံၬအဆၧဂၩ့ဆၧဖၪ့",
			"4": "<sup>4</sup> လဖၪ,ဒဲခူၬခါလၩ့ခွံၬအၡ့ရိၫၥံၪနီၪး- ဒဲမၪလူၬယုဒၫ လၧအကြၨၭအၪ့ဎၬ ယဟိဝၩအဝ့ၫၥံၪ အဖါလဖၪအ ယွၩနီၪ,ဒဲအဆၧၥီၪ့ဆၧၥၫ့ ဒဲအဆၧမၪလူၬလဖၪနီၪဆ့",
			"5": "<sup>5</sup> လီၫ.- လၧယုဒၫအဒိၩ့လဖၪ ထီးအလူၬအဖၧၩ့နီၪ,အ ဝ့ၫဒၪမၩဂၭဂီၩ့ဆ့အလးထၪ့ထီၫလဖၪ, ဒဲအဆၧဂၩ့ ဆၧဖၪ့တၭ, အဘၩ့အမုးနီၪအီၪရှုၪအီၪမုၬဝ့ၫလၧအ မ့ၬယၫလီၫ.",
			"6": "<sup>6</sup> တၭလၧယုဒၫအဖၧၩ့နီၪ အဝ့ၫမၩထၪ့ဒိၩ့ပဒၩ့ဆၧ လဖၪ,အဂဲးဘဲၫယီၩ ထံၫၥံၪခးၥံၪအီၪပွံၭဝ့ၫ, လၧနံၪ့ လဖၪနီၪဆၧဒုၭၥုၭအီၪဝ့ၫ နးစီၪ့အ့ၬး အဂဲးဘဲၫယီၩ",
			"7": "<sup>7</sup> ယဟိဝၩဖ့ၪလၫ့ယူၭဆၧအီၪပွံၭယူၭလီၫ.- အခိးမွဲအ ဝ့ၫဒၪစံၭယုဒၫနီၪ, မွဲပမၩထၪ့ၡီၩ့ဒိၩ့လဖၪယီၩဆံၭ, ဒဲမၩထၪ့ခိၪဒၧၩ့ၥံၪဝၬဖီၩ့ဝ့ၫ, ဒဲတၨၭထၪ့ထီၫၥံၪ, ဒဲတ ရၫ့ၥံၪ,ဒဲနိၪဘီၩ့ၥံၪတၭ, ထံၫၥံၪခးၥံၪအီၪဒံၭလၧပမ့ၬ ယၫဒံၭ, အဂဲးဘဲၫယီၩ ပအၪ့ဎၬယူၭယဟိဝၩပယွၩ တၭ,ပအၪ့ဎၬဝ့ၫနီၪ, အဝ့ၫဒၪဖ့ၪလၫ့ယူၭပၧၩလၧဆၧ အီၪပွံၭကိၭခီၫဒ့ၭလီၫ. အခိးမွဲအဝ့ၫၥံၪမၩထၪ့ဆၧ",
			"8": "<sup>8</sup> တၭဘီၪထၪ့ယီၫထၪ့ဝ့ၫဒၪလီၫ.- စအၫစၫအီၪလၧၦၥုၭ မုတၭ,အဝ့ၫၥံၪဆိၬထၩ့ဖံၭၥံၪ, ဖၩ့ၥံၪနၭၥံၪတၭ,လၧ ယုဒၫအဖၧၩ့မွဲၦၥၧၫ့ကုၬ, ဒဲလၧဘံၪ့ယမံၫ့အဖၧၩ့, ၦ လၧအဆိၬထၩ့ဖံၭၥံၪ, ဒဲခၭချံၪၥံၪ, မွဲၦနံၫကုၬဎိၭလၬ ၥံၪတၭး ၦလဖၪနီၪ ထီးအလူၬ မွဲၦအၥၭဆီၪ့ဒဲၥၭဒူၩ လီၫ.",
			"9": "<sup>9</sup> ၦကုၡၫဖိၪစဇံရၫလဂၩနီၪ ဂဲၫထၪ့ထၫ့ဒၩအဝ့ၫၥံၪ တၭ,အီၪလၧၦၥုၭမုခမျၧးအၡၩလခွး, ဒဲလဲၪ့ၥုၭလဖၪ",
			"10": "<sup>10</sup> ၥၧၫ့ယၩတၭ,အဝ့ၫၥံၪဂဲၫထီၩ့လၧမၫရၡၫလီၫ.- တၭ စအၫစၫလ့ၩထၪ့ထၫ့ဒၩအဝ့ၫလဂၩနီၪ, အဝ့ၫၥံၪတဲၩ့ ဝဲၩဆၧဒုၭၥုၭလၧဇ့ၭဖၥၫအခိၪလီၩ့ဆူၭဖၧၩ့လၧမၫရ",
			"11": "<sup>11</sup> ၡၫအဂၩ့ထံၭနီၪလီၫ.- စအၫစၫကိၭထၪ့ယဟိဝၩအဝ့ၫ ဒၪအယွၩတၭ, စံၭဝ့ၫဒၪ, ယဟိဝၩဧ့, နမၩဘိၭမၩဆၧၩ့ ဆၧလၧၦၡၩအၪဂၩမွဲဂ့ၩ, လၧၦအစီၩ့အမၩ့လအီၪ ဘၪမွဲဂ့ၩ, လၧနမ့ၬယၫမွဲဆၧနးမံၩ့အ့ၬတၭ, ယဟိဝၩ ပယွၩဧ့, မၩဘိၭမၩဆၧၩ့ပၧၩဆံၭ, အဂဲးဘဲၫယီၩပ ဒိၭနဲၩ့ပၥၭလၧနၧၩ, ဒဲလၧနမံၩ့အကၠီၩ့နီၪ, ပလ့ၩထၪ့ ထၫ့ဒၩၦခမျၧးဖၭဒိၪယီၩလီၫ. ယဟိဝၩဧ့, နမွဲပယွၩ",
			"12": "<sup>12</sup> တၭ,မွဲၦၡၩၥံၪထီးမၩနၧၩ့မၩစၪနၧၩလဂ့ၩ.- အခိးမွဲ ယဟိဝၩကျီၪ့ၥံၫခွံၬၦကုၡၫဖိၪၥံၪ လၧအၫစၫ,ဒဲလၧယု",
			"13": "<sup>13</sup> ဒၫအမ့ၬယၫတၭး ၦကုၡၫဖိၪၥံၪစဲၪ့ဖျိၭဝ့ၫဒၪလီၫ.- စ အၫစၫဒဲၦအီၪလၧအၥိၭလီၩ့ဆီးအဝ့ၫၥံၪ ထီၩ့လၧဂံရၫ တၭ,ၦကုၡၫဖိၪၥံၪဘၪဆၧမၩဂၭဂီၩ့ဝ့ၫတၭ, မၩန့ထဲၩ့ ဒီၭအစီၩ့အမၩ့ၥ့ၪအ့ၬး အဂဲးဘဲၫယီၩ ဘၪဆၧဂၭဂီၩ့ လၧယဟိဝၩအမ့ၬယၫ, ဒဲလၧအဝ့ၫဒၪ အၥုၭမုခမျၧး ၥံၪအမ့ၬယၫနီၪး တၭအဝ့ၫၥံၪဆိၬန့ခွံၬ ဆၧအၪ့ဂူၬဆီၪ့",
			"14": "<sup>14</sup> အၪအၪလ့ၬလီၫ.- တၭအဝ့ၫၥံၪမၩဂၭဂီၩ့ခွံၬကယဲဒိၩ့ လဖၪလၧအအီၪဝၬဖီၩ့ဂံရၫနီၪး အဂဲးဘဲၫယီၩ ယဟိ ဝၩအဆၧၥၭမဲၪအီၪလၧအဝ့ၫၥံၪအလီၩ့လီၫ. တၭမၩ န့ဆၧအၪ့ဂူၬဆီၪ့လဖၪ လၧဒိၩ့ၥံၪထီးအလူၬအဖၧၩ့ နီၪ,အဂဲးဘဲၫယီၩဆၧအၪ့ဂူၬဆီၪ့လၧဒိၩ့ၥံၪနီၪအဖၧၩ့",
			"15": "<sup>15</sup> အီၪဝ့ၫအၪအၪလ့ၬလီၫ.- အဝ့ၫၥံၪကျီၪ့ခွံၬဆ့ဆၧဖိၪ ဆၧဎါအတၩ့ခူၬလဖၪတၭ, ဆိၬန့ခွံၬၥိၪၥံၪဘ့ၪၥံၪ, ဒဲ ကလအူၭၥံၪအၪအၪလ့ၬတၭ, ထဲၩ့ထဲၩ့ဝ့ၫလၧယရုစ လံၫ့လီၫ."
		},
		"15": {
			"1": "<sup>1</sup> ယွၩအၥၭဂဲၫလၩ့လၧစအိဒ့ၭ အဖိၪခွၫစအၭဇရဲအၫ",
			"2": "<sup>2</sup> အလီၩ့တၭး- အဝ့ၫဒၪလ့ၩထၪ့ဒၪဘၪလိၬအၥၭလၧ စအၫစၫတၭး စံၭအဝ့ၫ, စအၫစၫဒဲယုဒၫထီးအလူၬဒဲ ဘံၪ့ယမံၫ့ၥံၪဧ့, ခိၭနၪယၧၩဆံၭ, နၥံၪအီၪလၧယဟိ ဝၩအဘိၩ့ဘၭနီၪ အဝ့ၫဒၪအီၪလၧနၥံၪအၥိၭဆ့, ဒဲနၥံၪ အ့ၪအၪ့ဎူၫအၪ့ဎၬအဝ့ၫတၭ, မိဒၪဘၪအဝ့ၫဒၪဆ့, အ့ၪ မွဲနၥံၪအ့ၪခွံၬၡိၭခွံၬ အဝ့ၫနီၪတၭ, အဝ့ၫမိခွံၬၡိၭခွံၬန",
			"3": "<sup>3</sup> ၥံၪဆ့လီၫ.- အဆၧၫ့အထီယံၬယံၬယူၭတၭ, အံၫစရ့ လၭအယွၩအတီၩအလီၩ့အီၪအ့ၬး ဒဲၦလုဆၧလၧအ",
			"4": "<sup>4</sup> ၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့ဝ့ၫ, ဒဲဆၧၥီၪ့ဆၧၥၫ့နီၪအီၪဆ့အ့ၬး- မွဲ လါနၫ့ဘိၩထီးအဝ့ၫၥံၪ အ့ၪအီၪလၧဆၧကၪဆၧဂဲၩအ ဖၧၩ့အဘိၩ့ဘၭတၭ, အ့ၪကၠၪထဲၩ့အၥၭလၧယဟိဝၩ အံၫစရ့လၭအယွၩအအီၪနီၪ, ဒဲအၪ့ဎူၫအၪ့ဎၬအဝ့ၫ",
			"5": "<sup>5</sup> တၭ,ဒၪဘၪအဝ့ၫဆ့လီၫ.- လၧအဆၧၫ့အထီလဖၪနီၪ, လၧၦလ့ၩထၪ့လၧခီၫ့မွဲဂ့ၩ, ၦလၧအဂဲၫနုၬအဂးမွဲဂ့ၩ, အဆၧဘၪလိၬအိၭလိၬအီၪအ့ၬး အ့ၪမွဲဆၧခိဆၧဝီၩ ဖၭဒိၪအီၪလၧထံၫၥံၪခးၥံၪ အၡၩလဖၪ ထီးအလူၬအ",
			"6": "<sup>6</sup> လီၩ့လီၫ.- ၦလဆၨၩမၩဂၭဂီၩ့ၦလဆၨၩဒၪ, ဒဲလဒိၩ့ နီၪမၩဂၭဂီၩ့လဒိၩ့ဒၪး အဂဲးဘဲၫယီၩ ယွၩမၩၡၪ့မၩ",
			"7": "<sup>7</sup> နၭဝ့ၫလၧဆၧခိဆၧဝီၩထီးအလူၬလီၫ.- ဆၧမၩအၥၭ ဘဲၫနီၪတၭ, အီၪဆီၪ့ထၪ့နၥံၪဝ့ၫတၭ, မွဲနၥံၪအစူၪလဖၪ ထီးလၩ့ဆါထဲၩ့လဂ့ၩ,ဧီၪး အဂဲးဘဲၫယီၩနၥံၪအဆၧ ဖံၭဆၧမၩမိအီၪလၧအလံၩ့အလဲၫလီၫ.",
			"8": "<sup>8</sup> ထီးစအၫစၫနါဂၧၫ့ ဆၧချဲၩ့လဖၪနီၪ, ဒဲမီၪစအိဒ့ၭ အဆၧချဲၩ့လၧမီၪအချိၬတၭ, အၥၭဆီၪ့ထၪ့ဒူၩထၪ့တၭ, အီၪက့ၪခွံၬကယဲဆၧဂၩ့ဆၧဖၪ့ ၥၭလိၪလဖၪလၧခးယု ဒၫ,ဒဲလၧဘံၪ့ယမံၫ့ထီးအလူၬအဖၧၩ့ ဒဲလၧဒိၩ့လဖၪ လၧအမၩန့ခွံၬဝ့ၫ လၧအံဖြံၫ့အခိၪလီၩ့နီၪဆ့တၭး ယဟိ ဝၩအဆၧလုအလးလၧ အအီၪဝ့ၫလၧယဟိဝၩအထိၬ",
			"9": "<sup>9</sup> ချိၫ့အမ့ၬယၫနီၪ, မၩထၪ့ထဲၩ့ဝ့ၫဒၪလီၫ.- တၭအဝ့ၫဒုၭ အီၪကီၪ့ယုဒၫ ဒဲဘံၪ့ယမံၫ့ထီးအလူၬး ဒဲၦမွံၩလၧအံ ဖြံၫ့,ဒဲလၧမနၭစ့ၫ, ဒဲလၧစံမအၧၫ့လဖၪ အီၪလၧအဝ့ၫ ၥံၪအၥိၭဆ့း အဂဲးဘဲၫယီၩ ထီးအဝ့ၫၥံၪ ဒၪဘၪလၧယ ဟိဝၩအဝ့ၫဒၪအယွၩ အီၪလၧအၥိၭတၭ, ဂဲၫလၧအ",
			"10": "<sup>10</sup> အီၪအၪအၪလ့ၬဆ့လီၫ.- အခိးမွဲလၧအဘၪစအၫစၫ ကဲၪစဎွၩလဆံၫယဲနံၪ့လနံၪ့ ဒဲလၩၥၧၫ့ဘံၪ့လဘံၪ့နီၪ,",
			"11": "<sup>11</sup> အဝ့ၫၥံၪအီၪကီၪ့လၧယရုစလံၫ့အဖၧၩ့လီၫ.- အဆၧၫ့ အထီနီၪအဝ့ၫၥံၪလုထၪ့ ယဟိဝၩလၧဆၧအၪ့ဂူၬန့ဆီၪ့ လၧအဂဲၫဆိၬဝ့ၫနီၪ, ချီဖၫၥံၪနွ့ၫယၩ, ဒဲၥိၪၥံၪဘ့ၪၥံၪနွ့ၫ",
			"12": "<sup>12</sup> ထီၫ့လီၫ.- တၭအဝ့ၫၥံၪအုၩ့လၩ့လိၬအၥၭ လၧအမိအၪ့ ဎူၫအၪ့ဎၬယဟိဝၩ အဝ့ၫၥံၪအဖါလဖၪအယွၩနီၪ,လၧ အၥၭထၧၫ့ဖျိၪ့ယၫ, ဒဲလၧအၥၭၡီၩ့ ထီးအလူၬတၭး",
			"13": "<sup>13</sup> ထီးဒၪၦလဂၩလါလါ လၧအလမိအၪ့ဎူၫအၪ့ဎၬဘၪ ယဟိဝၩ အံၫစရ့လၭအယွၩနီၪ, အဒိၪမွဲဂ့ၩ, အဆံၭ မွဲဂ့ၩ,အမုၪမွဲဂ့ၩ, အခွၫမွဲဂ့ၩ မိဘၪဆၧမၩၥံၫဝ့ၫလီၫ.",
			"14": "<sup>14</sup> အဝ့ၫၥံၪဆိၪလၩ့အၥၭ လၧယဟိဝၩလၧအလူၥီၫဖၭ ဒိၪ,ဒဲလၧဆၧကိၭၡၭထၪ့, ဒဲလၧခွ့ၩၥံၪခဲၫၥံၪဆ့လီၫ.",
			"15": "<sup>15</sup> လၧအဆိၪလၩ့အၥၭအကၠီၩ့နီၪ ယုဒၫထီးအလူၬၥုၪ့ထိၬ ၥၭထိၬဝ့ၫး အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪဆိၪလၩ့အၥၭလၧ အၥၭထၧၫ့ဖျိၪ့ယၫ, ဒဲအၪ့ဎူၫအၪ့ဎၬ ယွၩလၧအဆိၫ့ ဆၧထီးအလူၬတၭ, ဒၪဘၪအဝ့ၫဒၪဆ့တၭး ယဟိဝၩ ဖ့ၪလၫ့အဝ့ၫၥံၪ လၧဆၧအီၪပွံၭဝၬဖီၩ့ဝ့ၫဒၪလီၫ.",
			"16": "<sup>16</sup> တၭစဎွၩအၫစၫနၫ့လၩ့ခွံၬ အမိနးမၫအခၫလၧနးဎွၩ မုၪအလးနီၪ, အဂဲးဘဲၫယီၩ အဝ့ၫမၩထၪ့ဆၧဂၩ့လၧ အၡ့ရိၫအဖၧၩ့တၭး စအၫစၫခူၬခါလၩ့ခွံၬ အဆၧဂၩ့ နီၪ,ယဲးလၩ့ဝ့ၫတၭ, ဆူၬထၪ့ခွံၬဝ့ၫလၧထံၫချိၬကံဒၧၫ့",
			"17": "<sup>17</sup> အနဲၩ့ထံၭနီၪလီၫ.- အ့ၪမွဲဆၧအလးထၪ့ထီၫလဖၪဆၧ မၩန့ခွံၬဝ့ၫလၧအံၫစရ့လၭ အဖၧၩ့အ့ၬး မွဲလါနၫ့ဘိၩ",
			"18": "<sup>18</sup> စအၫစၫအၥၭလၧၫ့ဎွ့ၩဝ့ၫ လဆိၩဒၪအၥၭလီၫ.- အဝ့ၫ ဂဲၫဆိၬန့ဆၧလၧအဖါ အီၪက့ၪဆံၫ့ဎံၪဝ့ၫလဖၪနီၪ, ဒဲ ဆၧလၧအနၫ့ဆါအီၪက့ၪဆံၫ့ဎံၪဝ့ၫဆ့, စ့ၩဒဲထီၫ့ဒဲဖၧၩ့",
			"19": "<sup>19</sup> ၥံၪထွ့ၫၥံၪလၧယွၩအဂံၪ့ဖၧၩ့လီၫ.- တၭဆၧဒုၭၥုၭလ အီၪဘၪထီၩ့လၩ့ စအၫစၫကဲၪစဎွၩ အနံၪ့ၥၧၫ့ဆံၫယဲ နံၪ့လနံၪ့နီၪလီၫ."
		},
		"16": {
			"1": "<sup>1</sup> လၧစအၫစၫကဲၪစဎွၩ အနံၪ့ၥၧၫ့ဆံၫဎူၫနံၪ့လနံၪ့အ ဖၧၩ့နီၪ,စဘၫၡၫအံၫစရ့လၭ အစဎွၩနီၪဂဲၫထၪ့ထၫ့ဒၩ ယုဒၫတၭ, မၩထၪ့ရၫမၫဘဲၫၥိၭ အမိပဒၩ့ၦလၧအစဲၪ့ ထၪ့ခွံၬ,ဒဲလ့ၩနုၬလၧယုဒၫ အစဎွၩအၫစၫအအီၪနီၪ",
			"2": "<sup>2</sup> လီၫ.- ထီးနီၪလဖၧၫ့စအၫစၫဆိၬထၪ့ခွံၬ စ့ၩဒဲထီၫ့လၧ အအီၪဝ့ၫလၧယဟိဝၩအဂံၪ့ အီၪက့ၪကီၪ့ဆၧအလး, ဒဲလၧစဎွၩအဂံၪ့ဖၧၩ့ဆ့တၭ အၪ့မၧၫ့ၦလ့ၩဆိၬဝ့ၫလၧ စံရအၫအစဎွၩ စဘံၫ့ဟၫဒၭအအီၪ လၧအအီၪဝ့ၫလၧ",
			"3": "<sup>3</sup> ဒမၭစကၧၭအဖၧၩ့တၭ, စံၭဝ့ၫဒၪ,- ဆၧအုၩ့လၩ့လိၬ လၧနၧၩဒဲယၧၩ, ဘဲၫအအီၪလၧနဖါဒဲယဖါအၥိၭနီၪ, မွဲအအီၪထၪ့ဘီၪး ယိခွါ, ယဖ့ၪလၫ့ယုနၧၩစ့ၩဒဲထီၫ့ တၭဘဲၫၥိၭအံၫစရ့လၭအစဎွၩ ဘၫၡၫလဂၩနီၪမိစဲၪ့ ထၪ့ခွံၬလၧယၧၩတၭ, လ့ၩဘီၪ, မၩဂၭဂီၩ့ခွံၬဆံၭ.",
			"4": "<sup>4</sup> စဘံၫ့ဟၫဒၭခိၭနၪစဎွၩအၫစၫတၭ, အၪ့မၧၫ့လၩ့အၥုၭ မုခမျၧးအခိၪလဖၪထၫ့ဒုၪဒၩအံၫစရ့ၭလၭအဒိၩ့လဖၪ လီၫ.တၭအဝ့ၫၥံၪမၩဂၭဂီၩ့ အဲယၧၫ့, ဒဲဒၫ့, ဒဲအၫဘ လၭမံၫ့,ဒဲနၭၥလဲၫအဒိၩ့အီၪက့ၪကီၪ့ ဆၧလဖၪထီးအ လူၬလီၫ.",
			"5": "<sup>5</sup> ထီးစဘၫၡၫနါဂၧၫ့ဝ့ၫတၭ, ဆၧမၩအၥၭလၧအမၩ ထၪ့ရၫမၫနီၪ, အီၪထီဝ့ၫဒဲမၩလၧၩ့အဆၧမၩနီၪအ့ၬ.",
			"6": "<sup>6</sup> ထီးနီၪလဖၧၫ့ စအၫစၫမၩန့ယုဒၫထီးအလူၬတၭ,အ ဝ့ၫၥံၪဆိၬခွံၬလိးလဖၪ, ဒဲအၥံၪ့လၧစဘၫၡၫမၩထၪ့ရၫ မၫနီၪ, စအၫစၫမၩထၪ့ဂံဘၫဒဲ မံစပၫလၧဆၧနီၪလဖၪလီၫ.",
			"7": "<sup>7</sup> လၧအဆၧၫ့အထီနီၪ မီၪစဟၫနနဲၫဂဲၫလၧယုဒၫအ စဎွၩအၫစၫအအီၪတၭ, စံၭအဝ့ၫနီၪလၧနဒိၭနဲၩ့နၥၭ လၧစံရအၫအစဎွၩအကၠီၩ့နီၪ, လဒိၭနဲၩ့ဘၪနၥၭလၧ ယဟိဝၩနယွၩနီၪ, အခိးမွဲဘဲၫနီၪတၭ, စံရအၫအစဎွၩ",
			"8": "<sup>8</sup> အၥုၭမုခမျၧးနီၪဂၭဖျ့ၭလၧ နစူၪဖၧၩ့လီၫ.- တၭၦကုၡၫ ဖိၪၥံၪဒဲလုဘံၫ့ဖိၪၥံၪ မွဲၦခမျၧးဖၭဒိၪ, အီၪလၧလဲၪ့ၥုၭ ၥံၪအၪအၪလ့ၬ, ဒဲၦထူၬကၥ့ၪလဖၪဆ့, မွဲအ့ၬဧၪ. မွဲလါ နၫ့ဘိၩ, လၧနဒိၭနဲၩ့နၥၭ လၧယဟိဝၩအစူၪဖၧၩ့အ ကၠီၩ့တၭ, အဝ့ၫဒၪဖ့ၪလၫ့ခွံၬ ၦလဖၪနီၪလၧနစူၪဖၧၩ့",
			"9": "<sup>9</sup> လီၫ.- အဂဲးဘဲၫယီၩ ယဟိဝၩအမ့ၬၥၪၥံၪလ့ၩဝံၩ့ဝၩ့ လၧဂၪ့ခိၪချိၫ့ယီၩ ဎံၩ့ဎံၩ့လ့ၬနီၪ, ဘဲၫၥိၭအမိနဲၪလၧ အနၫ့ဆါဆီၪ့လၧကယဲၦလၧ အၥၭလၧၫ့ဎွ့ၩလၧယွၩအ ဖၧၩ့အဂးလီၫ. လၧဆၧယီၩလမံၩ့အကၠီၩ့တၭ, နမၩ ဘဲၫၦဂီၩ့ဖိၪအၥိၭနီၪလီၫ. အခိးမွဲဘဲၫနီၪတၭ, လၧယၫ လခီၫနီၪ, နမိအီၪလၧဆၧဒုၭၥုၭလဖၪလီၫ.",
			"10": "<sup>10</sup> ထီးနီၪလဖၧၫ့ စအၫစၫၥၭထၪ့ မီၪလဂၩနီၪဒူၭလၩ့ ဝ့ၫလၧထီၫ့ဖၧၩ့း အဂဲးဘဲၫယီၩအၥၭခိထၪ့ဖၭဒိၪလၧ ဆၧနီၪလမံၩ့အကၠီၩ့လီၫ. တၭအဆၧၫ့အထီနီၪ စအၫ စၫမၩၡၪ့မၩနၭၦၡၩခမျၧး လနၩ့နၩ့ဆ့လီၫ.",
			"11": "<sup>11</sup> တၭယိခွါ, စအၫစၫအဆၧမၩလဖၪ, လၧအခၪ့ထံၭ ထီးအထုၬနီၪ,ယိခွါ, အီၪကွ့ၭအၥၭလၧယုဒၫဒဲအံၫစရ့ လၭအစဎွၩၥံၪအလံၬဖၧၩ့နီၪ, မွဲအ့ၬဧၪ.",
			"12": "<sup>12</sup> လၧစအၫစၫကဲၪစဎွၩ အနံၪ့ၥၧၫ့ဆံၫခွံၫနံၪ့လနံၪ့အ ဖၧၩ့နီၪအခၪ့ဆၫထၪ့တၭ, အဆၧဆၫနီၪဒိၪထၪ့နၭနၭ လ့ၬလါနၫ့နီၪ, လၧအဆၧဆၫအဖၧၩ့, အၪ့ဎၬယဟိဝၩ",
			"13": "<sup>13</sup> အ့ၬ,အ့ၪမွဲအၪ့ဎၬၦၥံၪဆရၫလဖၪနီၪလီၫ.- တၭစအၫ စၫမံၫဝ့ၫလၧအဖါၥံၪအၥိၭတၭ, ၥံၫဝ့ၫလၧအပၧၩ့ဆၧ",
			"14": "<sup>14</sup> အနံၪ့လံဆံၫလနံၪ့အဖၧၩ့နီၪလီၫ.- တၭအဝ့ၫၥံၪခုၪ့လၩ့ ဘၧၩ့ဝ့ၫလၧအၥွၪခိၪဒၪဝ့ၫအဖၧၩ့, လၧအမၩဝဲၩဝ့ၫလၧ အနၫ့ဆါဒၪဝ့ၫအဂး, လၧစဒၫဝံၭအဒိၩ့ဖၧၩ့တၭ,အီၪ က့ၪဝ့ၫလၧလးမံၫအဖၧၩ့, လၧဆၧမၩဎွ့ၩထၪ့ဝ့ၫလၧ ဆၧနၧၫ့မၧၫ့အၪမံၩ့ လၧဆၧလဲၩဎုၬဘဲၫၦလဲၩဎုၬၥံၪအ ၥိၭနီၪလီၫ. တၭအဝ့ၫၥံၪမၩဆၧဆူၭခဲၩထၪ့ဖၭဒိၪလၧ အဝ့ၫဒၪအဂးလီၫ."
		},
		"17": {
			"1": "<sup>1</sup> အဖိၪခွၫစယဟီၡဖၭ ကဲၪထၪ့စဎွၩလၧအလးနီၪ",
			"2": "<sup>2</sup> တၭ,မၩဆီၪ့ထၪ့အၥၭထၫ့ဒၩ အံၫစရ့လၭလီၫ.- အ ဝ့ၫဒၪအီၪက့ၪၥုၭဖိၪၥံၪ လၧယုဒၫအဒိၩ့အီၪလၧ အခိၪ ဒၧၩ့ထီးအလူၬအဖၧၩ့တၭ, အီၪက့ၪလၩ့ၦခိၭဆၧလ ဒီၪ့လဒီၪ့လၧခးယုဒၫအဖၧၩ့, ဒဲလၧအံဖြံၫ့အဒိၩ့ၥံၪအ",
			"3": "<sup>3</sup> ဖၧၩ့လၧအဖါစအၫစၫမၩန့ဝ့ၫလီၫ.- ယဟိဝၩအီၪလၧ စယဟီၡဖၭအၥိၭနီၪ, အဂဲးဘဲၫယီၩအဝ့ၫဖိၬအဖါစဒၫ ဝံၭအဖၧၩ့ၥၭအခၪ့ထံၭလဖၪနီၪတၭ အၪ့ဎၬဘၫအလၭ",
			"4": "<sup>4</sup> လဖၪအ့ၬ.- အ့ၪမွဲအၪ့ဎၬယဟိဝၩ အဖါအယွၩတၭ, လ့ၩဝ့ၫလၧဆၧမၪလူၬအဖၧၩ့တၭ, မၩထွ့ၫအံၫစရ့",
			"5": "<sup>5</sup> လၭအဆၧမၩအခဲၫ့အ့ၬ.- အခိးမွဲယဟိဝၩဒုၭအီၪဂုး အီၪခၧၫ့ဘၩ့မုးနီၪလၧအစူၪဖၧၩ့တၭ, ယုဒၫထီးအလူၬ ဂဲၫဆိၬလၬဆီၪ့လဖၪ လၧစယဟီၡဖၭအအီၪတၭ, အီၪ ဝ့ၫလၧဆၧလူဒိၪဎွ့ၩဒိၪ ဒဲဆၧလၩဆၧဖၩ့အၪအၪလ့ၬ",
			"6": "<sup>6</sup> လီၫ.- အၥၭဆီၪ့ထၪ့ဝ့ၫလၧယဟိဝၩ အဖၧၩ့ၥၭအဖၧၩ့ တၭ,ၥုၭခွံၬဆၧအလးထၪ့ထီၫၥံၪ, ဒဲအၡ့ရိၫၥံၪလၧ",
			"7": "<sup>7</sup> ယုဒၫအဖၧၩ့လီၫ.- တၭလၧအကဲၪစဎွၩၥၧၫ့နံၪ့လနံၪ့ နီၪအၪ့မၧၫ့လၩ့အၦဒိၪဖၭဒိၪၥံၪ, စဘံၫ့ဟၫအံၫလၭ, ဒဲစအိၫဘဒဲအၫ,ဒဲစဇ့ၭခရဲအၫ, ဒဲစနၥၫ့နအ့လၭ,ဒဲစမံၫ ခ့ယၫ ဘဲၫၥိၭအမိၥီၪ့လိၪ ဆၧလၧယုဒၫအဒိၩ့ၥံၪအ",
			"8": "<sup>8</sup> ဖၧၩ့လီၫ.- ၦအီၪလၧအဝ့ၫၥံၪအၥိၭ ၦလံဝဲၫဖိၪၥံၪ,ဒဲစ ၡ့ၫမအဲအၫ ဒဲစန့ၭၥနဲအၫ, ဒဲစဇ့ၭဘဒဲအၫ,ဒဲစအၫစ ဟ့လၭ,ဒဲစၡမံရမီၭ, ဒဲစယဟိနၥၫ့,ဒဲစအၭဒနဲယၫ,ဒဲစ တိၫဘဲယၫ,ဒဲစထိဘၫဒနဲယၫ, ၦလံဝဲၫဖိၪၥံၪတၭ,လၧ အဝ့ၫၥံၪအၥိၭၦလုဆၧလဖၪစအံၫလံၭၡမၫ, ဒဲစယဟိ",
			"9": "<sup>9</sup> ရၫ့လီၫ.- အဝ့ၫၥံၪၥီၪ့လိၪဆၧလၧ ယုဒၫအဖၧၩ့တၭ, ယဟိဝၩအလံၬဆၧၥီၪ့ဆၧၥၫ့ အီၪလၧအဝ့ၫၥံၪအၥိၭ တၭ,လ့ၩဝံၩ့ဝၩ့ လၧယုဒၫအဒိၩ့ ထီးအလူၬအဖၧၩ့ တၭ,ၥီၪ့လိၪၦခမျၧးလီၫ.",
			"10": "<sup>10</sup> ဆၧၥၭမဲၪယဟိဝၩလၩ့ဘၪလၧ ခးၥံၪအၡၩဘၩ့မုး ဖိၪလၧအအီၪဝၬဖီၩ့ယုဒၫတၭ, ဒုၭၥုၭလၧစယဟီၡဖၭ",
			"11": "<sup>11</sup> အ့ၬ.- ၦလၧဖလံၡၫဖိၪအကျၩလဖၪ ဂဲၫဆိၬလၬဆီၪ့ လၧစယဟီၡဖၭအအီၪ, ဖ့ၪလၫ့အခီၫ့စ့ၩတၭ, ၦအရ့ ဘၠၫဖိၪဂဲၫဆိၬန့ဝ့ၫလၧၥိၪၥံၪဘ့ၪၥံၪ, ၥိၪဖၫနွ့ၫထီၫ့နွ့ၫ",
			"12": "<sup>12</sup> ယၩ,ဒဲဘ့ၪဖၫနွ့ၫထီၫ့နွ့ၫယၩလီၫ.- စယဟီၡဖၭဒိၪ ထၪ့,ဒိၪထၪ့တၭ, ၥုၪ့ထၪ့ထိၬၥံၪဒဲဒိၩ့ၥံၪအီၪက့ၪထၬ",
			"13": "<sup>13</sup> ဆၧလၧယုဒၫအဖၧၩ့လီၫ.- အဆၧမၩအၪအၪလ့ၬအီၪ ဝ့ၫလၧယုဒၫအဒိၩ့ၥံၪအဖၧၩ့တၭ, ၦၥုၭဖိၪ, ဒဲၦအဒိၪ အဆီၪ့အီၪဝ့ၫလၧယရုစလံၫ့အဖၧၩ့လီၫ.",
			"14": "<sup>14</sup> တၭအယီၩမွဲအဆၧဝံထၪ့နၬထၪ့ ဘဲၫအဖါၥံၪအဂံၪ့ လဖၪအၥိၭလီၫ. လၧယုဒၫအကျၩ ၦအထီၫ့ၥံၪအခိၪ လဖၪနီၪး စအၭဒနၫမွဲအခိၪတၭ, ၦအဆီၪ့အီၪလၧအ",
			"15": "<sup>15</sup> ၥိၭၥၧၫ့ကုၬလီၫ.- တၭဆၧအခိၪစယဟိဟနၫ့အီၪလၧ အစူၪဖၧၩ့တၭ, ၦအီၪလၧအဝ့ၫဒၪအၥိၭနံၫကုၬဎိၭလၬ",
			"16": "<sup>16</sup> လီၫ.- တၭစဇံၭခြဲၫအဖိၪခွၫ စအၫမဇဲအၫ လၧအဖ့ၪ လၫ့ဒၪအၥၭ လၧယဟိဝၩလဂၩ အီၪလၧအဝ့ၫအစူၪ ဖၧၩ့တၭ,ၦအဒိၪအဆီၪ့ အီၪလၧအဝ့ၫဒၪအၥိၭနံၫကုၬ",
			"17": "<sup>17</sup> လီၫ.- တၭလၧဘံၪ့ယမံၫ့အကျၩနီၪ ၦအဒိၪအဆီၪ့ စအံၫလဲအဒၫ, ၦအီၪလၧအစူၪဝဲၩ, ဒဲချံၪ, ဒဲထၩ့ဖံၭၥံၪ",
			"18": "<sup>18</sup> အီၪလၧအဝ့ၫဒၪအၥိၭနံၫကုၬလီၫ.- စယဟီဇဘၭအီၪ လၧအစူၪဖၧၩ့တၭ, ၦလၧအတဲၩ့ဝဲၩအၥၭလၧဒုၭဆၧ",
			"19": "<sup>19</sup> အဂးအီၪလၧအဝ့ၫဒၪအၥိၭ လကုၬဎိၭလၬလီၫ.- အဝ့ၫ ၥံၪမွဲၦလၧအမၩစဎွၩအဆၧး လၧနီၪအမ့ၬယၫၦလၧ စဎွၩအီၪက့ၪဝဲၩဝ့ၫလၧ ဒိၩ့အီၪလၧအခိၪဒၧၩ့ၥံၪလၧယု ဒၫထၧၫ့ဘံၪ့ယၫအဖၧၩ့အီၪဝ့ၫလီၫ."
		},
		"18": {
			"1": "<sup>1</sup> တၭစယဟီၡဖၭအီၪဝ့ၫလၧ ဆၧလူဒိၪဎွ့ၩဒိၪ,ဒဲဆၧ လၩဆၧဖၩ့အၪအၪလ့ၬတၭ, မၩအၥိၭလၧစအၫဟၭ",
			"2": "<sup>2</sup> လီၫ.- လၧနံၪ့လဖၪနီၪအလးခဲၫ့လ့ၩလၩ့လၧစအၫဟၭ အီၪလၧစမ့ရအၫအဖၧၩ့တၭ, စအၫဟၭ မၩၥံၫၥိၪၥံၪ ဘ့ၪၥံၪဒဲချီဖၫၥံၪ လၧအဂးအၪအၪလ့ၬ ဒဲလၧၦခမျၧး လၧအအီၪလၧအၥိၭအဂးတၭ, ပဂၨၪထၪ့အဝ့ၫဘဲၫ ၥိၭအမိလ့ၩထၪ့လၧအၥိၭ လၧရၫမီၭဂံလအၭနီၪလီၫ.",
			"3": "<sup>3</sup> တၭအံၫစရ့လၭအစဎွၩအၫဟၭ, စံၭယုဒၫအစဎွၩယ ဟီၡဖၭနီၪ, မွဲနမိလ့ၩဆၧလၧယၥိၭလၧရၫမီၭဂံလအၭ နီၪဆ့ဧၪ. တၭအဝ့ၫဒၪစံၭဆၧၫ့ဝ့ၫ ယဝ့ၫဒၪယီၩယမွဲ ဘဲၫနၥိၭ, ယၡၩခမျၧးဘဲၫနၡၩခမျၧးအၥိၭတၭ, ပမိ အီၪလၧနၥိၭလၧဆၧဒုၭၥုၭအဖၧၩ့လီၫ.",
			"4": "<sup>4</sup> တၭစယဟီၡဖၭစံၭအံၫစရ့လၭအစဎွၩ, အၪ့စၪ့လါ",
			"5": "<sup>5</sup> လၧယဟိဝၩအလူလၧမုဆၫလနံၩယီၩဆံၭ.- တၭအံၫ လၭအစဎွၩဒုၭအီၪကိၩ့အီၪကီၪ့မီၪၥံၪး ၦလံယၩတၭ, စံၭအဝ့ၫၥံၪ, မွဲပမိဘၪလ့ၩဒုၭၥုၭ လၧရၫမီၭဂံလအၭ နီၪဆ့ဧၪ, မွဲပဘၪအီၪထးလဲၪး တၭအဝ့ၫၥံၪစံၭ, လ့ၩ ထၪ့ဆံၭ. အဂဲးဘဲၫယီၩ ယဟိဝၩမိဖ့ၪလၫ့ခွံၬဝ့ၫလၧ စဎွၩအစူၪဖၧၩ့လီၫ.",
			"6": "<sup>6</sup> တၭစယဟီၡဖၭစံၭဝ့ၫဒၪ, ယဟိဝၩအမီၪလၧပမိ အၪ့စၪ့ဆၧလၧအဝ့ၫ, မွဲအအီၪထီးယီၩနးဂၩအ့ၬဧၪ.",
			"7": "<sup>7</sup> တၭအံၫစရ့လၭအစဎွၩစံၭစယဟီၡဖၭ, ၦလၧပမိအၪ့ စၪ့ဘၪဆၧလၧယဟိဝၩနီၪအီၪဒံၭလဂၩ, စအံၫမလၫ အဖိၪခွၫစမံၫခ့ယၫလီၫး မွဲလါနၫ့ဘိၩ ယၥၭဂဲၫ့အဝ့ၫ လီၫ.အဂဲးဘဲၫယီၩချဲၩ့ဆၧလၧ မီၪအချိၬအဂ့ၩအဘၪ လၧယဂဲးယကၠီၪ့နီၪနးဆိၭအ့ၬ, မွဲဆၧအၧၩ့ကိၭမုနံၩ မုနၩဒ့ၭလီၫ. တၭစယဟီၡဖၭစံၭဝ့ၫဒၪ, မွဲစဎွၩထီး စံၭဘဲၫနီၪလဂ့ၩ.",
			"8": "<sup>8</sup> အံၫစရ့လၭအစဎွၩကိၭန့ၦဒိၪလဂၩတၭ, စံၭဝ့ၫဒၪ,",
			"9": "<sup>9</sup> ဒုၭဂဲၫစအံမလၫအဖိၪခွၫစမံၫခ့ယၫ ချဲၫ့ချဲၫ့ဆံၭ.- တၭ အံၫစရ့လၭအစဎွၩဒဲယုဒၫအစဎွၩ ယဟီၡဖၭ,လုၬထၪ့ အဝိၬလိၫ့ၥံၪဆၧၫ့နၩ့လဂၩ လၧအလးဆီၩ့ဆီ, လဂၩ လၧအလးဆီၩ့ဆီ, လၧအလးထီးဆၧလ့ၩနုၬလၧစမ့ ရအၫအတရၫ့ဖၧၩ့နီၪတၭ, မီၪထီးအလူၬချဲၩ့ဆၧလၧ",
			"10": "<sup>10</sup> မီၪအချိၬလၧအဝ့ၫၥံၪအမ့ၬယၫလီၫ.- စခံၫနၫအၫနၫအ ဖိၪခွၫ,စဇ့ၭဒကဲအၫလဂၩမၩဆၧနိၩ့ထၭလဖၪလၧအ ဂးတၭ, စံၭဝ့ၫဒၪယဟိဝၩစံၭဘဲၫယီၩ, နမိဘျႃၪ့ၦစံရ အၫဖိၪလၧဆၧလဖၪယီၩ ထီးနမၩလူၬခွံၬ အဝ့ၫၥံၪ",
			"11": "<sup>11</sup> လီၫ.- တၭမီၪထီးအလူၬၥံၪချဲၩ့ဆၧလၧမီၪအချိၬဘဲၫ နီၪအၥိၭတၭ, စံၭဝ့ၫဒၪ, လ့ၩထၪ့လၧရၫမီၭဂံလအၭ တၭ,ဘီၪထၪ့ယီၫထၪ့ဆံၭ. အဂဲးဘဲၫယီၩ ယဟိဝၩမိ ဖ့ၪလၫ့ခွံၬဝ့ၫလၧစဎွၩအစူၪဖၧၩ့လီၫ.",
			"12": "<sup>12</sup> အၥီၫ့လၧအလ့ၩကိၭန့စမံၫခ့ယၫ လဂၩနီၪချဲၩ့ဆၧ လၧအဝ့ၫတၭ, စံၭဝ့ၫဒၪ,ယိခွါ, မီၪၥံၪအဆၧချဲၩ့မွဲဆၧ အဂ့ၩလၧစဎွၩအဂး လၧအနိၭလဖၧၫ့ဎးလီၫ. အခိးမွဲ ဘဲၫနီၪတၭ မွဲနဆၧချဲၩ့မၩလါအၥၭဘဲၫ ၦလၧအဝ့ၫၥံၪ အကျၩလဂၩအဆၧချဲၩ့အၥိၭနီၪတၭ, ချဲၩ့ဆၧအဂ့ၩ",
			"13": "<sup>13</sup> ဆံၭ.- တၭစမံၫခ့ယၫလဂၩစံၭဝ့ၫဒၪ, ယဟိဝၩမၧၫ့ဝ့ၫ တၭ,ဆၧလၧယယွၩစံၭယၧၩနီၪ, ယမိချဲၩ့ဆၧနီၪ",
			"14": "<sup>14</sup> လီၫ.- ဂဲၫဝ့ၫလၧစဎွၩအအီၪတၭ, စဎွၩစံၭဝ့ၫ, စမံၫခ့ ယၫဧ့,ပမိလ့ၩထၪ့ဒုၭၥုၭထၫ့ဒၩ ရၫမီၭဂံလအၭနီၪဆ့ ဧၪ,မွဲပဘၪအီၪထးလဲၪ. အဝ့ၫစံၭဆၧၫ့ဝ့ၫ, လ့ၩထၪ့ တၭ,ဘီၪထၪ့ယီၫထၪ့ဆံၭ. တၭဆၧမိဖ့ၪလၫ့ခွံၬအဝ့ၫ",
			"15": "<sup>15</sup> ၥံၪလၧနၥံၪအစူၪဖၧၩ့လီၫ.- တၭစဎွၩစံၭဝ့ၫ, ဘဲၫၥိၭနမိ စံၭယၧၩန့ၫဆၧမွဲဆၧတီၩ လၧယဟိဝၩအမံၩ့နီၪ,မွဲယ",
			"16": "<sup>16</sup> မိဘၪဒုၭဆိၪလၩ့နၥၭဎွ့ဖၧၫ့လဲၪ.- ထီးနီၪလဖၧၫ့အဝ့ၫ ဒၪစံၭဝ့ၫ, ယဒၪဘၪအံၫစရ့လၭ ထီးအလူၬလၩ့ပြံၩ လၩ့ပၩလၧခိၪလီၩ့အဒၩ့ခိၪ, ဘဲၫၥိၪလၧၦယိၥိၪလအီၪ ဘၪအၥိၭနီၪ, ယဟိဝၩစံၭဝ့ၫဒၪ, အဝ့ၫၥံၪအကဆါ အီၪအ့ၬ.မွဲၦထဲၩ့ထဲၩ့လဂၩ လၧအဂံၪ့ဒၪဝ့ၫ,လဂၩလၧ",
			"17": "<sup>17</sup> အဂံၪ့ဒၪဝ့ၫမုၬမုၬဆံၭ.- တၭအံၫစရ့လၭအစဎွၩစံၭစ ယဟီၡဖၭ, ယစံၭနၧၩလၧအဝ့ၫမိချဲၩ့ဆၧလၧမီၪအချိၬ လၧဆၧအဂ့ၩလၧယဂးအ့ၬး မွဲလၧဆၧအၧၩ့လခီၫနီၪ,",
			"18": "<sup>18</sup> မွဲအ့ၬဧၪ.- အဝ့ၫဒၪစံၭဒီၭဝ့ၫ, မၩအၥၭဘဲၫနီၪတၭ,ခိၭ နၪယဟိဝၩအလူဆံၭ. ယဒၪဘၪ ယဟိဝၩဆၧၫ့နၩ့ လၧအလးဆီၩ့ဆီတၭ, မူၭခိၪအၥုၭမုခမျၧးထီးအလူၬ ဆၧၫ့ထုၪ့လၧအစူၪထွ့ၪလခီၫ, ဒဲလၧအစူၪစ့ၪလခီၫ",
			"19": "<sup>19</sup> လီၫ.- ယဟိဝၩစံၭဝ့ၫဒၪ, မွဲပလၫမိအၪ့လွ့ၫန့အံၫစရ့ လၭအစဎွၩစအၫဟၭ, ဘဲၫၥိၭအမိလ့ၩထၪ့တၭ, လၩ့ ထံၩဖါလၧရၫမီၭဂံလအၭ အဖၧၩ့လဂၩလဲၪ. တၭလ",
			"20": "<sup>20</sup> ဂၩစံၭဝ့ၫဘဲၫအံၩ, လဂၩစံၭဝ့ၫဘဲၫအိၩလီၫ.- ထီးနီၪ လဖၧၫ့ၥၭလဂၩဂဲၫထၪ့ဆၧၫ့ထုၪ့ လၧယဟိဝၩအမ့ၬ",
			"21": "<sup>21</sup> ယၫတၭ,စံၭဝ့ၫဒၪ, ယမိအၪ့လွ့ၫန့အဝ့ၫလီၫ.- ယဟိ ဝၩစံၭအဝ့ၫ,လၧဆၧနီၪလမံၩ့လဲၪ. တၭအဆၧစံၭဝ့ၫ, ယမိလ့ၩထၪ့ကဲၪထၪ့ၥၭအဘျံၭအဘျၪ လၧမီၪၥံၪထီး အလူၬအနိၭဖၧၩ့လီၫ. အဆၧစံၭဝ့ၫဒၪ, နမိအၪ့လွ့ၫန့ အဝ့ၫတၭ,မၩနၧၩ့ဆၧဆ့လီၫ. လ့ၩထၪ့တၭ, မၩဘဲၫ",
			"22": "<sup>22</sup> နီၪဆံၭ.- တၭဘိၩ့နဲၪ့ယီၩ,ယိခွါ, ယဟိဝၩအီၪက့ၪအ ၥၭအဘျံၭအဘျၪလၧမီၪၥံၪထီးအလူၬယီၩ အနိၭဖၧၩ့ တၭ,ယဟိဝၩချဲၩ့အၧၩ့ဆၧထၫ့ဒုၪဒၩနၧၩလီၫ.",
			"23": "<sup>23</sup> စခံၫနၫအၫနၫ အဖိၪခွၫစဇ့ၭဒကဲအၫ ၥုၭဘူၭအၥၭ တၭ,ဒဲၩစမံၫခ့ယၫလၧအနိၭပၩထံၭတၭ, စံၭဝ့ၫဒၪ,ဘဲၫ ၥိၭအမိချဲၩ့ဆၧလၧနၧၩတၭ, ယဟိဝၩအၥၭစဲၪ့ထၪ့",
			"24": "<sup>24</sup> လၧယအီၪခီၫခီၫလဲၪ.- တၭစမံၫခ့ယၫစံၭဝ့ၫဒၪ,ယိခွါ, မုလနံၩလၧနမိလ့ၩနုၬ လၧဒူၭလၧအဖၧၩ့လခီၫလဒူၭ, ဘဲၫၥိၭနမိအီၪက့ၪၥူၪနၥၭနီၪ, နမိၥ့ၪယၫဘၪလီၫ.",
			"25": "<sup>25</sup> ထီးနီၪလဖၧၫ့ အံၫစရ့လၭအစဎွၩစံၭဝ့ၫဒၪ, မၩန့ စမံၫခ့ယၫတၭ, ဆိၬထဲၩ့လၧဒိၩ့အခိၪစအၫမၧၫ့အအီၪ",
			"26": "<sup>26</sup> ဒဲလၧစဎွၩအဖိၪခွၫစယိအၭအအီၪး- တၭစံၭ, စဎွၩ စံၭဘဲၫယီၩ,အီၪက့ၪၦလဂၩယီၩ လၧထီၫ့ဖၧၩ့တၭ,လု အၪ့လုအီၩဝ့ၫလၧဆၧၡၪ့ဆၧနၭအကိၪ, ဒဲဆၧၡၪ့ဆၧ",
			"27": "<sup>27</sup> နၭအထံၫထီးယဂဲၫထဲၩ့ထဲၩ့မုၬမုၬဆံၭ.- တၭစမံၫခ့ ယၫစံၭဝ့ၫဒၪ, နအ့ၪဂဲၫထဲၩ့မုၬမုၬတၡါတၭ, ယဟိဝၩ ချဲၩ့ဆၧၫ့ဆၧလၧယၧၩအ့ၬ. တၭအဝ့ၫဒၪစံၭဝ့ၫ, ၦခ မျၧးၥံၪဧ့, ခိၭနၪကိၭအဂၩဒ့ၭဆံၭ.",
			"28": "<sup>28</sup> တၭအံၫစရ့လၭအစဎွၩ, ဒဲယုဒၫအစဎွၩယဟီၡဖၭ",
			"29": "<sup>29</sup> လ့ၩထၪ့လၧရၫမီၭဂံလအၭလီၫ.- တၭအံၫစရ့လၭအ စဎွၩစံၭစယဟီၡဖၭ, ယမိမၩလၩ့မဲၩယၥၭတၭ,လ့ၩ နုၬလၧဆၧဒုၭၥုၭအဖၧၩ့လီၫ. အ့ၪမွဲနဝ့ၫဒၪယီၩလုၬ ထၪ့နဝိၬလိၫ့ဆံၭ. အံၫစရ့လၭအစဎွၩ မၩလၩ့မဲၩအ",
			"30": "<sup>30</sup> ၥၭတၭ,လ့ၩနုၬလၧဆၧဒုၭၥုၭအဖၧၩ့လီၫ.- စံရအၫအ စဎွၩမၪလူၬအလဲၪ့ၥုၭအခိၪၥံၪတၭ, စံၭဝ့ၫဒၪ,အဒိၪမွဲ ဂ့ၩ,အဆံၭမွဲဂ့ၩ,ဒုၭလဂ့ၩ. ဒုၭန့ၫအံၫစရ့လၭအစ",
			"31": "<sup>31</sup> ဎွၩလဂၩနီၪဆံၭ.- ထီးလဲၪ့ၥုၭအခိၪၥံၪဒၪဘၪစယဟီ ၡဖၭတၭ, ဆၧမၩအၥၭလၧအစံၭဝ့ၫဒၪ, မွဲဝ့ၫလၧအံၫ စရ့လၭအစဎွၩလီၫ. အခိးမွဲဝၩ့ထၬဝ့ၫဘဲၫၥိၭအမိဒုၭ ဆၧလၧအဝ့ၫတၭ, စယဟီၡဖၭကိၭထၪ့ဆၧနီၪ,ယဟိ ဝၩမၩဆၧၩ့ဝ့ၫတၭ, ယွၩဒုၭကၠၪခွံၬအဝ့ၫၥံၪလၧအအီၪ",
			"32": "<sup>32</sup> လီၫ.- ထီးလဲၪ့ၥုၭအခိၪၥံၪ ဒၪဘၪဝ့ၫလၧအလမွဲဘၪ အံၫစရ့လၭအစဎွၩတၭ, ဆၧမၩအၥၭလၧအထဲၩ့က",
			"33": "<sup>33</sup> ဒၩထဲၩ့လၧအလီၩ့ဆီးဝ့ၫနီၪလီၫ.- တၭၦလဂၩခၭကြၩ့ ဆၧလထံၪတၭ, ဘၪအံၫစရ့လၭအစဎွၩလၧအဆဲၫ့ ၥုၭအဆၧၫ့တၭ, အဝ့ၫစံၭအလဲၪ့ၥုၭအခိၪ, ကၠၪထဲၩ့န စူၪတၭ,ဆိၬထၪ့ခွံၬယၧၩ လၧၦၥုၭမုအကျၩဆံၭ. အ",
			"34": "<sup>34</sup> ဂဲးဘဲၫယီၩ ဆၧခၭဘၪယၧၩနုၬဝ့ၫလီၫ.- ဆၧဒုၭၥုၭ ဆီၪ့ထၪ့လၧမုလနံၩနီၪတၭ, ၦဒုၭဒိၭနဲၩ့စဎွၩလၧလဲၪ့ ၥုၭအဖၧၩ့ ထၫ့ဒၩစံရအၫဖိၪ ထီးမုဂၪလၩ့တၭ, ထီးမု လၩ့နုၬနီၪၥံၫဝ့ၫဒၪလီၫ."
		},
		"19": {
			"1": "<sup>1</sup> တၭယုဒၫအစဎွၩ စယဟီၡဖၭထဲၩ့ထဲၩ့ဝ့ၫလၧအ",
			"2": "<sup>2</sup> ဂံၪ့မုၬမုၬလၧယရုစလံၫ့အဖၧၩ့လီၫ.- တၭၦဒၪဆၧလၧ ယၫစဟၫနနဲၫအဖိၪခွၫ စယံဟုၫလ့ၩအၪ့ဂၬဝ့ၫတၭ, စံၭစဎွၩယဟီၡဖၭ, နကြၨၭမၩဆၧၩ့ ၦလတီၩလလီၩ့ ဘၪ,ဒဲအဲၪၦလၧအၥၭဂဲၫ့ယဟိဝၩနီၪဧၪ. အခိးမွဲဆၧ ၥၭထၪ့ဘၪနၧၩ လၧယဟိဝၩအမ့ၬယၫ လၧဆၧနီၪအ",
			"3": "<sup>3</sup> ကၠီၩ့လီၫ.- မွဲလါနၫ့တၭ ဆၧဒၪန့ဆၧအဂ့ၩလဖၪလနၩ့ နၩ့လၧနဖၧၩ့လီၫ. အဂဲးဘဲၫယီၩနမၩဂၭဂီၩ့ခွံၬအၡ့ ရိၫလဖၪလၧခးဖၧၩ့တၭ, နတဲၩ့ဝဲၩယူၭနၥၭဘဲၫၥိၭနမိ အၪ့ဎၬယဟိဝၩယူၭ.",
			"4": "<sup>4</sup> စယဟီၡဖၭအီၪဝ့ၫလၧယရုစလံၫ့အဖၧၩ့တၭ လ့ၩ ထၪ့ဒီၭလၧၦခမျၧးအကျၩ လၧဘံအၧၫၡံဘၫထီၩ့လၧ ခိၪလီၩ့အံဖြံၫ့တၭ, ဒုၭကၠၪလီၩ့ထဲၩ့အဝ့ၫၥံၪလၧယဟိ ဝၩအဝ့ၫၥံၪအဖါလဖၪအယွၩ အအီၪလီၫ.",
			"5": "<sup>5</sup> အဝ့ၫအီၪက့ၪအၡၩစ့ၩရၫ့ခွး လၧထံၫၥံၪခးၥံၪအ ဖၧၩ့လၧဒိၩ့အီၪလၧအခိၪဒၧၩ့ လၧယုဒၫအဖၧၩ့လဒိၩ့",
			"6": "<sup>6</sup> ဘၪလဒိၩ့ကိၭဖျိၪ့ဒ့ၭလီၫ.- တၭစံၭၦစ့ၩရၫ့ခွး, နၥံၪ မၩဘဲၫၥ့ၪလဲၪ, ဘဲၫၥ့ၪလဲၪနီၪ ထီးလၩ့နၥံၪအၥၭဆံၭ. အဂဲးဘဲၫယီၩ နၥံၪစ့ၩရၫ့ဆၧ လၧၦၡၩအဂးမွဲအ့ၬး လၧယဟိဝၩအဂး, လၧအအီၪဝ့ၫလၧနၥံၪအၥိၭလၧ",
			"7": "<sup>7</sup> စ့ၩရၫ့ဆၧအဖၧၩ့လီၫ.- တၭဘိၩ့နဲၪ့ယီၩမွဲဆၧၥၭမဲၪ ယဟိဝၩအီၪလၧနၥံၪအလီၩ့ဆံၭ. ထီးလၩ့နၥံၪအၥၭ တၭ,မၩဆၧဆံၭ. အဂဲးဘဲၫယီၩဆၧအၧၩ့မွဲဂ့ၩး ဆၧ ယိမ့ၬမွဲဂ့ၩ, ဆၧမၩန့လၬဆီၪ့မွဲဂ့ၩ, အီၪလၧယဟိဝၩ ပယွၩအ့ၬ.",
			"8": "<sup>8</sup> တၭထီးအဝ့ၫၥံၪဂဲၫထဲၩ့ထီၩ့ဝ့ၫ လၧယရုစလံၫ့နီၪစ ယဟီၡဖၭအီၪက့ၪၦလံဝဲၫဖိၪ လၧယရုစလံၫ့အဖၧၩ့ ဆ့,ဒဲၦလုဆၧၥံၪ, ဒဲအံၫစရ့လၭအဖါအခိၪၥံၪလၧယ ဟိဝၩအဆၧစ့ၩရၫ့အဂး, ဒဲလၧဆၧလိၭခွးအဂးလီၫ.",
			"9": "<sup>9</sup> အဝ့ၫဒၪမၪလူၬအဝ့ၫၥံၪတၭ, စံၭဝ့ၫဒၪ, နၥံၪမိဘၪမၩ လၧဆၧၥၭမဲၪယဟိဝၩအဖၧၩ့ဘဲၫယီၩ, လၧနၥံၪအလူ",
			"10": "<sup>10</sup> တီၩ,ဒဲလၧနၥံၪအၥၭထၧၫ့ဖျိၪ့ယၫလီၫ.- တၭထီးဒၪ ဆၧလိၭခွးလမံၩ့မံၩ့ မိဂဲၫလၧနၥံၪအမ့ၬယၫ, ဘၪဆဲၫ့ လၧနၥံၪအထၧၫ့ဖုဝဲလၧအအီၪလၧ ဆၧၥွံၪအဘိၩ့ဆၧၩ့ လၧဆၧၥီၪ့ဆၧၥၫ့ဆၧမၪလူၬ, ဆၧၥနိၫၥံၪ,ဒဲဆၧစ့ၩရၫ့ ၥံၪအဘိၩ့ဆၧၩ့, နၥံၪမိဘၪၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့ဝ့ၫ, ဘဲၫၥိၭ အထီးမၩမၪဘၪယဟိဝၩ, ဒဲအဆၧၥၭထၪ့ထီးဘၪန ၥံၪ,ဒဲနၥံၪအထၧၫ့ဖုဝဲၥံၪလဂ့ၩတၭ, မၩဘဲၫနီၪဆံၭ.",
			"11": "<sup>11</sup> တၭနၥံၪမၩမၪဘၪဆၧအ့ၬ.- တၭယိခွါ, ၦလုဆၧအ ဒိၪ,စအၫမရဲအၫ, အီၪဝ့ၫလၧနၥံၪအဖၫ့ခိၪလၧကယဲ ဆၧဘၪဆဲၫ့လၧယဟိဝၩး ဒဲယုဒၫအၡၩဂံၪ့ဖိၪအခိၪစ အံၫၡမၫအ့လၭအဖိၪခွၫ စဇ့ၭဘဒဲအၫ လၧကယဲဆၧ ဘၪဆဲၫ့လၧစဎွၩ, ဒဲၦလံဝဲၫဖိၪမိကဲၪထၪ့ၦဒိၪၥံၪလၧ နၥံၪအမ့ၬယၫလီၫ. အီၪက့ၪဆီၪ့ထၪ့ နၥံၪအၥၭတၭ, မၩဆၧဆံၭ. တၭယဟိဝၩမိအီၪလၧၦအဂ့ၩ အၥိၭ လီၫ."
		},
		"20": {
			"1": "<sup>1</sup> တၭလၧဆၧနီၪလဖၪအလးခဲၫ့ ဆၧမၩအၥၭလၧၦ မိအၭဖိၪ,ဒဲၦအၫမၧၫ့ဖိၪ, ဒဲၦအံဒၧၫ့ဖိၪလၧအဝ့ၫၥံၪအ ၥိၭဂဲၫထၫ့ဒၩစယဟီၡဖၭ ဘဲၫၥိၭအမိဒုၭဆၧလီၫ.",
			"2": "<sup>2</sup> ထီးနီၪလဖၧၫ့, ၦလနၩ့နၩ့ ဂဲၫလီၩဘၪစယဟီၡဖၭ တၭ,စံၭဝ့ၫဒၪ, ၦခမျၧးဖၭဒိၪဂဲၫထၫ့ဒၩနၧၩ လၧမၫဆ မံၭဝါလခီၫ လၧစံရအၫအယီၩလခီၫ, ယိခွါ,အီၪဝ့ၫ လၧဟၭဇဇၫ့တၫမၫအဖၧၩ့, လၧအမွဲအံၪ့ဂံၫဒဲၫလီၫ.",
			"3": "<sup>3</sup> တၭစယဟီၡဖၭၥၭမဲၪဆၧတၭ, ကၠၪအၥၭဘဲၫၥိၭအမိ အၪ့ဎၬယဟိဝၩလီၫ. တၭကိၭထၪ့ဆၧဒုၪဆၧအၪ့",
			"4": "<sup>4</sup> ဆၧအီၩလၧယုဒၫဖိၪ ထီးအလူၬအကျၩလီၫ.- ယုဒၫ ဖိၪအီၪကိၩ့အီၪကီၪ့ဘဲၫၥိၭ အမိအၪ့ကံၩ့ဆၧလၧယဟိ ဝၩတၭ, လၧယုဒၫအဒိၩ့ထီးအလူၬနီၪ, မွဲၦဂဲၫအၪ့ဎၬ",
			"5": "<sup>5</sup> ယဟိဝၩလီၫ.- တၭစယဟီၡဖၭ ဆၧၫ့ထုၪ့ဝ့ၫလၧယု ဒၫ,ဒဲယရုစလံၫ့အဆၧအီၪကီၪ့အကျၩ လၧယဟိဝၩ",
			"6": "<sup>6</sup> အဂံၪ့ဖၧၩ့,လၧဝၩ့အၥၫ့အမ့ၬယၫလီၫ.- တၭစံၭဝ့ၫဒၪ, ယဟိဝၩပဖါၥံၪအယွၩဧ့, နမွဲယွၩလၧမူၭခိၪမွဲအ့ၬဧၪး ဒဲနပၧၩ့ၦဆၨၩလဖၪအဘၩ့အမုးထီးအလူၬ, လမွဲဘၪ ဧၪး တၭဆၧအစီၩ့အမၩ့, ဒဲဆၧအဂဲးအဘၭ အီၪဝ့ၫ လၧနစူၪဖၧၩ့, ဒဲလၧၦအီၪက့ၪဆၧၫ့ထုၪ့အၥၭ ထၫ့ဒၩ",
			"7": "<sup>7</sup> နၧၩလအီၪဘၪ,မွဲအ့ၬဧၪ.- နမွဲပယွၩလၧအနၫ့ထၪ့ခွံၬ ၦလၧအအီၪဝ့ၫလၧခးယီၩအဖၧၩ့ လၧၦခမျၧးအံၫစရ့ လၭအမ့ၬယၫတၭ, ဖ့ၪလၫ့ဝ့ၫလၧနထံၩနၥိၭစအၫဘြ",
			"8": "<sup>8</sup> ဟၫ့အချံၫအၥၫလၩ့ဆိၩလၩ့ကၠၪ, လမွဲဘၪဧၪ.- ၦအီၪ ဝ့ၫလၧအဖၧၩ့တၭ, မၩထၪ့န့နၧၩလၧ ဆၧအလးဆံၫ့",
			"9": "<sup>9</sup> ဎံၪလၧအဖၧၩ့လၧနမံၩ့အဂးတၭ, စံၭဝ့ၫဒၪ,- နၭၥံၪဖၩ့ ၥံၪမွဲဂ့ၩ,ဆၧစ့ၩရၫ့မွဲဂ့ၩ, ဆၧၥံၫချဲၫ့မွဲဂ့ၩ, ဆၧၥၭဝံ လၩ့ဒိၩမွဲဂ့ၩ,ဆၧအၧၩ့အ့ၪဘၪပၧၩတၭ, ပဆၧၫ့ထုၪ့ လၧဂံၪ့ယီၩအမ့ၬယၫ, ဒဲလၧနမ့ၬယၫ, (အဂဲးဘဲၫယီၩ, နမံၩ့အီၪဝ့ၫလၧဂံၪ့ယီၩအဖၧၩ့) တၭကိၭထၪ့နၧၩလၧ ပဘၪဆၧၡၪ့ဆၧနၭအဆၧၫ့အထီတၭ, နမိခိၭနၪဒဲမၩ",
			"10": "<sup>10</sup> ဆၧၩ့ဆၧလီၫ.- တၭဘိၩ့နဲၪ့ယီၩ,ယိခွါ, ၦအၫမၧၫ့ဖိၪ, ဒဲၦမိအၭဖိၪ, ဒဲၦခိၪလီၩ့စံအၫဖိၪ ထီးအံၫစရ့လၭစဲၪ့ ထၪ့လၧခးအံဇံၭအဖၧၩ့နီၪတၭ, နလဒုၭဂဲၫနုၬဘၪ အံၫစရ့လၭလၧအဝ့ၫၥံၪအခး, အ့ၪမွဲကၠၪခွံၬအၥၭလၧ",
			"11": "<sup>11</sup> အဝ့ၫၥံၪအအီၪ ဒဲလမၩဂၭဂီၩ့ဘၪဝ့ၫလီၫ.- ယိခွါ,အ ဝ့ၫၥံၪဖ့ၪလၫ့ဆၧၫ့ပၧၩ လၧအဂဲၫဘဲၫၥိၭအမိနၫ့ထၪ့ခွံၬ",
			"12": "<sup>12</sup> ပၧၩလၧဆၧန့ၥၫအဖၧၩ့ လၧနဒုၭန့ၥၫပၧၩလီၫ.- ပယွၩ ဧ့,နမိစ့ၩရၫ့ဝ့ၫအ့ၬဧၪ. အဂဲးဘဲၫယီၩလၧၦခမျၧးဖၭ ဒိၪလၧအဂဲၫထၫ့ဒၩဘၪပၧၩယီၩ အမ့ၬယၫပဂဲးပဘၭ လၧပမိထၫ့ဒၩ အဝ့ၫၥံၪအီၪအ့ၬ. တၭပမိမၩဘဲၫၥ့ၪ လဲၪ,ဘဲၫၥ့ၪလဲၪနီၪ ပၥ့ၪယၫဆ့အ့ၬ, အ့ၪမွဲပမ့ၬၥၪအီၪ",
			"13": "<sup>13</sup> ဝ့ၫလၧနအီၪလီၫ.- တၭယုဒၫထီးအလူၬဆၧၫ့ထုၪ့လၧ ယဟိဝၩအမ့ၬယၫ အီၪလၧအဖိၪဆံၭၥံၪ, ဒဲအမၫၥံၪ, ဒဲအဖိၪအလံၩၥံၪလီၫ.",
			"14": "<sup>14</sup> ထီးနီၪလဖၧၫ့ ၦလံဝဲၫဖိၪစမၭတနဲအၫ အဖိၪခွၫ, စယဟဲၫအ့လၭအဖိၪခွၫ စဘံၫ့နအဲအၫအဖိၪခွၫ,စဇ့ၭ ခရဲအၫအဖိၪခွၫစဟၭဇအ့လၭ, လၧစအၫစၭအဖိၪခွၫ ၥံၪအကျၩလဂၩနီၪ, ယဟိဝၩ အၥၭအီၪထၪ့လၧအ",
			"15": "<sup>15</sup> လီၩ့လၧဆၧအီၪကီၪ့အကျၩတၭ,- အဝ့ၫဒၪစံၭ, ယုဒၫ ထီးအလူၬ,ဒဲၦအီၪဝ့ၫလၧယရုစလံၫ့အဖၧၩ့နၥံၪဝ့ၫဒၪ, ဒဲနဝ့ၫဒၪစဎွၩ ယဟီၡဖၭဧ့, ခိၭနၪဆံၭ. ယဟိဝၩစံၭ နၥံၪဘဲၫယီၩ, ထီးၥၭမဲၪဆၧလဂ့ၩ, ထီးအၪ့ယိၪဆၧ လၧၦခမျၧးဖၭဒိၪယီၩ အကၠီၩ့လဂ့ၩး အဂဲးဘဲၫယီၩ",
			"16": "<sup>16</sup> ဆၧဒုၭၥုၭနီၪမွဲနၥံၪအဆၧအ့ၬ, မွဲယွၩအဆၧလီၫ.- ကဲ ဂီၩခိၬလနံၩနီၪ လ့ၩလၩ့ထၫ့ဒၩအဝ့ၫၥံၪဆံၭ. ယိခွါ, အဝ့ၫၥံၪဂဲၫထၪ့ဝ့ၫ လၧခိၪလီၩ့ဇံဇၭအဖၧၩ့ၥၭလၧခိၪ လီၩ့ဆူၭလၧအအီၪဝ့ၫလၧ ယရုၫအ့လၭအမံၩ့လၬကျၩ",
			"17": "<sup>17</sup> နီၪလီၫ.- နၥံၪဒုၭဘၪဆၧလၧဆၧဒုၭယီၩအဖၧၩ့အလး အီၪအ့ၬ, တဲၩ့ဝဲၩနၥံၪအၥၭ, ဆၧၫ့ထုၪ့တၭ, ဒၪဘၪယ ဟိဝၩအဆၧထိးထဲၩ့တၩ့ထဲၩ့ အီၪလၧနၥံၪအဂးဆံၭ. ယုဒၫ,ဒဲယရုစလံၫ့ၥံၪဧ့, ၥၭမဲၪလဂ့ၩ, ဒဲအၪ့ယိၪဆၧ လဂ့ၩ,ကဲဂီၩခိၬနီၪ လ့ၩလၩ့ထၫ့ဒၩအဝ့ၫၥံၪဆံၭ. အ",
			"18": "<sup>18</sup> ဂဲးဘဲၫယီၩယဟိဝၩအီၪလၧနၥံၪအၥိၭလီၫ.- စယဟီ ၡဖၭၡီၫ့လၩ့အခိၪ လၧဂၪ့ခိၪဒဲယုဒၫထီးအလူၬ, ဒဲၦ အီၪဝ့ၫလၧယရုစလံၫ့အဖၧၩ့လဖၪနီၪ ၡီၫ့လၩ့အၥၭလၧ ယဟိဝၩအမ့ၬယၫတၭ, ဘိၪ့ထၪ့ဘၩထၪ့ယဟိဝၩ",
			"19": "<sup>19</sup> လီၫ.- တၭၦလံဝဲၫဖိၪလၧၦကိဟၭဖိၪအကျၩ, ဒဲလၧ ၦကိရၫဖိၪအကျၩလဖၪ ဆၧၫ့ထုၪ့စံၭထၪ့အၪ့အူၭယ ဟိဝၩအံၫစရ့လၭအယွၩ လၧအလူၥီၫဖၭဒိၪလၧဆၧ ထၪ့ထီၫနီၪလီၫ.",
			"20": "<sup>20</sup> မုဆဲၪ့ထၪ့နီၪအဝ့ၫၥံၪဂဲထုၪ့ဂီၩဂီၩတၭ, လ့ၩထၪ့လၧ ၡါမုနၧၫ့ဖၫ တံၫကိအၫလီၫ. ထီးအဝ့ၫၥံၪလ့ၩထၪ့နီၪ စယဟီၡဖၭဆၧၫ့ထုၪ့တၭ, စံၭဝ့ၫဒၪ,ခိၭနၪယလူဆံၭး ယုဒၫ,ဒဲၦအီၪဝ့ၫလၧယရုစလံၫ့ၥံၪဧ့, နဲၩထဲၩ့ယဟိ ဝၩနၥံၪအယွၩဆံၭ. တၭနၥံၪမိအီၪဂုးအီၪခၧၫ့လီၫ. နဲၩအမီၪလဖၪဆ့း တၭနၥံၪမိဘီၪထၪ့ယီၫထၪ့လီၫ.",
			"21": "<sup>21</sup> အဝ့ၫၥံၪကိၪ့လိၬအၥၭ လၧၦခမျၧးဂီၩ့တၭ, အီၪက့ၪၦ ၥံၫကျံၩဆၧလၧယဟိဝၩအဂး, ဘဲၫၥိၭအဝ့ၫၥံၪမိစံၭ ထၪ့အၪ့အူၭဆၧဆံၫ့ဎံၪအဎံၫအလၩ, လၧအလ့ၩထၪ့ လၧၦၥုၭမုအမ့ၬယၫ အဘိၩ့ဘၭနီၪ, မိစံၭဘၪဝ့ၫဘဲၫ ယီၩ,စံၭထၪ့အၪ့အူၭယဟိဝၩဆံၭ. အဂဲးဘဲၫယီၩအ ခိးအတၩအီၪဝ့ၫလၩ့ဆိၩလၩ့ကၠၪလီၫ.",
			"22": "<sup>22</sup> ထီးအဝ့ၫၥံၪၥံၫကျံၩဆၧအခၪ့ထံၭ ဒဲစံၭထၪ့အၪ့အူၭ ဝ့ၫနီၪ,ယဟိဝၩအီၪက့ၪၥူၪဆၧထၫ့ဒၩ ၦအၫမၧၫ့ဖိၪၥံၪ, ဒဲၦမိအၭဖိၪၥံၪ, ဒဲၦခိၪလီၩ့စံအၫဖိၪၥံၪ လၧအဂဲၫထၫ့",
			"23": "<sup>23</sup> ဒၩယုဒၫနီၪတၭ, အဝ့ၫၥံၪဘၪဆၧကျီၪ့ၥံၫဝ့ၫလီၫ.- အဂဲး ဘဲၫယီၩၦအၫမၧၫ့ဖိၪ, ဒဲၦမိအၭဖိၪ, ဆၧၫ့ထုၪ့ထၫ့ဒၩ ၦအီၪဝ့ၫလၧခိၪလီၩ့စံအၫအလီၩ့ ဘဲၫၥိၭအမိမၩၥံၫခွံၬ, ဒဲမၩဂၭဂီၩ့ခွံၬဝ့ၫလီၫ. ထီးအမၩလူၬခွံၬၦအီၪဝ့ၫလၧ စံအၫအလီၩ့တၭ, မၩဆၧၩ့လိၬအၥၭ ဘဲၫၥိၭအမိမၩ ၥံၫလိၬအၥၭလီၫ.",
			"24": "<sup>24</sup> ထီးယုဒၫဂဲၫစိၩလၧထိၬခိၭဆၧ လၧၡါမုနၧၫ့ဖၫနီၪ, ယိၦခမျၧးတၭ,ယိခွါ, အဝ့ၫၥံၪနီၪ, မွဲၦအစွၪလဖၪ လၧအလၩ့ထံၩဖါလၧဂၪ့ခိၪချိၫ့တၭ, ၦဖီၩ့ဖျ့ၭဝ့ၫနးဂၩ",
			"25": "<sup>25</sup> အ့ၬ.- စယဟီၡဖၭ, ဒဲၦခမျၧးဂဲၫအၪ့ဂူၬန့အဝ့ၫၥံၪအ ဆၧဖိၪဆၧလံၩတၭ, လၧအကျၩနီၪ ဒၪန့ဆၧအၪအၪ လ့ၬ, ဆၧလူဒိၪဎွ့ၩဒိၪဒဲဆၧကီၩ့ဆၧၥိၭ ဒဲဆၧကယၧၩ့ လဖၪအဆၧလူဒိၪဎွ့ၩဒိၪတၭ, ဘဲၪ့လၩ့ခွံၬလၧအဂးဒၪ ဝ့ၫအၪနဲၪ့လၧအဆိၬဝ့ၫန့လီၫ. မွဲဆၧဖိၪဆၧလံၩအီၪ အၪအကၠီၩ့တၭ, ဘၪအၪ့ထုၫ့ထၪ့ဆၧအၪ့ဂူၬန့လဖၪ",
			"26": "<sup>26</sup> ၥၧၫ့နံၩလီၫ.- တၭလံနံၩလနံၩနီၪ အဝ့ၫၥံၪအီၪကိၩ့အီၪ ကီၪ့လၧခိၪလီၩ့ဆူၭဘ့ရခၫး အဂဲးဘဲၫယီၩစံၭထၪ့အၪ့ အူၭယဟိဝၩအမံၩ့ထီးနီၪလီၫ. မၩအၥၭဘဲၫနီၪတၭ, ဖျိၬဝ့ၫဆၧအလးနီၪအမံၩ့ ဘ့ရခၫထီးမုဆၫလနံၩယီၩ လီၫ.",
			"27": "<sup>27</sup> ထီးနီၪလဖၧၫ့ ယုဒၫဒဲယရုစလံၫ့အၡၩထဲၩ့ထဲၩ့ဝ့ၫ ကိၭအဂၩဒ့ၭတၭ, စယဟီၡဖၭအီၪလၧအမ့ၬယၫဘဲၫ ၥိၭအမိထဲၩ့ထဲၩ့လၧ ယရုစလံၫ့အီၪလၧဆၧၥၭထိၬ လီၫ.အဂဲးဘဲၫယီၩ ယဟိဝၩဒုၭၥၭထိၬဝ့ၫလၧအဒုၪ",
			"28": "<sup>28</sup> အဒၩအဖၫ့ခိၪလီၫ.- တၭဂဲၫဝ့ၫလၧယရုစလံၫ့အီၪလၧ",
			"29": "<sup>29</sup> ၥၫ့ထီးဒဲနါဒံၩ့, ဒဲခွ့ၩလၧယဟိဝၩအဂံၪ့လီၫ.- တၭထီး ခးလဖၪနီၪအၡၩဘၩ့မုးဖိၪ နါဂၧၫ့ဝ့ၫလၧယဟိဝၩဒုၭ ဆၧထၫ့ဒၩအံၫစရ့လၭ အဒုၪအဒၩလဖၪတၭ,ဆၧၥၭ",
			"30": "<sup>30</sup> မဲၪယွၩအီၪဝ့ၫလၧအဝ့ၫၥံၪအလီၩ့လီၫ.- တၭစယဟီၡ ဖၭအဘၩ့အမုးအီၪဂုးဖုးဝ့ၫလီၫ. အဂဲးဘဲၫယီၩအဝ့ၫ ဒၪအယွၩဖ့ၪလၫ့ဝ့ၫလၧ ဆၧအီၪပွံၭဝၬဖီၩ့ဝ့ၫလီၫ.",
			"31": "<sup>31</sup> စယဟီၡဖၭကဲၪစဎွၩ လၧယုဒၫအဖၫ့ခိၪတၭ,လၧ အကဲၪၥၫ့စဎွၩနီၪ အၥၭအီၪၥၧၫ့ဆံၫယဲနံၪ့တၭ, ကဲၪ စဎွၩလၧယရုစလံၫ့အဖၧၩ့ နံၫဆံၫယဲနံၪ့လီၫ. တၭအ",
			"32": "<sup>32</sup> မိအမံၩ့မွဲနးအဇုဘၫ, စၡံလဟဲၫအဖိၪမုၪလီၫ.- အ ဝ့ၫဒၪဖိၬအဖါစအၫစၫအဖၧၩ့ၥၭ ဘဲၫၥိၭအမိမၩဆၧ ဂ့ၩလၧယဟိဝၩအမ့ၬယၫတၭ, ကၠၪခွံၬအၥၭလၧအဝ့ၫ",
			"33": "<sup>33</sup> အ့ၬ.- မွဲလါနၫ့ဘိၩဆၧမၩဂၭဂီၩ့ ဆၧအလးထၪ့ထီၫ အ့ၬ. တၭၦခမျၧးၥံၪတဲၩ့ဝဲၩအၥၭ လၧအဖါၥံၪအယွၩ",
			"34": "<sup>34</sup> အဂးအ့ၬ.- တၭဆၧအီၪလၩ့ထးဘၪဆဲၫ့လၧ စယဟီၡ ဖၭ,ဆၧအခၪ့ထံၭဒဲအထုၬနီၪ, ယိခွါ, ကွ့ၭအၥၭလၧ လံၬစဟၫနနဲၫအဖိၪခွၫ စယံဟုၫအဖၧၩ့ လၧအဂဲးအ ကၠီၪ့အီၪဝ့ၫလၧအံၫစရ့လၭအစဎွၩ အလံၬကွ့ၭနဲၪ့ဆၧ အဖၧၩ့လီၫ.",
			"35": "<sup>35</sup> တၭဆၧလဖၪနီၪအလးခဲၫ့ ယုဒၫအစဎွၩစယဟီၡ ဖၭမၩအၥိၭလၧအံၫစရ့လၭ အစဎွၩစအၫဟဇဲအၫ,လၧ",
			"36": "<sup>36</sup> အမၩဆၧလတီၩလလီၩ့ဘၪလီၫ.- တၭမၩဎုၬဆၧလၧ အဝ့ၫဘဲၫၥိၭအမိအၪ့မၧၫ့လၩ့ကဘၩ့ လၧတၫၡံၭလီၫ. အဝ့ၫၥံၪမၩကဲၪထၪ့ ကဘၩ့ လၧအံဇအၧၫ့ဂံဘၧၫအ",
			"37": "<sup>37</sup> ဖၧၩ့လီၫ.- တၭၦမရံၡၫဖိၪ, စဒိၫဒဝၫအဖိၪခွၫစအံၫလ အ့ဇၧၫလဂၩ ချဲၩ့ဆၧလၧမီၪအချိၬထၫ့ဒၩ စယဟီၡဖၭ တၭ,စံၭဝ့ၫဒၪ,မွဲနမၩဎုၬဆၧလၧ စအၫဟဇဲအၫအကၠီၩ့ တၭ,ယဟိဝၩမၩဂၭဂီၩ့ခွံၬယူၭနဆၧမၩယူၭ. ကဘၩ့ ဂၭဂီၩ့တၭ, လ့ၩဆၧလၧတၫၡံၭၥ့ၪအ့ၬ."
		},
		"21": {
			"1": "<sup>1</sup> စယဟီၡဖၭမံၫဝ့ၫလၧအဖါၥံၪအၥိၭတၭ, ၦခုၪ့လၩ့ ဘၧၩ့ခွံၬဝ့ၫလၧအဖါၥံၪအၥိၭ လၧစဒၫဝံၭအဒိၩ့ဖၧၩ့ တၭ,အဖိၪခွၫစယဟိရၫ့ ကဲၪထၪ့စဎွၩလၧအလးနီၪ",
			"2": "<sup>2</sup> လီၫ.- တၭအီၪဝ့ၫလၧအထၧၫ့ဖုဝဲၥံၪ စယဟီၡဖၭအဖိၪ ခွၫစအၭဇရဲအၫ, ဒဲစယဟဲၫအ့လၭ, ဒဲစဇ့ၭခရဲယၫ, ဒဲစအၭဇရဲအၫ, ဒဲစမဲၫခအ့လၭ, ဒဲစၡ့ၭဖတဲအၫလီၫ. အဝ့ၫၥံၪနီၪမွဲယုဒၫအစဎွၩ ယဟီၡဖၭအဖိၪခွၫၥံၪလီၫ.",
			"3": "<sup>3</sup> အဝ့ၫၥံၪအဖါဖ့ၪလၫ့စ့ၩ ဒဲထီၫ့ဒဲဆၧလူဒိၪဎွ့ၩဒိၪအၪ အၪလ့ၬ,ဒဲဒိၩ့အီၪလၧအခိၪဒၧၩ့လဖၪ လၧယုဒၫအ ဖၧၩ့လီၫ. အ့ၪမွဲဘၩ့မုးနီၪဖ့ၪလၫ့ဝ့ၫလၧ အဖိၪခွၫစယ",
			"4": "<sup>4</sup> ဟိရၫ့လီၫ. အဂဲးဘဲၫယီၩမွဲအဖိၪဝဲၡါလီၫ.- တၭထီး စယဟိရၫ့ထၪ့ဘၭလၧအဖါအဘၩ့အမုးတၭ, မၩဆီၪ့ ထၪ့အၥၭတၭ, မၩၥံၫအထၧၫ့ဖုဝဲထီးအလူၬ လၧနၭ, ဒဲလၧအံၫစရ့လၭအၦဒိၪအကျၩ တဘျႃၭဂၩဆ့လီၫ.",
			"5": "<sup>5</sup> လၧစယဟိရၫ့ကဲၪၥၫ့စဎွၩနီၪ အၥၭအီၪယူၭၥၧၫ့ ဆံၫနံၫနံၪ့တၭ, ကဲၪစဎွၩလၧယရုစလံၫ့အဖၧၩ့နီၪ ဎိၭ",
			"6": "<sup>6</sup> နံၪ့လီၫ.- အဝ့ၫဖိၬအံၫစရ့လၭအစဎွၩၥံၪအဖၧၩ့ၥၭ, ဘဲၫစအၫဟၭ အၡၩဂံၪ့ဖိၪအၥိၭနီၪလီၫ. အဂဲးဘဲၫ ယီၩ,စအၫဟၭအဖိၪမုၪ လဂၩမွဲအမၫလီၫ. အဝ့ၫဒၪ",
			"7": "<sup>7</sup> မၩဆၧအၧၩ့လၧယဟိဝၩအမ့ၬယၫလီၫ.- မွဲလါနၫ့ဘိၩ ယဟိဝၩမၩဂၭဂီၩ့စဒၫဝံၭအဂံၪ့ဖိၪနီၪ, အၥၭလအီၪ ဘၪမွဲဆၧအုၩ့လၩ့လၧအမၩဝ့ၫ လၧယုဒၫအကၠီၩ့ဘဲၫ ၥိၭအမိဖ့ၪလၫ့အဝ့ၫဒဲအဖိၪအလံၩ လၧဆၧဖၩ့လဖျိၪ့ အဆိၩဆိၩအကၠၪကၠၪနီၪလီၫ.",
			"8": "<sup>8</sup> လၧအမုနံၩလဖၪနီၪ အံဒၧၫ့ဖိၪပိၩ့ထၪ့ဆၧလၧအ အီၪလၧယုဒၫအဖၫ့လၬတၭ, အီၪက့ၪစဎွၩလၧအနၫ့",
			"9": "<sup>9</sup> ဆါၥံၪအဂးလီၫ.- စယဟိရၫ့စဲၪ့ထၪ့ဒဲအၦဒိၪဖၭဒိၪ လဖၪတၭ, အလဲၪ့ၥုၭထီးအလူၬ အီၪလၧအၥိၭလီၫ. ဂဲထုၪ့လၧမုနၩလခီၫတၭ, ကျီၪ့ၥံၫခွံၬၦအံဒၧၫ့ဖိၪ,လၧ",
			"10": "<sup>10</sup> အအီၪဝၬဖီၩ့ဝ့ၫ ဒဲအလဲၪ့ၥုၭအခိၪၥံၪလီၫ.- တၭၦအံ ဒၧၫ့ဖိၪလၧအအီၪဝ့ၫလၧယုဒၫအဖၫ့လၬ ပိၩ့ထၪ့ဆၧ ခီးမုဆၫလနံၩယီၩလီၫ. ထီးနီၪလဖၧၫ့လံဘနၫပိၩ့ထၪ့ ဝ့ၫအဆၧၫ့အထီလဖၧၫ့ဎးလီၫ. အဂဲးဘဲၫယီၩအဝ့ၫ ဒၪစဲၪ့ဒၪယူၭယဟိဝၩ လၧအမွဲအဖါၥံၪအယွၩယူၭ.",
			"11": "<sup>11</sup> အဝ့ၫဒၪမၩထၪ့ဆၧအလးထၪ့ထီၫလဖၪ လၧယုဒၫ အခိၪလီၩ့အလီၩ့နီၪ, ဒဲဒုၭမၩမၪမုၪ မၩမၪခွၫလၧၦ အီၪဝ့ၫလၧယရုစလံၫ့အဖၧၩ့ ဒဲအၪ့မၧၫ့ဆီၪ့ ယုဒၫဆ့",
			"12": "<sup>12</sup> လီၫ.- တၭလံၬလဘံၪ့ဂဲၫလၧမီၪအံၫလဲယၫထီၩ့လၧ အအီၪတၭ,စံၭဝ့ၫဒၪ, ယဟိဝၩနဖါစဒၫဝံၭအယွၩစံၭ ဘဲၫယီၩ, နဖါစယဟီၡဖၭအဖၧၩ့ၥၭၥံၪမွဲဂ့ၩ, ယုဒၫအ စဎွၩအၫစၫအဖၧၩ့ၥၭမွဲဂ့ၩ, မွဲနလဖိၬဘၪအကၠီၩ့,",
			"13": "<sup>13</sup> အ့ၪမွဲနဖိၬအံၫစရ့လၭ အစဎွၩၥံၪအဖၧၩ့ၥၭတၭ, ဒုၭ မၩမၪမုၪမၩမၪခွၫယုဒၫ ဒဲၦအီၪဝ့ၫလၧယရုစလံၫ့အ ဖၧၩ့,ဘဲၫစအၫဟၭအၡၩဂံၪ့ဖိၪ အဆၧမၩမၪမုၪမၩမၪ ခွၫအၥိၭနီၪတၭ, နမၩၥံၫနထၧၫ့ဖုဝဲ လၧနဖါအၡၩဂံၪ့",
			"14": "<sup>14</sup> ဖိၪအကျၩလၧအဂ့ၩနဲၪ့နၧၩအကၠီၩ့တၭ,- ယိခွါ,ယ ဟိဝၩမိကျီၪ့နၡၩခမျၧး, ဒဲနဖိၪနလံၩၥံၪ, ဒဲနမၫၥံၪ,ဒဲန ဆၧဖိၪဆၧလံၩထီးအလူၬ လၧဆၧမၩဂၭဂီၩ့ဖၭဒိၪ",
			"15": "<sup>15</sup> တၭ,- နမိဆၫထၪ့နၭနၭလ့ၬတၭ, နဎွံၬမိဆံၬထၪ့လၧ ခီၫ့လၧဆၧဆၫဘၪနၧၩ လနံၩဘၪလနံၩအကၠီၩ့နီၪလီၫ.",
			"16": "<sup>16</sup> လၧနီၪအမ့ၬယၫ ယဟိဝၩထိၪဂဲၩၦဖလံၡၫဖိၪအၥၭ, ဒဲၦအရ့ဘၠၫဖိၪအၥၭ လၧအအီၪဘူၭလၧၦကုၡၫဖိၪလ",
			"17": "<sup>17</sup> ဖၪ,ထၫ့ဒၩစယဟိရၫ့လီၫ.- အဝ့ၫၥံၪနီၪဂဲၫထၪ့လၧယု ဒၫဘုၪ့ဖိးဆၧတၭ, ဆိၬထၪ့ခွံၬ ကယဲဆၧဖိၪဆၧလံၩ လၧအအီၪဝ့ၫလၧစဎွၩအဂံၪ့ဖၧၩ့ ဒဲအဖိၪခွၫၥံၪဒဲအ မၫၥံၪဆ့,အီၪလၩ့ထးနးဂၩအ့ၬ. အီၪလၩ့ထးန့ၫအဖိၪ",
			"18": "<sup>18</sup> ခွၫဒၪဘၨၩစယဟိအဟၭလဂၩဎးလီၫ.- တၭဆၧလ ဖၪနီၪထီးအလူၬအလးခဲၫ့ ယဟိဝၩထးအဝ့ၫလၧဆၧ",
			"19": "<sup>19</sup> ဆၫလၧအဎွံၬဖၧၩ့လၧအဘျၪလၥ့ၪဘၪလီၫ.- ဆၧမၩ အၥၭလၧနံၫနံၪ့အထုၬတၭ, အဎွံၬၥံၪဆံၬထၪ့ခွံၬလၧ ဆၧဆၫအကၠီၩ့တၭ, ၥံၫဝ့ၫလၧဆၧဆၫအၧၩ့အကၠီၩ့နီၪ လီၫ.တၭၦခမျၧးဆူၭခဲၩဆၧလၧအဂး ဘဲၫအဖါၥံၪ",
			"20": "<sup>20</sup> အဆၧဆူၭခဲၩအၥိၭနီၪအ့ၬ.- လၧအကဲၪၥၫ့စဎွၩနီၪ အၥၭအီၪၥၧၫ့ဆံၫနံၫနံၪ့တၭ, ကဲၪစဎွၩလၧယရုစလံၫ့ အဖၧၩ့ဎိၭနံၪ့တၭ, ထဲၩ့ထဲၩ့ဝ့ၫတၭၦမီၪ့ဘၪၥၭယူဝ့ၫ အ့ၬ.မွဲလါနၫ့ဘိၩ ၦခုၪ့လၩ့ဘၧၩ့ခွံၬဝ့ၫ လၧစဒၫဝံၭ အဒိၩ့ဖၧၩ့နီၪ, အ့ၪမွဲ,မွဲလၧစဎွၩအဆၧၥွၪခိၪအဖၧၩ့ အ့ၬ."
		},
		"22": {
			"1": "<sup>1</sup> တၭၦအီၪဝ့ၫလၧယရုစလံၫ့အဖၧၩ့လဖၪနီၪ, အီၪ က့ၪထၪ့အဖိၪဒၪဘၨၩစအၫဟဇဲအၫ လၧစဎွၩလၧအ လးလီၫ. အဂဲးဘဲၫယီၩၦလဒီၪ့ လၧအဂဲၫလၧၦအရ့ ဘၠၫဖိၪအၥိၭ လၧၦၥုၪ့တဲၩအလးနီၪ, မၩၥံၫယူၭအဝဲ ၥံၪထီးအလူၬလီၫ. တၭယုဒၫအစဎွၩ စယဟိရၫ့အ",
			"2": "<sup>2</sup> ဖိၪခွၫစအၫဟဇဲအၫကဲၪထၪ့စဎွၩလီၫ.- တၭစအၫဟ ဇဲအၫကဲၪၥၫ့စဎွၩနီၪ အၥၭၡါလံဆံၫနံၫနံၪ့တၭ, ကဲၪ စဎွၩလနံၪ့လၧယရုစလံၫ့အဖၧၩ့တၭ, အမိအမံၩ့မွဲနး",
			"3": "<sup>3</sup> အၭၥလဲအၫ စအီမြဲၫအဖိၪမုၪလီၫ.- အဝ့ၫဒၪဖိၬစအၫ ဟၭအၡၩဂံၪ့ဖိၪအဖၧၩ့ၥၭလီၫ. အဂဲးဘဲၫယီၩအမိမွဲ ၦလၧအဒုၭကိၪ့အဝ့ၫဘဲၫၥိၭအမိမၩ ဆၧအၧၩ့လီၫ.",
			"4": "<sup>4</sup> တၭအဝ့ၫမၩဆၧအၧၩ့ လၧယဟိဝၩအမ့ၬယၫ, ဘဲၫစ အၫဟၭအၡၩဂံၪ့ဖိၪအၥိၭနီၪလီၫ. အဂဲးဘဲၫယီၩလၧ အဖါၥံၪအလးခဲၫ့နီၪ အဝ့ၫၥံၪမွဲၦဒုၭကိၪ့အဝ့ၫထီးအ",
			"5": "<sup>5</sup> ထီၩ့လၧဆၧဂၭဂီၩ့လီၫ.- အဝ့ၫဒၪလ့ၩဆ့ဘဲၫအဝ့ၫၥံၪ ဒုၭကိၪ့ဆၧအၥိၭတၭ, လ့ၩဝ့ၫလၧစအၫဟၭအဖိၪခွၫ စယိရၫ့အၥိၭလၧဆၧဒုၭၥုၭလၧစံရအၫအစဎွၩဟၭ ဇအ့လၭလၧရၫမီၭဂံလအၭအဖၧၩ့တၭ, ၦစံရအၫဖိၪ",
			"6": "<sup>6</sup> ၥံၪကျီၪ့စယိရၫ့လီၫ.- တၭစယိရၫ့ထဲၩ့ကဒၩထဲၩ့ဝ့ၫ လၧယ့ၭဇအ့လၭ, ဘဲၫၥိၭအဖၧၩ့လးလဖၪလၧၦစံရ အၫဖိၪမၩဝ့ၫလၧရၫမၫ, ထီးအဒုၭၥုၭ လၧစံရအၫအ စဎွၩဟၭဇအ့လၭနီၪမိဘျၪထဲၩ့ဝ့ၫလီၫ. တၭယုဒၫအ စဎွၩယဟိရၫ့အဖိၪခွၫ စအၫဟဇဲအၫနီၪလ့ၩထၪ့အီၪ ၡီၩ့စအၫဟၭအဖိၪခွၫ စယိရၫ့လၧယ့ၭဇအ့လၭအ ဖၧၩ့,အဂဲးဘဲၫယီၩဆၫဝ့ၫလီၫ.",
			"7": "<sup>7</sup> တၭစအၫဟဇဲအၫ ဘၪဆၧမၩဂၭဂီၩ့ဝ့ၫနီၪဂဲၫလၩ့ ဝ့ၫလၧယွၩလခီၫ, လၧအဂဲၫလၧစယိရၫ့အအီၪအကၠီၩ့ လီၫ. အဂဲးဘဲၫယီၩထီးအထီၩ့ဝ့ၫတၭ, လ့ၩထၪ့ဝ့ၫ လၧစယိရၫ့အၥိၭထၫ့ဒၩစနံၫ့ၡဲၫအဖိၪခွၫစယံဟုၫလၧ ယဟိဝၩဂုၪဝ့ၫ, ဘဲၫၥိၭအမိဒၪ့ထ့ၬခွံၬ စအၫဟၭအ",
			"8": "<sup>8</sup> ၡၩဂံၪ့ဖိၪလီၫ.- ထီးစယံဟုၫစ့ၩရၫ့စအၫဟၭအၡၩဂံၪ့ ဖိၪတၭ, ဆၧမၩအၥၭလၧအဒၪန့ယုဒၫအၦဒိၪဖၭဒိၪ လဖၪဒဲစအၫဟဇဲအၫအထၧၫ့ဖုဝဲလဖၪ အဖိၪခွၫၥံၪ လၧအမၩစအၫဟဇဲအၫအဆၧတၭ, မၩၥံၫအဝ့ၫၥံၪ",
			"9": "<sup>9</sup> လီၫ.- တၭအၪ့ဎၬစအၫဟဇဲအၫတၭ, ၦဖီၪ့န့ဝ့ၫ (အ ဂဲးဘဲၫယီၩ, အီၪက့ၪၥူၪအၥၭ လၧစမ့ရအၫအဖၧၩ့) တၭဂဲၫၥိၫ့ဝ့ၫ လၧစယံဟုၫအအီၪတၭ, ထီးအမၩၥံၫ ဘၪဝ့ၫတၭ, ခုၪ့လၩ့ဘၧၩ့ခွံၬဝ့ၫလီၫ. အဂဲးဘဲၫယီၩစံၭ ဝ့ၫဒၪ,မွဲစယဟီၡဖၭလၧအအၪ့ဎၬ ယဟိဝၩလၧအၥၭ ထၧၫ့ဖျိၪ့ယၫအဖိၪခွၫလီၫ. တၭစအၫဟဇဲအၫအၡၩ ဂံၪ့ဖိၪပၧၩ့ဒံၭဘၩ့မုးနီၪအစီၩ့အမၩ့အီၪအ့ၬ.",
			"10": "<sup>10</sup> ထီးစအၫဟဇဲအၫအမိ နးအၭၥလဲအၫလဂၩဒၪ ဘၪဝ့ၫလၧအဖိၪခွၫၥံၫယူၭတၭ, ဂဲထုၪ့မၩဂၭဂီၩ့စဎွၩအ ချံၫအၥၪထီးအလူၬ လၧအဘၪဆဲၫ့ယုဒၫအၡၩဂံၪ့ဖိၪ",
			"11": "<sup>11</sup> လီၫ.- အ့ၪမွဲစဎွၩအဖိၪမုၪ နးယဟီၡဘံအၭလဂၩမၩ န့စအၫဟဇဲအၫအဖိၪခွၫ စယိအၭအၪ့ဂူၪန့ဝ့ၫလၧစ ဎွၩအဖိၪခွၫလၧအဘၪဆၧမၩၥံၫဝ့ၫအကျၩတၭ, အီၪ က့ၪၥူၪခွံၬဝ့ၫဒၪ, ဒဲအၡၩဒုၭအၪ့နူလဂၩ လၧဒူၭဖၧၩ့ လီၫ. တၭစယဟိရၫ့အဖိၪမုၪ, ၦလုဆၧစယဟီအဒၫ အမၫနးယဟီၡဘံအၭ (အဂဲးဘဲၫယီၩ မွဲစအၫဟဇဲ အၫအထၧၫ့ဖုဝဲမုၪ) အီၪက့ၪၥူၪခွံၬအဝ့ၫ လၧနးအၭၥ လဲအၫအမ့ၬယၫတၭ, ၦမုၪနီၪမၩၥံၫဘၪဝ့ၫဒၪအ့ၬ.",
			"12": "<sup>12</sup> တၭအဝ့ၫဒၪဘၪဆၧအီၪက့ၪၥူၪဝ့ၫ လၧယွၩအဂံၪ့ဖၧၩ့ ဎူၫနံၪ့လီၫ. တၭနးအၭၥလဲအၫနီၪ ကဲၪထၪ့နးဎွၩမုၪ လၧခးအဖၫ့ခိၪလီၫ."
		},
		"23": {
			"1": "<sup>1</sup> လၧနွ့ၫနံၪ့လနံၪ့အဖၧၩ့နီၪ စယဟီအဒၫအီၪက့ၪဆီၪ့ ထၪ့အၥၭတၭ, မၩန့ၦအယၩၥံၪ အခိၪလဖၪစယရိ ဟၫ့အဖိၪခွၫစအၭဇရဲအၫ, ဒဲစယဟိဟနၫ့အဖိၪခွၫ စအံၫၡမၫအ့လၭ, ဒဲစအိၫဘ့ၭအဖိၪခွၫ စအၭဇရဲအၫ, ဒဲစအဒဲအၫအဖိၪခွၫ စမ့ၫအဇဲအၫ, ဒဲစဇ့ၭခြဲၫအဖိၪ ခွၫစအလံၡဖၭတၭ, အုၩ့လၩ့လိၬအၥၭ လၧအဝ့ၫၥံၪ",
			"2": "<sup>2</sup> လီၫ.- အဝ့ၫၥံၪလ့ၩဝံၩ့ဝၩ့ဆၧလၧ ယုဒၫအဖၧၩ့တၭ, ဒုၭအီၪကိၩ့အီၪကီၪ့ၦလံဝဲၫဖိၪ လၧယုဒၫအဒိၩ့ထီးအ လူၬ,ဒဲအံၫစရ့လၭအဖါၥံၪအခိၪနီၪတၭ, အဝ့ၫၥံၪဂဲၫ",
			"3": "<sup>3</sup> ထီၩ့ဝ့ၫလၧယရုစလံၫ့လီၫ.- တၭၦအီၪကီၪ့ဝ့ၫထီးအ လူၬနီၪ, အုၩ့လၩ့လိၬအၥၭလၧစဎွၩလၧယွၩအဂံၪ့ဖၧၩ့ နီၪလီၫ. တၭအဝ့ၫဒၪစံၭအဝ့ၫၥံၪ, ယိခွါ, စဎွၩအဖိၪခွၫ မိကဲၪထၪ့စဎွၩ ဘဲၫယဟိဝၩစံၭဆၧလၧ စဒၫဝံၭအဖိၪ",
			"4": "<sup>4</sup> ခွၫၥံၪ အဂဲးအကၠီၪ့အၥိၭနီၪလီၫ.- အယီၩမွဲဆၧလၧ နၥံၪမိမၩဘၪလမံၩ့, နၥံၪဝ့ၫလဖၪ ၥၧၫ့ဒီၪ့လဒီၪ့လၧ အလ့ၩနုၬလၧမးၥံၫအနံၩလဖၪ လၧၦလုဆၧလဖၪ,ဒဲ လၧၦလံဝဲၫဖိၪအကျၩ မိကဲၪထၪ့ၦခိၭဆၧလၧတရၫ့ၥံၪ",
			"5": "<sup>5</sup> အခၪ့ထံၭ,- ၦၥၧၫ့ဒီၪ့လဒီၪ့မိဘၪအီၪလၧစဎွၩအဂံၪ့ တၭ,ၦၥၧၫ့ဒီၪ့လဒီၪ့ မိဘၪအီၪလၧဆၧၥုၪ့ထၪ့အခၪ့ ထံၭအတရၫ့နီၪ, ၦခမျၧးၥံၪထီးအလူၬ မိဘၪအီၪဝ့ၫ",
			"6": "<sup>6</sup> လၧယဟိဝၩအဂံၪ့အဝၩ့လဖၪအဖၧၩ့လီၫ.- အ့ၪမွဲဒုၭ လ့ၩနုၬၦၡၩလၧယဟိဝၩအဂံၪ့ဖၧၩ့ န့ၫၦလုဆၧၥံၪဒဲၦ လံဝဲၫဖိၪၥံၪ လၧအမၩဆၧလဖၪနီၪဆံၭ. အဝ့ၫၥံၪနီၪ မိလ့ၩနုၬဘၪလီၫ. အဂဲးဘဲၫယီၩ မွဲအဆံၫ့ဎံၪဝ့ၫလီၫ. အ့ၪမွဲၦခမျၧးထီးအလူၬနီၪ မိဘၪခိၭန့ယဟိဝၩအဆၧ",
			"7": "<sup>7</sup> ခိၭလီၫ.- တၭၦလံဝဲၫဖိၪဘၪဝၩ့ထၬ စဎွၩဝၬဖီၩ့ဝ့ၫ,လ ဂၩလၧအစူၪဝဲၩလၧအစူၪဖၧၩ့, လဂၩလၧအစူၪဝဲၩ လၧအစူၪဖၧၩ့တၭ, ထီးဒၪၦလၧအမိလ့ၩနုၬလၧဂံၪ့အ ဖၧၩ့နီၪမိဘၪဆၧမၩၥံၫဝ့ၫလီၫ. ထီးစဎွၩစဲၪ့ထၪ့ဒဲဂဲၫ နုၬဝ့ၫနီၪ, အီၪနၥံၪဝ့ၫလၧစဎွၩအၥိၭဆံၭ.",
			"8": "<sup>8</sup> ၦလံဝဲၫဖိၪဒဲယုဒၫထီးအလူၬနီၪ, မၩဝ့ၫဘဲၫကယဲ ဆၧလၧၦလုဆၧစယဟီအဒၫ မၪလူၬဝ့ၫအၥိၭနီၪတၭ, မၩန့ၦလၧအဂဲၫနုၬလၧမးၥံၫအနံၩ, ဒဲစဲၪ့ထၪ့ဝ့ၫလၧမး ၥံၫအနံၩလီၫ. အဂဲးဘဲၫယီၩၦလုဆၧစယဟီအဒၫဖျါ",
			"9": "<sup>9</sup> ခွံၬၦအဆၫ့လဖၪအ့ၬ.- တၭၦလုဆၧစယဟီအဒၫဖ့ၪ လၫ့ၦအယၩၥံၪအခိၪလဖၪ လၧစဒၫဝံၭအဖၩ့ၥံၪ,ဒဲအ ထၩ့ဖံၭဖၭဒိၪၥံၪ, ဒဲအထၩ့ဖံၭဖိၪၥံၪလၧအအီၪဝ့ၫလၧယွၩ",
			"10": "<sup>10</sup> အဂံၪ့ဖၧၩ့လီၫ.- တၭၦအီၪက့ၪၦခမျၧးထီးအလူၬလ ဂၩအီၪလၧအစူၪဝဲၩလၧအစူၪဖၧၩ့, လဂၩအီၪလၧအ စူၪဝဲၩလၧအစူၪဖၧၩ့အီၪဝၬဖီၩ့စဎွၩ လၧဂံၪ့အစူၪထွ့ၪ လခီၫ,ထီၩ့လၧဂံၪ့အစူၪစ့ၪလခီၫ, လၧဆၧလုအလးဒဲ",
			"11": "<sup>11</sup> ဂံၪ့အနဲၩ့ထံၭနီၪလီၫ.- ထီးနီၪလဖၧၫ့အဝ့ၫၥံၪဂဲၫဆိၬ ထၪ့စဎွၩ အဖိၪခွၫတၭ, ဒုၭချႃၬထၪ့ဝ့ၫလၧၥရဖူၩ,ဒဲ အီၪက့ၪဆၧအုၩ့လၩ့တၭ, အီၪက့ၪထၪ့ဝ့ၫလၧစဎွၩ အလးတၭ, စယဟီအဒၫအဖိၪခွၫၥံၪဂုၪဝ့ၫတၭ, စံၭဝ့ၫ, မွဲစဎွၩမၧၫ့ဝ့ၫဆံၭ.",
			"12": "<sup>12</sup> ထီးနးအၭၥလဲအၫနီၪနါဂၧၫ့ ၦခမျၧးစဲၪ့ဒဲစံၭထၪ့ အၪ့အူၭစဎွၩနီၪတၭ, ဂဲၫဝ့ၫလၧၦခမျၧးအအီၪလၧယ",
			"13": "<sup>13</sup> ဟိဝၩအဂံၪ့ဖၧၩ့လီၫ.- တၭယိဝ့ၫတၭ, ယိခွါ, စဎွၩ ဆၧၫ့ထုၪ့ဝ့ၫလၧဆၧအလးထၪ့ထီၫ ထီးဆၧလ့ၩနုၬနီၪ တၭ,ၦဒိၪဖၭဒိၪလဖၪ ဒဲၦအူၪခွ့ၩၥံၪ, အီၪဝ့ၫလၧစဎွၩ အနဲၩ့ထံၭနီၪလီၫ. ခးအၡၩခမျၧးထီးအလူၬနီၪ, ၥုၪ့ ထိၬၥၭထိၬတၭ, အူၪထၪ့ခွ့ၩဒဲၦၥံၫကျံၩဆၧအီၪဝ့ၫလၧ ၥၫ့ထီးနါဒံၩ့ ဒဲၦလၧအၥီၪ့လိၪဆၧၥံၫကျံၩ စံၭထၪ့အၪ့ အူၭလီၫ. ထီးနီၪလဖၧၫ့နးအၭၥလဲအၫၡၫ့အဆဲၫ့, ဒဲ",
			"14": "<sup>14</sup> ကိၭထၪ့,ဆၧပိၩ့ထၪ့ဖီၩၬ ဆၧပိၩ့ထၪ့ဖီၩၬ- ၦလုဆၧ စယဟီအဒၫဒုၭလ့ၩထၪ့ ၦအယၩၥံၪအခိၪလဖၪ, ဒဲ ၦၥုၭမုအခိၪၥံၪတၭစံၭဝ့ၫ, နၫ့ထၪ့ခွံၬၦမုၪနီၪလၧဂံၪ့ ဖၧၩ့လၧဆၧအဂဲးလဖၪလၧခီၫ့တၭ, ၦလၧအလီၩ့ဖိၬ ဝ့ၫအခဲၫ့နီၪ, မွဲအဘၪဆၧမၩၥံၫဝ့ၫလၧနၭဆံၭ. အဂဲး ဘဲၫယီၩၦလုဆၧစံၭယူၭ, မွဲနၥံၪထီးမၩၥံၫလၧယဟိ",
			"15": "<sup>15</sup> ဝၩအဂံၪ့ဖၧၩ့လဂ့ၩ.- အခိးမွဲဘဲၫနီၪၦဖီၪ့ထၬဝ့ၫတၭ, ထီးအလ့ၩဝ့ၫထီၩ့လၧဆၧလ့ၩနုၬ လၧကၥ့ၪအတရၫ့ လၧစဎွၩအဂံၪ့နဲၩ့တၭ, ၦမၩၥံၫဝ့ၫထီးနီၪလီၫ.",
			"16": "<sup>16</sup> စယဟီအဒၫအုၩ့လၩ့ဆၧ ဒဲဒုၭအုၩ့လၩ့လိၬအၥၭ လၧၦခမျၧးထီးအလူၬ ဒဲလၧစဎွၩနီၪ, ဘဲၫၥိၭအဝ့ၫၥံၪ",
			"17": "<sup>17</sup> မိကဲၪထၪ့ယဟိဝၩ အၡၩခမျၧးလီၫ.- ထီးနီၪလဖၧၫ့ ၦခမျၧးထီးအလူၬ လ့ၩထၪ့လၧဘၫအလၭအဂံၪ့ဖၧၩ့ တၭ,မၩလၩ့ဎီးဝ့ၫတၭ, မၩခါလၩ့ဘျ့ၭအဆၧလုလး ဒဲအဆၧဂၩ့ၥံၪတၭ, မၩၥံၫဘၫအလၭ အၡၩလုဆၧ",
			"18": "<sup>18</sup> စမၭတၫ့လၧဆၧလုလးလဖၪအမ့ၬယၫလီၫ.- တၭစ ယဟီအဒၫအီၪက့ၪလၩ့ဆၧဖံၭဆၧမၩလဖၪ လၧယဟိ ဝၩအဂံၪ့ဖၧၩ့လၧၦလုဆၧ ၦလံဝဲၫဖိၪၥံၪအစူၪဖၧၩ့,ၦ လၧစဒၫဝံၭအၪ့နၩ့ဖၭဝ့ၫအဆၧၫ့ လၧယဟိဝၩအဂံၪ့ ဖၧၩ့ဘဲၫၥိၭအမိလုထၪ့ယဟိဝၩ လၧဆၧလုမ့ၪဘဲၫဆၧ ကွ့ၭအၥၭလၧစမိစ့ၭအဆၧၥီၪ့ဆၧၥၫ့ အဖၧၩ့အၥိၭနီၪ, အီၪလၧဆၧၥုၪ့ထိၬၥၭထိၬတၭ, ၥံၫကျံၩဆၧ,ဘဲၫစဒၫ",
			"19": "<sup>19</sup> ဝံၭမၪလူၬဝ့ၫအၥိၭနီၪလီၫ.- အဝ့ၫဒၪအီၪက့ၪၦခိၭဆၧ ထီးယဟိဝၩအဂံၪ့အတရၫ့လဖၪ ဘဲၫၥိၭဆၧလဆံၫ့",
			"20": "<sup>20</sup> ဘၪထီးနုၬနးမံၩ့လဂ့ၩလီၫ.- အဝ့ၫဒၪမၩန့ၦအယၩၥံၪ အခိၪလဖၪ, ဒဲၦလၧအဘၪဆဲၫ့လၧစဎွၩအၡၩဂံၪ့ဖိၪ, ဒဲၦပၧၩ့ၦခမျၧးၥံၪဒဲ ခးအၡၩခမျၧးထီးအလူၬတၭ,ဂဲၫ ဆိၬလၩ့ခွံၬစဎွၩလၧ ယဟိဝၩအဂံၪ့တၭ, ဂဲၫလၧတရၫ့ ထၪ့ထီၫအဖၧၩ့ထီၩ့လၧစဎွၩအဂံၪ့ဖၧၩ့တၭ, ဒုၭဆၧၫ့",
			"21": "<sup>21</sup> နၩ့စဎွၩလၧဘၩ့မုးအလးဆီၩ့ဆီအဖၫ့ခိၪလီၫ.- တၭ ခးအၡၩခမျၧးထီးအလူၬ ၥုၪ့ထိၬၥၭထိၬတၭ, ၦမၩၥံၫ ယူၭနးအၭၥလဲအၫလၧနၭအလးခဲၫ့နီၪ, ဒိၩ့အီၪမုၬဝ့ၫ ဒၪလီၫ."
		},
		"24": {
			"1": "<sup>1</sup> စယိအၭကဲၪၥၫ့စဎွၩနီၪ အၥၭအီၪနွ့ၫနံၪ့တၭ, ကဲၪ စဎွၩလၧယရုစလံၫ့အဖၧၩ့ အနံၪ့လံဆံၫလီၫ. အမိအ မံၩ့မွဲနးဇံၫဘဲအၫ, ဘၪဆဲၫ့လၧဘံအၧၫၡံၫဘၫလီၫ.",
			"2": "<sup>2</sup> လၧကယဲၦလုဆၧစယဟီအဒၫအမုနံၩ ထီးအလူၬနီၪ, စယိအၭမၩဆၧအဂ့ၩ လၧယဟိဝၩအမ့ၬယၫလီၫ.",
			"3": "<sup>3</sup> စယဟီအဒၫမၩန့မၫၥံၪလၧအဂးနံၫဂၩတၭ, အဝ့ၫထၪ့ ဖိၪအဖိၪခွၫၥံၪဒဲအဖိၪမုၪၥံၪလီၫ.",
			"4": "<sup>4</sup> လၧဆၧနီၪလဖၪအလးခဲၫ့ ဆၧမၩအၥၭလၧစယိအၭ အၥၭအီၪလၧအမိမၩဂ့ၩထၪ့ထဲၩ့ ယဟိဝၩအဂံၪ့လီၫ.",
			"5": "<sup>5</sup> ဒုၭအီၪကိၩ့အီၪကီၪ့ၦလုဆၧလဖၪ, ဒဲၦလံဝဲၫဖိၪၥံၪ တၭ,စံၭအဝ့ၫၥံၪ, လ့ၩလၧကယဲယုဒၫအဒိၩ့လဖၪ တၭ,အၪ့ထုၫ့ကီၪ့စ့ၩ လၧအံၫစရ့လၭ ထီးအလူၬဘဲၫ နၥံၪမိမၩဂ့ၩထၪ့ထဲၩ့ နၥံၪအယွၩအဂံၪ့လနံၪ့ဘၪလ နံၪ့ဆံၭ.တၭမၩဆၧယီၩချဲၫ့ချဲၫ့ဆံၭ. မွဲလါနၫ့ဘဲၫနီၪ တၭ,ၦလံဝဲၫဖိၪမၩဝ့ၫချဲၫ့ချဲၫ့အ့ၬ.",
			"6": "<sup>6</sup> စဎွၩကိၭန့ဆၧအခိၪ စယဟီအဒၫတၭ, စံၭအဝ့ၫ, နလအၪ့မၧၫ့ဘၪၦလံဝဲၫဖိၪၥံၪ ဂဲၫဆိၬယဟိဝၩအခ့ၫ အၡၩစမိစ့ၭအဆၧအၪ့ထုၫ့ကီၪ့လၧယုဒၫ, ဒဲလၧယရုစ လံၫ့အဖၧၩ့, ဒဲလၧအံၫစရ့လၭအၡၩ အီၪကီၪ့ဖိၪလၧ",
			"7": "<sup>7</sup> ဆၧအုၩ့လၩ့အတဲၩဆံၫ့ဎံၪအဂးနီၪ, မွဲဘၪလဲၪ.- အဂဲး ဘဲၫယီၩ ၦမုၪအအၧၩ့ နးအၭၥလဲအၫ အဖိၪခွၫၥံၪမၩ ဂၭဂီၩ့ယူၭယွၩအဂံၪ့တၭ, ကယဲဆၧလမံၩ့လါလါလၧ ၦအီၪက့ၪဆံၫ့ဎံၪဝ့ၫလၧ ယဟိဝၩအဂံၪ့ဖၧၩ့နီၪ,အဝ့ၫ ၥံၪဖ့ၪလၫ့ယူၭလၧ ဘၫအလၭလဖၪလီၫ.",
			"8": "<sup>8</sup> စဎွၩမၪလူၬဆၧနီၪ ၦမၩတလၫလဖျိၪ့တၭ,အီၪက့ၪ",
			"9": "<sup>9</sup> လၩ့ဝ့ၫလၧယဟိဝၩအဂံၪ့ အတရၫ့နီၪလၧခီၫ့လီၫ.- တၭ အဝ့ၫၥံၪဒုၭဂၧၫ့ထၪ့ၥၩလၩ့ ဆၧလၧယုဒၫထၧၫ့ခးယၫ, ဒဲလၧယရုစလံၫ့ ထၧၫ့ဒိၩ့ယၫ ဘဲၫၥိၭၦမိဂဲၫဆိၬဆၧ အၪ့ထုၫ့ကီၪ့လၧယွၩအခ့ၫအၡၩ စမိစ့ၭအီၪက့ၪလၧ အံၫစရ့လၭအဖၫ့ခိၪလၧ ၡါမုနၧၫ့ဖၫနီၪ, လၧယဟိဝၩ",
			"10": "<sup>10</sup> အအီၪလီၫ.- ၦဒိၪဖၭဒိၪၥံၪ, ဒဲၦခမျၧးထီးအလူၬၥုၪ့ ထိၬၥၭထိၬဂဲၫဆိၬဆၧတၭ, ဒုၭနုၬလၩ့ဝ့ၫလၧတလၫ",
			"11": "<sup>11</sup> လဖျိၪ့နီၪအဖၧၩ့ထီးအထုၬလီၫ.- တၭအဆၧၫ့အထီ လၧတလၫနီၪ ဘၪဆၧဂဲၫဆိၬဝ့ၫလၧစဎွၩအၦဒိၪဖၭ ဒိၪအအီၪလၧၦလံဝဲၫဖိၪအစူၪဖၧၩ့နီၪ, ထီးအဝ့ၫၥံၪဒၪ ဘၪလၧစ့ၩအီၪအၪမၬတၭ, ဆၧမၩအၥၭလၧစဎွၩအ ၡၩကွ့ၭလံၬလဂၩ, ဒဲၦလုဆၧအခိၪ အၦဒိၪလဂၩဂဲၫ ဂါလၩ့ခွံၬဝ့ၫတၭ, မၩန့ဝ့ၫ, အီၪက့ၪထဲၩ့ဝ့ၫလၧအလး လီၫ.မၩဝ့ၫဘဲၫနီၪလနံၩဘၪလနံၩတၭ, အၪ့ထုၫ့ကီၪ့",
			"12": "<sup>12</sup> စ့ၩအၪအၪလ့ၬလီၫ.- စဎွၩဒဲစယဟီအဒၫ ဖ့ၪလၫ့ဝ့ၫ လၧၦမၩယဟိဝၩအဂံၪ့အဆၧမၩတၭ, အၪ့လံၩ့ၦပၠၩ့ ၥမါၥံၪ, ဒဲၦလဲၬၥမါၥံၪလၧစ့ၩဘဲၫၥိၭ အမိမၩထဲၩ့ယ ဟိဝၩအဂံၪ့, ဒဲၦလၧအမၩဆၧလၧထၭဒဲလၧထီးဝီၩဆ့,",
			"13": "<sup>13</sup> ဘဲၫၥိၭအမိမၩဂ့ၩထၪ့ထဲၩ့ယဟိဝၩအဂံၪ့လီၫ.- ၦမၩ ဆၧၥံၪနီၪမၩဆၧတၭ, ဆၧမၩနီၪဂီၩ့ဝ့ၫဂ့ၩဘၪစဲၪတၭ,",
			"14": "<sup>14</sup> မၩဂုးမၩခၧၫ့ယွၩအဂံၪ့လီၫ. အဝ့ၫၥံၪမၩဝ့ၫဂီၩ့တၭ, ဂဲၫဆိၬစ့ၩလၧအအီၪလၩ့ထးနီၪ လၧစဎွၩဒဲစယဟီအ ဒၫအအီၪတၭ, ၦမၩကဲၪထၪ့ဝ့ၫလၧထွ့ၫၥံၪ လၧယဟိ ဝၩအဂံၪ့အဂး, ထွ့ၫၥံၪလၧၦမၩဆၧအဂး, ဒဲလၧဆၧ လုအဂး, ဒဲလၧနိၪထိၩ့ၥံၪ, ဒဲထွ့ၫထီၫ့ၥံၪ, ဒဲထွ့ၫစ့ၩၥံၪ လီၫ.တၭအဝ့ၫၥံၪလုထၪ့ ဆၧလုမ့ၪလၧယဟိဝၩအ ဂံၪ့ဖၧၩ့လထံၪဎးဘီၩ့ဎး လၧစယဟီအဒၫအမုနံၩထီး အလူၬနီၪလီၫ.",
			"15": "<sup>15</sup> စယဟီအဒၫအၥၭၡါထၪ့တၭ, အမုနံၩလဖၪလၧၫ့ ဎွ့ၩထၪ့တၭၥံၫဝ့ၫဒၪလီၫ. ထီးအၥံၫနီၪအၥၭၡါအနံၪ့",
			"16": "<sup>16</sup> လယၩၥၧၫ့ဆံၫလီၫ.- တၭၦခုၪ့လၩ့ဘၧၩ့ခွံၬဝ့ၫလၧ စဒၫဝံၭအဒိၩ့ဖၧၩ့ လၧစဎွၩအကျၩ, အဂဲးဘဲၫယီၩ လၧယွၩအဂးမွဲဂ့ၩ, လၧအၡၩဂံၪ့ဖိၪအဂးမွဲဂ့ၩ, အဝ့ၫ မၩဆၧဂ့ၩလၧအံၫစရ့လၭအဖၧၩ့လီၫ.",
			"17": "<sup>17</sup> လၧစယဟီအဒၫ ၥံၫဝ့ၫအလးခဲၫ့နီၪ, ယုဒၫအၦဒိၪ ဖၭဒိၪလဖၪဂဲၫဝ့ၫတၭ, ၡီၫ့ကူၭလၩ့အၥၭလၧစဎွၩအ",
			"18": "<sup>18</sup> မ့ၬယၫတၭ, စဎွၩခိၭနၪအဝ့ၫၥံၪအလူလီၫ.- အဝ့ၫၥံၪ စဲၪ့ဒၪယဟိဝၩအဝ့ၫၥံၪအဖါလဖၪ အယွၩအဂံၪ့တၭ, မၩအၡ့ရိၫဒဲဆၧဂၩ့လဖၪအဆၧတၭ, ဆၧၥၭထၪ့လၩ့ ဘၪယုဒၫဒဲယရုစလံၫ့ လၧအဆၧမၩမၪဆၧနီၪအကၠီၩ့",
			"19": "<sup>19</sup> လီၫ.- မွဲလါနၫ့တၭအဝ့ၫဒၪအၪ့မၧၫ့လၩ့ မီၪၥံၪဘဲၫၥိၭ အမိဒုၭထဲၩ့ထဲၩ့အဝ့ၫၥံၪ လၧယဟိဝၩအအီၪတၭ, အဝ့ၫၥံၪထိးအၥၭထၫ့ဒၩဝ့ၫလါနၫ့တၭ, ၦၡၩခိၭနၪဝ့ၫ အ့ၬ.",
			"20": "<sup>20</sup> ယွၩအၥၭလၩ့ဘၪ ၦလုဆၧစယဟီအဒၫအဖိၪခွၫ စဇ့ၭခရဲအၫလၧအဆၧၫ့ထုၪ့လၧ ၦခမျၧးအဖၫ့ခိၪတၭ, စံၭအဝ့ၫၥံၪ, ယဟိဝၩစံၭဘဲၫယီၩ, နၥံၪလၨၪခၫ့ဖၬယဟိ ဝၩအဆၧမၪလူၬလဖၪ ထီးနၥံၪဘီၪထၪ့ယီၫထၪ့လၥ့ၪ ဘၪနီၪ,မွဲဘၪလဲၪ. မွဲနၥံၪစဲၪ့ဒၪ ယဟိဝၩတၭ,အဝ့ၫ",
			"21": "<sup>21</sup> ဒၪစဲၪ့ဒၪနၥံၪဆ့လီၫ.- ၦကိၪ့ထၪ့လိၬအၥၭထၫ့ဒၩအ ဝ့ၫတၭ,ခွံၬဝ့ၫလၧလိးလၧစဎွၩ မၪလူၬဆၧအကၠီၩ့လၧ",
			"22": "<sup>22</sup> ယဟိဝၩအဂံၪ့အဝၩ့ဖၧၩ့နီၪလီၫ.- တၭစဎွၩယိအၭ နၪ့ထၪ့ထဲၩ့လၧၩ့ဆၧအခိးအတၩ လၧအဖါစယဟီအ ဒၫမၩဝ့ၫဒၪဆ့အ့ၬ, မၩၥံၫအဖိၪခွၫတၭး ထီးအၥံၫနီၪ စံၭဝ့ၫဒၪ,မွဲယဟိဝၩယိဝ့ၫ, ဒဲအၪ့ဎၬဝ့ၫဆံၭ.",
			"23": "<sup>23</sup> ဆၧလၧနံၪ့နီၪဆၧၫ့ထဲၩ့အလးတၭ, ဆၧမၩအၥၭ လၧစံရအၫအၡၩၥုၭမုခမျၧး ဂဲၫထၫ့ဒၩအဝ့ၫတၭ, ဂဲၫ ဝ့ၫလၧယုဒၫဒဲယရုစလံၫ့တၭ, မၩဂၭဂီၩ့ကယဲၦခမျၧး အၦဒိၪဖၭဒိၪထီးအလူၬ လၧၦခမျၧးအကျၩတၭ, ဖ့ၪ လၫ့ယူအဆၧအၪ့ဂူၬန့ထီးအလူၬ လၧဒမၭစကၧၭအ",
			"24": "<sup>24</sup> စဎွၩလီၫ.- အဂဲးဘဲၫယီၩၦစံရအၫဖိၪအၥုၭမုဂဲၫၦၡၩ ၥံၪၡၩဂၩတၭ, ယဟိဝၩဖ့ၪလၫ့ၦၥုၭမုခမျၧးဖၭဒိၪလၧ အဝ့ၫၥံၪအစူၪဖၧၩ့ လၧအစဲၪ့ဒၪယဟိဝၩ အဝ့ၫၥံၪအဖါ ၥံၪအယွၩအကၠီၩ့လီၫ. တၭအဝ့ၫၥံၪဒုၭဘၪစယိအၭ လၧဆၧစ့ၩရၫ့ဘဲၫနီၪလီၫ.",
			"25": "<sup>25</sup> ထီးအဝ့ၫၥံၪစဲၪ့ထၪ့ခွံၬ လၧအအီၪ (အဂဲးဘဲၫယီၩ စဲၪ့ဒၪဝ့ၫလၧအဘၪ ဆၧဆၫနၭနၭလ့ၬ,) အခ့ၫအၡၩ ဒၪဝ့ၫကိၪ့ထၪ့လိၬအၥၭထၫ့ဒၩအဝ့ၫ လၧၦလုဆၧစယ ဟီအဒၫအဖိၪခွၫၥံၪ အၥွံၪအကၠီၩ့တၭ, မၩၥံၫဝ့ၫလၧ အလးမံၫဖၧၩ့ၥံၫဝ့ၫတၭ, ၦခုၪ့လၩ့ဘၧၩ့ခွံၬဝ့ၫလၧစဒၫ ဝံၭအဒိၩ့ဖၧၩ့း အ့ၪမွဲ, ခုၪ့လၩ့ဘၧၩ့ဝ့ၫလၧစဎွၩၥံၪအ",
			"26": "<sup>26</sup> ၥွၪခိၪအဖၧၩ့အ့ၬ.- အယီၩမွဲၦလၧအကိၪ့ထၪ့လိၬအ ၥၭထၫ့ဒၩဝ့ၫ, ၦအၫမၧၫ့မုၪ နးၡံမအၭအဖိၪခွၫစဇၫ ဘၭ,ဒဲၦမိအၭမုၪ နးၡံမရၭ အဖိၪခွၫစယဟီဇဘၭ",
			"27": "<sup>27</sup> လီၫ.- တၭအဖိၪခွၫလဖၪ, ဒဲဆၧအွံၪဆၧယိၭလၧအ ဎၧၫ့လၧအအီၪဝ့ၫလၧအလီၩ့, ဒဲဆၧမၩဂ့ၩထၪ့ထဲၩ့ယ ဟိဝၩအဂံၪ့အဂဲးအကၠီၪ့နီၪ, ယိခွါ, ကွ့ၭအၥၭလၧလံၬ စဎွၩအလံၬလီၩဆိၩဆၧအဖၧၩ့လီၫ. တၭအဖိၪခွၫ စအၫမဇဲအၫကဲၪထၪ့စဎွၩလၧအလးလီၫ."
		},
		"25": {
			"1": "<sup>1</sup> လၧစအၫမဇဲအၫ ကဲၪၥၫ့စဎွၩနီၪ အၥၭအီၪနံၫဆံၫ ယဲနံၪ့တၭ, ကဲၪစဎွၩလၧယရုစလံၫ့အဖၧၩ့နံၫဆံၫခွံၫ နံၪ့လီၫ. အမိအမံၩ့မွဲနးယဟိအၭဒၫ့ လၧယရုစလံၫ့နီၪ",
			"2": "<sup>2</sup> လီၫ.- စဎွၩမၩဆၧဂ့ၩလၧယဟိဝၩ အမ့ၬယၫလါနၫ့",
			"3": "<sup>3</sup> တၭ,မၩဝ့ၫလၧအၥၭ ထၧၫ့ဖျိၪ့ယၫဆ့အ့ၬ.- ထီးအ ဘၩ့အမုးအီၪဂုးအီၪခၧၫ့ လၧအစူၪဖၧၩ့တၭ, ဆၧမၩ အၥၭလၧအမၩၥံၫအခ့ၫအၡၩလဖၪ လၧအမၩၥံၫအ",
			"4": "<sup>4</sup> ဖါနီၪလီၫ.- မၩၥံၫအဝ့ၫၥံၪအဖိၪလဖၪနီၪအ့ၬ. ဘဲၫ ဆၧကွ့ၭအၥၭလၧစမိစ့ၭ အဆၧၥီၪ့ဆၧၥၫ့အဖၧၩ့အ ၥိၭ,ထီးယဟိဝၩမၪလူၬဆၧစံၭဝ့ၫဒၪ, ဖါလဖၪဘၪၥံၫ လၧဖိၪလဖၪအကၠီၩ့အ့ၬ, ဖိၪလဖၪနီၪဘၪၥံၫလၧဖါအ ကၠီၩ့ဆ့အ့ၬ. အ့ၪမွဲၦၡၩမိဘၪၥံၫလဂၩဘၪလဂၩလ ဂၩဘၪလဂၩ လၧအဆၧဒဲၩဘၭဒၪဝ့ၫအကၠီၩ့နီၪဆုၬ ဆုၬလီၫ.",
			"5": "<sup>5</sup> စအၫမဇဲအၫဒုၭအီၪကီၪ့ယုဒၫတၭ, အီၪက့ၪၦအ ထီၫ့ၥံၪအခိၪလဖၪ, ဒဲၦအယၩၥံၪအခိၪလဖၪ, ဘဲၫအ ဝ့ၫၥံၪအဖါလဖၪအဂံၪ့အၥိၭနီၪ, လၧယုဒၫဒဲဘံၪ့ယမံၫ့ ထီးအလူၬအကျၩတၭ, ဝံထၪ့နၬထၪ့ ၦလၧအၥၭအီၪ အနံၪ့နံၫဆံၫ, ဒဲနံၫဆံၫအဖၫ့ခိၪတၭ, ဒၪန့ၦရွံန့ဖိၪၥၧၫ့ ကုၬလၧအလ့ၩဒုၭၥုၭၥ့ၪ, ဖီၪ့ထၬဖၩ့ၥံၪဒဲထၩ့ဖံၭၥံၪၥ့ၪ",
			"6": "<sup>6</sup> လီၫ.- အဝ့ၫအၪ့လံၩ့ၦအဆီၪ့, ဒဲအၥၭဒူၩလၧအံၫစရ့ လၭအကျၩလကုၬလၧ စ့ၩအကံကၫလယၩအဂးလီၫ.",
			"7": "<sup>7</sup> အ့ၪမွဲယွၩအၡၩလဂၩဂဲၫလၧအအီၪတၭ, စံၭဝ့ၫဒၪ, စဎွၩဧ့, ဒုၭလ့ၩအံၫစရ့လၭအၡၩၥုၭမုလၧနၥိၭလဂ့ၩ, အဂဲးဘဲၫယီၩ ယဟိဝၩအီၪလၧအံၫစရ့လၭ, အံဖြံၫ့ဖိၪ",
			"8": "<sup>8</sup> ထီးအလူၬအၥိၭနီၪအ့ၬ.- အ့ၪနမိလ့ၩတၭ, လ့ၩဘီၪ, နမိဆီၪ့ထၪ့လၧဒုၭဆၧအဂးလါနၫ့ ယွၩမိဒုၭလၩ့ထံၩ ဖါနၧၩလၧနဒုၪနဒၩၥံၪအမ့ၬယၫလီၫ. အဂဲးဘဲၫယီၩ ယွၩအီၪဝ့ၫလၧအစီၩ့အမၩ့ဘဲၫၥိၭ အမိမၩဆၧၩ့ဆၧ",
			"9": "<sup>9</sup> ဒဲဘဲၫၥိၭအမိဒုၭလၩ့ထံၩဖါဆၧလီၫ.- တၭစအၫမဇဲၫ အၫစံၭယွၩအၡၩ, စ့ၩအကံကၫလယၩလၧယဖ့ၪလၫ့ အံၫစရ့လၭအၡၩၥုၭမုနီၪ, ပမိမၩဘဲၫၥ့ၪလဲၪ. တၭ ယွၩအၡၩစံၭဆၧၫ့ဝ့ၫဒၪ, ယဟိဝၩဖ့ၪလၫ့နၧၩအၪနဲၪ့",
			"10": "<sup>10</sup> အနီၪၥ့ၪလီၫ.- ထီးနီၪလဖၧၫ့စအၫမဇဲၫအၫမၩလၩ့မု လၩ့ဖၭၦၥုၭမုလၧအဂဲၫလၧအအီၪ လၧအံဖြံၫ့ဘဲၫၥိၭ အမိထဲၩ့ထဲၩ့လၧအလးဒၪဝ့ၫ, မၩအၥၭဘဲၫနီၪတၭ, အဝ့ၫၥံၪအၥၭထၪ့ခဲၩထၪ့ထၫ့ဒၩ ယုဒၫနၭနၭလ့ၬတၭ, ထဲၩ့ထဲၩ့ဝ့ၫလၧအလး လၧအၥၭထၪ့ဖၭဒိၪလီၫ.",
			"11": "<sup>11</sup> စအၫမဇဲၫအၫမၩဆီၪ့ထၪ့အၥၭတၭ, ၥိၫ့ထၪ့အၡၩ ခမျၧးလ့ၩဝ့ၫ လၧထံၫလၪအခိၪလီၩ့ဆူၭတၭ, ကျီၪ့ၥံၫ",
			"12": "<sup>12</sup> ခွံၬၦစံအၫဖိၪလလၬလီၫ.- တၭၦလၧအမၧၫ့ဒံၭလလၬ နီၪၦယုဒၫဖိၪဆိၬထၪ့ခွံၬဝ့ၫတၭ ဆိၬန့ဝ့ၫထီၩ့လၧလိး အဒၩ့ခိၪတၭ, ခွံၬလၩ့ခွံၬဝ့ၫလၧလိးအဒၩ့ခိၪနီၪ ၦလ ဖၪနီၪလၩ့ဘျ့ၭခွံၬဝ့ၫထီးအလူၬလီၫ.",
			"13": "<sup>13</sup> ၦၥုၭဖိၪလဒီၪ့လၧစအၫမဇဲၫအၫအၪ့မၧၫ့အထဲၩ့ဘဲၫ ၥိၭအထီးလ့ၩဝ့ၫလၧအၥိၭ လၧဆၧဒုၭၥုၭလဂ့ၩနီၪ, ကျီၪ့ခွံၬယုဒၫအဒိၩ့လဖၪ လၧစမ့ရအၫဖိးလၧဘ့ၫၥဟိ ရၫ့,ကျီၪ့ခွံၬၦၥၧၫ့ထီၫ့လၧအကျၩတၭ, မၩန့ဆၧဖိၪဆၧ",
			"14": "<sup>14</sup> လံၩအၪအၪလ့ၬလီၫ.- စအၫမဇဲၫအၫဂဲၫဝ့ၫလၧဆၧ မၩၥံၫၦအံဒၧၫ့ဖိၪ အလးခဲၫ့နီၪ, ဆၧမၩအၥၭလၧအ ဂဲၫဆိၬၦစံအၫဖိၪအယွၩလဖၪတၭ, အီၪက့ၪဝ့ၫလၧအ မ့ၬယၫတၭ, ဆူၭခဲၩထၪ့ဆၧနၧၫ့မၧၫ့လၧအဂးလီၫ.",
			"15": "<sup>15</sup> တၭယဟိဝၩအၥၭထၪ့ခဲၩထၪ့ထၫ့ဒၩ စအၫမဇဲအၫ တၭ,အၪ့မၧၫ့လၩ့မီၪလဂၩ လၧအအီၪလၧအစံၭဝ့ၫ,န အၪ့ဎၬဆၧလၧၦဆၨၩအယွၩၥံၪလၧ အမၩဖီၩ့မၩဖျ့ၭ အၡၩခမျၧးဒၪဝ့ၫ လၧနစူၪဖၧၩ့လၥ့ၪဘၪနီၪ, မွဲဘၪ",
			"16": "<sup>16</sup> လဲၪ.- အဆၧချဲၩ့ဒုၪ့အဝ့ၫဒၪအဘိၩ့ဘၭနီၪတၭ, ဆၧ မၩအၥၭလၧစဎွၩစံၭဝ့ၫ, မွဲနကဲၪထၪ့ၦကိၪ့လိၬဆၧလၧ စဎွၩနီၪဆ့ဧၪ, အီၪလၩ့မါပံၭဆံၭ. နမိဘၪဆၧကျီၪ့ နၧၩမွဲဘၪလဲၪ တၭမီၪလဂၩနီၪအီၪလၩ့မါပံၭတၭ, စံၭ ဝ့ၫဒၪ,ယၥ့ၪယၫလၧယွၩဖၭဝဲၩဝ့ၫ လၧအမိမၩဂၭဂီၩ့ နၧၩလီၫ. အဂဲးဘဲၫယီၩနမၩဆၧလမံၩ့ယီၩ, လခိၭနၪ ဘၪဆၧၥီၪ့လီၫ.",
			"17": "<sup>17</sup> ထီးနီၪလဖၧၫ့ယုဒၫအစဎွၩ စအၫမဇဲၫအၫထီးန့ဆၧ ၥီၪ့တၭ,အၪ့မၧၫ့လၩ့အၥီၫ့လဂၩ လၧအံၫစရ့လၭအစ ဎွၩယံဟုၫအဖိၪခွၫ စယဟိအဟၭအဖိၪခွၫ စယိအၭ",
			"18": "<sup>18</sup> တၭ,စံၭဝ့ၫဒၪဂဲၫဘီၪၬ မွဲပယိလိၬပမ့ၬဆံၭ.- တၭအံၫ စရ့လၭအစဎွၩယိအၭ အၪ့မၧၫ့လၩ့ဆၧလၧယုဒၫအစ ဎွၩအၫမဇဲၫအၫတၭ, စံၭဝ့ၫဒၪ, ဆၧဆူၪလၧလ့ၭဘ နၧၫ့အလီၩ့,အၪ့မၧၫ့လၩ့ဆၧလၧၥံၪ့ၡိၫအ့ရ့ၭလၧလ့ၭ ဘနၧၫ့အလီၩ့စံၭဝ့ၫဒၪ, ဖ့ၪလၫ့နဖိၪမုၪလၧယဖိၪခွၫအ မၫအဂးဆံၭ. တၭဆၧဖိၪဆၧဎါအမံၩ့လၧလ့ၭဘနၧၫ့ အလီၩ့လဒုၩလ့ၩဖီၩ့ဝ့ၫတၭ ယဲးထဲးလၩ့ဆၧဆူၪနီၪ",
			"19": "<sup>19</sup> လီၫ.- နစံၭ,ယိခွါ, နကျီၪ့ခွံၬယူၭၦအံဒၧၫ့ဖိၪယူၭတၭ, နၥၭအီၪက့ၪထၪ့ထီၫနၧၩ ဘဲၫၥိၭနမိအီၪက့ၪဖိၫလိၫန ၥၭလီၫ. အီၪလၧနဂံၪ့ဆံၭ. နအၪ့ဎၬန့နလးလၧနမိဘၪ ထံၭအဂးဘဲၫၥိၭနမိလၩ့ထံၩဖါ, နဝ့ၫဒၪ,ဒဲယုဒၫလၧန",
			"20": "<sup>20</sup> ၥိၭဆ့,မွဲဘၪလဲၪ.- မွဲလါနၫ့ဘိၩစအၫမဇဲၫအၫခိၭနၪ ဝ့ၫအ့ၬ. အဂဲးဘဲၫယီၩမွဲဝ့ၫလၧယွၩလခီၫး ဘဲၫၥိၭအ မိဖ့ၪလၫ့ခွံၬအဝ့ၫၥံၪလၧအဒုၪအဒၩ အစူၪဖၧၩ့လၧအ အၪ့ဎၬဆၧလၧအံဒၧၫ့ အယွၩလဖၪ အကၠီၩ့နီၪလီၫ.",
			"21": "<sup>21</sup> အခိးမွဲအံၫစရ့လၭအစဎွၩ ယိအၭလ့ၩထၪ့တၭ,အဝ့ၫ ဒၪဒဲယုဒၫအစဎွၩအၫမဇဲၫအၫယိလိၬအမ့ၬ လၧဘ့ၭၥ",
			"22": "<sup>22</sup> ၡံမ့ၭ,ဘၪဆဲၫ့လၧယုဒၫလီၫ.- ယုဒၫစၪဝ့ၫလၧအံၫစရ့ လၭအမ့ၬယၫတၭ, ၦစဲၪ့ခွံၬဝ့ၫလဂၩ လၧအတဲၩဒၪ",
			"23": "<sup>23</sup> ဝ့ၫ,လဂၩလၧအတဲၩဒၪဝ့ၫနီၪလီၫ.- တၭအံၫစရ့လၭအ စဎွၩယိအၭမၩန့ယုဒၫအစဎွၩယဟိအဟၭအဖိၪခွၫ, စယိအၭအဖိၪခွၫစအၫမဇဲၫအၫ လၧဘ့ၭၥၡံမ့ၭအဖၧၩ့ တၭဂဲၫဆိၬဝ့ၫလၧယရုစလံၫ့တၭ, မၩလၩ့ဎီးခွံၬယရု စလံၫ့အခိၪဒၧၩ့အဖျါလံယၩလၧ တရၫ့အံဖြံၫ့ထီၩ့လၧ",
			"24": "<sup>24</sup> ဆၧအနိၪ့အတရၫ့လီၫ.- တၭမၩန့ထီၫ့ဒဲစ့ၩ ထီးအ လူၬ,ဒဲဆၧအဎၧၩ့အဎီ လၧအဒၪန့ဝ့ၫ လၧယွၩအဂံၪ့ ဖၧၩ့,အီၪလၧစအိၫဘဒံဒၧၫ့အစူၪဖၧၩ့ထီးအလူၬ, ဒဲဆၧ လူဒိၪဎွ့ၩဒိၪလၧစဎွၩအဂံၪ့ဖၧၩ့, ဒဲၦထိးအၥၭလဖၪ ဆ့တၭ,ထဲၩ့ကဒၩထဲၩ့ဝ့ၫလၧစမ့ရအၫနီၪလီၫ.",
			"25": "<sup>25</sup> လၧအံၫစရ့လၭအစဎွၩ ယဟိအဟၭအဖိၪခွၫစယိ အၭၥံၫဝ့ၫအလးခဲၫ့နီၪ, ယုဒၫအစဎွၩယိအၭအဖိၪခွၫ",
			"26": "<sup>26</sup> စအၫမဇဲၫအၫမၧၫ့ဒံၭလဆံၫယဲနံၪ့လီၫ.- ဆၧအီၪလၩ့ ထးဘၪဆဲၫ့လၧစအၫမဇဲၫအၫ အခၪ့ထံၭ ဒဲအထုၬနီၪ, ယိခွါ,ကွ့ၭအၥၭလၧယုဒၫဒဲ အံၫစရ့လၭအစဎွၩၥံၪအ",
			"27": "<sup>27</sup> လံၬဖၧၩ့နီၪ,လမွဲဘၪဧၪ.- တၭလၧအဆၧၫ့အထီလၧ စအၫမဇဲၫအၫကၠၪကဒၩခွံၬအၥၭ လၧအဖိၬယဟိဝၩ အခဲၫ့နီၪ, ၦကိၪ့ဆၧအၧၩ့ထၫ့ဒၩအဝ့ၫ လၧယရုစလံၫ့ အဖၧၩ့တၭ, အဝ့ၫစဲၪ့ဖျိၭဖိးလၧလၫခံၭ, အ့ၪမွဲဆၧအၪ့ မၧၫ့လၩ့ၦလီၩ့ဆီးအဝ့ၫ ထီၩ့လၧလၫခံၭတၭ, မၩၥံၫ ဝ့ၫထီးနီၪလီၫ.",
			"28": "<sup>28</sup> တၭၦဂဲၫဆိၬဝ့ၫလၧကၥ့ၪအလီၩ့ ခုၪ့လၩ့ဘၧၩ့ခွံၬ ဝ့ၫလၧအဖါၥံၪအၥိၭ လၧယုဒၫအဒိၩ့ဖၧၩ့လီၫ."
		},
		"26": {
			"1": "<sup>1</sup> ထီးနီၪလဖၧၫ့ယုဒၫအၡၩခမျၧးထီးအလူၬ မၩန့စ အၧၭဇဲအၫ, လၧအၥၭအီၪ လဆံၫဎူၫနံၪ့လဂၩတၭ, အီၪက့ၪထၪ့ဝ့ၫ လၧစဎွၩလၧအဖါ စအၫမဇဲၫအၫအ",
			"2": "<sup>2</sup> လးနီၪလီၫ.- လၧစဎွၩမံၫလၧအဖါၥံၪအၥိၭ အလးခဲၫ့ နီၪ,အဝ့ၫဒၪမၩထၪ့ထဲၩ့အံလီၭတၭ, မၩန့ထဲၩ့ဝ့ၫလၧ ယုဒၫအဂးလီၫ.",
			"3": "<sup>3</sup> စအၧၭဇဲအၫကဲၪၥၫ့စဎွၩနီၪ အၥၭအီၪလဆံၫဎူၫနံၪ့ တၭ,ကဲၪစဎွၩလၧယရုစလံၫ့အဖၧၩ့ ယဲဆံၫနံၫနံၪ့လီၫ. အမိအမံၩ့မွဲနးယ့ၭကလဲအၫ ဘၪဆဲၫ့လၧယရုစလံၫ့",
			"4": "<sup>4</sup> လီၫ.- တၭအဝ့ၫဒၪမၩဆၧအဂ့ၩ လၧယဟိဝၩအမ့ၬ ယၫဘဲၫကယဲဆၧလၧအဖါ စအၫမဇဲၫအၫမၩဝ့ၫအၥိၭ",
			"5": "<sup>5</sup> နီၪလီၫ.- တၭလၧစဇၭခရဲအၫအမုနံၩလဖၪလၧအနၪ ၥ့ၪဆၧဒၪဆၧလၧယၫလခီၫ ဘၪဆဲၫ့လၧယွၩနီၪ, အဝ့ၫ ဒၪအၪ့ဎၬယွၩတၭ, မုနံၩလဖၪလၧအအၪ့ဎၬယဟိဝၩ နီၪ,ယွၩဒုၭဘီၪထၪ့ယီၫထၪ့ဝ့ၫလီၫ.",
			"6": "<sup>6</sup> အဝ့ၫဒၪလ့ၩဆၧတၭ, ဒုၭဆၧလၧၦဖလံၡၫဖိၪတၭ, မၩလၩ့ဎီးခွံၬဂၫၥၭအခိၪဒၧၩ့, ဒဲယၭဘနံၫအခိၪဒၧၩ့ဒဲ အၭၡဒီၭအခိၪဒၧၩ့တၭ, မၩကဲၪထၪ့ဒိၩ့လဖၪလၧအၭ",
			"7": "<sup>7</sup> ၡဒီၭအနဲၩ့, ဒဲလၧၦဖလံၡၫဖိၪအကျၩနီၪလီၫ.- တၭ ယဟိဝၩမၩဆၧၩ့ဝ့ၫ ထၫ့ဒၩၦဖလံၡၫဖိၪ ဒဲၦအရ့ဘၠၫ ဖိၪလၧအအီၪဝ့ၫ လၧဂၧၫဘၫအလၭ, ဒဲလၧၦမဟုနံၫ့ ဖိၪအကျၩလီၫ.",
			"8": "<sup>8</sup> ၦအၫမၧၫ့ဖိၪၥံၪဖ့ၪလၫ့လၬဆီၪ့ လၧစအၧၭဇဲအၫ တၭအမံၩ့ဂၧၫ့ထၪ့ၥၩလၩ့ ထီၩ့လၧဆၧလ့ၩနုၬလၧအံ ဇံၭအဖၧၩ့လီၫ. အဂဲးဘဲၫယီၩမၩဆီၪ့ထၪ့အၥၭဆီၪ့",
			"9": "<sup>9</sup> ဆီၪ့လ့ၬလီၫ.- လၧနီၪအမ့ၬယၫစအၧၭဇဲအၫမၩကဲၪ့ ထၪ့တၨၭထီၫၥံၪလၧယရုစလံၫ့အဖၧၩ့ ထီးဆၧအနိၪ့ အတရၫ့, ဒဲလၧခိၪလီၩ့ဆူၭအတရၫ့, ဒဲလၧဆၧအနိၪ့ နီၪတၭ,မၩခၧၫ့ထၪ့ဝ့ၫလီၫ.",
			"10": "<sup>10</sup> မၩကဲၪထၪ့ဆ့တၨၭထီၫၥံၪ လၧၡါမုနၧၫ့ဖၫဒဲခုၪ့ထံၫ ဖၧၩ့အၪဖၧၩ့လီၫ. အဂဲးဘဲၫယီၩလၧခိၪလီၩ့ဆူၭဖၧၩ့ မွဲဂ့ၩ, လၧဆၧဒၩဖၧၩ့မွဲဂ့ၩ အဆၧဖိၪဆၧဎါအဒိၩ့အီၪ အၪအၪလ့ၬတၭ, အီၪလၧၦမၩဆံၬ, ဒဲၦယိစဘံၭမု, လၧခိၪလီၩ့ထိၩ့ချိၬ, ဒဲလၧဆၧၥၪထၪ့ဂ့ၩ အလးလီၫ. အဂဲးဘဲၫယီၩ အဝ့ၫဒၪအဲၪဒိၭဆၧမၩကၩလီၫ.",
			"11": "<sup>11</sup> လၧနီၪအမ့ၬယၫစအၧၭဇဲအၫအီၪလၧ ၦၥုၭမုခမျၧး ၦၥုၭဖိၪလၧအလ့ၩဒုၭၥုၭလဒီၪ့လဒီၪ့, ဘဲၫအဝ့ၫၥံၪအ ဆရၫ့အဆၧဝံဆၧနၬ လၧၦကွ့ၭလံၬ စယအ့လၭဒဲၦ ဒိၪစမၫအစဲအၫ အစူၪဖၧၩ့အၥိၭအီၪဝ့ၫလၧစဎွၩအ",
			"12": "<sup>12</sup> ၥုၭခိၪစဟၫနၫနဲအၫအစူၪဖၫ့လၬနီၪလီၫ.- တၭၦအ ဒိၪအဆီၪ့အဖါၥံၪအခိၪလဖၪ အဆၧဝံဆၧနၬနီၪမွဲၦ",
			"13": "<sup>13</sup> နံၫထီၫ့ဎူၫယၩလီၫ.- တၭလၧအဝ့ၫၥံၪအစူၪဖၧၩ့နီၪ,ၦ ၥုၭမုခမျၧးၥၧၫ့ကုၬနွ့ၫထီၫ့ယဲယၩအီၪဝ့ၫ လၧဒုၭဆၧ, ဒဲအစီၩ့ဒိၪအမၩ့ထီၫ ဘဲၫၥိၭအမိမၩဆၧၩ့စဎွၩထၫ့ဒၩ",
			"14": "<sup>14</sup> ဆၧအဒုၪအဒၩနီၪလီၫ.- တၭလၧၥုၭမုခမျၧးထီးအ လူၬအဂးနီၪ, စအၧၭဇဲအၫတဲၩ့ဝဲၩထၩ့ဖံၭၥံၪ, ဒဲဖၩ့ၥံၪ, ဒဲခိၪလူၬၥုၭၥံၪ, ဒဲဆဲၫ့ၥုၭၥံၪ, ဒဲချံၪၥံၪ, ဒဲဖလီၥံၪလၧအ",
			"15": "<sup>15</sup> ခွံၬလိးလဖၪလီၫ.- တၭလၧယရုစလံၫ့အဖၧၩ့နီၪ,မၩ စဲၭဖၭဒိၪၥံၪလၧၦကိၪ့ထၪ့ဆၧၥ့ၪလဖၪ ကိၪ့န့ဝ့ၫဘဲၫၥိၭ အမိအီၪလၧတၨၭထီၫအဖၫ့ခိၪ, ဒဲလၧခိၪဒၧၩ့အဖၫ့ခိၪ လၧအမိခၭဖျါး ဒဲလိးဖၭဒိၪၥံၪဆ့လီၫ. တၭအမံၩ့ဂၧၫ့ ထၪ့ၥၩလၩ့ဝ့ၫလီၫ. အဂဲးဘဲၫယီၩ ဆၧမၩဆၧၩ့ဝ့ၫ လၩ့မဲၩဒၪအဆၧထီးအဆီၪ့ထၪ့လီၫ.",
			"16": "<sup>16</sup> အ့ၪမွဲထီးအဝ့ၫဆီၪ့ထၪ့တၭ, အီၪက့ၪထၪ့ထီၫအၥၭ ထီးအထီၩ့လၧဆၧဂၭဂီၩ့လီၫ. အဂဲးဘဲၫယီၩမၩမၪ ယဟိဝၩလၧအမွဲအယွၩတၭ, လ့ၩနုၬလၧယဟိဝၩ အနီးဖၧၩ့ဘဲၫၥိၭအမိဆူၭခဲၩထၪ့ ဆၧနၧၫ့မၧၫ့လၧဆၧ",
			"17": "<sup>17</sup> လုအလးဆူၭခဲၩဆၧနၧၫ့မၧၫ့အဖၫ့ခိၪလီၫ.- ၦလုဆၧ စအၭဇရဲအၫလ့ၩနုၬဖိၬအခဲၫ့တၭ, ယဟိဝၩအၡၩလု",
			"18": "<sup>18</sup> ဆၧဎိၭဆံၫ, ၦအဆီၪ့အီၪလၧအၥိၭ,- အဝ့ၫၥံၪပဒၩ့စ ဎွၩအၧၭဇဲအၫတၭ, စံၭအဝ့ၫ, စအၧၭဇဲအၫဧ့, နမိဆူၭ ခဲၩဆၧနၧၫ့မၧၫ့ လၧယဟိဝၩအဂးနီၪ ဘၪဆဲၫ့လၧနၧၩ အ့ၬ. မွဲအဘၪဆဲၫ့လၧၦလုဆၧ စအၫရၧၫ့အဖိၪခွၫၥံၪ လၧဆၧအီၪက့ၪဆံၫ့ဎံၪဝ့ၫ ဘဲၫၥိၭအမိဆူၭခဲၩထၪ့ဆၧ နၧၫ့မၧၫ့လီၫ. စဲၪ့ထၪ့ခွံၬလၧဆၧအလးဆံၫ့ဎံၪအဖၧၩ့ ဆံၭ.အဂဲးဘဲၫယီၩ နမၩမၪဘၪယူၭဆၧယူၭ, ကဲၪထၪ့ နလၩနဖၩ့လၧယဟိဝၩအ့ၬ.",
			"19": "<sup>19</sup> စအၧၭဇဲအၫအၥၭထၪ့တၭ, ဖၧၩ့မ့ၪအီၪဝ့ၫလၧအ စူၪဖၧၩ့ဘဲၫၥိၭအမိဆူၭခဲၩထၪ့ဆၧနၧၫ့မၧၫ့တၭ, ဘိၩ့ လၧအၥၭထၪ့ၦလုဆၧလဖၪနီၪ, ဆၧခံၫထူၬဆၫအၧၩ့ အီၪထၪ့ဝ့ၫလၧအမ့ၬထုးခိၪ လၧၦလုဆၧအမ့ၬယၫလၧ ယဟိဝၩအဂံၪ့ဖၧၩ့ လၧဆၧလုလးဆူၭခဲၩနၧၫ့မၧၫ့အ",
			"20": "<sup>20</sup> နဲၩ့ထံၭနီၪလီၫ.- ၦလုဆၧအခိၪစအၭဇရဲအၫဒဲၦလု ဆၧလဖၪထီးအလူၬယိဝ့ၫတၭ, ယိခွါ,ဘၪဆၧခံၫထူၬ ဆၫအၧၩ့လၧအမ့ၬထုးခိၪတၭ, အဝ့ၫၥံၪနၫ့ထၪ့ခွံၬဝ့ၫ ထီးနီၪတၭ, မွဲမၬ,အနၫ့ဆါဒၪဝ့ၫမၩချဲၫ့ချဲၫ့ဘဲၫၥိၭအ မိစဲၪ့ထၪ့ခွံၬ, အဂဲးဘဲၫယီၩ, မွဲယဟိဝၩထးဝ့ၫအကၠီၩ့",
			"21": "<sup>21</sup> လီၫ.- တၭစအၧၭဇဲအၫစဎွၩနီၪ မွဲၦခံၫထူၬဆၫအၧၩ့ ထီးမုနံၩလၧအၥံၫဝ့ၫ, အီၪလၧၦခံၫထူၬဆၫအၧၩ့အ ဂံၪ့ဖၧၩ့လီၫ. အဂဲးဘဲၫယီၩဘၪဆၧဒၪ့ထ့ၬခွံၬဝ့ၫလၧ ယဟိဝၩအဂံၪ့တၭ, အဖိၪခွၫစယိၥၫ့အီၪဝ့ၫလၧစဎွၩ အဂံၪ့အဖၫ့ခိၪတၭ စ့ၩရၫ့ၦခးဖိၪလီၫ.",
			"22": "<sup>22</sup> တၭဆၧအီၪလၩ့ထး ဘၪဆဲၫ့လၧစအၧၭဇဲအၫ,ဆၧ အခၪ့ထံၭဒဲအထုၬနီၪစအၫမူၭ အဖိၪခွၫမီၪစအဲၫစ့ယၫ",
			"23": "<sup>23</sup> ကွ့ၭဝ့ၫလီၫ.- တၭစအၧၭဇဲအၫမံၫဝ့ၫ လၧအဖါၥံၪအ ၥိၭတၭ, ၦခုၪ့လၩ့ဘၧၩ့ခွံၬဝ့ၫ လၧအဖါၥံၪအၥိၭ လၧ စဎွၩလဖၪအဆၧၥွၪခိၪ အဝၩ့လီၫ. အဂဲးဘဲၫယီၩ, စံၭဝ့ၫ လၧအမွဲၦခံၫထူၬဆၫအၧၩ့လီၫ. တၭအဖိၪခွၫ စယိၥၫ့ကဲၪထၪ့စဎွၩလၧအလးနီၪလီၫ."
		},
		"27": {
			"1": "<sup>1</sup> စယိၥၫ့ကဲၪၥၫ့စဎွၩနီၪ အၥၭအီၪနံၫဆံၫယဲနံၪ့တၭ, ကဲၪစဎွၩလၧယရုစလံၫ့အဖၧၩ့ လဆံၫဎူၫနံၪ့လီၫ.အ မိအမံၩ့မွဲနးယရုၡၫစဇၫဒီၭအဖိၪမုၪလီၫ.",
			"2": "<sup>2</sup> အဝ့ၫဒၪမၩဆၧဂ့ၩလၧယဟိဝၩအမ့ၬယၫတၭ, မၩ ဝ့ၫဘဲၫကယဲဆၧလၧအဖါ စအၧၭဇဲအၫမၩယူၭဝ့ၫအ ၥိၭနီၪမွဲလါနၫ့ဘိၩ, လ့ၩနုၬဝ့ၫလၧယဟိဝၩအဂံၪ့ဖၧၩ့",
			"3": "<sup>3</sup> အ့ၬ.တၭၦခမျၧးမၩဒံၭ ဆၧဘၪၥၭလိၪလီၫ.- အဝ့ၫ ဒၪမၩထၪ့ထဲၩ့ယဟိဝၩအဂံၪ့ အတရၫ့ထၪ့ထီၫလဘံၪ့ ဒဲလၧအိဖ့ၫလၭအခိၪဒၧၩ့အလီၩ့နီၪ, မၩထၪ့ဆၧအၪ အၪလ့ၬလီၫ.",
			"4": "<sup>4</sup> အဝ့ၫမၩကဲၪထၪ့ဒိၩ့ၥံၪ လၧယုဒၫအခိၪလီၩ့ထိၩ့ချိၬ ဒဲလၧမံၩ့လၬကျၩနီၪ မၩထၪ့ထိၬ ဒဲတၨၭထီၫလဖၪ",
			"5": "<sup>5</sup> လီၫ.- ဒုၭဆၧလၧၦအၫမၧၫ့ဖိၪအစဎွၩတၭ, မၩစၪဝ့ၫ လီၫ.တၭလၧလနံၪ့ဎးနီၪ ၦအၫမၧၫ့ဖိၪဖ့ၪလၫ့ဝ့ၫလၧ စ့ၩအကံကၫလယၩ, ဒဲဘုၪကၠိၩ့အနၬလလၬ, ဒဲဘုၪမု ယီၩအနၬလလၬလီၫ. ဆၧဎွ့ၩနီၪၦအၫမၧၫ့ဖိၪၥံၪဖ့ၪ",
			"6": "<sup>6</sup> လၫ့ဝ့ၫလၧနံၫနံၪ့လနံၪ့ ဒဲလၧၥၧၫ့နံၪ့လနံၪ့နီၪလီၫ.- တၭ စယိၥၫ့ဆီၪ့ထၪ့ဝ့ၫလီၫ. အဂဲးဘဲၫယီၩတဲၩ့ဝဲၩအဖၧၩ့ ၥၭလဖၪလၧယဟိဝၩ လၧအမွဲအယွၩအမ့ၬယၫလီၫ.",
			"7": "<sup>7</sup> တၭဆၧအီၪလၩ့ထးဘၪဆဲၫ့လၧ စယိၥၫ့ဒဲအဒုၭဆၧ ထီးအလူၬ, ဒဲအဖၧၩ့ၥၭလဖၪနီၪ,ယိခွါ, ကွ့ၭအၥၭလၧ",
			"8": "<sup>8</sup> အံၫစရ့လၭဒဲယုဒၫအစဎွၩအလံၬဖၧၩ့လီၫ.- လၧအ ကဲၪၥၫ့စဎွၩနီၪ အၥၭအီၪနံၫဆံၫယဲနံၪ့တၭ, ကဲၪစဎွၩ လၧယရုစလံၫ့အဖၧၩ့ လဆံၫဎူၫနံၪ့လီၫ.",
			"9": "<sup>9</sup> စယိၥၫ့မံၫဝ့ၫလၧအဖါၥံၪအၥိၭတၭ, ၦခုၪ့လၩ့ဘၧၩ့ ခွံၬဝ့ၫလၧအဖါစဒၫဝံၭအဒိၩ့ဖၧၩ့လီၫ. အဖိၪခွၫစအၫ ဟဇၭကဲၪစဎွၩလၧအလးလီၫ."
		},
		"28": {
			"1": "<sup>1</sup> လၧစအၫဟဇၭကဲၪၥၫ့စဎွၩနီၪ အၥၭအီၪအနံၪ့နံၫ ဆံၫတၭ,ကဲၪစဎွၩလၧယရုစလံၫ့အဖၧၩ့ လဆံၫဎူၫနံၪ့ တၭး မၩဆၧဂ့ၩလၧယဟိဝၩအမ့ၬယၫ ဘဲၫအဖါစဒၫ",
			"2": "<sup>2</sup> ဝံၭအၥိၭအ့ၬ.- ဖိၬအံၫစရ့လၭအစဎွၩၥံၪအဖၧၩ့ၥၭ တၭမၩကဲၪထၪ့ ဘၫအလၭၥံၪ အဆၧဂၩ့ ၥိၫ့အၥၭ",
			"3": "<sup>3</sup> လဖၪတၭ,- လၧနီၪအမ့ၬယၫဆူၭခဲၩဆၧနၧၫ့မၧၫ့လၧ စဟံၪ့နၧၫ့အဖိၪခွၫအခိၪလီၩ့ဆူၭဖၧၩ့တၭ ဆူၭထၪ့ ခွံၬအဖိၪၥံၪလၧမ့ၪဘဲၫၦဆၨၩလဖၪ အဆၧၥၭလိၪအ ၥိၭ,လၧယဟိဝၩနၫ့ထၪ့ခွံၬဝ့ၫ လၧအံၫစရ့လၭဖိၪအ",
			"4": "<sup>4</sup> မ့ၬယၫနီၪလီၫ.- အဝ့ၫဒၪလုထၪ့ဆၧဆ့ ဒဲဆူၭခဲၩဆၧ နၧၫ့မၧၫ့လၧဆၧအလးထၪ့ထီၫလဖၪအဖၫ့ခိၪ, ဒဲလၧ ဆၧစီၩ့ခိၪအဖၫ့ခိၪ, ဒဲလၧကယဲၥံၪ့ၥံၫ့ဆ့ၬအဖၫ့လၬနီၪ လီၫ.",
			"5": "<sup>5</sup> မၩအၥၭဘဲၫနီၪတၭ, ယဟိဝၩအဝ့ၫဒၪအယွၩဖ့ၪ လၫ့ခွံၬအဝ့ၫလၧစံရအၫအစဎွၩအစူၪဖၧၩ့တၭ, အဝ့ၫ ၥံၪကျီၪ့ခွံၬအဝ့ၫတၭ, ဆိၬန့ခွံၬအၪ့မၧၫ့ဎီး ၦအၪဂၩ တၭ,ဆိၬန့ခွံၬဝ့ၫထီၩ့လၧဒမၭစကၧၭလီၫ. အဝ့ၫဘၪ ဆၧဖ့ၪလၫ့ခွံၬဆ့ လၧအံၫစရ့လၭအစဎွၩအစူၪဖၧၩ့,",
			"6": "<sup>6</sup> လၧအကျီၪ့ခွံၬဝ့ၫလၧဆၧကျီၪ့ခွံၬဖၭဒိၪလီၫ.- တၭစရ့ၫ မလဲအၫအဖိၪခွၫစပံကၫမၩၥံၫ ၦလကုၬနံၫလၬလၧလ နံၩဎးလၧယုဒၫအဖၧၩ့ ၦအဂဲးဆီၪ့ထီးအလူၬလီၫ.အ ဂဲးဘဲၫယီၩအဝ့ၫၥံၪစဲၪ့ဒၪယူၭ ယဟိဝၩအဝ့ၫၥံၪအဖါ",
			"7": "<sup>7</sup> လဖၪအယွၩလီၫ.- ၦအဂဲးဆီၪ့ၦအံဖြံၫ့ဖိၪစဇံၭခြဲၫမၩ ၥံၫစဎွၩအဖိၪစမၫအစဲအၫ ဒဲၦဂံၪ့ဖိၪအခိၪစအၭဇကၫ့,",
			"8": "<sup>8</sup> ဒဲၦလၧစဎွၩအဖၫ့လၬစအ့လကနၫလီၫ.- ၦအံၫစရ့လၭ ဖိၪဆိၬထၪ့ခွံၬအၪ့မၧၫ့ဎီးၦနံၫကုၬ, ၦမုၪၥံၪ, ဒဲၦခွၫၥံၪ ဒဲၦအဖိၪမုၪၥံၪ လၧအထၧၫ့ဖုဝဲအကျၩတၭ, မၩန့ဆၧ အၪ့ဂူၬဆီၪ့လၧအဝ့ၫၥံၪအၪအၪလ့ၬတၭ, ဂဲၫဆိၬဆၧ ဖိၪဆၧလံၩလၧစမ့ရအၫအဖၧၩ့လီၫ.",
			"9": "<sup>9</sup> ယဟိဝၩအမီၪလဂၩ အီၪဝ့ၫထီးနီၪတၭ, အမံၩ့မွဲ စအိဒ့ၭတၭ, စဲၪ့ထၪ့ဝ့ၫလၧၥုၭမုခမျၧးလၧအဂဲၫလၧ စမ့ရအၫအမ့ၬယၫတၭ, စံၭအဝ့ၫၥံၪ, မွဲယဟိဝၩနၥံၪ အဖါအယွၩၥၭထၪ့ယုဒၫတၭ, ဖ့ၪလၫ့ခွံၬဝ့ၫလၧနၥံၪ အစူၪဖၧၩ့တၭ, နၥံၪမၩၥံၫဝ့ၫလၧဆၧၥၭထၪ့လၧအထၪ့",
			"10": "<sup>10</sup> ဘၭလၧမူၭခိၪလီၫ.- တၭဘိၩ့နဲၪ့ယီၩ နၥံၪစံၭလၧနၥံၪ မိအီၪက့ၪလၩ့ၦယုဒၫဖိၪ, ဒဲၦယရုစလံၫ့ဖိၪ လၧနၥံၪအ ဎီးခွၫဒဲနၥံၪအဎီးမုၪလီၫ. ဆၧအီၪလၧနၥံၪ,ဆၧမၩမၪ ယဟိဝၩနၥံၪအယွၩအီၪလၧနၥံၪဒၪလ့ၬ, မွဲအ့ၬဧၪ.",
			"11": "<sup>11</sup> တၭဘိၩ့နဲၪ့ယီၩခိၭနၪယလူ ဒဲဖျါခွံၬၦလၧနၥံၪအၪ့မၧၫ့ ဎီးလၧနၥံၪအထၧၫ့ဖုဝဲအကျၩနီၪဆံၭ. အဂဲးဘဲၫယီၩ",
			"12": "<sup>12</sup> ယဟိဝၩအဆၧၥၭထၪ့နီၪလၩ့ဘၪနၥံၪလီၫ.- ထီးနီၪ လဖၧၫ့ၦလၧအံဖြံၫ့ဖိၪ အခိၪအကျၩလဖၪနီၪ, စယိၫ ဟၫနၫ့အဖိၪခွၫစအၭစရဲအၫ, စမၡံလမီၭအဖိၪခွၫစ ဘ့ၫရခဲအၫ, ဒဲစၡၫလၧၫ့အဖိၪခွၫ, စယ့ၫဟ့ၭဇကဲအၫ, ဒဲစဟၭဒလ့အဲၫအဖိၪခွၫ စအၫမစၫလဖၪနီၪဂဲထုၪ့ထၫ့",
			"13": "<sup>13</sup> ဒၩၦလၧအဂဲၫထဲၩ့လၧဆၧဒုၭၥုၭလဖၪနီၪတၭ,- စံၭ အဝ့ၫၥံၪ, နၥံၪဂဲၫဆိၬနုၬဘၪၦလၧအကဲၪဎီးထီးယီၩ အ့ၬ. အဂဲးဘဲၫယီၩ ပမၩမၪဘၪယူၭ ယဟိဝၩယူၭ တၭ,နၥံၪစံၭလၧနၥံၪမိမၩအၪထၪ့ ပဆၧဒဲၩဘၭဒဲဆၧ အမၪလီၫ. အဂဲးဘဲၫယီၩပဆၧအမၪနီၪမွဲအဒိၪအယိၬ",
			"14": "<sup>14</sup> တၭ,ဆၧၥၭထၪ့ဆီၪ့နီၪဘၪအံၫစရ့လၭလီၫ.- တၭၦ ၥုၭဖိၪအီၪက့ၪလၩ့ၦလၧအကဲၪဎီးဒဲဆၧဖိၪဆၧလံၩလၧ ၦဒိၪဖၭဒိၪ, ဒဲလၧဆၧအီၪကီၪ့ ထီးအလူၬ အမ့ၬယၫ",
			"15": "<sup>15</sup> လီၫ.- ၦလၧဆၧကိၭထၪ့အမံၩ့လဖၪနီၪဂဲထုၪ့တၭ,အၪ့ မၩန့ၦကဲၪဎီး, ဒဲဆၧဖိၪဆၧလံၩလၧဆၧအၪ့ဂူၬန့ဝ့ၫနီၪ ဒုၭကီၩ့ဒုၭၥိၭ ကယဲၦလၧအအီၪဘိၪ့ဝ့ၫလၧအကျၩ, ဒဲကယၧၩ့ဝ့ၫ, ဒဲဒုၭၥိၭထၪ့ဝ့ၫအခၪ့ဖံၭ, ဒဲဖ့ၪအၪ့ဖ့ၪ အီၩဝ့ၫ,ဒဲဂုၪဝ့ၫ, ဒဲဆိၬၦအဆၫၥံၪ လၧကၥ့ၪယီၩ့အ လီၩ့တၭ,ဆိၬဝ့ၫလၧယ့ၫရခိၫ, ဒိၩ့ၥံၪ့စီၩ့မလီၫ့,လၧအ ထၧၫ့ဖုဝဲအအီၪတၭ, ထီးနီၪလဖၧၫ့ ထဲၩ့ကဒၩထဲၩ့ဝ့ၫ လၧစမ့ရအၫလီၫ.",
			"16": "<sup>16</sup> လၧအဆၧၫ့အထီနီၪစဎွၩအၫဟဇၭ အၪ့မၧၫ့လၩ့ ဆၧလၧအစံရအၫအစဎွၩလဖၪ ဘဲၫၥိၭအမိမၩဆၧၩ့ဝ့ၫ",
			"17": "<sup>17</sup> လီၫ.- ၦအံဒၧၫ့ဖိၪဂဲၫယူၭဝ့ၫတၭ, ကျီၪ့ယုဒၫတၭ,ထဲၩ့",
			"18": "<sup>18</sup> ဆိၬအၪ့မၧၫ့ဎီးၦလဖၪနီၪလီၫ.- တၭၦဖလံၡၫဖိၪၥံၪ လ့ၩနုၬယူၭ လၧဒိၩ့လဖၪလၧဆၧဒၩဖၧၩ့ ဒဲယုဒၫမုခံၫ့ လခီၫတၭ, မၩန့ဘ့ၭၥၡံမံၭ, ဒဲအၭဇလၧၫ့, ဒဲကဒံရီၭ, ဒဲၡိကိၫဒဲအတဝၫ့ၥံၪ, ဒဲတံၭမနၫဒဲအတဝၫ့ၥံၪ, ဒဲဂံၭမ",
			"19": "<sup>19</sup> ဇိၫဆ့ဒဲအတဝၫ့ၥံၪတၭ, အီၪဝ့ၫထီးနီၪလီၫ.- အဂဲးဘဲၫ ယီၩယဟိဝၩဒုၭဆၪ့လၩ့ယုဒၫ လၧအံၫစရ့လၭအစဎွၩ အၫဟဇၭအကၠီၩ့လီၫ. အဂဲးဘဲၫယီၩအဝ့ၫဒၪဒုၭအီၪ",
			"20": "<sup>20</sup> ဘိၪ့ယုဒၫတၭ, မၩမၪဘၪယဟိဝၩဒိၪမၬလီၫ.- တၭ အစံရအၫအစဎွၩတံၭဂလၭပလံစၫ ဂဲၫလၧအအီၪတၭ",
			"21": "<sup>21</sup> မၩကၪမၩဂဲၩဝ့ၫတၭ, ဒုၭဆီၪ့ထၪ့ဝ့ၫအ့ၬ.- အဂဲးဘဲၫ ယီၩစအၫဟဇၭမၩန့ခွံၬ ဆၧအဂးလၧယဟိဝၩအဂံၪ့ ဖၧၩ့,ဒဲလၧစဎွၩဒဲၦဒိၪၥံၪအဂံၪ့ဖၧၩ့တၭ, ဖ့ၪလၫ့ဝ့ၫ လၧအစံရအၫစဎွၩလီၫ. မွဲလါနၫ့ဘိၩအဝ့ၫမၩဆၧၩ့ ဝ့ၫအ့ၬ.",
			"22": "<sup>22</sup> တၭလၧအဘၪဆၧခိဆၧဝီၩ အဆၧၫ့အထီနီၪမၩမၪ ဘၪယဟိဝၩအၪနဲၪ့အနီၪဒံၭလီၫ. အဝ့ၫဒၪမွဲစဎွၩအၫ",
			"23": "<sup>23</sup> ဟဇၭလီၫ.- တၭဒမၭစကၧၭအယွၩ လၧအကျီၪ့ခွံၬ ဝ့ၫလဖၪနီၪ, အဝ့ၫလုထၪ့ဝ့ၫတၭ, စံၭဝ့ၫဒၪ,မွဲစံရအၫ အစဎွၩအယွၩလဖၪ မၩဆၧၩ့အဝ့ၫၥံၪတၭ, ယမိလု ထၪ့ဝ့ၫဘဲၫၥိၭအမိမၩဆၧၩ့ယၧၩဆ့လီၫ. အ့ၪမွဲအဝ့ၫ ၥံၪကဲၪထၪ့လၧအဝ့ၫဒၪ ဒဲအံၫစရ့လၭထီးအလူၬအ",
			"24": "<sup>24</sup> ဆၧလၩ့ထံၩဖါအလးလီၫ.- စအၫဟဇၭအၪ့ထုၫ့ကီၪ့ ယွၩအဂံၪ့အဎၧၩ့အဎီတၭ, ဒၪ့ဘျ့ၭခွံၬ ယွၩအဂံၪ့အ ဎၧၩ့အဎီဒဲကၭဘံၭထၬယဟိဝၩ အဂံၪ့အတရၫ့လဖၪ တၭ,မၩဆၧလုအလး လၧယရုစလံၫ့အဖၧၩ့ကိၭဆၧ",
			"25": "<sup>25</sup> အနိၪ့ဒ့ၭလီၫ.- တၭမၩဆၧအလးထၪ့ထီၫလၧကယဲ ယုဒၫအဒိၩ့ဖၧၩ့လဒိၩ့ဘၪလဒိၩ့ လဒိၩ့ဘၪလဒိၩ့ဘဲၫ ၥိၭအမိဆူၭခဲၩဆၧနၧၫ့မၧၫ့ လၧယွၩအဂူၫဂၩလဖၪအ ဂးတၭ,ထိၪဂဲၩယဟိဝၩ လၧအမွဲအဖါၥံၪအယွၩအ ဆၧၥၭထၪ့လီၫ.",
			"26": "<sup>26</sup> တၭဆၧအီၪလၩ့ထးဘၪဆဲၫ့ လၧအဝ့ၫဒၪအဆၧမၩ လဖၪ,ဒဲအဖၧၩ့ၥၭထီးအလူၬအခၪ့ထံၭ, ဒဲဆၧအထုၬ နီၪ,ယိခွါ, ကွ့ၭအၥၭလၧယုဒၫဒဲအံၫစရ့လၭအစဎွၩ",
			"27": "<sup>27</sup> ၥံၪအလံၬဖၧၩ့လီၫ.- စအၫဟဇၭမံၫဝ့ၫလၧအဖါၥံၪအ ၥိၭတၭ, ၦခုၪ့လၩ့ဘၧၩ့ခွံၬဝ့ၫ လၧဒိၩ့ဖၧၩ့လၧယရုစ လံၫ့အဖၧၩ့လါနၫ့တၭ, ဂဲၫဆိၬဘၪဝ့ၫလၧအံၫစရ့လၭ အစဎွၩၥံၪအဆၧၥွၪခိၪအဖၧၩ့အ့ၬ. တၭအဖိၪခွၫစ ဟ့ၭဇကဲအၫကဲၪစဎွၩ လၧအလးလီၫ."
		},
		"29": {
			"1": "<sup>1</sup> လၧစဟ့ၭဇကဲအၫကဲၪၥၫ့စဎွၩနီၪ အၥၭအီၪနံၫဆံၫ ယဲနံၪ့တၭ, ကဲၪစဎွၩလၧယရုစလံၫ့အဖၧၩ့ နံၫဆံၫခွံၫနံၪ့ လီၫ. တၭအမိအမံၩ့မွဲနးအဘဲယၫ စဇ့ၭခရဲအၫအဖိၪ",
			"2": "<sup>2</sup> မုၪလီၫ.- တၭအဝ့ၫဒၪမၩဆၧဂ့ၩ လၧယဟိဝၩအမ့ၬ ယၫဘဲၫကယဲဆၧလၧအဖါ စဒၫဝံၭမၩဝ့ၫအၥိၭနီၪ လီၫ.",
			"3": "<sup>3</sup> အဝ့ၫဒၪလၧအကဲၪစဎွၩအခၪ့ထံၭလနံၪ့, လၧ လၩခၪ့ထံၭလဘံၪ့နီၪ ဝဲထၪ့ယဟိဝၩ အဂံၪ့အတရၫ့",
			"4": "<sup>4</sup> မၩဂ့ၩထဲၩ့ဝ့ၫလီၫ.- ဒုၭဂဲၫနုၬၦလုဆၧလဖၪဒဲၦလံဝဲၫ ဖိၪလဖၪတၭ, ဒုၭအီၪကိၩ့အီၪကီၪ့ဝ့ၫလၧဖၧၩ့ၥၭမုထၪ့",
			"5": "<sup>5</sup> လခီၫအဖၧၩ့လီၫ.- တၭစံၭဝ့ၫ, ၦလံဝဲၫဖိၪၥံၪဧ့, ခိၭနၪ ယလူ,မၩဆံၫ့ထၪ့နၥံၪအၥၭတၭ, မၩဆံၫ့ဎံၪယဟိဝၩ နၥံၪအဖါယွၩအဂံၪ့တၭ, ဆိၬထၪ့ခွံၬဆၧၥၭလိၪ လၧ",
			"6": "<sup>6</sup> ဆၧအလးဆံၫ့ဎံၪအဖၧၩ့နီၪဆံၭ.- အဂဲးဘဲၫယီၩပဖါ မၩမၪဘၪဆၧတၭ, မၩဆၧအၧၩ့လၧယဟိဝၩပယွၩ အမ့ၬယၫတၭ, စဲၪ့ဒၪအဝ့ၫတၭ, အဝ့ၫၥံၪကၠၪခွံၬအမ့ၬ လၧယဟိဝၩအီၪဝ့ၫအလးတၭ, ကၠၪဒိၭချိၫ့အၥၭလီၫ.",
			"7": "<sup>7</sup> တၭအဝ့ၫၥံၪကၭဘံၭထၬ ထိၬချိၫ့အတရၫ့တၭမၩလၩ့ ဖံၬမ့ၪဒိၩ့ၥံၪ, လဆူၭခဲၩဘၪဆၧနၧၫ့မၧၫ့, ဒဲလလုထၪ့ ဘၪအံၫစရ့လၭအယွၩ လၧဆၧလုမ့ၪ လၧဆၧအလး",
			"8": "<sup>8</sup> ဆံၫ့ဎံၪအဖၧၩ့နီၪလီၫ.- မၩအၥၭဘဲၫနီၪတၭယဟိဝၩ အဆၧၥၭထၪ့ဘၪယုဒၫ, ဒဲယရုစလံၫ့တၭ, အဆၧဖ့ၪ လၫ့ခွံၬဝ့ၫလၧဆၧခိဆၧဝီၩ, အီၪက့ၪဝ့ၫလၧဆၧထီၫမံၫ ထီၫမၪအလးဒုၪဒွ့ၪ ဘဲၫနဒၪဘၪ လၧနၥံၪအမ့ၬၥၪအ",
			"9": "<sup>9</sup> ၥိၭနီၪလီၫ.- ယိခွါ, ပဖါၥံၪလၩ့ထံၩဖါလၧနၭတၭ,ပ ဖိၪခွၫၥံၪ ဒဲပဖိၪမုၪၥံၪ ဒဲပမၫၥံၪကဲၪဎီး လၧဆၧနီၪအ",
			"10": "<sup>10</sup> ကၠီၩ့လီၫ.- တၭဘိၩ့နဲၪ့ယီၩ ယၥၭအီၪလၧယမိအုၩ့ လၩ့ဆၧလၧယဟိဝၩ အံၫစရ့လၭအယွၩဘဲၫၥိၭအၥၭ",
			"11": "<sup>11</sup> ထၪ့ဆီၪ့မိကၠၪခွံၬအၥၭ လၧပအီၪလီၫ.- ယဖိၪခွၫၥံၪဧ့, ဘိၩ့နဲၪ့ယီၩ,နၥံၪအ့ၪလထီးလၩ့ဘၪ နၥံၪအၥၭတၭ အီၪလဂ့ၩ. ယဟိဝၩရွံန့နၥံၪ ဘဲၫၥိၭနၥံၪမိဆၧၫ့ထုၪ့ လၧအမ့ၬယၫလၧနၥံၪမိမၩအဆၧ, ဒဲဘဲၫၥိၭနၥံၪမိမၩ ဆၧအခ့ၫအၡၩအဆၧ, ဒဲဆူၭခဲၩထၪ့ဆၧနၧၫ့မၧၫ့လီၫ.",
			"12": "<sup>12</sup> ထီးနီၪလဖၧၫ့ၦလံဝဲၫဖိၪဂဲထုၪ့, စအၫမစ့အဲၫအဖိၪ ခွၫစမၫဟၭ, ဒဲစအၭဇရဲအၫအဖိၪခွၫ စယိၫအ့လၭ, လၧၦကိဟၭဖိၪၥံၪအကျၩး ဒဲလၧစမရၫရဲၫအဖိၪခွၫ ၥံၪအကျၩနီၪ, စအၭဘဒံၫအဖိၪခွၫ, စကံၭ,ဒဲစယဟၫ လအ့လၭအဖိၪခွၫ စအၭဇရဲအၫလီၫ. လၧၦဂၭၡၧၫ့ ဖိၪအကျၩ, စဇံမမၫအဖိၪခွၫစယိအၫ, ဒဲစယိအၫအဖိၪ",
			"13": "<sup>13</sup> ခွၫစအံဒံၫ့လီၫ.- တၭလၧစအလံၭဇဖၫ့အဖိၪခွၫၥံၪအ ကျၩနီၪ,စၡံမရဲၫ ဒဲစယအဲၫအ့လၭး ဒဲလၧစအၫစဖၭ အဖိၪခွၫၥံၪအကျၩနီၪ, စဇ့ၭခရဲအၫ, ဒဲစမၭတနဲအၫ.",
			"14": "<sup>14</sup> လၧစဟံမၫ့အဖိၪခွၫၥံၪအကျၩနီၪ စယဟဲၫအ့လၭ,ဒဲစ ၡံမအဲၫ,ဒဲလၧစယဒုၥၫ့အဖိၪခွၫၥံၪအကျၩနီၪ, စၡံမဲ",
			"15": "<sup>15</sup> အၫ,ဒဲစအၧၭဇဲၫအ့လၭလီၫ.- အဝ့ၫၥံၪဒုၭအီၪကိၩ့အီၪ ကီၪ့အထၧၫ့ဖုဝဲလဖၪတၭ, မၩဆံၫ့ဎံၪအၥၭတၭ, ဂဲၫ ဝ့ၫဘဲၫစဎွၩအဆၧမၪလူၬ လၧယဟိဝၩအလူအၥိၭနီၪ,",
			"16": "<sup>16</sup> ဘဲၫၥိၭအမိမၩဆံၫ့ထၪ့ယဟိဝၩအဂံၪ့လီၫ.- တၭၦလု ဆၧလဖၪလ့ၩနုၬလၧယဟိဝၩ အဂံၪ့လၧယၫလခီၫ ဘဲၫၥိၭအမိမၩဆံၫ့ထၪ့ဝ့ၫတၭ, ဂဲၫထဲၩ့ဆိၬဆၧလဆံၫ့ ဘၪလဖၪထီးအလူၬ လၧအဒၪန့ဝ့ၫလၧယဟိဝၩအနီး ဖၧၩ့နီၪ ထီၩ့လၧယဟိဝၩအဂံၪ့အဝၩ့ဖၧၩ့တၭ, ၦလံ ဝဲၫဖိၪမၩန့ဆိၬထၪ့ခွံၬဝ့ၫ လၧခီၫ့လၧထံၫချိၬကံၭဒၧၫ့",
			"17": "<sup>17</sup> အဖၧၩ့လီၫ.- လၧလၩအခၪ့ထံၭလၩထၪ့လနံၩနီၪအ ဝ့ၫၥံၪမၩထၪ့ၥၫ့ ဘဲၫၥိၭအမိမၩဆံၫ့ဎံၪထၪ့ဝ့ၫတၭ, လၧလၩဎိၭနံၩလနံၩနီၪ, ဂဲၫဝ့ၫလၧယဟိဝၩအထိၬ ချိၫ့တၭ, မၩဆံၫ့ဎံၪယူၭယဟိဝၩအဂံၪ့ လၧဎိၭနံၩအ ထးဖၧၩ့လီၫ. လၧလၩအခၪ့ထံၭလဆံၫဎူၫနံၩလနံၩနီၪ မၩဝ့ၫထီးအလူၬလီၫ.",
			"18": "<sup>18</sup> ထီးနီၪလဖၧၫ့ အဝ့ၫၥံၪလ့ၩဆၧ လၧစဎွၩဟ့ၭဇကဲ အၫအအီၪတၭ, စံၭဝ့ၫဒၪ, ပမၩဆံၫ့ထၪ့ယူၭယဟိဝၩ အဂံၪ့ထၧၫ့ဂံၪ့ယၫ, ဒဲဆၧလုမ့ၪအလး, ဒဲအဎၧၩ့အဎီ ထီးအလူၬ, ဒဲဆၧမ့ၬယၫအကိၪအစပွဲ, ဒဲအဖၧၩ့ၥံၪ,",
			"19": "<sup>19</sup> ထွ့ၫၥံၪထီးအလူၬလီၫ.- လၧစဎွၩအၫဟဇၭပၧၩ့ဆၧ အဘိၩ့ဘၭနီၪဆၧအဎၧၩ့အဎီ လၧအခွံၬၡိၭခွံၬဝ့ၫလၧ အမၩမၪဆၧအဖၧၩ့ထီးအလူၬနီၪ, ပတဲၩ့ဝဲၩယူၭ, ဒဲပ မၩဆံၫ့ယူၭတၭ, ယိခွါ, အီၪဝ့ၫလၧယဟိဝၩအဆၧလု",
			"20": "<sup>20</sup> လးအမ့ၬယၫလီၫ.- ထီးနီၪလဖၧၫ့စဎွၩဟ့ၭဇကဲအၫ ဂဲထုၪ့ဂီၩဂီၩတၭ, ဒုၭအီၪကီၪ့ဒိၩ့အၦဒိၪဖၭဒိၪလဖၪ",
			"21": "<sup>21</sup> တၭ,လ့ၩထၪ့ဝ့ၫလၧယဟိဝၩအဂံၪ့ဖၧၩ့လီၫ.- အဝ့ၫ ၥံၪဂဲၫဆိၬချီဖၫနွ့ၫဒုၩ, ဒဲၥိၪဖၫနွ့ၫဒုၩ, ဒဲၥိၪဖိၪနွ့ၫဒုၩ, ဒဲဘ့ၪဖၫနွ့ၫဒုၩ,လၧဆၧလုဆၧဒဲၩဘၭအဂး, ဒဲလၧဘၩ့ မုးအဂးဒဲလၧဆၧအလးဆံၫ့ဎံၪအဂး, ဒဲလၧယုဒၫအ ဂးတၭ,မၪလူၬၦလုဆၧ စအၫရၧၫ့အဖိၪခွၫၥံၪလၧအမိ ဘၪလုထၪ့ဝ့ၫလၧယဟိဝၩ အဆၧလုလးအဖၫ့ခိၪလီၫ.",
			"22": "<sup>22</sup> ၦမၩၥံၫချီဖၫလဖၪတၭ, ၦလုဆၧၥံၪဒိၭန့ဆၧၥွံၪတၭ, ဎွံၪဝ့ၫလၧဆၧလုလး အဖၫ့ခိၪလီၫ. မၩၥံၫၥိၪဖၫတၭ, ဎွံၪဝ့ၫလၧအၥွံၪလၧဆၧလုလးအဖၫ့ခိၪ, မၩၥံၫၥိၪဖိၪ",
			"23": "<sup>23</sup> တၭ,ဎွံၪဝ့ၫအၥွံၪလၧဆၧလုလးအဖၫ့ခိၪလီၫ.- အဝ့ၫ ၥံၪဂဲၫဆိၬဘ့ၪဖၫၥံၪ လၧဆၧလုဆၧဒဲၩဘၭအဂးလၧ စဎွၩဒဲလၧဆၧအီၪကီၪ့အမ့ၬယၫတၭ, အဝ့ၫၥံၪအီၪက့ၪ",
			"24": "<sup>24</sup> အစူၪလၧအဖၫ့ခိၪလီၫ.- ၦလုဆၧလဖၪမၩၥံၫဝ့ၫတၭ, မၩဆၧဘၪလိၬအိၭလိၬ လၧအၥွံၪအကၠီၩ့လၧဆၧလုလး အဖၫ့ခိၪနီၪ, ဘဲၫၥိၭအမိမၩဆၧဖီၩ့ဖျ့ၭလၧအံၫစရ့လၭ ထီးအလူၬအဂးလီၫ. အဂဲးဘဲၫယီၩ စဎွၩမၪလူၬဝ့ၫ လၧဆၧလုမ့ၪ,ဒဲဆၧလုဆၧဒဲၩဘၭနီၪ မိဘၪလၧအံၫစ",
			"25": "<sup>25</sup> ရ့လၭထီးအလူၬအဂးလီၫ.- တၭအဝ့ၫဒၪအီၪက့ၪၦ လံဝဲၫဖိၪလၧယဟိဝၩအဂံၪ့ဖၧၩ့ အီၪလၧစံၩ့စံၩ့ၥံၪ,ဒဲနါ ဒံၩ့ၥံၪ,ဘဲၫစဒၫဝံၭဒဲစဎွၩ အၡၩဒၪဆၧလၧယၫ, စဂၭ, ဒဲစနၫၥၫ့အဆၧမၪလူၬအၥိၭနီၪလီၫ. အဂဲးဘဲၫယီၩ",
			"26": "<sup>26</sup> ယဟိဝၩမၪလူၬဆၧနီၪလၧမီၪၥံၪလီၫ.- တၭၦလံဝဲၫဖိၪ ဆၧၫ့ထုၪ့အီၪလၧစဒၫဝံၭအနါဒံၩ့ၥံၪ, ၥၫ့ထီးၥံၪတၭၦ",
			"27": "<sup>27</sup> လုဆၧလဖၪနီၪအီၪလၧခွ့ၩလဖၪလီၫ.- စဟ့ၭဇကဲအၫ မၪလူၬဝ့ၫလၧအမိလုထၪ့ဆၧလုမ့ၪ လၧဆၧလုလးအ ဖၫ့ခိၪတၭး ထီးအလုထၪ့ၥၫ့ဆၧလုမ့ၪနီၪ, မွဲယဟိဝၩ အဆၧၥံၫကျံၩထၪ့ၥၫ့အီၪလၧခွ့ၩၥံၪ, ဒဲၥၫ့ထီးနါဒံၩ့ၥံၪ ဘဲၫလၧအံၫစရ့လၭအစဎွၩဒၫဝံၭ မၪလူၬဝ့ၫအၥိၭနီၪ",
			"28": "<sup>28</sup> လီၫ.- ဆၧအီၪကီၪ့ထီးအလူၬ ဘိၪ့ထၪ့ဘၩထၪ့ဆၧ တၭ,ၦၥံၫကျံၩဆၧလဖၪနီၪၥံၫကျံၩဆၧ, ဒဲၦအူၪခွ့ၩၥံၪ, အူၪထၪ့ဝ့ၫတၭ, ဆၧထီးအလူၬနီၪမၩဝ့ၫထီးအလုထၪ့",
			"29": "<sup>29</sup> ဆၧလုဂီၩ့တၭ, စဎွၩဒဲကယဲၦအီၪလၧအၥိၭထီးအလူၬ",
			"30": "<sup>30</sup> နီၪၡီၫ့လၩ့အခိၪတၭ, ထွံၩလၩ့ဘၩထၪ့ဆၧလီၫ.- တၭ စဎွၩဟ့ၭဇကဲအၫ ဒဲအၦဒိၪဖၭဒိၪလဖၪနီၪမၪလူၬၦ လံဝဲၫဖိၪဘဲၫၥိၭ အမိစံၭထၪ့အၪ့အူၭယဟိဝၩ, ဘဲၫစ ဒၫဝံၭ,ဒဲၦဒၪဆၧလၧယၫ စအၫစၭအဆၧချဲၩ့အၥိၭနီၪ လီၫ.တၭအဝ့ၫၥံၪၥံၫကျံၩဆၧလၧ အၥုၪ့ထိၬအၥၭထိၬ ၡီၫ့လၩ့အခိၪတၭဘိၪ့ထၪ့ဘၩထၪ့ဝ့ၫလီၫ.",
			"31": "<sup>31</sup> ထီးနီၪလဖၧၫ့စဟ့ၭဇကဲအၫ ချဲၩ့ဆၧတၭ,စံၭဝ့ၫဒၪ, ဘိၩ့နဲၪ့ယီၩနၥံၪမၩဆံၫ့ဎံၪယူၭ နၥံၪအၥၭလၧယဟိ ဝၩအဂးယူၭ, ၥုၭဘူၭနၥံၪအၥၭဂဲၫဆိၬဆၧလုလဖၪ, ဒဲဆၧလုစံၭထၪ့အၪ့အူၭလဖၪ လၧယဟိဝၩအဂံၪ့ဖၧၩ့ ဆံၭ. တၭဆၧအီၪကီၪ့နီၪဂဲၫဆိၬဆၧလုလဖၪ, ဒဲဆၧလု စံၭထၪ့အၪ့အူၭတၭ, ထီးဒၪၦလၧအၥၭအီၪထၪ့ဒၪ",
			"32": "<sup>32</sup> ဆၧလဂၩဂၩနီၪ ဂဲၫဆိၬအဆၧလုမ့ၪလီၫ.- တၭဆၧလု မ့ၪလၧဆၧအီၪကီၪ့ ဂဲၫဆိၬဝ့ၫလဖၪ အဆၧဝံဆၧနၬနီၪ မွဲချီဖၫနွ့ၫဆံၫ, ဒဲၥိၪဖၫလယၩ, ဒဲၥိၪဖိၪနံၫယၩလီၫ. အဝ့ၫၥံၪထီးအလူၬနီၪ အီၪလၧဆၧလုထၪ့ယဟိဝၩအ",
			"33": "<sup>33</sup> ဆၧလုမ့ၪအဂးလီၫ.- တၭဆၧလၧၦအီၪက့ၪဆံၫ့ဎံၪ",
			"34": "<sup>34</sup> ဝ့ၫလဖၪနီၪမွဲချီဖၫဎူၫယၩ ဒဲၥိၪၥၧၫ့ထီၫ့လီၫ.- မွဲလၧၦ လုဆၧၥံၪအီၪၡၩလၨၪအကၠီၩ့တၭ, မၩၥံၫဆၧလုမ့ၪ ထီးအလူၬၥ့ၪအ့ၬ. အခိးမွဲဘဲၫနီၪတၭ, အထၧၫ့ဖုဝဲၦ လံဝဲၫဖိၪမၩဆၧၩ့ဝ့ၫ ထီးဆၧလုအဆၧမၩနီၪ ဂီၩ့ဝ့ၫ, ဒဲထီးၦလုဆၧၥံၪမၩဆံၫ့ဎံၪထၪ့အၥၭလီၫ. အဂဲးဘဲၫ ယီၩၦလံဝဲၫဖိၪၥံၪလၧ အမိမၩဆံၫ့ဎံၪအၥၭနီၪ, မွဲအ",
			"35": "<sup>35</sup> တီၩနဲၪ့လီၩ့နဲၪ့ၦလုဆၧဒံၭလီၫ.- တၭဆၧလုမ့ၪအီၪ ဝ့ၫအၪအၪလ့ၬ, ဒဲဆၧလုမၩဘၪလိၬအိၭလိၬလဖၪအ ဆၧၥိၪ,ဒဲဆၧလုအီၩလဖၪ လၧဆၧလုမ့ၪအဂးလီၫ. တၭယဟိဝၩ အဂံၪ့ အဆၧမၩနီၪ တဲၩ့ဝဲၩယူၭအၥၭ လီၫ.",
			"36": "<sup>36</sup> တၭစဟ့ၭဇကဲအၫၥုၪ့ထိၬၥၭထိၬ ဒဲၦခမျၧးထီးအ လူၬလၧယဟိဝၩတဲၩ့ဝဲၩ ၦခမျၧးၥံၪ အကၠီၩ့နီၪလီၫ. အဂဲးဘဲၫယီၩဆၧကဲၪထၪ့ဝ့ၫဒၪချဲၫ့မၬလီၫ."
		},
		"30": {
			"1": "<sup>1</sup> စဟ့ၭဇကဲအၫအၪ့မၧၫ့လၩ့ဆၧ လၧအံၫစရ့လၭဒဲ ယုဒၫထီးအလူၬကွ့ၭဖ့ၪယုဆ့လံၬ လၧအံဖြံၫ့ဒဲမနၭစ့ၫ ဘဲၫၥိၭအဝ့ၫၥံၪမိဂဲၫလၧယဟိဝၩအဂံၪ့ လၧယရုစလံၫ့ လၧအမိမၩဆၧဘိၪ့လ့ၩဖၬ လၧယဟိဝၩအံၫစရ့လၭ",
			"2": "<sup>2</sup> အယွၩအဂးလီၫ.- အဂဲးဘဲၫယီၩ စဎွၩကိၪ့လိၬယူၭ အၥၭလၧၦဒိၪဖၭဒိၪၥံၪ ဒဲၦအီၪကီၪ့လၧယရုစလံၫ့အ ဖၧၩ့ထီးအလူၬလၧအမိမၩဘိၪ့လ့ၩဖၬ လၧလၩနံၫဘံၪ့",
			"3": "<sup>3</sup> လဘံၪ့အဖၧၩ့လီၫ.- အဂဲးဘဲၫယီၩ အထီထီးနီၪမၩ ဆၧဘိၪ့ၥ့ၪအ့ၬ. အဂဲးဘဲၫယီၩ ၦလုဆၧမၩဆံၫ့ဎံၪ ထၪ့အၥၭအၪအၪဒံၭအ့ၬ. တၭၦခမျၧးအီၪကီၪ့ဒံၭလၧ",
			"4": "<sup>4</sup> ယရုစလံၫ့အဖၧၩ့ဒံၭအ့ၬ.- တၭဆၧလမံၩ့နီၪဘၪစဎွၩ",
			"5": "<sup>5</sup> ဒဲဆၧအီၪကီၪ့ထီးအလူၬအၥၭလီၫ.- အခိးမွဲအဝ့ၫၥံၪ ဒုၭအီၪဂုးအီၪခၧၫ့ဆၧစ့ၩရၫ့ လၧၦဘၪဒုၭဂၧၫ့ထၪ့ၥၩ လၩ့လၧအံၫစရ့လၭထီးအလူၬ အကျၩလၧဘံအၧၫၡံၫ ဘၫ,ထီၩ့ဒၪလ့ၬလၧဒၫ့နီၪ, ဘဲၫၥိၭၦမိဂဲၫမၩဆၧဘိၪ့ လ့ၩဖၬလၧယဟိဝၩ, အံၫစရ့လၭအယွၩအဂးလၧယ ရုစလံၫ့အဖၧၩ့လီၫ. အဂဲးဘဲၫယီၩ ဘဲၫဆၧကွ့ၭအၥၭ အၥိၭနီၪဆၧလမၩဘၪဝ့ၫယံၬယံၬလ့ၬလီၫ.",
			"6": "<sup>6</sup> တၭၦၥိၫ့လံၬလဖၪလ့ၩဝ့ၫလၧ စဎွၩဒဲအၦဒိၪဖၭဒိၪ ၥံၪအလံၬလၧအံၫစရ့လၭ ဒဲယုဒၫထီးအလူၬအကျၩ, ဘဲၫစဎွၩအဆၧမၪလူၬအၥိၭနီၪတၭ, စံၭဝ့ၫဒၪ, အံၫစ ရ့လၭဖိၪၥံၪဧ့, ကၠၪထဲၩ့နၥံၪအၥၭလၧယဟိဝၩ,စအၫ ဘြဟၫ့,ဒဲစအံစၭ ဒဲအံၫစရ့လၭ အယွၩအအီၪဆံၭ. တၭအဝ့ၫဒၪမိဂဲၫထဲၩ့ကဒၩထဲၩ့ လၧနၥံၪ လၧအအီၪ လၩ့ထးလၧအဖီၩ့ဖျ့ၭ အစံရအၫအစဎွၩလဖၪအစူၪ",
			"7": "<sup>7</sup> ဖၧၩ့နီၪလီၫ.- တၭမွဲနၥံၪထီးကဲၪထၪ့ၦဘဲၫနၥံၪအဖါ ၥံၪဒဲနၥံၪအထၧၫ့ဖုဝဲၥံၪ လၧအမၩမၪဘၪယဟိဝၩအ ဝ့ၫၥံၪအဖါလဖၪအယွၩအၥိၭနီၪလဂ့ၩး အခိးမွဲဘဲၫနီၪ တၭ,ဆၧဖ့ၪလၫ့ခွံၬအဝ့ၫၥံၪ လၧဆၧအီၪယူဝ့ၫဘဲၫန",
			"8": "<sup>8</sup> ၥံၪဒၪဘၪအၥိၭနီၪလီၫ.- တၭဘိၩ့နဲၪ့ယီၩအီၪက့ၪဆီၪ့ နၥံၪအခိၬဘဲၫနၥံၪအဖါၥံၪ အၥိၭနီၪလဂ့ၩး ဖ့ၪလၫ့န ၥံၪအနၫ့ဆါၥံၪလၧယဟိဝၩတၭ, လ့ၩနုၬလၧအလး ဆံၫ့ဎံၪလၧအအီၪက့ၪဆံၫ့ဎံၪဝ့ၫ လၩ့ဆိၩလၩ့ကၠၪ,ဒဲ မၩယဟိဝၩနၥံၪအယွၩအဆၧ ဘဲၫၥိၭအၥၭထၪ့ဆီၪ့မိ",
			"9": "<sup>9</sup> ကၠၪခွံၬအၥၭလၧနၥံၪအအီၪဆံၭ.- အဂဲးဘဲၫယီၩနၥံၪ အ့ၪကၠၪထဲၩ့ဒီၭနၥံၪအၥၭ လၧယဟိဝၩအအီၪတၭ,န ၥံၪအထၧၫ့ဖုဝဲ, ဒဲနၥံၪအဖိၪလဖၪမိဘၪဆၧယၫ့ၥၭလၧ ၦလၧအမိအၪ့မၧၫ့ဎီးဝ့ၫအမ့ၬယၫတၭ မိဂဲၫထဲၩ့ကဒၩ ထဲၩ့လၧခးယီၩအဖၧၩ့လီၫ. အဂဲးဘဲၫယီၩ ယဟိဝၩ နၥံၪအယွၩ ယၫ့ၥုၪ့ယၫ့ၥၭဆၧ, ဒဲအၥၭအီၪဆၧလီၫ. နၥံၪအ့ၪကၠၪထဲၩ့နၥံၪအၥၭလၧအအီၪတၭ, အဝ့ၫဒၪမိ ကၠၪခွံၬအမ့ၬလၧနၥံၪအအီၪအ့ၬ.",
			"10": "<sup>10</sup> တၭၦလၧအလ့ၩၥိၫ့လံၬၥံၪ လ့ၩဝ့ၫလၧလဒိၩ့ဘၪ လဒိၩ့လၧအံဖြံၫ့ ဒဲမနၭစ့ၫအခးထၧၫ့ဘံၪ့ယၫထီၩ့ဒၪ လ့ၬလၧဇ့ၭဘလၧၫ့နီၪ, အ့ၪမွဲၦနံဘၪဝ့ၫဒဲမၩကြၩ့ထမး",
			"11": "<sup>11</sup> ဝ့ၫလီၫ.- မွဲလါနၫ့ဘိၩ, ၦၡၩလၧအၭၡၧၫဒဲမနၭစ့ၫ, ဒဲဇ့ၭဘလၧၫ့အကျၩလဖၪ ဆၪ့လၩ့အၥၭတဘျႃၭဂၩ",
			"12": "<sup>12</sup> တၭဂဲၫဝ့ၫလၧယရုစလံၫ့လီၫ.- တၭလၧယုဒၫအဖၧၩ့ ဆ့ယွၩအစူၪအီၪဝ့ၫလၧအဖ့ၪလၫ့ဝ့ၫ အဝ့ၫၥံၪအၥၭလ ဖျိၪ့ဎးဘဲၫၥိၭအမိထီးန့စဎွၩ, ဒဲၦဒိၪဖၭဒိၪၥံၪအဆၧ မၪလူၬလၧယဟိဝၩအလူလီၫ.",
			"13": "<sup>13</sup> တၭၦအီၪကီၪ့လၧယရုစလံၫ့အဖၧၩ့ အၪဂၩဘဲၫၥိၭ အမိမၩဆၧဘိၪ့ကိၪလအီၪဘၪလၧမံၪ လၧလၩနံၫဘံၪ့",
			"14": "<sup>14</sup> လဘံၪ့အဖၧၩ့, ဆၧအီၪကီၪ့ဖၭဒိၪလီၫ.- အဝ့ၫၥံၪဂဲထုၪ့ ဝ့ၫတၭ, ဆိၬထၪ့ခွံၬဆၧလုအလးလဖၪ လၧအအီၪဝ့ၫ လၧယရုစလံၫ့အဖၧၩ့တၭ, ဆိၬထၪ့ခွံၬဆၧလုအလး ဆူၭခဲၩဆၧနၧၫ့မၧၫ့ထီးအလူၬတၭ, ခွံၬလၩ့ခွံၬဝ့ၫလၧ",
			"15": "<sup>15</sup> ထံၫချိၬကံဒၧၫ့အဖၧၩ့လီၫ.- ထီးနီၪလဖၧၫ့လၧလၩနံၫ ဘံၪ့လဘံၪ့လၩထၪ့လဆံၫလံနံၩလနံၩနီၪ, အဝ့ၫၥံၪ မၩၥံၫဆၧဘိၪ့လ့ၩဖၬတၭ, ၦလုဆၧလဖၪ, ဒဲၦလံဝဲၫ ဖိၪၥံၪအမ့ၬမဲတၭ မၩဆံၫ့ဎံၪထၪ့အၥၭတၭ, ဂဲၫဆိၬ",
			"16": "<sup>16</sup> ဆၧလုမ့ၪလၧယဟိဝၩအဂံၪ့ဖၧၩ့လီၫ.- တၭအဝ့ၫၥံၪ ဆၧၫ့ထုၪ့လၧအလးဘဲၫဆၧစ့ၩရၫ့အၥိၭ, ဒဲဘဲၫယွၩအ ၡၩစမိစ့ၭအဆၧၥီၪ့ဆၧၥၫ့အၥိၭနီၪလီၫ. တၭၦလုဆၧ လဖၪဎွံၪဆၧၥွံၪ လၧအဒိၭန့ဝ့ၫလၧ ၦလံဝဲၫဖိၪအစူၪ ဖၧၩ့လီၫ.",
			"17": "<sup>17</sup> ၦလၧအလဆံၫ့လဎံၪဘၪ လၧဆၧအီၪကီၪ့အကျၩ နီၪ,အီၪဝ့ၫအၪဂၩး မၩအၥၭဘဲၫနီၪတၭ, ၦလံဝဲၫဖိၪၥံၪ မၩၥံၫဆၧဘိၪ့လ့ၩဖၬလဖၪ လၧကယဲၦလၧအလဆံၫ့ ဘၪအဂး, ဘဲၫၥိၭအဝ့ၫၥံၪမိမၩဆံၫ့ထၪ့ဝ့ၫလၧယဟိ",
			"18": "<sup>18</sup> ဝၩအဂးလီၫ.- အဂဲးဘဲၫယီၩၦခမျၧး, ၦအၪဂၩလၧအံ ဖြံၫ့ဒဲမနၭစ့ၫ, ဒဲအံစခၫ, ဒဲဇ့ၭဘလၧၫ့အကျၩနီၪ, မၩ ဆံၫ့ထၪ့အၥၭဒံၭအ့ၬ, မွဲလါနၫ့ဘိၩ အဝ့ၫၥံၪအၪ့ဆၧ ဘိၪ့လ့ၩဖၬနီၪ လမွဲဘၪဘဲၫ ဆၧကွ့ၭအၥၭအၥိၭလီၫ. အ့ၪမွဲလါနၫ့ဘဲၫနီၪတၭ, စဟ့ၭဇကဲအၫ ဘၩဆိၪဖၪန့",
			"19": "<sup>19</sup> အဂးတၭ,စံၭဝ့ၫဒၪ,- ၦလၧအတဲၩ့ဝဲၩအၥၭဘဲၫၥိၭအ မိအၪ့ဎၬယွၩယဟိဝၩ အဝ့ၫၥံၪအဖါလဖၪအယွၩ, အ့ၪလဆံၫ့ဘၪဘဲၫဆၧအလးဆံၫ့ဎံၪ အဆၧမၩဆံၫ့အ ၥိၭလါနၫ့ဘိၩ, မွဲဆၧဂ့ၩယဟိဝၩနီၪ မၩဖီၩ့မၩဖျ့ၭအ",
			"20": "<sup>20</sup> ဝ့ၫၥံၪကိၭဂၩဒ့ၭဆံၭ.- ယဟိဝၩခိၭနၪစဟ့ၭဇကဲအၫ အလူတၭ, မၩဘျၪထဲၩ့ၦခမျၧးလီၫ.",
			"21": "<sup>21</sup> တၭၦအံၫစရ့လၭဖိၪ လၧအအီၪလၧယရုစလံၫ့အ ဖၧၩ့လဖၪနီၪမၩဆၧဘိၪ့ကိၪလအီၪဘၪ လၧမံၪနွ့ၫနံၩ လဖၪအီၪဝ့ၫလၧအၥုၪ့ထိၬၥၭထိၬဖၭဒိၪလီၫ. ၦလံဝဲၫ ဖိၪ,ဒဲၦလုဆၧလဖၪ စံၭထၪ့အၪ့အူၭယဟိဝၩလနံၩ ဘၪလနံၩအီၪဝ့ၫလၧနါဒံၩ့ၥံၪ ၥၫ့ထီးၥံၪ အၥီၫဖၭဒိၪ",
			"22": "<sup>22</sup> လၧယဟိဝၩအဂးလီၫ.- စဟ့ၭဇကဲအၫချဲၩ့ဆၧမုၬမုၬ လၧၦလံဝဲၫဖိၪ ထီးအလူၬ လၧအၥီၪ့လိၪယဟိဝၩအ ဆၧၥ့ၪယၫ လၧအဂ့ၩလီၫ. တၭအဝ့ၫၥံၪအၪ့ဆၧလၧ ဆၧဘိၪ့နွ့ၫနံၩအထးဖၧၩ့တၭ, လုထၪ့ဆၧလုဘၪလိၬ အိၭလိၬတၭ, အၪ့ကံၩ့လၩ့အၥၭလၧယဟိဝၩအဝ့ၫ ၥံၪအဖါလဖၪအယွၩလီၫ.",
			"23": "<sup>23</sup> ဆၧအီၪကီၪ့ထီးအလူၬ ကိၪ့လိၬအၥၭလၧအမိထီး န့အနံၩဂူၫဂၩလဖၪနွ့ၫနံၩတၭ, မၩဘိၪ့နွ့ၫနံၩ အဂူၫ",
			"24": "<sup>24</sup> ဂၩနီၪလၧဆၧၥုၪ့ထိၬၥၭထိၬလီၫ.- အဂဲးဘဲၫယီၩယု ဒၫအစဎွၩစဟ့ၭဇကဲၫအၫ ဖ့ၪလၫ့ဆၧအီၪကီၪ့လၧချီဖၫ လထီၫ့, ဒဲၥိၪနွ့ၫထီၫ့တၭ, ၦဒိၪဖၭဒိၪၥံၪ ဖ့ၪလၫ့ဆၧ အီၪကီၪ့လၧချီဖၫလထီၫ့, ဒဲၥိၪလလၬတၭး ၦလုဆၧ",
			"25": "<sup>25</sup> လဖၪမၩဆံၫ့ဎံၪထၪ့အၥၭအၪဂၩလီၫ.- တၭယုဒၫအ ၡၩအီၪကီၪ့ထီးအလူၬ, ဒဲၦလုဆၧလဖၪ ဒဲၦလံဝဲၫဖိၪ ၥံၪ,ဒဲဆၧအီၪကီၪ့ထီးအလူၬ လၧအဂဲၫလၧအံၫစရ့ လၭအကျၩ, ဒဲၦလခီၫဘၩ့မုးဖိၪ လၧအဂဲၫထၪ့လၧ အံၫစရ့လၭအခးဖၧၩ့, ဒဲလၧအအီၪဝ့ၫ လၧယုဒၫအ",
			"26": "<sup>26</sup> ဖၧၩ့လဖၪနီၪၥုၪ့ထိၬၥၭထိၬဝ့ၫလီၫ.- တၭဆၧၥၭထိၬ ဖၭဒိၪအီၪဝ့ၫလၧယရုစလံၫ့အဖၧၩ့လီၫ. အဂဲးဘဲၫ ယီၩလၧအံၫစရ့လၭအစဎွၩ ဒၫဝံၭအဖိၪခွၫစစီလမၧၫ့ အမုနံၩလဖၪ အလးခဲၫ့နီၪ, ဆၧဘဲၫနီၪအၥိၭအီၪလၧ",
			"27": "<sup>27</sup> ယရုစလံၫ့အဖၧၩ့အ့ၬ.- ထီးနီၪလဖၧၫ့ၦလုဆၧလဖၪ, ဒဲၦလံဝဲၫဖိၪလဖၪ, ဂဲထုၪ့တၭဆိၪဂ့ၩၦခမျၧးလီၫ.ယ ဟိဝၩခိၭနၪအဝ့ၫၥံၪအလူ ဒဲအဆၧဘၩဆိၪဖၪနီၪထၪ့ ဘၭလၧအအီၪအလးဆံၫ့ဎံၪ လၧမူၭခိၪနီၪလီၫ."
		},
		"31": {
			"1": "<sup>1</sup> ထီးဆၧထီးအလူၬနီၪ အ့ၪဂီၩ့ဝ့ၫတၭ, အံၫစရ့လၭ လၧအအီၪဝ့ၫထီးအလူၬ လ့ၩထၪ့ဝ့ၫလၧယုဒၫအဒိၩ့ လဖၪအဖၧၩ့တၭ, မၩခါလၩ့ဘျ့ၭဆၧဂၩ့ဆၧဖၪ့တၭ, ခူၬလၩ့ခွံၬအၡ့ရိၫလဖၪတၭ, မၩလၩ့ဎီးခွံၬဆၧအလး ထၪ့ထီၫလဖၪဒဲဆၧလုအလးလဖၪ လၧယုဒၫဒဲဘံၪ့ယ မံၫ့ထီးအလူၬအဖၧၩ့, ဒဲလၧအံဖြံၫ့ဒဲမနၭစ့ၫအဖၧၩ့ဆ့ ထီးအမၩဂၭဂီၩ့ခွံၬဝ့ၫ လူၬထူၬဆံၫ့ဘၩ့လီၫ. ထီးနီၪ လဖၧၫ့ၦအံၫစရ့လၭဖိၪ ထဲၩ့ထဲၩ့လဂၩလၧအဆၧဖီၪ့ ထၬဒၪဝ့ၫ, လဂၩလၧအဆၧဖီၪ့ထၬဒၪဝ့ၫ ဆုၬဆုၬလၧ အဒိၩ့ဒၪဝ့ၫအဖၧၩ့လီၫ.",
			"2": "<sup>2</sup> တၭစဟ့ၭဇကဲအၫ, အီၪက့ၪလၩ့ၦလုဆၧလဖၪ,ဒဲ ၦလံဝဲၫဖိၪလဖၪလဆၫ့ဘၪလဆၫ့ ဘဲၫအဆၫ့အၥိၭ,လ ဂၩဘဲၫအဆၧမၩအၥိၭကိၭဂၩဒ့ၭး ၦလုဆၧဒဲၦလံဝဲၫ ဖိၪၥံၪ,လၧအလုထၪ့ဆၧလုမ့ၪအဂး, ဒဲဆၧလုထၪ့ဆၧ လုဘၪလိၬအိၭလိၬအဂး ဘဲၫၥိၭအမိမၩဆၧအခ့ၫအ ၡၩအဆၧ, ဒဲစံၭထၪ့အၪ့အူၭဆၧ, ဒဲၥံၫကျံၩဆၧလၧ",
			"3": "<sup>3</sup> ယဟိဝၩအတဲၩလဖၪအတရၫ့ဖၧၩ့လီၫ.- တၭလၧစဎွၩ အဆၧဖိၪဆၧလံၩဒၪဝ့ၫအဖၧၩ့နီၪ ဖ့ၪလၫ့ဝ့ၫလၧဆၧလု မ့ၪအဂးလၧဂီၩ, လၧဂၪ,လၧဆၧလုမ့ၪအဂး, ဒဲဆၧလု မ့ၪလၧမးၥံၫအနံၩအဂး, ဒဲလၧလၩၥံၫအဂးဒဲလၧမၩ ဘိၪ့အဂး, ဘဲၫဆၧကွ့ၭအၥၭလၧယဟိဝၩအဆၧၥီၪ့ ဆၧၥၫ့အဖၧၩ့အၥိၭနီၪလီၫ.",
			"4": "<sup>4</sup> လၧနီၪအမ့ၬယၫအဝ့ၫဒၪမၪလူၬ ၦခမျၧးလၧအအီၪ ဝ့ၫလၧယရုစလံၫ့အဖၧၩ့ ဘဲၫၥိၭအမိဖ့ၪလၫ့ၦလုဆၧ ၥံၪ,ဒဲၦလံဝဲၫဖိၪၥံၪလၧအဂး လၧအၥၭမိဆီၪ့ထၪ့လၧ",
			"5": "<sup>5</sup> ယဟိဝၩအဆၧၥီၪ့ဆၧၥၫ့အဖၧၩ့လီၫ.- ထီးဆၧမၪလူၬ ဂၧၫ့ထၪ့ၥၩလၩ့တၭ, ၦအံၫစရ့လၭဖိၪ ဂဲၫဆိၬဆၧၥၪ ဆိၫဘၪဆဲၫ့လၧ ဘုၪၥံၪဂူၫၥံၪ, စဘံၭထံၫ,ဒဲၥိၪ, ဒဲန့ၫ စၩ့,ဒဲဂၪ့ခိၪအဆၧအၪထၪ့လဖၪ အၪအၪလ့ၬး ဒဲဆၧ",
			"6": "<sup>6</sup> ဆံၫပိၩ့လပိၩ့ဂဲၫဆိၬဝ့ၫအၪအၪလ့ၬလီၫ.- တၭၦအံၫ စရ့လၭဖိၪဒဲၦယုဒၫဖိၪ လၧအအီၪဝ့ၫလၧယုဒၫအဒိၩ့ လဖၪအဖၧၩ့နီၪ ဂဲၫဆိၬဆ့ချီဖၫ, ဒဲၥိၪဆံၫဒုၩလဒုၩ, ဒဲ ဆၧဆံၫ့ဎံၪလၧဆၧအီၪက့ၪဆံၫ့ဎံၪ လၧယဟိဝၩအဝ့ၫ ၥံၪအယွၩအဂးဆံၫပိၩ့လပိၩ့တၭ, အီၪက့ၪပိၩ့ဝ့ၫလပိၩ့",
			"7": "<sup>7</sup> လပိၩ့လီၫ.- လၧလၩၥၧၫ့ဘံၪ့လဘံၪ့နီၪ အီၪက့ၪၥၫ့ဆၧ အပိၩ့လဖၪအခၪ့ထံၭတၭ, မၩဝ့ၫဂီၩ့လၧလၩနွ့ၫဘံၪ့",
			"8": "<sup>8</sup> လဘံၪ့လီၫ.- ထီးစဟ့ၭဇကဲအၫ, ဒဲၦဒိၪၥံၪဂဲၫဝ့ၫတၭ, ဒၪဘၪဆၧအပိၩ့လဖၪနီၪတၭ, စံၭထၪ့အၪ့အူၭယဟိ",
			"9": "<sup>9</sup> ဝၩ,ဒဲအၡၩခမျၧးအံၫစရ့လၭလီၫ.- ထီးနီၪလဖၧၫ့ စဟ့ၭဇကဲအၫအၪ့စၪ့ၦလုဆၧၥံၪ, ဒဲၦလံဝဲၫဖိၪၥံၪ,လၧ",
			"10": "<sup>10</sup> ဆၧအပိၩ့လဖၪအဂဲးအကၠီၪ့လီၫ.- စဇၫဒီၭအၡၩဂံၪ့ ဖိၪၦလုဆၧအခိၪ စအၭဇရဲအၫစံၭဆၧၫ့ဆၧတၭ, စံၭ ဝ့ၫဒၪ, လၧၦဂဲၫဆိၬၥၫ့ဆၧမၩဘိၪ့ လၧယဟိဝၩအဂံၪ့ ဖၧၩ့နီၪ,ခီးဘိၩ့နဲၪ့ယီၩ ပဆၧအၪ့အီၪအၪဝ့ၫ အကၠီၩ့ တၭ,ပအီၪက့ၪလၩ့ထးဆၧလၧအအၪလီၫ. အဂဲးဘဲၫ ယီၩယဟိဝၩဆိၪဂ့ၩယူၭ ၦခမျၧးယူၭတၭ,ဆၧလၧအ အီၪလၩ့ထးလဖၪယီၩ, မွဲဆၧအီၪပိၩ့ဖၭဒိၪယီၩလီၫ.",
			"11": "<sup>11</sup> စဟ့ၭဇကဲအၫမၪလူၬဝ့ၫ ဘဲၫၥိၭဆၧမိတဲၩ့ဝဲၩဒူၭၥံၪ လၧယဟိဝၩအဂံၪ့ဖၧၩ့တၭ, အဝ့ၫၥံၪတဲၩ့ဝဲၩဝ့ၫလီၫ.",
			"12": "<sup>12</sup> တၭၦဂဲၫဆိၬဆၧမၩဘိၪ့လဖၪ, ဒဲဆၧဆံၫပိၩ့လပိၩ့လ ဖၪ,ဒဲဆၧဘၪဆၧအီၪက့ၪဆံၫ့ဎံၪဝ့ၫလဖၪ တီၩတီၩလီၩ့ လီၩ့တၭး ၦလံဝဲၫဖိၪစကၫအနဲအၫ မွဲၦပၧၩ့ဆၧလဖၪ နီၪတၭ,အထၧၫ့ဖုဝဲစၡံမအဲၫ အီၪလၧအဖၫ့လၬလီၫ.",
			"13": "<sup>13</sup> တၭစဟဲၫအ့လၭ, ဒဲအၭဇဇဲယၫ, ဒဲစနၫဟၭ, ဒဲစအၫ စဟ့လၭ, ဒဲစယ့ၫရမီၭ, ဒဲစယီၭဇဘၭ, ဒဲစအံၫလဲၫအ့ လၭ, ဒဲစအံၭစမၫခဲအၫ, ဒဲစမၫဟၭ, ဒဲစဘံၫ့နအဲအၫ မွဲၦယိဆၧဖိၪဆၧလံၩလၧစကၫ့အနဲအၫ ဒဲအထၧၫ့ဖုဝဲ စၡံမအဲၫနီၪ, အစူၪအဖၫ့လၬ, မွဲလၧစဎွၩဟ့ၭဇကဲအၫ ဒဲယဟိဝၩအဂံၪ့အခိၪ စအၭဇရဲအၫ အဆၧမၪလူၬ",
			"14": "<sup>14</sup> လီၫ.- တၭၦလံဝဲၫဖိၪစအံမနၫအဖိၪခွၫ စကိရ့ၫလဂၩ ပၧၩ့တရၫ့လၧမုထၪ့လခီၫနီၪ အီၪဝ့ၫလၧဆၧမၩဘိၪ့ဒၪ ဝ့ၫလဖၪလၧယွၩအဂးအဖၫ့ခိၪ, ဘဲၫၥိၭအမိအၪ့နၩ့ ဖၭဖ့ၪလၫ့ယဟိဝၩအဆၧမၩဘိၪ့လဖၪ, ဒဲဆၧဆံၫ့ဎံၪ",
			"15": "<sup>15</sup> ထုၬလဖၪနီၪလီၫ.- တၭလၧအဝ့ၫဒၪအဖၫ့လၬနီၪ, စအံ ဒံၫ့ဒဲစမနဲအမံၫ့, ဒဲစယ့ၭရှုၫအၫ, ဒဲစၡ့ၫမအဲအၫ,ဒဲစ အၫမရဲအၫ,ဒဲစၡ့ၭခနဲအၫ လၧၦလုဆၧၥံၪအဒိၩ့လဖၪ အဖၧၩ့,လၧအလးလၧဆၧအီၪက့ၪဝ့ၫ ဘဲၫၥိၭအမိအၪ့ နၩ့ဖၭဖ့ၪလၫ့ဆၧလၧ အထၧၫ့ဖုဝဲၥံၪလဆၫ့လဆၫ့, အ",
			"16": "<sup>16</sup> ဒိၪဂ့ၩအဆံၭဂ့ၩး- လၧၦခွၫၥံၪအဆၨၩအဆရၫ့အမ့ၬ ယၫနီၪ,ၦလၧအၥၭအီၪၥၧၫ့နံၪ့, ဒဲၥၧၫ့နံၪ့အဖၫ့ခိၪဒံၭ ကယဲၦလၧအဂဲၫနုၬလၧယဟိဝၩ အဂံၪ့လဂၩလါလါ နီၪဖ့ၪလၫ့ဝ့ၫအဂး, လၧလနံၪ့အဂး လနံၪ့အဂးလၧအ မၩဆၧအကၠီၩ့, ဘဲၫအဆၫ့လဆၫ့ဘၪလဆၫ့အၥိၭနီၪ",
			"17": "<sup>17</sup> လီၫ.- ဖ့ၪလၫ့ဝ့ၫလၧၦလုဆၧအဆၨၩအဆရၫ့ ဘဲၫအ ဖါၥံၪအဂံၪ့အၥိၭတၭ, ၦလံဝဲၫဖိၪၥံၪလၧအၥၭအီၪအ နံၪ့နံၫဆံၫဒဲနံၫဆံၫအဖၫ့ခိၪနီၪ လၧအခိၭဆၧအဖၧၩ့,",
			"18": "<sup>18</sup> ဘဲၫအဆၫ့, လဆၫ့ဘၪလဆၫ့အၥိၭနီၪတၭ,- လၧအ ဖိၪဒံၩဖိၪၥၪထီးအလူၬ, အဖိၪအမၫၥံၪ, ဒဲအဖိၪခွၫၥံၪ, ဒဲအဖိၪမုၪၥံၪအဆၨၩအဆရၫ့ လၧဆၧအီၪကီၪ့ထီးအ လူၬအကျၩနီၪလီၫ. အဂဲးဘဲၫယီၩအဝ့ၫၥံၪမၩဆံၫ့ဎံၪ အနၫ့ဆါၥံၪ လၧအလးလၧဆၧအီၪက့ၪဝ့ၫနီၪလီၫ.",
			"19": "<sup>19</sup> တၭၦလၧစအၫရၧၫ့အဖိၪခွၫအကျၩ, ၦလုဆၧၥံၪအီၪ ဝ့ၫလၧဂၪ့ခိၪအဝၩ့လဖၪ လၧအဒိၩ့ၥံၪအဆၧအၪ့အ ဆၪအလးလၧဒိၩ့ကိၭဖျိၪ့ဒ့ၭအဖၧၩ့နီၪ, ၦလၧဆၧကိၭ ထၪ့ယူၭအမံၩ့လဖၪနီၪ ဖ့ၪလၫ့ဝ့ၫလၧအဂးလၧၦခွၫထီး အလူၬ, လၧၦလုဆၧအကျၩဒဲကယဲၦလၧဆၧဝံဆၧနၬ ထၪ့ဝ့ၫလၧအဆၨၩအဆရၫ့ လၧၦလံဝဲၫဖိၪၥံၪအကျၩ ထီးအလူၬလီၫ.",
			"20": "<sup>20</sup> တၭစဟ့ၭဇကဲအၫမၩဆၧနီၪ လၧယုဒၫထီးအလူၬ အကျၩ,ဒဲမၩဆၧလၧအဂ့ၩအဘွၩ, ဒဲအတီၩအလီၩ့,",
			"21": "<sup>21</sup> အမွဲအတီၩလၧယဟိဝၩအမ့ၬယၫလီၫ.- တၭကယဲ ဆၧလၧအမၩထၪ့ၥၫ့လၧယွၩအဂံၪ့ အဆၧမၩအဖၧၩ့, ဒဲလၧဆၧမၪလူၬအဖၧၩ့, ဘဲၫၥိၭအမိအၪ့ဎၬအယွၩလ မံၩ့လါလါနီၪမၩဝ့ၫ လၧအၥၭထၧၫ့ဖျိၪ့ယၫတၭ, ဘီၪ ထၪ့ယီၫထၪ့ဝ့ၫဒၪလီၫ."
		},
		"32": {
			"1": "<sup>1</sup> ဆၧလဖၪနီၪအလးခဲၫ့, လၧဆၧမၩဂုးထၪ့ခၧၫ့ထၪ့ ဝ့ၫတၭ,အစံရအၫအစဎွၩစနၭခရံၭဂဲၫဝ့ၫနီၪ, ဂဲၫနုၬလၧ ယုဒၫတၭ, ၥုၪ့တဲၩထၫ့ဒၩဒိၩ့အီၪလၧအခိၪဒၧၩ့လဖၪ နီၪတၭ,မိမၩန့ဝ့ၫလၧအဂးဒၪဝ့ၫလီၫ.",
			"2": "<sup>2</sup> ထီးစဟ့ၭဇကဲအၫ ဒၪဘၪဝ့ၫလၧစနၭခရံၭဂဲၫဒဲအ",
			"3": "<sup>3</sup> ဆၧကိၪ့အီၪလၧအမိဒုၭယရုစလံၫ့တၭ,- ကိၪ့လိၬအ ၥၭလၧအၦဒိၪဖၭဒိၪၥံၪ, ဒဲၦအဆီၪ့ၥံၪ ဘဲၫၥိၭအမိဆွံၫ ဘံၭထံၫထၪ့ဖျိၭလၧအအီၪဝ့ၫ လၧဒိၩ့အချိၫ့တၭ, အ",
			"4": "<sup>4</sup> ဝ့ၫၥံၪမၩဆၧၩ့ဝ့ၫလီၫ.- တၭၦခမျၧးအီၪကိၩ့အီၪကီၪ့ တၭ,ဆွံၫဘံၭထၬထံၫထၪ့ဖျိၭထီးအလူၬ ဒဲထံၫချိၬလၧ အယွၩလၩ့ဝ့ၫလၧခးအၥၭခံဖၧၩ့တၭ, စံၭဝ့ၫဒၪ,ၦအစံရ အၫအစဎွၩမိဂဲၫတၭ ဒၪန့ထံၫအၪအၪလ့ၬနီၪ, မွဲဘၪ",
			"5": "<sup>5</sup> လဲၪ.- အဝ့ၫဒၪမၩဆီၪ့ထၪ့အၥၭတၭ, မၩထဲၩ့ဆၧခိၪ ဒၧၩ့လၧအလၩ့ဎီးကိၭစီၪ့ဒ့ၭတၭ, မၩထၪ့ဝ့ၫထီၩ့လၧ တၨၭထီၫလဖၪဒဲဆၧခိၪဒၧၩ့ဂူၫဂၩ လၧခီၫ့တၭ,မၩထဲၩ့ မံလိၫလၧစဒၫဝံၭအဒိၩ့ဖၧၩ့တၭ, မၩကဲၪထၪ့ဖၩ့ၥံၪ",
			"6": "<sup>6</sup> နၭၥံၪဒဲထၩ့ဖံၭအၪအၪလ့ၬလီၫ.- တၭအီၪက့ၪၦၥုၭဖိၪ အခိၪလဖၪလၧၦခမျၧးအဖၫ့ခိၪတၭ, ဒုၭအီၪကိၩ့အီၪ ကီၪ့ဝ့ၫလၧအအီၪ လၧဒိၩ့အတရၫ့အဖၧၩ့ၥၭ အဖၧၩ့",
			"7": "<sup>7</sup> တၭ, ချဲၩ့ဆၧမုၬမုၬလၧအဝ့ၫၥံၪတၭ, စံၭဝ့ၫဒၪ,- အီၪ က့ၪဆီၪ့နၥံၪအဂဲးအဘၭတၭ, မၩဒူၩထၪ့နၥံၪအၥၭ ဆံၭ.ထီးၥၭမဲၪလဂ့ၩ, အၪ့ယိၪဆၧလၧအစံရအၫအ စဎွၩအကၠီၩ့ဒဲလၧၦခမျၧးထီးအလူၬ လၧအအီၪလၧ အဝ့ၫအၥိၭအကၠီၩ့လဂ့ၩး အဂဲးဘဲၫယီၩၦလၧအအီၪ",
			"8": "<sup>8</sup> လၧပၥိၭယီၩအၪနဲၪ့ၦလၧ အအီၪလၧအဝ့ၫလီၫ.- ဆၧ ဖံၭဆၧယၪအစူၪဒူၪအီၪလၧအဝ့ၫဒၪလီၫ. အ့ၪမွဲယဟိ ဝၩပယွၩအီၪလၧပၥိၭ ဘဲၫၥိၭအမိမၩဆၧၩ့ပၧၩလၧ ဆၧဒုၭၥုၭလဖၪလီၫ. တၭၦခမျၧးဒိၭနဲၩ့အၥၭလၧယု ဒၫအစဎွၩဟ့ၭဇကဲအၫ အဆၧချဲၩ့လဖၪနီၪလီၫ.",
			"9": "<sup>9</sup> ဆၧနီၪအလးခဲၫ့ အစံရအၫအစဎွၩ စနၭခရံၭအၪ့ မၧၫ့လၩ့အခ့ၫအၡၩ လၧယရုစလံၫ့, (တၭအနၫ့ဆါ အီၪထၫ့ဒၩလၫခံၭ အီၪလၧအၥုၭမုခမျၧးထီးအလူၬ) လၧယုဒၫအစဎွၩဟ့ၭဇကဲအၫအအီၪ, ဒဲလၧယုဒၫထီး အလူၬလၧအအီၪလၧ ယရုစလံၫ့အဖၧၩ့အအီၪတၭစံၭ",
			"10": "<sup>10</sup> ဝ့ၫဒၪ,- အစံရအၫအစဎွၩ စနၭခရံၭစံၭဝ့ၫဘဲၫယီၩ, လၧဆၧမိဝၩ့ထၬယရုစလံၫ့အဘိၩ့ဘၭနီၪ, နၥံၪမိအီၪ ဒၪနၥံၪအဆၧတၭ, ဒိၭနဲၩ့နၥံၪအၥၭလၧဆၧနီၪလမံၩ့",
			"11": "<sup>11</sup> လဲၪ.- စဟ့ၭဇကဲအၫစံၭဝ့ၫ, ယဟိဝၩပယွၩမိမၩဖီၩ့ မၩဖျ့ၭပၧၩလၧအစံရအၫအစဎွၩ အစူၪဖၧၩ့တၭ, အၪ့ ယၫန့နၥံၪဘဲၫနၥံၪမိဖ့ၪလၫ့ နၥံၪအၥၭလၧနၥံၪမိၥံၫ လၧဆၧၥၭဝံလၩ့ဒိၩ ဒဲဆၧၥူၫအီၩနၥံၪအၥၭလၧထံၫ,",
			"12": "<sup>12</sup> မွဲအ့ၬဧၪ.- ဆၧလၧစဟ့ၭဇကဲအၫလဂၩနီၪဆိၬထၪ့ ခွံၬအလးထၪ့ထီၫ ဒဲအဆၧလုလးတၭ, မၪလူၬယုဒၫ ဒဲယရုစလံၫ့တၭ, စံၭဝ့ၫဒၪ, နၥံၪမိဘၪဘိၪ့ထၪ့ဘၩ ထၪ့လၧဆၧလုအလးလစီၪ့ဎးအမ့ၬယၫတၭ, ဆူၭခဲၩ",
			"13": "<sup>13</sup> ထၪ့ဆၧနၧၫ့မၧၫ့လၧအဖၫ့ခိၪနီၪ, မွဲအ့ၬဧၪ.- ဆၧလၧ ယၧၩဒဲယဖါလဖၪမၩၦခမျၧး ထီးအလူၬလၧခးလဖၪ အဖၧၩ့နီၪ,နၥံၪလၥ့ၪယၫဘၪဧၪ. ခးလဖၪနီၪအၡၩ ဆၨၩၥံၪအယွၩလဖၪ မၩဖီၩ့မၩဖျ့ၭအထံၫအခးလၧ",
			"14": "<sup>14</sup> ယစူၪဖၧၩ့ဆ့ဧၪ.- ဘဲၫၥိၭနၥံၪအယွၩမိမၩဖီၩ့မၩဖျ့ၭ နၥံၪလၧယစူၪဖၧၩ့မိၥ့ၪတၭ, ၦဆၨၩလၧယဖါမၩဂၭ ဂီၩ့ခွံၬဝ့ၫလဖၪအယွၩ ထီးအလူၬအကျၩနီၪ, မွဲပလၫ မၩဖီၩ့ မၩဖျ့ၭ အၡၩခမျၧး လၧယစူၪဖၧၩ့ ၥ့ၪလဂၩ",
			"15": "<sup>15</sup> လဲၪ.- တၭဘိၩ့နဲၪ့ယီၩ ဒုၭအၪ့လီၫန့နၥံၪအၥၭလၧစ ဟ့ၭဇကဲအၫလဂ့ၩး တၭဒုၭအၪ့ယၫန့နၥံၪအၥၭလၧ အဝ့ၫဘဲၫနီၪအၥိၭလဂ့ၩ. နဲၩအဝ့ၫလဂ့ၩ, အဂဲးဘဲၫ ယီၩၦလဆၨၩအယွၩမွဲဂ့ၩ, ၦလခီၫဘၩ့မုးဖိၪအယွၩ မွဲဂ့ၩ,မၩဖီၩ့မၩဖျ့ၭအၡၩခမျၧး လၧယစူၪဖၧၩ့ဒဲလၧ ယဖါၥံၪအစူၪဖၧၩ့နီၪၥ့ၪနးဂၩအ့ၬ. နၥံၪအယွၩမိမၩ",
			"16": "<sup>16</sup> ဖီၩ့မၩဖျ့ၭနၥံၪ လၧယစူၪဖၧၩ့လၩလါဆ့အ့ၬ.- တၭအ ခ့ၫအၡၩချဲၩ့ဒံၭဆၧထၫ့ဒၩ ယဟိဝၩယွၩ, ဒဲထၫ့ဒၩအ ခ့ၫအၡၩစဟ့ၭဇကဲအၫနီၪလီၫ.",
			"17": "<sup>17</sup> အဝ့ၫဒၪကွ့ၭလံၬလဘံၪ့ဆ့ လၧအဒုၪဒွ့ၪယဟိဝၩ အံၫစရ့လၭအယွၩ, ချဲၩ့ဆၧထၫ့ဒၩဝ့ၫတၭ, စံၭဝ့ၫဒၪ, ဘဲၫခးလဖၪအဆၨၩၥံၪအယွၩလဖၪ လမၩဖီၩ့ဖျ့ၭဘၪ အၡၩခမျၧးလၧယစူၪဖၧၩ့အၥိၭနီၪ, စဟ့ၭဇကဲအၫ အယွၩမိမၩဖီၩ့မၩဖျ့ၭအၡၩခမျၧး လၧယစူၪဖၧၩ့ဆ့",
			"18": "<sup>18</sup> အ့ၬ.- ထီးနီၪလဖၧၫ့အဝ့ၫၥံၪ ကိၭထၪ့ဆၧလၧအလူဖၭ ဒိၪလၧယုဒၫအလၨ လၧၦခမျၧးအမ့ၬယၫ လၧဒိၩ့ခိၪ",
			"19": "<sup>19</sup> ဒၧၩ့အဖၫ့ခိၪဘဲၫၥိၭအမိမၩန့ဒိၩ့လီၫ.- တၭချဲၩ့ဆၧ ထၫ့ဒၩယရုစလံၫ့အယွၩ ဘဲၫလၧဂၪ့ခိၪအၡၩခမျၧးအ ယွၩလဖၪလၧၦမၩကဲၪထၪ့ဝ့ၫ လၧအစူၪအၥိၭနီၪလီၫ.",
			"20": "<sup>20</sup> တၭလၧဆၧနီၪအကၠီၩ့ စဎွၩဟ့ၭဇကဲအၫ, ဒဲစအၫ မူၭအဖိၪခွၫမီၪစအဲၫစ့ယၫ ဘၩဆိၪဖၪဆၧတၭ, ကိၭ",
			"21": "<sup>21</sup> ထၪ့ဆၧလၧမူၭခိၪလီၫ.- တၭယဟိဝၩအၪ့မၧၫ့လၩ့အ ၥီၫ့လဂၩလၧအဒၪ့ထ့ၬခွံၬ ၦအဒိၪအဆီၪ့ထီးအလူၬ,ဒဲ ၦအခိၪလဖၪ, ဒဲၦဒိၪဖၭဒိၪလၧအစံရအၫ အစဎွၩအ ၡၩၥုၪ့တဲၩအလးဖၧၩ့လီၫ. တၭအဝ့ၫဒၪထဲၩ့ကဒၩ ထဲၩ့ဝ့ၫလၧအခးဒၪဝ့ၫ အီၪလၧအမ့ၬမဲလီၫ. ထီၩ့ဝ့ၫ လၧအယွၩအဂံၪ့တၭ, ၦလၧအမွဲအဖိၪလၩ့ထံးလၩ့",
			"22": "<sup>22</sup> ဆ့ၭနီၪမၩၥံၫအဝ့ၫလၧနၭထီးနီၪလီၫ.- တၭယဟိဝၩ မၩဖီၩ့မၩဖျ့ၭ စဟ့ၭဇကဲအၫ, ဒဲၦအီၪဝ့ၫလၧယရုစ လံၫ့အဖၧၩ့လၧအစံရအၫအစဎွၩ စနၭခရံၭအစူၪဖၧၩ့, ဒဲလၧၦထီးအလူၬအစူၪဖၧၩ့တၭ, ၥိၫ့အဝ့ၫၥံၪလၧအ",
			"23": "<sup>23</sup> အီၪဝၬဖီၩ့ဝ့ၫကိၭစီၪ့ဒ့ၭလီၫ.- တၭၦအၪဂၩဂဲၫဆိၬ ဆၧမၩဘိၪ့လၧယဟိဝၩအအီၪ လၧယရုစလံၫ့,ဒဲလၬ ဆီၪ့ၥံၪလၧယုဒၫ အစဎွၩ ဟ့ၭဇကဲအၫအအီၪလီၫ. လၧဆၧမၩအၥၭဘဲၫနီၪအလးခဲၫ့တၭ, အဝ့ၫဒၪဒိၪထၪ့ ဝ့ၫလၧၦကိၭဆၨၩဒ့ၭအမ့ၬယၫလီၫ.",
			"24": "<sup>24</sup> ဆၧလၧမုနံၩလဖၪနီၪ စဟ့ၭဇကဲအၫဆၫထၪ့ထီးအ မိၥံၫဝ့ၫလီၫ. ဘၩဆိၪဖၪယဟိဝၩတၭ, အဆၧချဲၩ့ဒုၪ့",
			"25": "<sup>25</sup> အဝ့ၫတၭ, ဖ့ၪလၫ့ဝ့ၫလၧဆၧမၩနဲၪ့လီၫ.- အ့ၪမွဲစဟ့ၭ ဇကဲအၫဖ့ၪလၫ့ကၪဆၧဘဲၫယီၩ ဆၧအခိးအတၩလၧ အဘၪဝ့ၫအၥိၭနီၪအ့ၬ. အဂဲးဘဲၫယီၩ အၥၭအီၪက့ၪ ထၪ့ထီၫအၥၭလီၫ. မၩအၥၭဘဲၫနီၪတၭ ဆၧၥၭထၪ့",
			"26": "<sup>26</sup> ဘၪအဝ့ၫတၭ, ဘၪဆ့ယုဒၫ,ဒဲယရုစလံၫ့လီၫ.- မွဲလါ နၫ့ဘဲၫနီၪတၭစဟ့ၭဇကဲအၫ ဆၪ့လၩ့အၥၭလၧအၥၭ ထၪ့ထီၫအကၠီၩ့နီၪ, (အဝ့ၫဒၪဒဲၦအီၪဝ့ၫလၧယရုစလံၫ့ အဖၧၩ့,) တၭယဟိဝၩအဆၧၥၭထၪ့ဘၪဝ့ၫလၧစဟ့ၭ ဇကဲအၫအမုနံၩအဖၧၩ့နီၪအ့ၬ.",
			"27": "<sup>27</sup> စဟ့ၭဇကဲအၫ အီၪဝ့ၫလၧဆၧလူဒိၪဎွ့ၩဒိၪ,ဒဲဆၧ လၩဆၧဖၩ့အၪအၪလ့ၬတၭ မၩဆၧအီၪက့ၪကီၪ့အ လးလၧစ့ၩအဂး, ဒဲလၧထီၫ့အဂး, ဒဲလၧလိးဂ့ၩအဂး, ဒဲဆၧနၧၫ့မၧၫ့အဂး ဒဲလၧအထၩ့ဖံၭၥံၪအဂး, ဒဲလၧဆၧ အဎၧၩ့အဎီလၧဆၧလၧ အဘၪၦအၥၭထီးအလူၬအ",
			"28": "<sup>28</sup> ဂး,- ဆၧအီၪက့ၪကီၪ့အလးဆ့, လၧဘုၪၥံၪဂူၫၥံၪ,ဒဲစ ဘံၭထံၫ, ဒဲၥိၪအဆၧအၪထၪ့အဂး, ဒဲတၩ့ခူၬၥံၪလၧ ဆၧဖိၪဆၧဎါအဒိၩ့လဒီၪ့ ဒဲလဒီၪ့အဂး, ဒဲဖီၩ့ၥံၪလၧ",
			"29": "<sup>29</sup> အၥိၪၥံၪဘ့ၪၥံၪအဂးလီၫ.- တၭအဝ့ၫမၩဒိၩ့ၥံၪလၧအ ဂး,ဒဲဆၧဖိၪဆၧလံၩ, ၥိၪၥံၪဘ့ၪၥံၪချီၥံၪအၪအၪလ့ၬ လီၫ. အဂဲးဘဲၫယီၩယွၩဖ့ၪလၫ့ဝ့ၫလၧ အစူၪလးအခၪ့ ခိၪအၪအၪလ့ၬလီၫ.",
			"30": "<sup>30</sup> အဝ့ၫဒၪ, မွဲစဟ့ၭဇကဲအၫလၧအမၩဘံၭထၬဂဲဟၫ့ အထံၫကၠီၪ့လၧထၭလခီၫလကၠီၪ့တၭ, ဒုၭယွၩလၩ့ဝ့ၫ လၧစဒၫဝံၭအဒိၩ့မုနုၬလခီၫလီၫ. တၭစဟ့ၭဇကဲအၫ ဘီၪထၪ့ယီၫထၪ့ဝ့ၫ လၧအဆၧမၩ ထီးအလူၬအဖၧၩ့",
			"31": "<sup>31</sup> လီၫ.- အ့ၪမွဲဆၧလၧအဘၪဆဲၫ့ လၧဘၭဘလၧၫ့အၦ ဒိၪဖၭဒိၪအၡၩချဲၩ့ဆၧလဖၪ လၧဆၧအၪ့မၧၫ့လၩ့ဝ့ၫ လၧအအီၪဘဲၫၥိၭအမိအၪ့စၪ့ဆၧလၧ ဆၧလၩ့လၭမၩ အၥၭလၧခးဖၧၩ့အဂဲးအကၠီၪ့နီၪ, ယွၩစဲၪ့ဒၪအဝ့ၫ ဘဲၫ ၥိၭအမိမၩခွါဝ့ၫ, ဒဲအမိၥ့ၪယၫ ကယဲဆၧလၧအအီၪ လၧအၥၭခံဖၧၩ့နီၪလီၫ.",
			"32": "<sup>32</sup> တၭဆၧအီၪလၩ့ထး ဘၪဆဲၫ့လၧစဟ့ၭဇကဲအၫ,ဒဲ အဂ့ၩအဘွၩနီၪ,ယိခွါ, ကွ့ၭအၥၭလၧစအၫမူၭအဖိၪ ခွၫစအဲၫစ့ယၫလၧအဒၪဆၧ လၧယၫလခီၫအဖၧၩ့ဒဲလၧ",
			"33": "<sup>33</sup> ယုဒၫ,ဒဲအံၫစရ့လၭအစဎွၩအလံၬဖၧၩ့လီၫ.- စဟ့ၭ ဇကဲအၫမံၫဝ့ၫလၧအဖါၥံၪအၥိၭတၭ, ၦခုၪ့လၩ့ဘၧၩ့ ခွံၬဝ့ၫလၧစဒၫဝံၭအဖိၪခွၫၥံၪ အဆၧၥွၪခိၪအဂ့ၩထုၬ အဖၧၩ့တၭ, ယုဒၫ, ဒဲၦအီၪဝ့ၫလၧယရုစလံၫ့အဖၧၩ့ ထီးအလူၬမၩလၩမၩဖၩ့ဝ့ၫ လၧအၥံၫဝ့ၫအထီလီၫ. တၭအဖိၪခွၫစမနၭစ့ၫ ကဲၪထၪ့စဎွၩလၧအလးလီၫ."
		},
		"33": {
			"1": "<sup>1</sup> လၧစမနၭစ့ၫကဲၪထၪ့ၥၫ့စဎွၩနီၪ, အၥၭအီၪလဆံၫ နံၫနံၪ့တၭ,ကဲၪစဎွၩလၧယရုစလံၫ့အဖၧၩ့ ယဲဆံၫယဲ",
			"2": "<sup>2</sup> နံၪ့လီၫ.- အဝ့ၫဒၪမၩဆၧအၧၩ့လၧယဟိဝၩအမ့ၬယၫ ဘဲၫၦဆၨၩၥံၪလၧယဟိဝၩနၫ့ထၪ့ခွံၬ လၧအံၫစရ့လၭ",
			"3": "<sup>3</sup> ဖိၪအမ့ၬယၫအဆၧဘၪၥၭလိၪအၥိၭလီၫ.- အဂဲးဘဲၫ ယီၩအဝ့ၫဒၪ, မၩထၪ့ထဲၩ့ဆၧအလး ထၪ့ထီၫလဖၪ လၧအဖါစဟ့ၭဇကဲအၫမၩဂၭဂီၩ့ခွံၬဝ့ၫတၭ, မၩထၪ့ ဆၧလုအလးလဖၪ လၧဘၫအလၭၥံၪအဂးတၭ, မၩ ကဲၪထၪ့အၡ့ရိၫတၭ, ဘၩမူၭခိၪအၥုၭမုခမျၧးထီးအ",
			"4": "<sup>4</sup> လူၬဒဲမၩအဝ့ၫၥံၪအဆၧလီၫ.- အဝ့ၫဒၪမၩထၪ့ဆ့ဆၧ လုအလးလဖၪ လၧယဟိဝၩအဂံၪ့ဖၧၩ့ လၧယဟိဝၩ စံၭလၧအဂဲး, ယမံၩ့မိအီၪလၧယရုစလံၫ့အဖၧၩ့လၩ့",
			"5": "<sup>5</sup> ဆိၩလၩ့ကၠၪလီၫ.- တၭမၩဆၧလုအလးလဖၪလၧမူၭ ခိၪအၥုၭမုထီးအလူၬအဂး လၧယဟိဝၩအဂံၪ့အဝၩ့",
			"6": "<sup>6</sup> နံၫစီၪ့အဖၧၩ့လီၫ.- တၭဒုၭခၫ့ဂၬအဖိၪၥံၪလၧမ့ၪလၧ စဟံၪ့နၧၫ့အဖိၪခွၫအခိၪလီၩ့ဆူၭဖၧၩ့, ဒဲထီးန့ဆၧအ ဆၧၫ့အထီ, ဒဲမၩဆၧအူၪဆၧပီၩ, ဒဲဆၧယူၬအဆၧမၩ အိၭလိၬအၥၭလၧဆၧဖူၫဆၧနၪ, ဒဲလၧဆၧယူၬၥံၪလီၫ. မၩဆၧအၧၩ့ဖၭဒိၪ လၧယဟိဝၩအမ့ၬယၫတၭ, ဒုၭ",
			"7": "<sup>7</sup> ထၪ့အဝ့ၫဒၪအၥၭလီၫ.- တၭအီၪက့ၪဆၧဂၩ့စိၭဖျၩ အၥၭ,ဆၧဂၩ့လၧအမၩကဲၪထၪ့ဝ့ၫနီၪ, လၧယွၩအဂံၪ့ ဖၧၩ့,လၧယွၩစံၭစဒၫဝံၭ ဒဲအဖိၪခွၫစစီလမၧၫ့လၧအဂဲး လၧဂံၪ့လဖျိၪ့ယီၩအဖၧၩ့, ဒဲလၧယရုစလံၫ့အဖၧၩ့လၧ ယရွံန့လၧအံၫစရ့လၭအဒီၪ့ ထီးအလူၬအကျၩနီၪ,",
			"8": "<sup>8</sup> ယမိအီၪက့ၪယမံၩ့အဆိၩဆိၩအကၠၪကၠၪလီၫ.- တၭ အဝ့ၫၥံၪအ့ၪထီးန့ကယဲဆၧလၧယမၪလူၬ အဝ့ၫၥံၪထီး အလူၬ,ဘဲၫကယဲဆၧၥီၪ့ဆၧၥၫ့ထီးအလူၬ, ဒဲဆၧမၪ လူၬ,ဒဲဆၧစ့ၩရၫ့လၧစမိစ့ၭအစူၪဖၧၩ့အၥိၭနီၪ, ယမိ ဒုၭစဲၪ့ထၪ့ခွံၬလၧၩ့အံၫစရ့လၭ လၧအခးယဖ့ၪလၫ့နၥံၪ အဖါၥံၪလဘံၪ့အဖၧၩ့အ့ၬ.",
			"9": "<sup>9</sup> တၭစမနၭစ့ၫဒုၭမၩယုဒၫ ဒဲၦအီၪဝ့ၫလၧယရုစလံၫ့ လၧဆၧအၧၩ့နၭနဲၪ့ၦဆၨၩလဖၪ လၧယဟိဝၩမၩဂၭ ဂီၩ့ဝ့ၫလၧၦအံၫစရ့လၭဖိၪအမ့ၬယၫနီၪလီၫ.",
			"10": "<sup>10</sup> ယဟိဝၩချဲၩ့ဆၧလၧစမနၭစ့ၫ ဒဲအၡၩခမျၧးတၭ,",
			"11": "<sup>11</sup> အဝ့ၫၥံၪခိၭနၪဝ့ၫအ့ၬ.- တၭယဟိဝၩဒုၭဂဲၫထၫ့ဒၩအဝ့ၫၥံၪ လၧအစံရအၫ အစဎွၩအၡၩၥုၭမုခမျၧး အခိၪလဖၪ လၧအဖီၪ့န့မၧၫ့ စမနၭစ့ၫတၭ, စၧၩ့ထၬဝ့ၫ လၧၥွ့ၫ ထၭတၭ,လ့ၩဆိၬအဝ့ၫ ထီၩ့လၧဘၭဘလၧၫ့အဖၧၩ့",
			"12": "<sup>12</sup> လီၫ.- ထီးအဘၪဆၧခိဆၧဝီၩတၭ, အၪ့ကံၩ့အၪ့ယၫ ယဟိဝၩလၧအမွဲအယွၩတၭ, ဆၪ့လၩ့အၥၭနၭနၭ",
			"13": "<sup>13</sup> လ့ၬလၧအဖါၥံၪ အယွၩအမ့ၬယၫလီၫ.- ဘၩဆိၪဖၪ အဝ့ၫတၭ, အဆၧထိးဆၧၫ့အဆၧအၪ့ကံၩ့အၪ့ယၫဝ့ၫ တၭ,ခိၭနၪအလူ, ဒုၭဂဲၫထဲၩ့ဝ့ၫ လၧယရုစလံၫ့လၧအ ဘၩ့အမုးအဖၧၩ့လီၫ. ထီးနီၪလဖၧၫ့စမနၭစ့ၫၥ့ၪယၫ ဝ့ၫလၧယဟိဝၩမွဲအဝ့ၫဒၪအယွၩလီၫ.",
			"14": "<sup>14</sup> ဆၧနီၪလဖၪအလးခဲၫ့ အဝ့ၫဒၪမၩထၪ့ဆၧခိၪဒၧၩ့ လၧစဒၫဝံၭအဒိၩ့ချိၫ့ လၧဂဲဟၫ့လၧမုနုၬလခီၫလၧခိၪ လီၩ့ဆူၭဖၧၩ့ထီၩ့လၧဆၧလ့ၩနုၬ လၧတရၫ့ယၪနီၪတၭ, မၩဝၬဖီၩ့အိဖ့ၫလၭတၭ, မၩထၪ့ဝ့ၫထီၫထီၫလ့ၬတၭး အီၪက့ၪၥုၭဖိၪအခိၪလဖၪ လၧယုဒၫအဒိၩ့အီၪလၧအ",
			"15": "<sup>15</sup> ခိၪဒၧၩ့ထီးအလူၬအဖၧၩ့လီၫ.- တၭဆိၬထၪ့ခွံၬၦလ ခီၫဘၩ့မုးဖိၪအယွၩလဖၪ, ဒဲဆၧဂၩ့လၧယဟိဝၩအဂံၪ့ ဖၧၩ့,ဒဲကယဲဆၧလုအလးလဖၪ လၧအမၩဝ့ၫလၧယ ဟိဝၩအဂံၪ့အခိၪလီၩ့, ဒဲလၧယရုစလံၫ့အဖၧၩ့နီၪ,ခွံၬ",
			"16": "<sup>16</sup> ၡိၭခွံၬဝ့ၫလၧဒိၩ့ချိၫ့လီၫ.- မၩဂ့ၩထၪ့ထဲၩ့ယဟိဝၩအ ဆၧလုအလးတၭ, လုထၪ့ဆၧလုဘၪလိၬအိၭလိၬ,ဒဲ ဆၧလုစံၭထၪ့အၪ့အူၭလၧအဖၫ့ခိၪတၭ, မၪလူၬယုဒၫ ဘဲၫၥိၭအမိမၩယဟိဝၩ အံၫစရ့လၭ အယွၩအဆၧ",
			"17": "<sup>17</sup> လီၫ.- မွဲလါနၫ့ဘဲၫနီၪတၭ, ၦခမျၧးလုထၪ့ဒံၭဆၧလၧ ဆၧအလးထၪ့ထီၫအဖၫ့ခိၪ, န့ၫလၧယဟိဝၩအဝ့ၫၥံၪ အယွၩလဂၩဎးအဂးလီၫ.",
			"18": "<sup>18</sup> တၭဆၧအီၪလၩ့ထးဘၪ ဆဲၫ့လၧစမနၭစ့ၫ, ဒဲအ ဘၩဆိၪဖၪအယွၩ, ဒဲၦဒၪဆၧ လၧယၫလဖၪအဆၧချဲၩ့ လၧအချဲၩ့ဒုၪ့အဝ့ၫလၧယဟိ ဝၩအံၫစရ့လၭအယွၩ အမံၩ့းယိခွါ,အီၪဝ့ၫလၧအံၫစရ့လၭအစဎွၩလဖၪ အလံၬ",
			"19": "<sup>19</sup> ဖၧၩ့လီၫ.- တၭအဆၧဘၩ ဆိၪဖၪ,ဒဲယဟိဝၩထိးဆၧၫ့ အဆၧအၪ့ကံၩ့အၪ့ယၫ,ဒဲ အဆၧဒဲၩဘၭထီးအလူၬ ဒဲအဆၧမၩမၪလၧအလချႃၭ ဆၪ့လၩ့ဒံၭဘၪအၥၭနီၪ, ဆၧအလးထီးအမၩထၪ့ဆၧ ထၪ့ထီၫလဖၪ, ဒဲအီၪ က့ၪထၪ့အၡ့ရိၫလဖၪ, ဒဲဆၧဂၩ့ စိၭဖျၩအၥၭလဖၪ, ယိခွါ,ကွ့ၭအၥၭလၧၦဒၪဆၧလၧ ယၫလဖၪအဆၧချဲၩ့",
			"20": "<sup>20</sup> အကျၩလီၫ.- စမနၭစ့ၫမံၫဝ့ၫလၧ အဖါၥံၪအၥိၭတၭ, ၦခုၪ့လၩ့ဘၧၩ့ခွံၬဝ့ၫလၧအဂံၪ့ဒၪ ဝ့ၫအဖၧၩ့တၭ, အဖိၪခွၫစအၫမၧၫ့ကဲၪထၪ့စဎွၩလၧ အလးနီၪလီၫ.",
			"21": "<sup>21</sup> လၧစအၫမၧၫ့ကဲၪၥၫ့စဎွၩနီၪ အၥၭအီၪနံၫဆံၫနံၫနံၪ့",
			"22": "<sup>22</sup> တၭ,ကဲၪစဎွၩလၧယရုစလံၫ့အဖၧၩ့နံၫနံၪ့လီၫ.- တၭ မၩဆၧအၧၩ့လၧယဟိဝၩအမ့ၬယၫ ဘဲၫအဖါစမနၭစ့ၫ မၩဝ့ၫအၥိၭနီၪလီၫ. အဂဲးဘဲၫယီၩ စအၫမၧၫ့လုထၪ့ ဆၧဂၩ့စိၭဖျၩအၥၭ လၧအဖါစမနၭစ့ၫ မၩကဲၪထၪ့",
			"23": "<sup>23</sup> ထီးအလူၬတၭ, မၩအဝ့ၫၥံၪအဆၧလီၫ.- တၭဆၪ့လၩ့ အၥၭလၧယဟိဝၩအမ့ၬယၫ ဘဲၫအဖါစမနၭစ့ၫဆၪ့ လၩ့အၥၭအၥိၭအ့ၬ. တၭစအၫမၧၫ့မၩမၪဆၧအၪထၪ့",
			"24": "<sup>24</sup> အၪထၪ့လခီၫလီၫ.- အခ့ၫအၡၩကိၪ့ဆၧအၧၩ့ထၫ့ဒၩ",
			"25": "<sup>25</sup> အဝ့ၫတၭ, မၩၥံၫဝ့ၫလၧအဂံၪ့ဒၪဝ့ၫအဖၧၩ့လီၫ.- အ့ၪ မွဲခးအၡၩၥံၪ မၩၥံၫၦလၧအကိၪ့ဆၧအၧၩ့ ထၫ့ဒၩစ ဎွၩအၫမၧၫ့ထီးအလူၬတၭ, ခးအၡၩလဖၪမၩကဲၪထၪ့ အဖိၪခွၫစယိၫစဲအၫစဎွၩလၧအလးနီၪလီၫ."
		},
		"34": {
			"1": "<sup>1</sup> စယိၫစဲအၫကဲၪၥၫ့စဎွၩနီၪအၥၭအီၪဎိၭနံၪ့တၭ, ကဲၪ",
			"2": "<sup>2</sup> စဎွၩလၧယရုစလံၫ့အဖၧၩ့ ၥၧၫ့ဆံၫလနံၪ့လီၫ.- အဝ့ၫ ဒၪမၩဆၧဂ့ၩလၧယဟိဝၩအမ့ၬယၫတၭ, ဖိၬအဖါစ ဒၫဝံၭအဖၧၩ့ၥၭလဖၪတၭ, လၧစူၪထွ့ၪမွဲဂ့ၩ, လၧစူၪစ့ၪ မွဲဂ့ၩ,ကၠၪအၥၭအ့ၬ.",
			"3": "<sup>3</sup> တၭလၧအကဲၪထၪ့စဎွၩအနံၪ့ဎိၭနံၪ့လနံၪ့, ဘိၩ့အၥၭ ဘၪ့ဒံၭနီၪ, အၪ့ဎၬၥၫ့အဖါစဒၫ ဝံၭအယွၩတၭ, လၧလ ဆံၫနံၫနံၪ့လနံၪ့နီၪ မၩဆံၫ့ထၪ့ခွံၬၥၫ့ယုဒၫဒဲယရုစလံၫ့ လၧဆၧအလးထၪ့ထီၫၥံၪဒဲအ ၡ့ရိၫၥံၪ, ဒဲဆၧဂၩ့စိၭ",
			"4": "<sup>4</sup> ဖျၩအၥၭၥံၪ, ဒဲဆၧဂၩ့ၥိၫ့အၥၭ ၥံၪလီၫ.- ၦလဖၪမၩလၩ့ ဎီးခွံၬဘၫအလၭၥံၪအဆၧလု အလးလဖၪလၧအဝ့ၫဒၪ အမ့ၬယၫ, ဒဲဆၧဂၩ့လဖၪလၧ အအီၪထၪ့ထီၫလၧအဖၫ့ ခိၪနီၪခူၬလၩ့ခွံၬဝ့ၫလီၫ. တၭအၡ့ရိၫဒဲဆၧဂၩ့စိၭဖျၩအၥၭ, ဒဲဆၧဂၩ့ၥိၫ့အၥၭနီၪ မၩလၩ့ဘျ့ၭခွံၬဝ့ၫတၭ, မၩလၩ့မုၬဝ့ၫ တၭ, ဎွံၪဝ့ၫလၧၦလၧအလုထၪ့ဆၧဂၩ့ၥံၪနီၪ အၥွၪခိၪ",
			"5": "<sup>5</sup> အဖၫ့ခိၪလီၫ.- ဆူၭထၪ့ခွံၬၦလုဆၧလဖၪအဎွံၪလၧမ့ၪ, လၧအဝ့ၫၥံၪ အဆၧလုလးၥံၪအဖၫ့ခိၪတၭ, မၩဆံၫ့",
			"6": "<sup>6</sup> ထၪ့ယုဒၫဒဲယရုစလံၫ့လီၫ.- တၭလၧမနၭစ့ၫဒဲအံဖြံၫ့ ဒဲစံမအၧၫ့အဒိၩ့ လဖၪအဖၧၩ့ထီၩ့ဒၪလ့ၬလၧစနၭၥ လဲၫနီၪ, မၩဝ့ၫလၧအဝ့ၫၥံၪအစၭခုၫၥံၪ့ၥံၪဝၬဖီၩ့ဝ့ၫလီၫ.",
			"7": "<sup>7</sup> ထီးအမၩလၩ့ဎီးခွံၬဆၧလုအလးၥံၪ, ဒဲအၡ့ရိၫၥံၪ, ဒဲထးလၩ့ဘျ့ၭဆၧဂၩ့စိၭဖျၩအၥၭ, ဒဲခူၬလၩ့ခွံၬဆၧဂၩ့ ၥံၪထီးအလူၬ လၧအံၫစရ့လၭ အခးထၧၫ့ဘံၪ့ယၫဂီၩ့တၭ, ထဲၩ့ကဒၩထဲၩ့ဝ့ၫလၧယရုစလံၫ့လီၫ.",
			"8": "<sup>8</sup> လၧစယိၫစဲအၫကဲၪစဎွၩ လဆံၫဎိၭနံၪ့လနံၪ့အဖၧၩ့ နီၪထီးအမၩဆံၫ့ထၪ့ ထံၫၥံၪခးၥံၪ, ဒဲဂံၪ့နီၪဂီၩ့တၭ,စ ဎွၩအၪ့မၧၫ့လၩ့ၦကွ့ၭလံၬစအၭဇလဲအၫ, အဖိၪခွၫစ ၡၫဖၫ့,ဒဲဒိၩ့အခိၪစမၫအစဲအၫ, ဒဲၦကွ့ၭနဲၪ့ဆၧစယဟိ အဟၭအဖိၪခွၫ စယိအၫၥံၪဘဲၫၥိၭ အဝ့ၫၥံၪမိမၩဂ့ၩ",
			"9": "<sup>9</sup> ထၪ့ထဲၩ့ယဟိဝၩအဝ့ၫဒၪအယွၩအဂံၪ့လီၫ.- ထီးအ ဝ့ၫၥံၪဂဲၫဝ့ၫလၧၦလုဆၧအခိၪ စဟံၫလကဲအၫအအီၪ တၭ,ဖ့ၪလၫ့စ့ၩလၧၦဂဲၫဆိၬလၧယွၩအဂံၪ့ဖၧၩ့, လၧ လံဝဲၫဖိၪလၧအပၧၩ့တရၫ့လဖၪ အၪ့ထုၫ့ကီၪ့လၧမနၭ စ့ၫဒဲအံဖြံၫ့အစူၪဖၧၩ့, ဒဲလၧၦအီၪလၩ့ထးလၧအံၫစရ့ လၭအကျၩထီးအလူၬ, ဒဲလၧယုဒၫဒဲဘံၪ့ယမံၫ့ထီးအ",
			"10": "<sup>10</sup> လူၬ,ဒဲၦအီၪဝ့ၫလၧယရုစလံၫ့အဖၧၩ့လီၫ.- ဖ့ၪလၫ့ဝ့ၫ လၧၦမၩဆၧၥံၪ လၧအယိယဟိဝၩ အဂံၪ့အစူၪဖၧၩ့ တၭ,အဝ့ၫၥံၪဖ့ၪလၫ့ထဲၩ့ ၦမၩဆၧလၧအမၩဆၧလၧ ယဟိဝၩအဂံၪ့ဖၧၩ့, ဘဲၫၥိၭအဝ့ၫၥံၪမိမၩဂ့ၩထၪ့ထဲၩ့",
			"11": "<sup>11</sup> ဒဲမၩဂုးထၪ့ခၧၫ့ထၪ့ဂံၪ့နီၪလီၫ.- ဖ့ၪလၫ့ဝ့ၫလၧၦစိၭဖျၩ ဆၧဒဲၦၥုၪ့ထၪ့ဆၧဘဲၫၥိၭ အမိဎွ့ၩလိးစိၭဖျၩအၥၭ,ဒဲ ၥံၪ့လၧဆၧထၫ့ထိၪဘုၭအဂးတၭ, ဒဲလၧအမၩထဲၩ့ ထီၩ့ခိၪလၧဂံၪ့ၥံၪ လၧယုဒၫအစဎွၩလဖၪမၩဂၭဂီၩ့",
			"12": "<sup>12</sup> ယူၭဝ့ၫလီၫ.- တၭၦၡၩလၧအမၩဆၧလဖၪနီၪ မၩဝ့ၫ လၧအလူတီၩလီၫ. တၭၦအီၪလၧအဝ့ၫၥံၪ အဖၫ့ခိၪ နီၪ,မွဲစယၫဟၭ, ဒဲစအိၫဘဒဲအၫ ၦလံဝဲၫဖိၪစမရၫရဲၫ အဖိၪခွၫအကျၩ, စဇ့ၭခရဲအၫ,ဒဲစၡၧလၫ့, ၦကိဟၭ ဖိၪလဖၪအဖိၪခွၫၥံၪအကျၩ ဒုၭမၩဆၧ,ဒဲၦလံဝဲၫဖိၪ ၥံၪ,ကယဲၦၥ့ၪဆၧဒံၩ့နါဒံၩ့ၥံၪ ၥၫ့ထီးၥံၪ ထီးအလူၬ",
			"13": "<sup>13</sup> လီၫ.- အဝ့ၫၥံၪအီၪဝ့ၫလၧ အွံၪဆၧယိၭဆၧအဖၫ့ခိၪ ဒဲမွဲၦမၩဆၧမၩနီၪလမံၩ့လါလါ ထီးအလူၬအခိၪလဖၪ တၭး ၦကွ့ၭလံၬဒဲၦပၧၩ့တရၫ့လဖၪနီၪ, မွဲၦလံဝဲၫဖိၪ လီၫ.",
			"14": "<sup>14</sup> ထီးၦဂဲၫဆိၬထၪ့စ့ၩ လၧၦၡၩဆိၬနုၬလၧယဟိဝၩ အဂံၪ့ဖၧၩ့တၭ, ၦလုဆၧစဟံၫလကဲအၫဒၪန့ယဟိဝၩ အလံၬဆၧၥီၪ့ဆၧၥၫ့ဆၧဖ့ၪလၫ့ဝ့ၫ လၧစမိစ့ၭအစူၪ",
			"15": "<sup>15</sup> ဖၧၩ့လီၫ.- စဟံၫလကဲအၫချဲၩ့ဆၧတၭ, စံၭၦကွ့ၭလံၬ စၡၫဖၫ့,ယဒၪန့ယူၭ လံၬဆၧၥီၪ့ဆၧၥၫ့လၧယဟိဝၩအ ဂံၪ့ဖၧၩ့ယူၭ. စဟံၫလကဲအၫဖ့ၪလၫ့ စၡၫဖၫ့လၧလံၬ",
			"16": "<sup>16</sup> နီၪလီၫ.- စၡၫဖၫ့လ့ၩဆိၬလံၬနီၪလၧစဎွၩအအီၪတၭ, ဂဲၫထဲၩ့ဆိၬဒီၭဆၧချဲၩ့လဖၪ လၧစဎွၩအအီၪတၭ, စံၭ ဝ့ၫဒၪ,ကယဲဆၧလၧ အဘၪဆၧအီၪက့ၪလၩ့ဝ့ၫလၧနခ့ၫ နၡၩအစူၪဖၧၩ့ထီးအလူၬနီၪ အဝ့ၫၥံၪမၩတၡါဝ့ၫလီၫ.",
			"17": "<sup>17</sup> အဝ့ၫၥံၪအၪ့ထုၫ့ကီၪ့ယူၭစ့ၩ လၧအဒၪန့ဝ့ၫလၧယဟိ ဝၩအဂံၪ့ဖၧၩ့တၭ, ဖ့ၪလၫ့ယူၭလၧၦယိဆၧလဖၪအစူၪ",
			"18": "<sup>18</sup> ဖၧၩ့,ဒဲလၧၦမၩဆၧၥံၪအစူၪဖၧၩ့ယူၭ.- ထီးနီၪလဖၧၫ့ ၦကွ့ၭလံၬစၡၫဖၫ့လီၩဘၪစဎွၩတၭ, စံၭဝ့ၫဒၪ,ၦလုဆၧ စဟံၫလကဲအၫနီၪဖ့ၪလၫ့ယၧၩ လၧလံၬလထူၫ လီၫ. တၭ",
			"19": "<sup>19</sup> စၡၫဖၫ့ဖီဝ့ၫလၧစဎွၩအမ့ၬယၫလီၫ.- ထီးစဎွၩနါဂၧၫ့ လံၬဆၧၥီၪ့ဆၧၥၫ့အလူတၭ, ဆၧမၩအၥၭလၧအၡၫ့",
			"20": "<sup>20</sup> အကီၩ့အၥိၭလီၫ.- စဎွၩမၪလူၬစဟံၫလကဲအၫ,ဒဲစၡၫ ဖၫ့အဖိၪခွၫစအဟဲကၫ့, ဒဲစမဲခၫအဖိၪခွၫစအၭဘဒၫ့, ဒဲၦကွ့ၭလံၬစၡၫဖၫ့ ဒဲစဎွၩအခ့ၫအၡၩ, စအၭစအဲအၫ",
			"21": "<sup>21</sup> တၭစံၭဝ့ၫဒၪ,- လ့ၩထၪ့အၪ့စၪ့ယဟိဝၩလၧယဂး,ဒဲ ၦလၧအအီၪလၩ့ထးဝ့ၫ လၧအံၫစရ့လၭဒဲယုဒၫအဖၧၩ့ လဖၪအဂး, လၧလံၬလထူၫလၧၦဒၪန့ဝ့ၫအလူအထၫ အဂဲးအကၠီၪ့ဆံၭး အဂဲးဘဲၫယီၩ ယဟိဝၩအဆၧၥၭ ထၪ့လၧအဂါလၩ့အၥၭ လၧပဖၫ့ခိၪ မွဲအဒိၪမၬလီၫ. အဂဲးဘဲၫယီၩ ပဖါၥံၪလထီးန့ဘၪ ယဟိဝၩအလူဘဲၫ ၥိၭအမိမၩကယဲဆၧကွ့ၭအၥၭ လၧလံၬယီၩအဖၧၩ့ လီၫ.",
			"22": "<sup>22</sup> တၭစဟံၫလကဲအၫ, ဒဲၦလၧစဎွၩလဖၪဒုၭလ့ၩဝ့ၫ နီၪလ့ၩလၧၦခိၭဆၧကီၩ့ဆၧၥိၭ စဟၭစရၫ အဖိၪခွၫ စတံၭဝၫအဖိၪခွၫစၡၫလၧၫ့အမၫမီၪမုၪ နးဟၧလဒၫလ ဂၩအအီၪတၭ, လီၩဘၪၦမုၪနီၪလၧဆၧအဂဲးအကၠီၪ့ နီၪလီၫ. တၭအဝ့ၫဒၪအီၪဝ့ၫလၧယရုစလံၫ့လၧဆၧအ",
			"23": "<sup>23</sup> လးနံၫစီၪ့လစီၪ့နီၪလီၫ.- တၭၦမုၪလီၩဘၪအဝ့ၫၥံၪ, ယဟိဝၩအံၫစရ့လၭအယွၩစံၭဝ့ၫဘဲၫယီၩ, လီၩဘၪ",
			"24": "<sup>24</sup> ၦလၧအအၪ့မၧၫ့လၩ့နၥံၪလၧယအီၪ.- ယဟိဝၩစံၭ ဘဲၫယီၩ,ယိခွါ, ယမိဒုၭဂဲၫဘၪဆၧအၧၩ့လၧအလး ယီၩအဖၫ့ခိၪ ဒဲၦလၧအအီၪဝ့ၫလၧအဖၧၩ့အလီၩ့ဆ့, ကယဲဆၧဆိၪအၧၩ့လမံၩ့လါလါ လၧအကွ့ၭအၥၭလၧ လံၬဖၧၩ့လၧအဝ့ၫၥံၪဖီဘၪဝ့ၫ လၧယုဒၫအစဎွၩအမ့ၬ",
			"25": "<sup>25</sup> ယၫလီၫ.- အဂဲးဘဲၫယီၩအဝ့ၫၥံၪစဲၪ့ဒၪယၧၩ, ဒဲဆူၭခဲၩ ဆၧနၧၫ့မၧၫ့လၧယွၩအဂူၫဂၩၥံၪအဂး, ဘဲၫၥိၭအမိဒုၭ ၥၭထၪ့ယၧၩလၧအစူၪ လၧအမၩဆၧအၧၩ့ထီးအလူၬ အကၠီၩ့လီၫ. အခိးမွဲယဆၧၥၭထၪ့မိဘၪဆၧဂါလၩ့ အၥၭလၧဆၧအလးယီၩတၭ, ဆၧမၩရှူၪလၩ့အၥၭ",
			"26": "<sup>26</sup> ၥ့ၪအ့ၬ.- အ့ၪမွဲယုဒၫအစဎွၩ လၧအအၪ့မၧၫ့နၥံၪဂဲၫ အၪ့စၪ့ယဟိဝၩနီၪ, နၥံၪမိဘၪစံၭအဝ့ၫ, ယဟိဝၩအံၫ စရ့လၭအယွၩစံၭဝ့ၫဘဲၫယီၩ, ဆၧချဲၩ့လၧနနါဂၧၫ့နီၪ,",
			"27": "<sup>27</sup> မွဲနၥၭဆၫတၭ, ထီးနနါဂၧၫ့ဆၧချဲၩ့လၧအချဲၩ့ထၫ့ဒၩ ဆၧအလးယီၩ ဒဲထၫ့ဒၩၦလၧအအီၪလၧအဖၧၩ့တၭ, နဆၪ့လၩ့နၥၭလၧယွၩအမ့ၬယၫ, ဒဲနဆၪ့လၩ့နၥၭလၧ ယမ့ၬယၫဒဲနၡၫ့နကီၩ့နၥိၭ ဒဲနမ့ၬထံၫလၩ့လၧယမ့ၬ ယၫအကၠီၩ့နီၪတၭး ယဝ့ၫဒၪယီၩယခိၭနၪဆ့ယူၭနၧၩ,",
			"28": "<sup>28</sup> ယဟိဝၩစံၭဝ့ၫဒၪ,- ယိခွါ,ယမိအီၪက့ၪကီၪ့နၧၩလၧ နဖါၥံၪအၥိၭတၭ, ဆၧမိအီၪက့ၪလၩ့နၧၩ လၧဆၧၥွၪ ခိၪဖၧၩ့မုၬမုၬတၭ, နမ့ၬၥၪမိဒၪဘၪဆၧအၧၩ့ထီးအလူၬ လၧယဒုၭဂဲၫဘၪဆၧအလးယီၩ, ဒဲၦလၧအအီၪလၧ အဖၧၩ့အ့ၬ. တၭအဝ့ၫၥံၪနီၪဂဲၫဆိၬန့စဎွၩ လၧဆၧ ချဲၩ့နီၪလီၫ.",
			"29": "<sup>29</sup> ထီးနီၪလဖၧၫ့စဎွၩအၪ့မၧၫ့လၩ့ဆၧတၭ, ၦဒုၭအီၪ ကီၪ့ယုဒၫဒဲယရုစလံၫ့အၡၩ ၥုၪ့က့ၭၥၭၡါထီးအလူၬ",
			"30": "<sup>30</sup> လီၫ.- တၭစဎွၩလ့ၩထၪ့လၧယဟိဝၩအဂံၪ့ဖၧၩ့ဒဲယု ဒၫအၡၩထီးအလူၬ, ဒဲၦအီၪလၧယရုစလံၫ့အဖၧၩ့ဒဲၦ လုဆၧၥံၪဒဲၦလံဝဲၫဖိၪၥံၪ ဒဲၦခမျၧးထီးအလူၬ, ဒဲဒိၪဒဲ ဆံၭတၭ, အဝ့ၫဒၪဖီကယဲဆၧချဲၩ့လၧလံၬဆၧအုၩ့လၩ့ လၧၦဒၪန့ဝ့ၫလၧယဟိဝၩအဂံၪ့ဖၧၩ့နီၪ လၧအဝ့ၫၥံၪ",
			"31": "<sup>31</sup> အနါဖၧၩ့လီၫ.- တၭစဎွၩဆၧၫ့ထုၪ့လၧအလးတၭ,မၩ ဆၧအုၩ့လၩ့လၧယဟိဝၩအမ့ၬယၫ လၧအမိလ့ၩဖိၬ ယဟိဝၩအခဲၫ့ ဒဲထီးန့အဆၧမၪလူၬၥံၪ, ဒဲအဆၧထိး အၥၭလဖၪ, ဒဲအဆၧမၪလူၬလဖၪ လၧအၥၭထၧၫ့ဖျိၪ့ ယၫ,ဒဲလၧအၥၭၡီၩ့ထီးအလူၬ ဘဲၫၥိၭအမိမၩဆၧ အုၩ့လၩ့အဆၧချဲၩ့ယီၩလၧအကွ့ၭအၥၭ လၧလံၬယီၩ",
			"32": "<sup>32</sup> အဖၧၩ့လီၫ.- တၭအဝ့ၫဒၪမၩဂုးမၩခၧၫ့ကယဲၦလၧအ အီၪလၧယရုစလံၫ့အဖၧၩ့, ဒဲလၧၦဘံၪ့ယမံၫ့ဖိၪအ ကျၩနီၪလီၫ. တၭၦအီၪလၧယရုစလံၫ့အဖၧၩ့လဖၪ မၩဝ့ၫဘဲၫယွၩအဆၧအုၩ့လၩ့ အီၪဝ့ၫအၥိၭအဝ့ၫၥံၪအ ဖါၥံၪအယွၩနီၪလီၫ.",
			"33": "<sup>33</sup> တၭစယိၫစဲအၫၥုၭခွံၬ ကယဲဆၧဘၪၥၭလိၪလၧခး ကိၭဘံၪ့ဒ့ၭအဖၧၩ့ လၧအဘၪဆဲၫ့လၧၦအံၫစရ့လၭ ဖိၪတၭ,ဒုၭမၩကယဲၦလၧအအီၪ လၧအံၫစရ့လၭအ ကျၩဒုၭမၩဝ့ၫလၧယဟိဝၩအဝ့ၫၥံၪအယွၩ အဆၧမၩ လီၫ.တၭလၧအဝ့ၫဒၪအမုနံၩမုနၩ ထီးအလူၬအဖၧၩ့ နီၪၦၡၩဖိၬယဟိဝၩအဝ့ၫၥံၪအဖါလဖၪ အယွၩအခဲၫ့ တၭ,စဲၪ့ဒၪခွံၬဝ့ၫအ့ၬ."
		},
		"35": {
			"1": "<sup>1</sup> စယိၫစဲအၫမၩဆၧဘိၪ့လ့ၩဖၬ လၧယဟိဝၩအဂး လၧယရုစလံၫ့အဖၧၩ့တၭ, လၧလၩအခၪ့ထံၭလဘံၪ့ လၩထၪ့လဆံၫလံနံၩလနံၩနီၪ မၩၥံၫဆၧလ့ၩဖၬလီၫ.",
			"2": "<sup>2</sup> အီၪက့ၪၦလုဆၧလဖၪ လၧအဆၧမၩအလးဖၧၩ့တၭ, ဒုၭဆီၪ့ထၪ့ဝ့ၫလၧအမိမၩ ယဟိဝၩအဂံၪ့အဆၧမၩ",
			"3": "<sup>3</sup> လီၫ.-တၭစံၭၦလံဝဲၫဖိၪၥံၪ လၧအၥီၪ့လိၪအံၫစရ့လၭ ထီးအလူၬ, လၧအမွဲၦဆံၫ့ဎံၪလၧယဟိဝၩအဂး, အီၪ က့ၪတလၫဆံၫ့ဎံၪလၧဂံၪ့ဖၧၩ့ လၧအံၫစရ့လၭအစဎွၩ စဒၫဝံၭအဖိၪခွၫစစီလမၧၫ့ ၥုၪ့ဝ့ၫနီၪဆံၭ. မွဲအထီးကဲၪ ဆၧယိၭဎၧၫ့လၧနၥံၪအခိၬထံၭခိၪလဂ့ၩ, မၩယဟိဝၩ",
			"4": "<sup>4</sup> နၥံၪအယွၩ ဒဲၦခမျၧးအံၫစရ့လၭအဆၧဆံၭ.- တၭ တဲၩ့ဝဲၩဆၧဘဲၫနၥံၪအဖါၥံၪအဂံၪ့အၥိၭနီၪ, ဘဲၫနၥံၪ အဆၫ့,လဆၫ့ဘၪလဆၫ့အၥိၭ, ဘဲၫအံၫစရ့လၭအစ ဎွၩစဒၫဝံၭအလံၬအၥိၭတၭ, ဘဲၫအဖိၪခွၫစစီလမၧၫ့",
			"5": "<sup>5</sup> အလံၬအၥိၭနီၪဆံၭ.- တၭဆၧၫ့ထုၪ့လၧဆၧအလး ဆံၫ့ဎံၪအဖၧၩ့ ဘဲၫၦခမျၧးနၥံၪအထၧၫ့ဖုဝဲအဖါၥံၪအ ၡၩဂံၪ့ဒီၪ့လဖၪ အဆၧအၪ့နၩ့ဖၭၥံၪ အၥိၭနီၪဆံၭ.",
			"6": "<sup>6</sup> မၩၥံၫဆၧဘိၪ့လ့ၩဖၬတၭ, တဲၩ့ဝဲၩနၥံၪအထၧၫ့ဖုဝဲဘဲၫ ၥိၭအမိမၩဝ့ၫဘဲၫယဟိဝၩ အလူအထၫ လၧစမိစ့ၭအ စူၪဖၧၩ့အၥိၭနီၪဆံၭ.",
			"7": "<sup>7</sup> လၧၥိၪၥံၪဘ့ၪၥံၪအကျၩနီၪ, စယိၫစဲအၫဖ့ၪလၫ့ၦ ခမျၧးအၥိၪဖိၪဒဲဘ့ၪဖိၪၥံၪ, ထီးအလူၬလၧဘိၪ့လ့ၩဖၬ အဆၧမၩဘိၪ့အဂး, လၧကယဲၦလၧအအီၪဝ့ၫထီးအ လူၬထီးအဎွ့ၩထၪ့ၥၧၫ့လၬ ဒဲချီဖၫၥၧၫ့ထီၫ့လီၫ. ဆၧ",
			"8": "<sup>8</sup> လဖၪနီၪမွဲဝ့ၫလၧစဎွၩအဖိၪအလံၩအကျၩလီၫ.- တၭ ၦဒိၪဖၭဒိၪလဖၪ ဖ့ၪလၫ့ယီၫဆၧလၧၦခမျၧးလၧၦလု ဆၧလဖၪ, ဒဲၦလံဝဲၫဖိၪလီၫ. ၦပၧၩ့ယွၩအဂံၪ့စဟံၫလ ကဲအၫ, ဒဲစဇ့ၭခရဲအၫ, ဒဲစယဟဲအ့လၭလဖၪနီၪဖ့ၪ လၫ့ၦလုဆၧလၧဆၧအဒုၩနံၫထီၫ့ဎူၫယၩ, ဒဲချီဖၫၥၧၫ့",
			"9": "<sup>9</sup> ယၩလၧဘိၪ့လ့ၩဖၬအဆၧမၩဘိၪ့အဂးလီၫ.- တၭၦ လံဝဲၫဖိၪအခိၪလဖၪစကိၫ့အနဲအၫ, ဒဲစၡံၫမအဲအၫ,ဒဲ စနၥၫ့နအ့လၭအထၧၫ့ဖုဝဲလဖၪ စဟၭၡဘဲအၫ,စယ အဲၫအ့လၭ, ဒဲစယီၭစဘၭလဖၪဖ့ၪလၫ့ၦလံဝဲၫဖိၪလၧ ဆၧအဒုၩယဲထီၫ့ဒဲချီဖၫ ယဲယၩလၧဘိၪ့လ့ၩဖၬအဆၧ ဘိၪ့အဂးလီၫ.",
			"10": "<sup>10</sup> ဆၧမၩနီၪဘၪတဲၩ့ဝဲၩအၥၭဂီၩ့တၭ, ၦလုဆၧလဖၪ ဆၧၫ့ထုၪ့လၧအလး, ဒဲၦလံဝဲၫဖိၪလဆၫ့လဆၫ့ဘဲၫစဎွၩ",
			"11": "<sup>11</sup> အဆၧမၪလူၬအၥိၭနီၪလီၫ.- ၦၡၩမၩၥံၫဆၧဘိၪ့လ့ၩ ဖၬတၭ,ၦလုဆၧလဖၪ ဎွံၪဆၧလၧအစူၪၥံၪတၭ, ၦလံ",
			"12": "<sup>12</sup> ဝဲၫဖိၪမွဲၦလၧအဘျူၭခွံၬအဖံၭလီၫ.- အဝ့ၫၥံၪၥုၭခွံၬ ဆၧလုမ့ၪၥံၪဘဲၫၥိၭ အမိဖ့ၪလၫ့ဆၧဘဲၫၦခမျၧးအဂံၪ့ ဒီၪ့ၥံၪအဆၧအၪ့နၩ့ဖၭလဖၪအၥိၭ, ဘဲၫၥိၭအမိလုထၪ့ ယဟိဝၩဘဲၫဆၧကွ့ၭအၥၭ လၧလံၬစမိစ့ၭ အဖၧၩ့အ",
			"13": "<sup>13</sup> ၥိၭနီၪလီၫ. တၭချီဖၫလဖၪဘဲၫနီၪအၥိၭလီၫ.- အၪ့ကၪ ဆၧဘိၪ့လ့ၩဖၬလၧမ့ၪ ဘဲၫဆၧစ့ၩရၫ့အၥိၭနီၪး အ့ၪလ မွဲဘၪဆၧဆံၫ့ဎံၪလဖၪအၪ့ဎွံဝ့ၫ လၧဖၧၩ့ဖၧၩ့,ဒဲလၧဖၧၩ့ အၪ့ဎွံဆၧအဖၧၩ့, ဒဲလၧဖၧၩ့ပၪပဲၪအဖၧၩ့တၭ, အၪ့နၩ့ ဖၭဝ့ၫချဲၫ့ချဲၫ့လၧၦခမျၧး ထီးအလူၬအကျၩလီၫ.",
			"14": "<sup>14</sup> တၭလၧခဲၫ့ထဲၩ့နီၪ တဲၩ့ဝဲၩဆၧလၧအနၫ့ဆါဒၪဝ့ၫ အဂးဒဲလၧၦလုဆၧလဖၪအဂးဆ့လီၫ. အဂဲးဘဲၫယီၩ စအၫရၧၫ့အဖိၪခွၫၦလုဆၧလဖၪ လုထၪ့ဆၧလုမ့ၪဒဲအ ၥိၪထီၩ့လၩ့လၧမုနၩလခီၫလီၫ. တၭၦလံဝဲၫဖိၪတဲၩ့ ဝဲၩဆၧလၧအဂးဒၪဝ့ၫ, ဒဲလၧစအၫရၧၫ့အဖိၪခွၫၥံၪ,ၦ",
			"15": "<sup>15</sup> လုဆၧလဖၪအဂးလီၫ.- တၭၦၥံၫကျံၩဆၧစအၫစဖၭ အဖိၪခွၫၥံၪ အီၪလၧအလး ဘဲၫစဒၫဝံၭအဆၧမၪလူၬ အၥိၭ,ဒဲစအၫစဖၭ, ဒဲစဟံမၫ့,ဒဲစဎွၩအၡၩဒၪဆၧလၧ ယၫစယ့ၭဒုၫၥၫ့, ဒဲၦခိၭတရၫ့အီၪဝ့ၫလၧတရၫ့ထံၭကိၭ စီၪ့ဒ့ၭတၭ, စဲၪ့ဒၪအဆၧမၩအ့ၬ, အဂဲးဘဲၫယီၩအထၧၫ့",
			"16": "<sup>16</sup> ဖုဝဲၦလံဝဲၫဖိၪတဲၩ့ဝဲၩဆၧလၧအဝ့ၫၥံၪအဂးလီၫ.- တၭ ဆၧမၩယဟိဝၩအဆၧထီးအလူၬနီၪ, ဘၪဆၧတဲၩ့ဝဲၩ အၥၭမုလနံၩဎးဘဲၫၥိၭ အမိမၩဆၧဘိၪ့လ့ၩဖၬ, ဒဲလု ထၪ့ဆၧလုမ့ၪလၧယဟိဝၩ အဆၧလုအလးအဖၫ့ခိၪ,",
			"17": "<sup>17</sup> ဘဲၫစဎွၩယိၫစဲအၫအဆၧမၪလူၬ အၥိၭနီၪလီၫ.- ၦအံၫ စရ့လၭဖိၪလၧအအီၪဝ့ၫလဖၪနီၪ မၩဆၧဘိၪ့လ့ၩဖၬ လၧအထီထီးနီၪ, ဒဲဆၧဘိၪ့ကိၪလအီၪဘၪ လၧမံၪနွ့ၫ နံၩလီၫ.",
			"18": "<sup>18</sup> တၭလၧမီၪစစၫမုၫအ့လၭ အမုနံၩလဖၪနီၪအလး ခဲၫ့,ၦမၩဘိၪ့လ့ၩဖၬဘဲၫနီၪအၥိၭ လၧအံၫစရ့လၭအကျၩ နးဖၧၫ့အ့ၬ. တၭဆၧဘိၪ့လ့ၩဖၬ လၧစယိၫစဲအၫဒဲၦ လုဆၧၥံၪ,ဒဲၦလံဝဲၫဖိၪၥံၪ, ဒဲယုဒၫ,ဒဲအံၫစရ့လၭထီး အလူၬလၧအအီၪဝ့ၫ, ဒဲၦလၧအအီၪဝ့ၫလၧယရုစလံၫ့ အဖၧၩ့လဖၪမၩဝ့ၫနီၪး အံၫစရ့လၭအစဎွၩၥံၪထီးအ",
			"19": "<sup>19</sup> လူၬမၩဘိၪ့လ့ၩဖၬဘဲၫနီၪအၥိၭဆ့အ့ၬ.- လၧစယိၫစဲ အၫပၧၩ့ဆၧအနံၪ့လဆံၫဎိၭနံၪ့လနံၪ့အဖၧၩ့, ၦၡၩမၩ ဆၧဘိၪ့လ့ၩဖၬနီၪလီၫ.",
			"20": "<sup>20</sup> ဆၧယီၩထီးအလူၬအလးခဲၫ့နီၪ ထီးစယိၫစဲအၫတဲၩ့ ဝဲၩယူၭနီးနီၪတၭ, အံဇံၭအစဎွၩနံကိၫ, ဂဲၫထၪ့ဘဲၫၥိၭ အမိဒုၭဆၧလၧခၫခံမံၭ လၧထံၫမိၡါယုၫဖ့တံၫအနဲၩ့",
			"21": "<sup>21</sup> တၭ,စယိၫစဲအၫလ့ၩထၪ့ထၫ့ဒၩအဝ့ၫလီၫ.- အဝ့ၫဒၪ အၪ့မၧၫ့လၩ့အၥီၫ့ၥံၪလၧအအီၪတၭ, စံၭဝ့ၫဒၪ,ယုဒၫ အစဎွၩဧ့, ယၧၩဒဲနၧၩမွဲဆၧဘၪဆဲၫ့လိၬပၥၭ ဘဲၫၥ့ၪ လဲၪး ဆၧလၧမုလနံၩယီၩယဂဲၫထၫ့ဒၩနၧၩမွဲအ့ၬ. အ့ၪ မွဲယထၫ့ဒၩဂံၪ့လဖျိၪ့လၧယဒုၭဆၧလၧ အဝ့ၫနီၪလီၫ. အဂဲးဘဲၫယီၩယွၩမၪလူၬယၧၩ မၩချဲၫ့ချဲၫ့တၭ, ထီး လၩ့နၥၭလၧယွၩလၧအအီၪလၧယၥိၭ, ဘဲၫၥိၭအထီး",
			"22": "<sup>22</sup> မၩဂၭဂီၩ့နၧၩလဂ့ၩလီၫ.- မွဲလါနၫ့ဘဲၫနီၪတၭ, စယိၫ စဲအၫလကၠၪခွံၬဘၪအမ့ၬလၧအဝ့ၫဒၪ, အ့ၪမွဲမၩလၩ့ မဲၩအနၫ့ဆါဒၪဝ့ၫနီၪ ဘဲၫၥိၭအမိဒုၭၥုၭ လၧအဝ့ၫဒၪ တၭ,လခိၭနၪဘၪစနံကိၫအလူ လၧယွၩအနိၭတၭ,ဂဲၫ",
			"23": "<sup>23</sup> ဒုၭၥုၭလၧမကံဒိၫခိၪလီၩ့ဆူၭအဖၧၩ့လီၫ.- ၦခၭဆၧ ၥံၪခၭဘၪစယိၫစဲအၫတၭ, စဎွၩစံၭအခ့ၫအၡၩ, ဆိၬ ထၪ့ခွံၬယၧၩဆံၭ. အဂဲးဘဲၫယီၩ, ယဘၪဆၧခၭယၧၩ",
			"24": "<sup>24</sup> တၭနုၬဝ့ၫဒၪလီၫ.- အခ့ၫအၡၩဆိၬထၪ့ခွံၬဝ့ၫလၧလဲၪ့ ၥုၭအဖၧၩ့တၭ, အီၪက့ၪဝ့ၫလၧလဲၪ့နံၫခိၪလခိၪအဖၧၩ့ လၧအအီၪလၧအဝ့ၫတၭ, ဂဲၫဆိၬဝ့ၫထီၩ့လၧယရုစလံၫ့ တၭ,ၥံၫဝ့ၫနီၪၦခုၪ့လၩ့ဘၧၩ့ခွံၬဝ့ၫ လၧအဖါၥံၪအဆၧ ၥွၪခိၪအဖၧၩ့တၭ, ယုဒၫဒဲယရုစလံၫ့ထီးအလူၬဂၪ့ဝ့ၫ",
			"25": "<sup>25</sup> လၧစယိၫစဲအၫအကၠီၩ့လီၫ.- စယ့ၫရမဲအၫဂၪ့ဝ့ၫယၧၩ့ ဝ့ၫလၧစယိၫစဲအၫအကၠီၩ့တၭ, ၦၥံၫကျံၩဆၧအခွၫ,ဒဲၦ ၥံၫကျံၩဆၧအမုၪလဖၪချဲၩ့ဆၧလၧ စယိၫစဲအၫအဂဲးအ ကၠီၪ့လၧအမီၪ့ဘၪၥၭယူဆၧအဖၧၩ့ ထီးမုဆၫလနံၩယီၩ တၭ, မၩဆၧအထူၫအရူၫလၧအံၫစရ့လၭ အဖၧၩ့တၭ, ယိခွါ, ကွ့ၭအၥၭလၧလံၬယၧၩ့ဘၪဆၧအဖၧၩ့လီၫ.",
			"26": "<sup>26</sup> တၭဆၧအီၪလၩ့ထးဘၪဆဲၫ့လၧ စယိၫစဲအၫဒဲအ ဂ့ၩအဘွၩဘဲၫဆၧကွ့ၭအၥၭ လၧယဟိဝၩအဆၧၥီၪ့ဆၧ",
			"27": "<sup>27</sup> ၥၫ့အဖၧၩ့အၥိၭနီၪး- ဒဲအမၩဆၧလဖၪလၧအခၪ့ထံၭ, ဒဲအထုၬနီၪ,ယိခွါ, ကွ့ၭအၥၭလၧအံၫစရ့လၭ, ဒဲယုဒၫ အစဎွၩၥံၪအလံၬဖၧၩ့လီၫ."
		},
		"36": {
			"1": "<sup>1</sup> ထီးနီၪလဖၧၫ့ထံၫၥံၪခးၥံၪ အၡၩခမျၧးမၩန့စယိၫစဲ အၫအဖိၪခွၫစယဟိအဟၭတၭ, အီၪက့ၪဝ့ၫလၧစဎွၩ",
			"2": "<sup>2</sup> လၧအဖါအလးလၧယရုစလံၫ့အဖၧၩ့လီၫ.- လၧစယ ဟိအဟၭကဲၪၥၫ့စဎွၩနီၪ အၥၭအီၪနံၫဆံၫၥၧၫ့နံၪ့တၭ,",
			"3": "<sup>3</sup> ကဲၪစဎွၩလၧယရုစလံၫ့အဖၧၩ့ လၩၥၧၫ့ဘံၪ့လီၫ.- အံ ဇံၭအစဎွၩထုၭခွံၬအဝ့ၫ လၧယရုစလံၫ့ အဖၧၩ့တၭ ဒုၭလိၭၦခးဖိၪလၧစ့ၩ အကံကၫလယၩ, ဒဲထီၫ့လကံ",
			"4": "<sup>4</sup> ကၫလီၫ.- အံဇံၭအစဎွၩအီၪက့ၪလၩ့အထၧၫ့ဖုဝဲစအံၫ လဲအကံၫ့လၧစဎွၩလၧ ယုဒၫဒဲယရုစလံၫ့အဖၫ့ခိၪတၭ, အၪ့လဲၩဝ့ၫအမံၩ့ လၧစယဟီအကံၫ့လီၫ. စနံကိၫမၩ န့အဝ့ၫဒၪအထၧၫ့ဖုဝဲစယဟိအဟၭ, ဆိၬန့ဝ့ၫထီၩ့လၧ အံဇံၭနီၪလီၫ.",
			"5": "<sup>5</sup> စယဟီအကံၫ့ကဲၪၥၫ့စဎွၩနီၪ အၥၭအီၪနံၫဆံၫယဲ နံၪ့တၭ, ကဲၪစဎွၩလဆံၫလနံၪ့လၧယရုစလံၫ့အဖၧၩ့တၭ, မၩဆၧအၧၩ့လၧယဟိဝၩ လၧအမွဲအယွၩအမ့ၬယၫ",
			"6": "<sup>6</sup> လီၫ.- ဘၭဘလၧၫ့အစဎွၩစန့ၭဘူၫခၭန့ဇၫဂဲၫထၪ့ထၫ့ ဒၩအဝ့ၫတၭ, စၧၩ့ထၬဝ့ၫလၧၥွ့ၫထၭဘဲၫၥိၭအမိဆိၬန့",
			"7": "<sup>7</sup> ဝ့ၫထီၩ့လၧဘၭဘလၧၫ့နီၪလီၫ.- စန့ၭဘူၫခၭန့ဇၫဆိၬ န့ဆ့ယဟိဝၩအဂံၪ့အဎၧၩ့အဎီ ထီၩ့လၧဘၭဘလၧၫ့ တၭ,အီၪက့ၪဝ့ၫလၧအနီးဖၧၩ့ လၧဘၭဘလၧၫ့အဖၧၩ့ နီၪလီၫ.",
			"8": "<sup>8</sup> ဆၧအီၪလၩ့ထးဘၪဆဲၫ့လၧ စယဟီအကံၫ့ဒဲအဆၧ ဘၪၥၭလိၪလၧအမၩဝ့ၫနီၪ, ဒဲဆၧလၧဆၧဒၪန့ဝ့ၫလၧ အဖၧၩ့ယိခွါ, ကွ့ၭအၥၭလၧအံၫစရ့လၭ ဒဲယုဒၫအ စဎွၩၥံၪအလံၬဖၧၩ့တၭ, အဖိၪခွၫစယဟီအခံၫ့ကဲၪထၪ့ စဎွၩလၧအလးနီၪလီၫ.",
			"9": "<sup>9</sup> လၧစယဟီအခံၫ့ ကဲၪၥၫ့စဎွၩနီၪအၥၭအီၪလဆံၫ ဎိၭနံၪ့တၭ, ကဲၪစဎွၩလၩၥၧၫ့ဘံၪ့ ဒဲဆံၫၥၫ့လၧယရုစ လံၫ့အဖၧၩ့တၭ, မၩဆၧအၧၩ့လၧယဟိဝၩအမ့ၬယၫ",
			"10": "<sup>10</sup> လီၫ.- ထီးနံၪ့ဆၧၫ့ထဲၩ့အလးနီၪ, စဎွၩန့ၭဘူၫခၭန့ဇၫ အၪ့မၧၫ့လၩ့ဆၧတၭ, ဂဲၫထဲၩ့ဆိၬအဝ့ၫထီၩ့လၧယဟိ ဝၩအဂံၪ့အဎၧၩ့အဎီ လၧအဘၪၦအၥၭ လဖၪတၭ, အီၪက့ၪအထၧၫ့ဖုဝဲစဇ့ၭဒကဲအၫ လၧစဎွၩလၧယုဒၫဒဲ ယရုစလံၫ့အဖၫ့ခိၪလီၫ.",
			"11": "<sup>11</sup> လၧစဇ့ၭဒကဲအၫ ကဲၪထၪ့ၥၫ့စဎွၩနီၪ အၥၭအီၪအ နံၪ့နံၫဆံၫတၭ, ကဲၪစဎွၩလၧယရုစလံၫ့အဖၧၩ့လဆံၫ",
			"12": "<sup>12</sup> လနံၪ့လီၫ.- တၭမၩဆၧအၧၩ့လၧယဟိဝၩလၧအမွဲအ ယွၩအမ့ၬယၫလီၫ. ဆၪ့လၩ့အၥၭလၧမီၪစယ့ၫရမဲအၫ လၧအချဲၩ့ဆၧလၧယဟိဝၩအနိၭလဂၩ အမ့ၬယၫဆ့ အ့ၬ.",
			"13": "<sup>13</sup> အဝ့ၫဒၪပိၩ့ထၪ့စန့ၭဘူၫခၭန့ဇၫ လၧအဒုၭဆိၪ လၩ့အၥၭလၧယွၩအမ့ၬယၫတၭ, အီၪက့ၪဆီၪ့ထၪ့အ ခိၬတၭ, မၩနီၩ့အၥၭဘဲၫၥိၭ အထီးကၠၪအၥၭလၧ ယဟိဝၩအံၫစရ့လၭအယွၩအအီၪလဂ့ၩလီၫ.",
			"14": "<sup>14</sup> လၧနီၪအမ့ၬယၫ ၦလုဆၧလဖၪဒဲၦခမျၧးထီးအလူၬ မၩမၪထွ့ၫၦဆၨၩလဖၪ အဆၧဘၪၥၭလိၪထီးအလူၬ အၪအၪလ့ၬတၭ, မၩဘၪၥၭလိၪယဟိဝၩအဂံၪ့လၧအ",
			"15": "<sup>15</sup> အီၪက့ၪဆံၫ့ဎံၪဝ့ၫလၧယရုစလံၫ့အဖၧၩ့နီၪလီၫ.- တၭ ယဟိဝၩအဝ့ၫၥံၪအဖါလဖၪအယွၩ အၪ့မၧၫ့လၩ့ဆၧ လၧအဝ့ၫၥံၪအအီၪလၧအၥီၫ့ၥံၪ, ဂဲထုၪ့ဝ့ၫဂီၩဂီၩအၪ့ မၧၫ့လၩ့ဆၧလီၫ. အဂဲးဘဲၫယီၩယၫ့ၥၭအၡၩခမျၧး,",
			"16": "<sup>16</sup> ဒဲအအီၪဝ့ၫအလးနီၪလီၫ.- အဝ့ၫၥံၪဒုၪဒွ့ၪယွၩအၥီၫ့ လဖၪတၭ, ယူၭထၪ့ယၪ့ထၪ့အလူအ့ၬ. မၩအၧၩ့အမီၪ ၥံၪထီးယဟိဝၩၥၭထၪ့ဘၪအၡၩခမျၧးတၭ, ဆၧမၩ ဘျၪထဲၩ့ဝ့ၫနီၪအီၪအ့ၬ.",
			"17": "<sup>17</sup> အခိးမွဲအဝ့ၫဒၪဒုၭဂဲၫထၫ့ဒၩအဝ့ၫၥံၪ လၧၦခၫလဒံ အၫဖိၪအစဎွၩလၧအမၩၥံၫၦဖိၪၥၪခွၫ လၧနၭလၧအ လးဆံၫ့ဎံၪအဂံၪ့ဖၧၩ့တၭ, ၦဖိၪၥၪခွၫမွဲဂ့ၩ,ၦမုၪနၩ့မွဲ ဂ့ၩ,ၦၥၭၡါမွဲဂ့ၩ, ၦလၧအယးဒံၩ့ကူၭလၩ့ဝ့ၫလၧအ ၥၭၡါအကၠီၩ့မွဲဂ့ၩ, ယၫ့ၥၭဝ့ၫအ့ၬ. ဖ့ၪလၫ့ခွံၬဝ့ၫထီး",
			"18": "<sup>18</sup> အလူၬလၧအဝ့ၫဒၪ အစူၪဖၧၩ့လီၫ.- တၭယွၩအဂံၪ့ အဎၧၩ့အဎီအဒိၪအဆံၭ ဒဲဆၧလူဒိၪဎွ့ၩဒိၪလၧယဟိ ဝၩအဂံၪ့ဖၧၩ့နီၪ, စဎွၩဒဲအၦဒိၪဖၭဒိၪၥံၪအဆၧလူဒိၪ ဎွ့ၩဒိၪနီၪဆ့, ဂဲၫထဲၩ့ဆိၬဝ့ၫလၧဘၭဘလၧၫ့အဖၧၩ့",
			"19": "<sup>19</sup> ထီးအလူၬလီၫ.- ၦဆူၭထၪ့ခွံၬယွၩအဂံၪ့ လၧမ့ၪတၭ, မၩလၩ့ဎီးခွံၬယရုစလံၫ့အခိၪဒၧၩ့တၭ, ဆူၭထၪ့ခွံၬအ နီးလဖၪလၧမ့ၪတၭ, မၩဂၭဂီၩ့ခွံၬအဎၧၩ့အဎီလၧအ",
			"20": "<sup>20</sup> ဘၪၦၡၩအၥၭလီၫ.- တၭၦလၧအဖီၩ့ဖျ့ၭဝ့ၫ လၧနၭ လဖၪနီၪ,အဝ့ၫဒၪဆိၬန့ခွံၬဝ့ၫ ထီၩ့လၧဘၭဘလၧၫ့ ထီးအကဲၪထၪ့အဖိၪခွၫလဖၪ အဎီးအၡၩထီၩ့လၩ့လၧ",
			"21": "<sup>21</sup> ပၧၡၫအဘၩ့အမုးပၧၩ့ဆၧ,- ဘဲၫၥိၭအမိမၩလၧၫ့ထၪ့ ဎွ့ၩထၪ့ယဟိဝၩအလူလၧ စယ့ၫရမဲအၫအနိၭဘဲၫၥိၭ ထံၫၥံၪခးၥံၪနီၪမိမုၬလၩလၧ အမးၥံၫအနံၩလဖၪလီၫ. ကိၭမုနံၩမုနၩလၧအအီၪယူဝ့ၫနီၪ, ထီးန့မးၥံၫအနံၩၥံၪ ထီးအဎွ့ၩထၪ့အနံၪ့နွ့ၫဆံၫလီၫ.",
			"22": "<sup>22</sup> တၭလၧပၧၡၫအစဎွၩစဲရၧၭ အခၪ့ထံၭလနံၪ့နီၪဘဲၫ ၥိၭယဟိဝၩအလူလၧစယ့ၫရမဲအၫအနိၭ မိလၧၫ့ထၪ့ ဎွ့ၩထၪ့တၭ, ယဟိဝၩထိၪဂဲၩပၧၡၫအစဎွၩစဲရၧၭအ ၥၭတၭ,အဝ့ၫဒၪဒုၭဂၧၫ့ထၪ့ၥၩလၩ့ ဆၧလၧအဘၩ့အ မုးအဖၧၩ့ဎံၩ့ဎံၩ့လ့ၬ, ဒဲဒုၭကွ့ၭလၩ့ဝ့ၫဆ့တၭ, စံၭဝ့ၫ",
			"23": "<sup>23</sup> ဒၪ,- ပၧၡၫအစဎွၩစဲရၧၭစံၭဝ့ၫဘဲၫယီၩ. ယဟိဝၩမူၭ ခိၪအယွၩနီၪဖ့ၪလၫ့ယူၭယၧၩ လၧကယဲဂၪ့ခိၪအဘၩ့ အမုးထီးအလူၬတၭ, အဝ့ၫဒၪမၪလူၬယၧၩဘဲၫၥိၭယ မိမၩထၪ့ဂံၪ့ လၧအဂးလၧယရုစလံၫ့အဖၧၩ့, လၧအ အီၪဝ့ၫလၧယုဒၫအဖၧၩ့နီၪလီၫ. ၦဘၪဆဲၫ့လၧအဝ့ၫ ဒၪအခ့ၫအၡၩထီးအလူၬနီၪ လၧနၥံၪအကျၩ မွဲပလၫ လဂၩလဲၪ. မွဲယဟိဝၩ အဝ့ၫဒၪအယွၩအီၪလၧအၥိၭ တၭ,မွဲအဝ့ၫဒၪလ့ၩထၪ့ဒၪဝ့ၫဆံၭ."
		}
	}
};
module.exports = book;